  {name: "West Windsor Plainsboro High School South", city: "West Windsor", state: "NJ", zip_code: 8550, site_url: "http://www.ww-p.org/schools/high_school_south", ed_level: "--- []\n", bio: "Complete AP Computer Science course", format: "1 year AP Computer Science course", street: "346 Clarksville Road", longitude: -74.6197, latitude: 40.3075, contact_email: "brandon.horn@ww-p.org", phone: "", languages: "---\n- Java\n- Mobile Apps (Android)\n", country: nil},
  {name: "Lakeside School", city: "Seattle", state: "WA", zip_code: 98125, site_url: "http://www.lakesideschool.org", ed_level: "---\n- Middle School\n- High School\n", bio: "Middle school: Computer 5, Computer 6 and Computer 7 - integrated technology courses in the middle school for 5th, 6th and 7th grades. Focus is on learning organizational and time management skills through programming. \r\n\r\nHigh School: \r\nComputer science 1 - an introductory course focused on building skills and confidence with computers and programming\r\nCS 2/3 - Java based, fast paced, AP level computer science sequence\r\nCS 4 - Advanced, project based, post AP class. \r\n3D modeling and printing - a project based hands on course in 3D printing. \r\n\r\nSummer school: \r\nCS1 - Computer science 1 - an introductory course focused on building skills and confidence with computers and programming (3 week all day intensive course). \r\nAdvanced CS - Building on the skills from a CS 1 course, this will focus on larger and harder problems to be solved with programming. \r\n", format: "", street: "14050 1st Avenue NE", longitude: -122.329, latitude: 47.7316, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n- Mobile Apps (Android)\n- PHP\n- Scratch\n", country: nil},
  {name: "University of Washington Summer Youth Program", city: "Seattle", state: "WA", zip_code: 98195, site_url: "www.summeryouth.washington.edu", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "UW Summer Youth Programs offer unique, hands-on enrichment opportunities for children and teens. Students can enroll in full day camps and half-day short courses led by highly qualified and experienced instructors. Camps and courses cover a wide range of topics designed to appeal to students who have interests in STEM (science, technology, engineering and math), computer programming, the visual and performing arts, and humanities.", format: "", street: "", longitude: -122.308, latitude: 47.6509, contact_email: "lromenagata@pce.uw.edu", phone: "206-543-2310", languages: "---\n- Computer game programming for middle school\n- Java\n- Kodu\n- Scratch\n", country: nil},
  {name: "Eckstein Middle School", city: "Seattle", state: "WA", zip_code: 98115, site_url: "http://www.ecksteinms.seattleschools.org", ed_level: "---\n- Middle School\n", bio: "A semester long exploration of computer science and technology that emphasizes problem solving and algorithmic thinking.  Each semester explores a different topic, so students may repeat this course as desired.  Some topics include computer programming, web development, robotics, hardware and networking.  Every semester will explore human/computer interaction, and the legal, social and ethical issues surrounding technology.", format: "", street: "3003 NE 75th Street", longitude: -122.294, latitude: 47.6808, contact_email: "", phone: "", languages: "---\n- HTML\n- Javascript\n- Python\n- Scratch\n", country: nil},
  {name: "Silicon Valley CoderDojo", city: "Mountain View", state: "CA", zip_code: nil, site_url: "www.coderdojo.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "At CoderDojo, young people, ages 7-17, learn how to code, develop websites, apps, programs, games and more. Dojos are set up, run by and taught at by volunteers. \r\n\r\nCoderDojo also puts a strong emphasis on open source and free software environments.\r\n\r\nLook for free tickets, and event announcements, on Eventbrite", format: "Free Programming Club for ages 7-17", street: "", longitude: -122.084, latitude: 37.3861, contact_email: "siliconvalley@coderdojo.com", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- Python\n- Ruby\n- Scratch\n", country: nil},
  {name: "CodeEd at the Community Charter School of Cambridge", city: "Cambridge", state: "MA", zip_code: 2141, site_url: "http://www.ccscambridge.org/", ed_level: "---\n- Middle School\n", bio: "CodeEd teaches computer science to girls in underserved communities, starting in middle school. Started in 2010, we train volunteer teachers with technical backgrounds, provide them with curriculum, support and computers, and match them with our education partners.", format: "", street: "245 Bent St.", longitude: -71.0845, latitude: 42.3674, contact_email: "angie@codeed.org", phone: "", languages: "---\n- Css\n- HTML\n", country: nil},
  {name: "Poinciana Elementary STEM Magnet School", city: "Boynton Beach", state: "FL", zip_code: 33435, site_url: "http://poincianastem.org", ed_level: "---\n- Elementary\n", bio: "Programming is integrated into our 2-5 curriculum through our Lego Robotics lab, use of Scratch in classrooms, and other projects.", format: "", street: "1203 N. Seacrest Blvd", longitude: -80.0645, latitude: 26.5375, contact_email: "kris.swanson@palmbeachschools.org", phone: "", languages: "---\n- HTML\n- Javascript\n- Lego / labview\n- Python\n- Scratch\n", country: nil},
  {name: "Codinghawks", city: "Redmond", state: "WA", zip_code: 98052, site_url: "http://codinghawks.wordpress.com/", ed_level: "--- []\n", bio: "This is a summer program that teaches programming to any kid under 18. Not only you will find programming fun, but also you will start to develop algorithm thinking skills. \r\n\r\nPlease summer schedules please visit \r\nhttp://codinghawks.wordpress.com, or leave a note at http://codinghawks.wordpress.com/contact-us/", format: "", street: "", longitude: -122.118, latitude: 47.6701, contact_email: "", phone: "", languages: "---\n- C\n- Java\n", country: nil},
  {name: "Dev Bootcamp (San Francisco)", city: "San Francisco", state: "CA", zip_code: 94108, site_url: "http://devbootcamp.com", ed_level: "---\n- Vocational\n", bio: "Dev Bootcamp, founded in 2011, is the first short-term programming bootcamp designed to train world-class junior web developers and software engineers.  Students spend 700+ hours over 9 weeks deliberately practicing the fundamentals of software engineering and web development using Ruby, Rails, HTML, CSS, SQL, and JavaScript.\r\n\r\nOur focus is on graduating engineers first and Rails-proficient web developers second. Within two months of graduation 90%+ of the students looking for jobs receive an offer with a median salary of $75k.  Our alumni work at companies like Exec, Hipmunk, 1000memories, ThoughtBot, Pivotal Labs, TapJoy, Ouya, and The Climate Corporation.\r\n\r\nThink of it as a bootcamp-ified Montessori school or an apprenticeship of steroids. Some words from our students:\r\n\r\n* \"DBC is the best learning environment that I have ever been in.\" (Student, Fall 2012)\r\n* \"Dev Bootcamp has simply changed my entire life.\" (Student, Summer 2012)\r\n* \"Dev Bootcamp was pretty much the best, most compact learning experience of my life.\" (Student, Summer 2012)", format: "9-week, 700-hour programming bootcamp", street: "717 California Suite 200", longitude: -122.367, latitude: 37.8198, contact_email: "hello@devbootcamp.com", phone: "", languages: "---\n- Css\n- HTML\n- Javascript\n- Ruby\n- Sql\n", country: nil},
  {name: "University of Washington Computer Science & Engineering", city: "Seattle", state: "WA", zip_code: 98195, site_url: "http://www.cs.washington.edu/outreach/k12", ed_level: "---\n- Middle School\n- High School\n", bio: "Our summer camps introduce middle and high school students to computer science (http://camps.cs.washington.edu/).\r\n\r\nOur open house brings in hundreds of students and their parents to try hands-on activities related to computing (http://www.cs.washington.edu/openhouse)\r\n\r\nWe host programming competitions for high school students (http://www.pscsta.org/p/student-programming-contests.html) and visit local classrooms.\r\n\r\nOur summer teacher workshops bring together over 70 local instructors (http://cs4hs.cs.washington.edu/).", format: "Summer camp", street: "185 Stevens Way", longitude: -122.306, latitude: 47.6532, contact_email: "outreach@cs.washington.edu", phone: "", languages: "---\n- HTML\n- Mobile apps (android)\n- Processing\n- Python\n- Scratch\n", country: nil},
  {name: "Code Fellows", city: "Seattle", state: "WA", zip_code: 98109, site_url: "http://codefellows.org", ed_level: "---\n- Vocational\n", bio: "At Code Fellows, we believe in hands-on training. Our full-time bootcamps have formal instruction in the mornings followed by co-working in the afternoons. Our instructors sit side-by-side with the students as they learn to code. We prepare students to enter the job market through interview coaching, guest lectures, and introductions to local companies.  We offer a rotating set of bootcamps teaching Ruby on Rails, Javascript, Python, and iOS, as well as evening workshops. For a complete listing, please visit our website. ", format: "4-week bootcamps", street: "South Lake Union", longitude: -122.334, latitude: 47.6256, contact_email: "hello@codefellows.org", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps (iOS)\n- Python\n- Ruby\n", country: nil},
