  {name: "DotNet Miami", city: "Coral Gables", state: "FL", zip_code: 333134, site_url: "http://dotnetmiami.com", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "We are a group of developers that are passionate about technology. We primarily focus on Microsoft technologies but are open minded to other platforms and ways of thought. We are diverse in our experiences with technology some of us are seasoned corporate developers while others are students. Within the group we see each other as equals and are able to learn from our unique experiences. We strive to deliver content that appeals to our members that are just beginning their journey into technology and those that have been on their journey for a while.\r\n", format: "Monthly Community Meetup", street: "1430 Ponce De Leon Blvd", longitude: -80.2591, latitude: 25.7584, contact_email: "dotnetmiami@gmail.com", phone: "", languages: "---\n- Asp.net\n- C#\n- HTML\n- Javascript\n- Sql\n", country: nil},
