  {name: "MakersAcademy", city: "London", state: nil, zip_code: 0, site_url: "http://www.MakersAcademy.com", ed_level: "---\n- College\n- Vocational\n", bio: "Ten weeks to turn you into an entry level software developer.\r\n\r\nIs it an easy course? Absolutely not. Will you be learning how to program from world-class experts? You bet!\r\n\r\nNew classes start each month.\r\n\r\nApply at MakersAcademy.com", format: "10 Week intensive Web Development course", street: "19 Mandela St. ", longitude: -0.136678, latitude: 51.5377, contact_email: "contact@makersacademy.com", phone: "", languages: "---\n- HTML\n- Javascript\n- Ruby\n", country: nil},
  {name: "UCode", city: "Hermosa Beach", state: "CA", zip_code: 90254, site_url: "http://www.ucode.com", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "We teach kids how to write software through creating games, websites, mobile apps, robots and other exciting projects. Kids learn Scratch, Ruby (programming language), Ruby on Rails web framework, HTML, CSS, JavaScript, CoffeeScript, RubyMotion for iPhone and iPad apps, Unity3d game framework, C++, RobotC and many other technologies!\r\n\r\nAll classes are individualized for each student so they can go at their own pace and start anytime. Kids come 2 hours a week (once or twice per week) and we encourage learning at home as well by providing all necessary resources and remote help anytime a kid needs assistance. \r\n\r\nHours are Monday-Friday 2-6:30pm and Saturdays 8am-12pm.\r\n", format: "Year-round programming curriculum for 6-18 year olds", street: "980 Artesia Blvd", longitude: -118.395, latitude: 33.8727, contact_email: "learn@ucode.com", phone: "888-888-8681", languages: "---\n- C++\n- Coffeescript\n- HTML\n- Javascript\n- Mobile Apps (iOS)\n- Robotc\n- Ruby\n- Scratch\n", country: nil},
