  {name: "Broadway Education Center - Mobile End Zone Academy", city: "Walnut", state: "CA", zip_code: 91789, site_url: "www.BroadwayEdu.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "We provide C++/C course teaching youth to participate in programming competion. This class is scheduled at Saturday and Sunday afternoon, weekly basis.\r\n\r\nWe offer mobile (iOS and Android) development classes focusing in native app development and gaming design.\r\n\r\nWe offer Scratch class for younger students in a fun and inspiring environment, to prepare them to learn C++, java coding in the future.\r\n\r\nWe offer cloud computing class to teach youth basic of internetworking, simple vitualization concepts and hands-on practice in Amazon AWS environment.\r\n\r\n", format: "", street: "18800 Amar Road, Suite A-7", longitude: -117.891, latitude: 34.0285, contact_email: "TYeh@Broadwayedu.com", phone: "909-595-4528", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- Objective c\n- Scratch\n", country: nil},
