  {name: "Park City High School", city: "Park City", state: "UT", zip_code: 84060, site_url: "http://www.pcschools.us/index.php?page=313&m=p", ed_level: "---\n- High School\n- College\n", bio: "Juniors and Seniors in high school, working in teams of 3-5, complete real projects for real companies making real contributions. Ex: Developing an iPhone app for a \"client\" includes a business student, a programming student and a digital design student. Developing a Database might include a business student and a programming student.\r\nWE WANT YOUR FILM! Learn more about our innovative approach to getting students ready for the \"real\" world.", format: "Totally new format of educator/business cooperation for better results.", street: "2700 Kearns Blvd", longitude: -111.486, latitude: 40.6684, contact_email: "jjackenthal@pcschools.us", phone: "4356455600 x1445", languages: "---\n- Any our clients need us to use to integrate with their existing systems\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- PHP\n- Perl\n- Python\n- Ruby\n- Scratch\n", country: nil},
