  {name: "BASE Camp - Bay Area Summer Enrichment", city: "Sunnyvale", state: "CA", zip_code: 94085, site_url: "http://www.sfbasecamp.com", ed_level: "---\n- Middle School\n", bio: "This summer design, program, and play your own computer games! Our curriculum takes advantage of the visual and interactive nature of making games so that students learn by experimenting. Students in our class learn programming fundamentals in Python  a powerful but easy to learn language. \r\n\r\nProgramming is a great way for students to expand their horizons, learn abstract thinking skills, and practice math concepts  all while having fun! After taking our class, students will have cool 2D games that they can play in their web browser and show their friends. \r\n\r\nWe offer small class sizes with knowledgable, experienced teachers. Our courses are for any rising 7th, 8th, and 9th grade students. We are conveniently located just off the 101 at the King's Academy in Sunnyvale.\r\n\r\nTake your education to new heights with BASE Camp!", format: "2 week summer camp", street: "562 North Britton Avenue", longitude: -122.011, latitude: 37.3865, contact_email: "cdehanas@sfbasecamp.com", phone: "510-516-1335", languages: "---\n- Python\n", country: nil},
  {name: "Drew University, Mathematics and Computer Science", city: "Madison", state: "NJ", zip_code: 7940, site_url: "http://www.drew.edu/mcs/", ed_level: "---\n- College\n", bio: "Students in the Mathematics and Computer Science department may major in computer science or in mathematics, or they may choose a joint major that includes core courses and electives in both disciplines. These studies provide rigor of thought and a background that is in demand not only in careers directly using mathematics and computer science but also in areas such as psychology, law and business, where clear thinking and analysis are indispensable.", format: "13-week fall and spring semester courses", street: "36 Madison Avenue", longitude: -74.4266, latitude: 40.7618, contact_email: "", phone: "", languages: "---\n- Java\n- Mobile Apps (Android)\n- Python\n", country: nil},
