  {name: "West Sacramento Early College Prep Charter School", city: "West Sacramento", state: "CA", zip_code: nil, site_url: "http://www.westsacprep.org", ed_level: "---\n- Middle School\n- High School\n", bio: "This course covers many things. Some basics of computer science are covered, then basic programming concepts are learned through Scratch. The coarse then covers basic electronics and circuitry concepts and combines both electronics and programming using Arduino micro controllers and the Arduino development environment, which uses C/C++. ", format: "", street: "", longitude: -121.53, latitude: 38.5805, contact_email: "raichele@westsacprep.org", phone: "", languages: "---\n- C++\n- Scratch\n", country: nil},
