  {name: "Wilson High School", city: "Portland", state: "OR", zip_code: 97215, site_url: "http://www.pps.k12.or.us/schools/wilson/", ed_level: "---\n- High School\n", bio: "We offer a full 4-Year Computer Science program:\r\nComputer Science 1-2 - Intro Programming using HTML/CSS, Scratch, Python and Lego Robotics.  Based on the Exploring Computer Science curriculum.\r\n\r\nComputer Science 3-4 Honors - A standard C++ programming course that covers OOP, Graphics and Game Design\r\n\r\nComputer Science 5-6 - A Java based course where students explore further ideas in OOP and focus on independent projects.\r\n\r\nComputer Science 7-8 & 9-10 - Students develop independent projects to work on...past projects have included Android Apps, 3D engines, AI such as flocking and neural networks, etc.\r\n\r\nSystems Dynamics 1-2 - We use the Stella software package to build models based on real life occurrences.  A focus on developing systems thinking skills.\r\n\r\nSystems Dynamics 3-4 - Students explore Agent Based simulation using Netlogo", format: "", street: "1151 SW Vermont Ave", longitude: -122.693, latitude: 45.4786, contact_email: "cbartlo@pps.net", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps (Android)\n- Netlogo\n- Python\n- Scratch\n- Stella\n", country: nil},
