  {name: "StudentRND", city: "Bellevue", state: "WA", zip_code: 98005, site_url: "http://codeday.org/", ed_level: "---\n- High School\n- College\n", bio: "Most competitions for students are about winning awards for a resume. CodeDay provides opportunities for students to do truly amazing things. Our events aren't about preparing to make something cool sometime in the future  at CodeDay, students build amazing things.\r\n\r\nCompetitions happen in major cities across the US on most 3-day weekends for high school students. An up-to-date list is available on the codeday.org site.", format: "24-hour Programming Marathon", street: "1405 132nd Ave NE, Suite 3", longitude: -122.165, latitude: 47.6231, contact_email: "contact@codeday.org", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- PHP\n- Python\n- Ruby\n", country: nil},
  {name: "Hochschule fr Technik, Rapperswil", city: "Rapperswil", state: "SG", zip_code: nil, site_url: "http://appquest.hsr.ch/", ed_level: "---\n- High School\n- Vocational\n", bio: "AppQuest is a 12 week contest for young people aged 15-20 who already have aquired basic knowledge of a programming language and want to learn to program an Android mobile phone. As part of the 12 week contest participants develop 4 Android Apps that are used to compete in a final on-site Quest at the Hochschule fr Technik, Rapperswil. At the kick-off event in Rapperswil participants receive training in the Android basics and develop their first App. They then work remotely in teams of 2 to develop the four needed Apps. The teams are supported by students of Hochschule fr Technik, Rapperswil. Next start is in Fall 2013. Language is German.", format: "", street: "Oberseestrasse", longitude: 8.82271, latitude: 47.2241, contact_email: "mstolze@hsr.ch", phone: "+41 76 711 1171", languages: "---\n- Mobile Apps (Android)\n", country: nil},
