  {name: "BRG1", city: "Vienna", state: "Vienna", zip_code: 1010, site_url: "http://www.brg1.at", ed_level: "---\n- Middle School\n- High School\n", bio: "In our school, programming is part of the \"Computer Science\" class which every student has to take at least two years before graduating.\r\n\r\nI teach the basics of programming in theory, then in Small Basic and then progress to Javascript, PHP and eventually Java (depending on the classes).\r\n\r\nEvery year we have game design Projects where students invent games and program them in HTML5 (Canvas + Javascript) and then display them on our school website\r\n\r\nStudents are also graded using a XP based grading system where they level up their grades by providing positive input or doing their homework. They can always track their progress live over a website.", format: "", street: "Schottenbastei 7 - 9", longitude: 16.3647, latitude: 48.2142, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- PHP\n- Small basic\n", country: nil},
