  {name: "L. D. College of Engineering", city: "Ahmedabad", state: "GJ", zip_code: 380015, site_url: "http://www.ldceahd.org/", ed_level: "---\n- College\n", bio: "L.D.College of Engineering, Ahmedabad is a premier engineering college in Gujarat State set with the objectives of imparting higher education in various fields of engineering. The institute is affiliated to Gujarat University and administrated by Department of Technical education, Gujarat State. Sheth Shri Kasturbhai Lalbhai established institute in 1948 with generous donation. It is situated adjacent to Gujarat University and at nucleus of various national level institutes like PRL, ATIRA, ISRO, IIM etc. The campus consists of buildings for various departments, offices, hostels and library with 64,565 sq.meter builtup area. The institute made a modest start with 75 students for undergraduate programs in 1948, post graduate programs in 1954. At present institute runs 14 undergraduate, 17-post graduate and 4 part-time programs. ", format: "", street: "Gujarat University Navrangpura", longitude: 72.5467, latitude: 23.0362, contact_email: "", phone: "", languages: "--- []\n", country: nil},
