  {name: "Ulster County BOCES", city: "Port Ewen", state: "NY", zip_code: 12466, site_url: "http://www.ulsterboces.org/CTCenter.cfm?subpage=623", ed_level: "---\n- High School\n- Vocational\n", bio: "Media and Game Design is a course introducing students to careers in interactive media, computer science, web design and digital game development. We cover college-level computer science concepts, internet-based media, video editing, digital video, animation, 3D modeling, 2D and 3D game design, Javascript and Python coding.", format: "", street: "Rt. 9W", longitude: -73.9777, latitude: 41.9104, contact_email: "tsmith@ulsterboces.org", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- Python\n", country: nil},
  {name: "McFarland Middle School", city: "Othello", state: "WA", zip_code: 99344, site_url: "http://www.edline.net/pages/McFarland_Middle_School", ed_level: "---\n- Middle School\n", bio: "After school club teaching basic programming skills and STEM concepts to middle schoolers.  We use python for it's beginner friendly syntax.  Simple computer games are the focus in order to keep kids interested long enough to capture their imagination!", format: "1.5 Hr After School Club - 2 Days / Week", street: "", longitude: -119.175, latitude: 46.826, contact_email: "", phone: "", languages: "---\n- Python\n", country: nil},
  {name: "Mamaroneck High School", city: "Mamaroneck", state: "NY", zip_code: 10543, site_url: "http://www.mamkschools.org", ed_level: "---\n- High School\n", bio: "At the high school we started students this with block-based programming with Scratch. The goal is to transfer the entire unit to the middle school, perhaps as early as 6th grade. The ECS curriculum developed in conjunction with CSTA is being followed loosely. Our goal is to expand the CS program next school year to offer courses that will prepare students to take the Advanced Placement Computer Science exam.", format: "", street: "1000 W Boston Post Rd", longitude: -73.7434, latitude: 40.9412, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- Python\n- Scratch\n", country: nil},
  {name: "Marshall University", city: "Huntington", state: "WV", zip_code: 25755, site_url: "http://www.marshall.edu/isat/cit/", ed_level: "---\n- College\n", bio: "IST163 - Concepts of software development and maintenance using C++, including syntax of the language, loops, functions, classes, decision structures, and file processing. Proper program design using object-oriented programming techniques are emphasized.", format: "", street: "One John Marshall Drive", longitude: -82.4293, latitude: 38.4231, contact_email: "brian.morgan@marshall.edu", phone: "304-696-6469", languages: "---\n- C++\n", country: nil},
  {name: "The Browning School", city: "New York", state: "NY", zip_code: 10065, site_url: "http://www.browning.edu", ed_level: "---\n- Elementary\n- Middle School\n", bio: "The Browning School Computer Science curriculum focuses on video game development. We begin programming concepts in the Lower School using Scratch. Scratch continues in the Middle School. Students then begin developing iPad apps in 9th grade for a required Computer Science course. Electives in Computer Science in the Upper School focus on programming Java. Intro to Computer Science helps students prepare for Advanced Computer Science, which prepares students for taking the AP if they wish. ", format: "", street: "52 East 62nd Street", longitude: -73.969, latitude: 40.765, contact_email: "", phone: "2128386280", languages: "---\n- HTML\n- Java\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- PHP\n- Python\n- Scratch\n", country: nil},
  {name: "Nashville Software School", city: "Nashville", state: "TN", zip_code: 37203, site_url: "http://nashvillesoftwareschool.com/", ed_level: "---\n- Vocational\n", bio: "Nashville Software School (NSS) is a place where a person with aptitude, motivation, passion and commitment can learn the craft of software development.  A place where you can get a running start down the path to a life-long career in technology and software development.  In fact its more than a running start, it's a blast down the runway with afterburners.\r\n\r\nOur intensive training and apprenticeship program dramatically accelerates learning about and access to the world of software development. Give us six months and we'll prepare you for an entry-level software developer job.", format: "", street: "315 Tenth Avenue North", longitude: -86.7876, latitude: 36.1624, contact_email: "wark.john@gmail.com", phone: "", languages: "---\n- HTML\n- Javascript\n- PHP\n- Python\n- Ruby\n", country: nil},
  {name: "Ladies Learning Code", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://ladieslearningcode.com", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "Ladies Learning Code is a Toronto-based not-for-profit organization that runs workshops for women (and men) who want to learn beginner-friendly programming and other technical skills in a social and collaborative way. We also have chapters in Vancouver and Ottawa.", format: "One-day workshops", street: "720 Bathurst Street, Suite 500", longitude: -79.4106, latitude: 43.6633, contact_email: "info@ladieslearningcode.com", phone: "", languages: "---\n- Css\n- HTML\n- Javascript\n- Mobile web\n- PHP\n- Photoshop\n- Python\n- Ruby\n- Windows 8 app design\n- Windows 8 app development\n- Wordpress\n", country: nil},
