  {name: "Girls Learning Code", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://girlslearningcode.com/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "We're looking for Toronto's most creative 9-13 year old girls. Know anyone like that? Introducing Girls Learning Code - tech camps, workshops and events for girls who want to change the world.\r\n\r\nFounded by the same women who introduced Ladies Learning Code in 2011, Girls Learning Code is less about code and more about changing the world  through teamwork, creativity, and, of course, technology. \r\n\r\nAt our camps and workshops, Torontos most creative 9-13 year old girls join us to participate in the citys only all-girls technology camp and workshops. This program experience is designed to help girls see technology in a whole new light  as a medium for self-expression, and as a means for changing the world.\r\n\r\nProgram Objectives:\r\nWe help girls:\r\n\r\n1. Discover a passion for learning about technology\r\n2. Experience the satisfaction that comes from being a builder  not just consumer  of the web and technology\r\n3. Become more confident and self-assured\r\n4. Develop a willingness to try new things\r\n5. Increase their knowledge of technology-related careers\r\n\r\nall while having fun!\r\n\r\nWhat Makes Girls Learning Code Different?\r\n\r\nGirls Learning Code has been designed specifically with girls in mind, by the team who founded Ladies Learning Code. When developing plans and curriculum for our camps and workshops, we keep in mind a recurrent theme in research on gender and technology: girls approach the computer as a tool useful primarily for what it can do; boys more often view the computer as a toy or an extension of the self. Thus, the themes revolve around Changing the World and technology is used as the means, not the end.", format: "Tech Camps, Workshops and Clubs for girls between 9-13 ", street: "720 Bathurst St, suite 500", longitude: -79.4106, latitude: 43.6633, contact_email: "laura@ladieslearningcode.com", phone: "4165799809", languages: "---\n- 3d printing and more\n- Arduino\n- HTML\n- Javascript\n- Mobile apps (android)\n- Photo editing\n- Python\n- Robotics\n- Ruby\n- Scratch\n- Technology careers\n- Video editing\n- Web design\n", country: nil},
