  {name: "HackerYou", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://hackeryou.com", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "HackerYou is all about hands-on, project-based learning from industry-leading professionals. Classes are small, with a 10:1 ratio (or better!) of students to instructors. It's the best place in Toronto to learn to code part-time - you can choose Web Development or Ruby on Rails. HackerYou is currently running three courses per year.", format: "3-month part-time courses, one-day workshops and corporate training", street: "720 Bathurst Street, Suite 500", longitude: -79.4106, latitude: 43.6633, contact_email: "info@hackeryou.com", phone: "", languages: "---\n- Css\n- HTML\n- Rails\n- Ruby\n", country: nil},
