  {name: "Bryan High School", city: "Bryan", state: "TX", zip_code: 77801, site_url: "http://bryanhighnorseman.com/", ed_level: "---\n- High School\n", bio: "Bryan High School offers several levels of computer programming and computer science.\r\n\r\nComputer Programming and Advanced Computer Programming are focused on business applications and simulation design.  Students are prepared for internships in computer programming.\r\n\r\nComputer Science AP and Computer Science IB are College Level preparatory programs and focus on science and engineering based applications in computer science and programming.  Students completing coursework in IB and AP computer science are expected to take the respective tests for possible college credit.", format: "", street: "3450 Campus Drive", longitude: -96.3349, latitude: 30.6554, contact_email: "jason.cordes@bryanisd.org", phone: "979.209.2400", languages: "---\n- Actionscript\n- C#\n- HTML\n- Java\n", country: nil},
  {name: "UC Berkeley", city: "Berkeley", state: "CA", zip_code: 94704, site_url: "http://inst.eecs.berkeley.edu/~cs10/", ed_level: "---\n- High School\n- College\n", bio: "CS10, The Beauty and Joy of Computing, is an exciting new course offered by the UC Berkeley EECS Dept. Computing has changed the world in profound ways. It has opened up wonderful new ways for people to connect, design, research, play, create, and express themselves. However, just using a computer is only a small part of the picture. The real transformative and empowering experience comes when one learns how to program the computer, to translate ideas into code. This course will teach students how to do exactly that, using BYOB and Snap! (based on Scratch), one of the friendliest programming languages ever invented. It's purely graphical, which means programming involves simply dragging blocks around, and building bigger blocks out of smaller blocks.\r\n\r\n   But this course is far more than just learning to program. We'll focus on some of the \"Big Ideas\" of computing, such as abstraction, design, recursion, concurrency, simulations, and the limits of computation. We'll show some beautiful applications of computing that have changed the world, talk about the history of computing, and where it will go in the future. Throughout the course, relevance will be emphasized: relevance to the student and to society. ", format: "Full university CS curriculum", street: "2200 University Ave", longitude: -122.266, latitude: 37.8724, contact_email: "", phone: "", languages: "---\n- Scratch\n- Snap\n", country: nil},
  {name: "CampInteractive", city: "Bronx", state: "NY", zip_code: 10468, site_url: "http://www.ciny.org", ed_level: "---\n- Middle School\n- High School\n- Vocational\n", bio: "CIs year-round programs introduce inner-city, at-risk youth to the creative power of technology. We use cutting-edge tech education tools to provide students with the skills and opportunities they need to succeed, and instill the leadership qualities necessary to achieve their potentials.\r\n\r\nOur modular, project-based curriculum provides an adaptive learning environment in which the students will flourish and focus on teamwork, self-confidence and sense of community.  This dynamic experience prepares them to thrive through ambiguity in their academics and kickstarts success in their professional careers.", format: "", street: "2876 Claflin ave", longitude: -73.8992, latitude: 40.8735, contact_email: "mike@campinteractive.org", phone: "718.708.4852", languages: "---\n- Css\n- HTML\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n", country: nil},
