  {name: "The Young Women's Leadership School of Astoria", city: "New York", state: "NY", zip_code: 11102, site_url: "http://www.globaloria.org/", ed_level: "---\n- High School\n", bio: "Globaloria is the nation's first and largest social learning network where students, middle school and higher, develop STEM and computing knowledge, digital literacy and global citizenship skills through game design. \r\n \r\nIn fall 2012, Globaloria launched at The Young Women's Leadership School (TYWLS) of Astoria in Queens, NY, a member of the Young Women's Leadership Network of secondary schools. TYWLS students engage in Globaloria as a cross-curricular STEM learning platform integrated into history/social studies and foreign language programs, advancing their STEM education and acquiring the skills, knowledge and experience for citizenship and leadership.\r\n\r\nThe class meets daily for 50 minutes. ", format: "Year-long, core-curriculum integrated, game-design course", street: "23-15 Newtown Ave", longitude: -73.9242, latitude: 40.771, contact_email: "andrea@tywls-astoria.org", phone: "718-267-2839", languages: "---\n- Actionscript\n", country: nil},
