  {name: "Urban Assembly Gateway School for Technology", city: "New York", state: "NY", zip_code: 10019, site_url: "http://www.uagateway.org", ed_level: "---\n- High School\n", bio: "The Urban Assembly Gateway School for Technology is an innovative public high school in New York City launched in 2011 that provides students with a rigorous college prep curriculum while preparing them to work in Digital Design & Animation, IT & Systems, and Software Engineering and Programming.  The school also provides technology-based afterschool programming, developed in response to student demand to suit their interests and skill-level.\r\n\r\nMission:  To engage our students through inventive problem-solving that integrates innovative technology and the habits of mind that prepare them for college, careers, and life.", format: "", street: "439 W 49th St, 7th Fl", longitude: -73.9918, latitude: 40.7687, contact_email: "uagateway@gmail.com", phone: "212 246 1041", languages: "---\n- C++\n- Java\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- Python\n- Scratch\n", country: nil},
