  {name: "Coding Dojo", city: "Sunnyvale", state: "CA", zip_code: 94085, site_url: "http://codingdojo.co", ed_level: "--- []\n", bio: "Coding Dojo, based in Silicon Valley CA, provides a 9 week bootcamp training for aspiring web developers.  If you get a job out of the program, you receive a full refund of your tuition.\r\n\r\nAt our offices in the heart of Silicon Valley, you'll learn everything from HTML to Ruby on Rails amidst the campuses of Google, Apple, and countless startups.  Students will meet from 9am-6pm, Monday-Friday, and learn to breath, eat (we provide lunch, dinner and healthy snacks), and dream about coding.  You'll have the opportunity to work closely with similarly driven people, attend a variety of different coding meetups, and frequently hear from prominent guest speakers, CTOs, and other generally cool developers.   After 9 weeks of intense training,  we'll have a demo day where recruiters, hiring managers, and startups will be invited to interview and hire you.  \r\n\r\nOver the last 2 years, CodingDojo has refined training for developers, allowing us to take someone new to programming to where they can build advanced web applications in PHP, Javascript, Ruby, Node.JS, SQL database, all in just a few months.  The training is rigorous, and only for those serious about learning to code, and serious about getting a job as a web developer.\r\n", format: "Full time bootcamp for aspiring web developers", street: "955 Benecia Ave.", longitude: -122.039, latitude: 37.3949, contact_email: "info@codingdojo.co", phone: "(650) 691-5012", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps (iOS)\n- PHP\n- Perl\n- Python\n- Ruby\n", country: nil},
  {name: "HTL fr Informatik", city: "Vienna", state: "Vienna", zip_code: 1050, site_url: "http://www2.spengergasse.at/lehrplan/informatik-0", ed_level: "---\n- High School\n- College\n", bio: "Die Ausbildung Informatik bietet dir eine fundierte Ausbildung in allen Bereichen der Softwareentwicklung, der Netzwerkstechnik, aber auch der Betriebswirtschaft und des Projektmanagements an. Sei es als Entwickler von Spielen oder als Manager von IT-Systemen. Nach dem Abschlu der HTL fr Informatik steht dir ein weites Beschftigungsfeld offen.", format: "", street: "Spengergasse 20", longitude: 16.3568, latitude: 48.1857, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n- PHP\n- Perl\n- Python\n", country: nil},
  {name: "Max-Eyth-Schule Kassel", city: "Kassel", state: "HE", zip_code: 34125, site_url: "http://www.max-eyth-schule.de", ed_level: "---\n- High School\n", bio: "It's a school for pupils.", format: "", street: "Weserstrae 7a", longitude: 9.50753, latitude: 51.3183, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n", country: nil},
  {name: "Decoded", city: "London", state: nil, zip_code: 0, site_url: "http://www.decoded.co", ed_level: "---\n- Vocational\n", bio: "Decoded's original \"Code in a Day\" class is revolutionary. It is the starting point for anyone seeking to understand digital concepts. We make the complex clear and simple, making code accessible to everyone. By the end of the day, participants will have coded their own multi-platform, geo-location app to take home.\r\n\r\nDecoded's vision is to provide digital enlightenment to everyone through an understanding of the code that underpins our digital world. Code powers innovation in almost every industry; it unleashes creativity, gives power to data, and connects people and products. Not everyone needs to be a coder, but those that lead the way need to understand the power of code and know how it can be used.\r\n\r\nFrom one day courses to 11 weeks in depth training you can: code your own app in a day; uncover the secrets of social networks; get creative with data; invest in some team-learning on a live brief; or go the whole way and become a developer. We give you the skills to transform your business.", format: "", street: "20 Underwood Row", longitude: -0.0918509, latitude: 51.53, contact_email: "", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps (Android)\n- Mobile Apps (iOS)\n", country: nil},
  {name: "Chandler High School", city: "Chandler", state: "AZ", zip_code: 85225, site_url: "http://www.cusd80.com/site/Default.aspx?PageID=6658", ed_level: "---\n- High School\n", bio: "Our Informational Technology program is under our state's Career and Technical Education program.  It is broken into 4 options.  Our introductory class (Fundamentals of Informational Technology or F.I.T.) covers each of these for a quarter of the year.  They are computer maintenance, software engineering, web design, and networking.  \r\n\r\nStudents who continue have the option of taking a computer maintenance class in preperation for taking the CompTia A+ certification exam.  This class covers both hardware and operating systems.  They also refurbish used computers through the STudents Recycling Used Technology program.\r\n\r\nAnother option is our Software Engineering I and IB/AP Java classes.  Both of these classes cover the Java curriculum required for the AP exam and our state CTE Software Development exam.  An introduction to creating Android apps is also taught.\r\n\r\nOur one other option is robotics.  We have it as both a class and a club.  The curriculum covers both hardware used such as motors, transmissions, speed controllers, programmable control boards, pneumatics, and design based learning concepts as well as java programming.  Students can choose to work independently on other languages for doing vision processing for autonomous programming as well. The club meets every Wednesday afterschool from 2:15 to 4:00.  During our FIRST Robotics season 6 week build time we will also come in on Saturdays for the whole day. Once school is out for the summer, we host the National Underwater Robotics Challenge or NURC.  That gives us the challenge of building underwater robots as well.  This last year we used an Arduino control board with an ethernet shield to talk to the surface.  New programming language challenges always!", format: "", street: "350 North Arizona Avenue", longitude: -111.842, latitude: 33.308, contact_email: "Alexander.Lsam@cusd80.com", phone: "480-812-7700", languages: "---\n- HTML\n- Java\n- Mobile Apps (Android)\n", country: nil},
  {name: "Loyola University Chicago", city: "Chicago", state: "IL", zip_code: 60611, site_url: "https://piazza.com/luc/spring2013/comp313413/home", ed_level: "---\n- College\n", bio: "In this programming-intensive course, you will learn how to design good object-oriented software using principles and patterns, understand event-driven and thread-based concurrent programming paradigms, gain some experience with mobile (Android) development and cloud-based services, practice some agile development methods, and experience collaboration in pairs and mid-size groups.", format: "", street: "820 N Michigan Ave, LT-520", longitude: -87.6162, latitude: 41.8925, contact_email: "info@cs.luc.edu", phone: "+1 (312) 915-7999", languages: "---\n- Java\n- Mobile Apps (Android)\n- Scala\n", country: nil},
