  {name: "Carleton College Summer Computer Science Institute", city: "Northfield", state: "MN", zip_code: 55057, site_url: "http://go.carleton.edu/scsi", ed_level: "---\n- High School\n- College\n", bio: "The Summer Computer Science Institute (SCSI) at Carleton focuses on understanding how to think about these processes, how to program computers to implement them, and how to apply computer science ideas to real problems of interest.\r\n\r\nStudents at SCSI will learn how to systematically approach problems like a computer scientist as they engage in classroom learning, hands-on lab activities, and collaborative guided research directed by Carleton faculty and mentored by undergraduate research assistants.  The Summer Computer Science Institute will culminate with the SCSI Research Symposium where students will demonstrate the results of their collaborative guided research project.  In short, during their three weeks at SCSI, students have a similar experience to what Carleton undergraduates who eventually major in Computer Science receive as they begin their academic journey.\r\n\r\nCurrent Sophomores and Juniors in High School are eligible to apply.  We also have financial aid available for the program.  View our website for all the details at http://go.carleton.edu/scsi.\r\n\r\n", format: "3 week residential summer experience for high school students", street: "One North College Street", longitude: -93.1556, latitude: 44.4613, contact_email: "scsi@carleton.edu", phone: "866-767-2275", languages: "--- []\n", country: nil},
