  {name: "Calumet High School", city: "Calumet", state: "MI", zip_code: 49913, site_url: "http://www.clkschools.org/high-school", ed_level: "---\n- High School\n", bio: "Software Design 9, 10, 11, 12\r\nPrerequisite: Computer Technologies or Department Approval\r\nSoftware Design is a one-semester course focused on writing computer software. The development of algorithms and good programming methodology will be learned through creating basic computer applications to game design. The goal of this course is to enable students to develop methods using the power of the computer to solve problems. Students will become familiar with programming methods such as top down design and object- oriented programming. They will learn to apply programming methods to writing program code and will become familiar with the structure and operation of Visual Basic.\r\nAdvanced Software Design 9, 10, 11, 12\r\nPrerequisite: Software Design\r\nAdvanced Software Design is a one semester continuation of the study of programming begun in Software Design. The general course goals will continue to be addressed through the study of advanced programming topics. Students will develop algorithms to solve problems and will become increasingly familiar with programming methods such as top down design and procedure-oriented programming. They will apply programming methods to writing program codes and will become familiar with the structure and operation of the compiler used with Java. Some of the major topics covered in this course include: further works with structures from Software Design, procedures, scope of variables, arrays, sorting and searching routines, manipulation of data structures, string processing, working with files, graphics and advanced programming applications, Java applications and applets.", format: "High School CS Classes", street: "57070 Mine Street", longitude: -88.448, latitude: 47.2435, contact_email: "mroland@clkschools.org", phone: "9063370311", languages: "---\n- C++\n- HTML\n- Java\n- Scratch\n- Visual basic\n", country: nil},
  {name: "Hart Career Center", city: "Mexico", state: "MO", zip_code: 65265, site_url: "http://www.hartcareercenter.org", ed_level: "---\n- High School\n- Vocational\n", bio: "We serve juniors and seniors from eight mid-Missouri schools at our area career center.  This three-hour block class incorporates computer programming, video game design, and web design into a two-year program.  \r\n\r\nLanguages covered this year include C++ and Python, and will expand to cover Java and Visual Basic next year.  The final project for each class involves working as part of a software development team.  We hope to integrate app development in the future as well.  \r\n\r\nWe use the UDK game engine and build characters in Blender and 3DS Max as part of a class game development team.  Programming skills are used inside the game engine.\r\n\r\nOur web design class covers HTML5, CSS3, JavaScript, and other pertinent topics.  We build a number of project websites as our skills progress over the course of the year, and hope to find a selection of non-profits for the students to build a site for as a capstone project.\r\n\r\nStudents compete in SkillsUSA contests in programming and web design.      ", format: "High School CS Classes", street: "905 N Wade", longitude: -91.89, latitude: 39.1792, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Python\n", country: nil},
