  {name: "Wasatch Institute of Technology", city: "South Jordan", state: "UT", zip_code: 84095, site_url: "http://www.wasatchinstitute.net", ed_level: "---\n- High School\n", bio: "The Wasatch Institute of Technology (WIT) is a new 9-12 charter high school opening Fall 2013.  The mission of the Wasatch Institute of Technology is to prepare Network/Systems and Software Engineers through Next Generation Education.  At WIT, computer science is elevated to a core subject and permeates everything we do, as important as math, science, or English.  Learn more by visiting www.wasatchinstitute.net.  ", format: "High School CS Program", street: "5200 South Jordan Parkway", longitude: -112.0, latitude: 40.5623, contact_email: "cu@wasatchinstitute.net", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- Mobile apps (ios)\n- Scratch\n", country: nil},
