  {name: "A.P. Schalick High School", city: "Elmer", state: "NJ", zip_code: 8318, site_url: "http://www.pittsgrove.net/", ed_level: "---\n- High School\n", bio: "1) Computer Science Level 1: Introduction to Computer Science with a focus on procedural programming and programming tools using C++\r\n2) Computer Science Level 2 and AP: Intermediate Computers Science with a focus on object oriented programming using Java\r\n3) Website Composition: Website creation using HTML and CSS with both straight HTML and Dreamweaver. Processing of form variables are also stressed with PERL and PHP. The use of PHP and SQL is used to store, manipulate, and retrieve data using a mySQL database. Apache web servers are used for back end coding.\r\n4) Introduction to Programming via Visual Basic and Robotic Programming: this class acts as our lowest lever intro to Comp Sci and programming. Finch bots and Lego Mindstorms are used for the Robotic programming unit. Experienced students can also take this class to enhance their experience.", format: "High School CS Classes", street: "718 Centerton Road", longitude: -75.1654, latitude: 39.5294, contact_email: "drozanski@pittsgrove.net", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Perl\n- Sql\n", country: nil},
