  {name: "Centennial High School", city: "Boise", state: "ID", zip_code: 83713, site_url: "http://www.centennialpatriots.org", ed_level: "---\n- High School\n", bio: "Centennial High School Professional Technical Department has an IT Pathway including Web Design (HTML, CSS, JavaScript, Flash, Fireworks, Introduction to Programming, AP Computer Science, Database Design & SQL, and PLSQL.   Centennial High School is an approved Oracle Academy.  Most programming courses are dual credit university courses with Boise State University.", format: "High School CS Classes", street: "12400 W. McMillan Road", longitude: -116.337, latitude: 43.6506, contact_email: "gabrielson.tanya@meridianschools.org", phone: "208-855-4250", languages: "---\n- HTML\n- Java\n- Javascript\n", country: nil},
