  {name: "Concord-Carlisle High School", city: "Concord", state: "MA", zip_code: 1742, site_url: "http://www.concordcarlisle.net/wp-content/themes/concordcarlisle/downloads/Forms_Page/Instructions/ProgramOfStudies12-13.pdf", ed_level: "---\n- High School\n", bio: "Java Programming.  We use the iJava course developed at UMass/Amherst by Dr. Robert Moll.\r\nStudents will be introduced to programming using the Java programming language. Object-oriented methodology will be used throughout the course. The student will learn the syntax and semantics of a large part of the Java language, and be exposed to the criteria for developing well-structured, readable and maintainable programs. Computer labs will be based on the development environments with rich educational features. The introductory course will provide the basic skills of programming, including class definition, method definition, procedural use of methods, variables and operators, and control flow with conditionals and loops.  The advanced course will address deeper concepts in object-oriented programming and, to the degree possible, explore the content of the AP Computer Science curriculum. Students will be evaluated primarily on the quality and functionality of programs that they develop in the computer lab, but also by written in-class assessments.", format: "High School Intro. to Java Sem1, Advanced Java Sem2", street: "500 Walden St.", longitude: -71.3475, latitude: 42.4472, contact_email: "abeckwith@colonial.net", phone: "", languages: "---\n- Java\n", country: nil},
