  {name: "Gorzycki Middle School", city: "Austin", state: "TX", zip_code: 78749, site_url: "http://tigerteched.pbworks.com/", ed_level: "---\n- Middle School\n", bio: "In Video Game design students learn the basics of computer programming while exploring the tools and technology used to create various types of computer games including 2D, 3D, mobile, RPG, and even Kinect (body-controlled) games. We will experience the complex process of game creation from start to finish. No programming knowledge is required for the course; they learn as you go.\r\n\r\nIn Video Game Design, students gain knowledge and skills in basic computer programming. Video Games are designed just like any other computer software; there is a set process that all software engineers go through. In this class we will explore this development process as well as the tools and technologies software engineers use to develop video games. In addition, we explore the art of video game design. What makes a game fun? How do you make a game challenging but not impossibly frustrating? What is it that makes a blockbuster game?\r\n\r\nDuring the first two six weeks, students will explore and learn several different game development platforms. The final six weeks, students will develop a prototype video game of their own design using the platform of their choosing following the software development process  starting at brainstorming and design all the way through testing.", format: "Middle School CS class", street: "7412 W Slaughter Lane", longitude: -97.8937, latitude: 30.2164, contact_email: "jon.howard@austinisd.org", phone: "512-841-8660", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- Scratch\n", country: nil},
  {name: "Topeka West High School", city: "Topeka", state: "KS", zip_code: 66604, site_url: "http://twhs.topekapublicschools.net/", ed_level: "---\n- High School\n", bio: "Expanding CS program offerings to increase interest among students.", format: "High School CS Classes", street: "2001 Fairlawn Road", longitude: -95.7472, latitude: 39.0311, contact_email: "mboyer@topeka.k12.ks.us", phone: "785-438-4000", languages: "---\n- Alice\n- Dreamweaver\n- Greenfoot\n- HTML\n- Scratch\n", country: nil},
  {name: "Lick-Wilmerding High School", city: "San Francisco", state: "CA", zip_code: 94112, site_url: "http://www.lwhs.org", ed_level: "---\n- High School\n", bio: "This course focuses on designing and building an electronic device from start to finish.  Students begin the semester by experimenting with a variety of programmable, Arduino compatible, devices and sensors such as: accelerometers, mp3-triggering boards, temperature, ultrasonic rangefinders, full color LCDs, and digital voice controllers.  They then work thorough a research and development phase to come up with an electronic project that engages a specific need which may be their own or someone elses.  With the instructor as a guide, students access a plethora of example technology and online resources to learn and implement the necessary components of their idea.  The course is about electronics, invention, being resourceful, innovation and working though the design process.  By the end of this class each student should be able to look at a piece of Technology and at least understand the starting point to figuring out how to manipulate it if not make it into something unique.  A student who repeats the course will be: asked to expand on the basic projects, held to higher standards, and expected to be a knowledge resource for peers.", format: "High School CS Classes", street: " 755 Ocean Avenue", longitude: -122.449, latitude: 37.7222, contact_email: "akleindolph@lwhs.org", phone: "", languages: "---\n- Arduino (c++)\n", country: nil},
  {name: "HLV Community School", city: "Victor", state: "IA", zip_code: 52347, site_url: "http://www.hlv.k12.ia.us", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Intro to Computers and Web Design", format: "Daily programming course", street: "402 5th Street/PO Box B", longitude: -92.298, latitude: 41.7317, contact_email: "", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "Ascend Training", city: "Chicago", state: "IL", zip_code: 60605, site_url: "http://www.ascendtraining.com", ed_level: "---\n- Vocational\n", bio: "Ascend Training & Consulting is an Adobe Authorized Training Center (AATC) and we have been providing the highest quality training programs for over 15 years. \r\n\r\nOur philosophy is that students learn by doing. Therefore all of our classes are hands-on with 10 students or less, and all of our instructors are Adobe Certified Experts in the software they teach, while also actively working in the industry. Our classes reflect our instructors' experience and are designed for immediate real-world application. We also feature on-site and online training by request.", format: "Adult CS  full-day workshops", street: "410 S Michigan Avenue", longitude: -87.6244, latitude: 41.8769, contact_email: "contact@ascendtraining.com", phone: "3123342140", languages: "---\n- Actionscript 3.0\n- Css3\n- HTML\n- Javascript\n- Jquery\n- Mobile apps (ios)\n- Objective c\n- PHP\n- Xml\n", country: nil},
  {name: "Skyline High School", city: "Salt Lake City", state: "UT", zip_code: 84109, site_url: "http://www.graniteschools.org/hs/skyline/", ed_level: "---\n- High School\n- College\n", bio: "An introductory course in computer programming/software engineering and applications. The course introduces students to the fundamentals of computer programming. Students will learn to design, code, and test their own programs while applying mathematical concepts. Introduction to programming language such as Objective C, C++, C#, Java, Python, Processing or VB. This course may also be taken to fulfill a third math credit requirement.", format: "High School/College CS Program", street: "3251 E 3760 S", longitude: -111.8, latitude: 40.691, contact_email: "kkapptie@graniteschools.org", phone: "3856461515", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile apps (ios)\n- Processing\n", country: nil},
  {name: "J. Sargeant Reynolds Community College", city: "Richmond", state: "VA", zip_code: 23285, site_url: "http://www.reynolds.edu", ed_level: "---\n- College\n", bio: "CSC 130 Scientific Programming (3 cr.)\r\nIntroduces a science and engineering-oriented, high-level programming language. Studies the C language and its application in problem solving in a structured programming environment. Includes the concepts and practice of structured programming, problem solving, top-down design of algorithms, basic C syntax, control structures, arrays, and data structures. Co-requisite or prerequisite: MTH 173 or equivalent. Pre-requisite: CSC 110 or permission of the instructor. Lecture 3 hours per week. \r\n  \r\n\r\nCSC 155 Computer Concepts and Applications (3 cr.)\r\nIntroduces basic hardware and software concepts of computer usage, programming languages, and the computer's impact on society. Includes applications of various types of software to illustrate how computers are used in sciences, social sciences, humanities, and education. Covers the use of an operating system, word processing, spreadsheets, e-mail, library access, database access and retrieval, presentation graphics, and the Internet. Lecture 3 hours per week. \r\n  \r\n\r\nCSC 200 Introduction to Computer Science (3 cr.)\r\nProvides a broad introduction to computer science. Discusses architecture and the function of computer hardware, including networks and operating systems, data and instruction representation, and data organization. Covers software, algorithms, programming languages, and software engineering. Discusses artificial intelligence and theory of computation. Includes a hands-on component with oral and written presentations. Prerequisite: MTH 166 or equivalent with a grade of \"C\" or better. Lecture 3 hours per week. \r\n  \r\n\r\nCSC 201 Computer Science I (4 cr.)\r\nIntroduces algorithm and problem-solving methods. Emphasizes structured programming concepts, elementary data structures, and the study and use of a high-level programming language. Co-requisite: MTH 173 or equivalent or school approval. Lecture 4 hours per week. \r\n  \r\n\r\nCSC 202 Computer Science II (4 cr.)\r\nExamines data structures, introduction to object-oriented design, and algorithm analysis. Covers data structures (including sets, strings, stacks, queues, arrays, records, files, linked lists, and trees), polymorphism, inheritance, exceptions, interfaces, abstract data types, algorithm analysis (including searching and sorting methods), and file structures. Prerequisite: CSC 201 with a grade of \"C\" or better. Co-requisite: MTH 174. Lecture 4 hours per week. \r\n  \r\n\r\nCSC 205 Computer Organization (4 cr.)\r\nExamines the hierarchical structure of computer architecture. Focuses on multi-level machine organization. A simple assembler language is used by students to complete programming projects. Includes processors, instruction execution, addressing techniques, data representation, and digital logic. Prerequisite: CSC 202. Lecture 4 hours per week. \r\n  \r\n\r\nCSC 210 Programming with C++ (4 cr.)\r\nIncludes language syntax, problem-solving techniques, top-down refinement, procedure definition, loop invariance, theory of numerical errors, and debugging. Covers the syntax of the C++ language. Prerequisites: CSC 201, CSC 202, EGR 125, or instructor's approval. Co-requisite: MTH 173. Lecture 4 hours per week. \r\n  \r\n\r\nCSC 295 Introduction to Discrete Structures (3 cr.)\r\nCovers Boolean algebra, combinatorial and sequential circuits, algorithms and algorithm analysis, recursion, recurrence relations, graphs, and trees. Prerequisites: CSC 201 and MTH 287 with a grade of C or better. Lecture 3 hours per week. \r\n", format: "College CS Program", street: " PO BOX 85622", longitude: -77.45, latitude: 37.56, contact_email: "", phone: "804-523-5509", languages: "---\n- Assembly\n- C++\n- Java\n", country: nil},
