  {name: "NASA Glenn Exploring Post 631 - Computer Technology", city: "Cleveland", state: "OH", zip_code: 44135, site_url: "http://www.nasa.gov/centers/glenn/education/NASAExplorers_GRC.html", ed_level: "---\n- High School\n", bio: "Youth in this group participate in a variety of computer activities. Students learn computer technology through challenging and interesting hands-on activities. Creativity is encouraged. The students gain experience in fields such as animation, robotics, graphics, game programming, Web development, Arduino programming, signal processing, data acquisition, and image processing. They are also exposed to the traditional topics including programming, computer architecture, and basic circuitry.\r\n\r\nThe Post meets Thursday evenings during the school year.", format: "High School CS Program", street: "21000 Brookpark Road", longitude: -81.8545, latitude: 41.4187, contact_email: "hschilling@nasa.gov", phone: "", languages: "---\n- C\n- HTML\n- Nxc\n- Nxt-g\n- PHP\n- Python\n- Scratch\n", country: nil},
