  {name: "Panther Creek High School", city: "Cary", state: "NC", zip_code: 27519, site_url: "http://panthercreekhs.wcpss.net/", ed_level: "---\n- High School\n", bio: "Panther Creek High School is located in RTP area of North Carolina. We normally offer four sections of computer programming I (Visual Basic 2010)in fall and two sections in spring. We also offer XNA game programming class that is based on C# language during spring semester.\r\nWe do not have any after school club for programming however; we have FBLA club where students can compete at regional, state and national levels.", format: "High School CS Program", street: "6770 McCrimmon Pkwy", longitude: -78.8888, latitude: 35.8302, contact_email: "kchudasama@wcpss.net", phone: "", languages: "---\n- C#\n- Visual basic 2010\n", country: nil},
