  {name: "Urban Video Game Academy - DMV", city: "Upper Marlboro", state: "MD", zip_code: 20774, site_url: "http://www.uvga.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "1. Background\r\nUrban Video Game Academy (UVGA) is a seven-year old project-based afterschool tech literacy and skills program design to promote STEM literacy and learning through the video game development process.  UVGA and its board of advisors and program partners also help serve as a clearinghouse for the development of college and university scholarship opportunities through  video game industry design competition events and their sponsor support.  \r\n\r\nBLAXCOM Solutions, LLC manages and operates the UVGA as a for-profit program that provides an after-school technology solutions to the need for computer-based curriculums that utilizes the video game development process to engage and teach students for 21st century skills mastery.\r\n\r\n2. Mission and Objectives\r\nThe mission of the Urban Video Game Academy (UVGA) is to better prepare students in disadvantaged areas for post-secondary education and technology careers by teaching them the fundamentals of video game design and development. Our mission has three basic components:  to expose dis-advantaged students to career opportunities in video game design and development, to educate them in how to create games, and to enhance their learning in math, science, reading, and writing, which are all important features of the video game development process.\r\n\r\nUVGA uses video game design and development to accomplish the following objectives:\r\n\r\n1. To better prepare disadvantaged youth for college-level study in video game design and related fields such as computer science, digital art and engineering;\r\n\r\n2. To enhance learning in math, science, reading, and writing through their applications in the video game development process;\r\n\r\n3. To excite and inform disadvantaged youth about career alternatives in the video game design industry and related fields such as computer science, digital art and engineering;\r\n\r\n4. To instill in disadvantaged youth a positive self image and teach them teamwork, leadership skills, and positive social interaction and communication skills;\r\n\r\n5. To provide after-school and weekend classes that will keep disadvantaged youth engaged in productive activities;\r\n\r\n6. To encourage related businesses and public organizations to support these efforts.\r\n\r\nThe UVGA program reaches students from elementary to high school students in the Baltimore-DC area.  The schools curriculum feature introductory graphic design software and computer programming, along with math enrichment.  Most of the software utilize by the program can be obtained and installed with a no-fee-license.  Software examples are: MS Power Point, MS Paint, ALICE 2.0, and Game Maker 8.1 Other software such as, Adobe Creative Suite 6 (CS6) which can include Photoshop, Illustrator, In-design, and FLASH).  Other application curriculums include Scalextric4Schools (uses PTC Creo CAD) Autodesk Maya, 3D Max, Blender, and Zbrush for 3D modeling sculpting and animation rigging. \r\n", format: "Elementry-High Scool CS Program", street: "319 Panora Way", longitude: -76.7651, latitude: 38.8904, contact_email: "regardsroderick@gmail.com", phone: "240-619-8842", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- Python\n", country: nil},
