  {name: "Long Island Lutheran Middle and High School", city: "Brookville", state: "NY", zip_code: 11949, site_url: "http://www.luhi.org", ed_level: "---\n- Middle School\n- High School\n", bio: "I teach Intro to programmming, advanced programming and AP Computer Science.  I also teach Scratch to my 6th graders.  In addition, I am launching a MinecraftEdu exploratory this semester.", format: "Middle/High School CS Program", street: "131 Brookville Rd.", longitude: -73.5499, latitude: 40.8191, contact_email: "christine.dragos@luhi.org", phone: "516-626-1700", languages: "---\n- Java\n- Scratch\n", country: nil},
  {name: "John L. Miller - Great Neck North High School", city: "Great Neck", state: "NY", zip_code: 11023, site_url: "http://www.greatneck.k12.ny.us/GNPS/NHS/index.html", ed_level: "---\n- High School\n", bio: "Introduction to Programming - Fall Semester\r\nSoftware has become an integral part of education and society over the past decade. From word processing to cell phone applications, the demand for programmers grows each and every day. This course serves as a platform for students to take an introductory look at how software is developed and to become familiar with a welcoming and user friendly coding language, Visual Basic. Students will explore the beginning aspects of how to read and write code, documentation, debugging, and working in teams to accomplish a common goal. The course culminates in a final project where students will use everything they learned over the course of the semesters to create an educational piece of software from scratch(Jeopardy, flashcards, etc.). No previous programming experience or computer skills required.\r\n\r\nIntroduction to Java - Spring Semester\r\nThe primary language in use today is Java, developed by Sun Microsystems. Java is the backbone of everything you see today, from applications to video games. In this course, we will study the beginning elements required to successfully understand and use Java. Students will be introduced to more conceptual elements such as object oriented programming, algorithm development, and class hierarchies.\r\n\r\nAP Computer Science A\r\nWhat is the most efficient way to sort a list of ten thousand names in the shortest amount of time? How can we continue to maintain a programs life span without excessive use of reusing code? These are the types of complicated yet intriguing questions that will be answered in AP Computer Science. This course takes students deep into the infrastructure of the Java language, including memory efficiency, searching and sorting, data structures, and polymorphism. There is also an in depth case study where students will have an opportunity to work with GridWorld, a simulated environment that mimics insect activity. In May, students will take the AP Exam.", format: "High School CS Into to Programming(VB), Intro to Java, AP Computer Science A", street: "35 Polo Road", longitude: -73.7395, latitude: 40.8004, contact_email: "ccubinski@greatneck.k12.ny.us", phone: "(516) 441-4750", languages: "---\n- C++\n- Java\n- Visual basic\n", country: nil},
