  {name: "Timber Creek High School", city: "Orlando", state: "FL", zip_code: 32828, site_url: "https://www.ocps.net/lc/east/htc/Pages/default.aspx", ed_level: "---\n- High School\n", bio: "Timber Creek High School offers a complete computer science program that prepares students to be successful in a collage level computer science or engineering major.   Students enrolled at Timber Creek High School can choose three different tracks: Computer Science, Web Design, or Cyber Security. \r\n\r\nOur computer science track starts the students out learning the Java language.  Students will progress and learn about Object-Oriented programming, data structures such as link-lists and binary search trees, and advanced algorithmic such as graph theory.  During this journey, students work with both desktop and mobile platforms. We also partner with our local research university which offer free courses and research opportunities. \r\n\r\nOur web design program allows students to learn the basics of HTML and CSS.  As the progress on this track they will be introduced to client side programming such as JavaScript and server side programming such as PHP.   ", format: "High School CS 4-year program", street: "1001 Avalon Park Blvd", longitude: -81.1469, latitude: 28.5273, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- PHP\n", country: nil},
