  {name: "Kalamazoo Area Math Science Center (KAMSC)", city: "Kalamazoo", state: "MI", zip_code: 49008, site_url: "http://www.kamsconline.com/", ed_level: "---\n- High School\n", bio: "9th graders are required to take a full year of I.T. (includes programming in Scratch)\r\n10th graders are required to take a full year of Pre-AP* Computer Science (includes programming in C++, HTML, JavaScript)\r\n11th and 12th graders may elect to take AP* Computer Science A (programming in Java)\r\n11th and 12th graders may elect to take a Fall semester of Discrete Math\r\n11th and 12th graders who have had AP* Computer Science may elect to take Spring semester of Advanced Computer Science (includes programming math problems in Python).\r\nA few one-week and two-week Summer School classes are offered for middle school and high school ages , introducing students to introductory programming concepts mixing C++ with Alice and Java with Scratch.", format: "High School CS Program. We are a half-day countywide pullout magnet for math, science and technology. ", street: "600 W. Vine St.", longitude: -85.5908, latitude: 42.2841, contact_email: "", phone: "269-337-0010", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Python\n- Scratch\n", country: nil},
