  {name: "Edmond Memorial High School", city: "Edmond", state: "OK", zip_code: 73013, site_url: "http://www.edmondschools.net/memorial/Home.aspx", ed_level: "---\n- High School\n", bio: "3 classes - 1) Computer Science - basic programming skills taught using Scratch, Alice, Greenfoot, Jeroo, Lego robots and photo manipulations.  The course also includes units on hardware, artificial intelligence, encryption and the internet.\r\n 2) AP Computer Science - as dictated by Collegeboard\r\n 3) Advanced Computer Science - advanced programming concepts, more robots ", format: "High School CS Program", street: "1000 East 15th Street", longitude: -97.4673, latitude: 35.6383, contact_email: "", phone: "", languages: "---\n- Alice\n- Java\n- Scratch\n", country: nil},
  {name: "Auburn University Robo Camp", city: "Auburn", state: "AL", zip_code: 36849, site_url: "http://eng.auburn.edu/outreach/k-12/robo-camp/index.html", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "ROBO CAMP is a program developed by Auburn's Department of Computer Science and Software Engineering to reinforce computer literacy, while introducing advanced concepts and hands-on applications of computer programming and robotics.\r\n \r\nStudents assigned individual tasks and work together in teams to complete assignments. Carnegie Mellon University Alice Programming System, Microsoft Kodu programming environment, Lego Mindstorms NXT, and Lego Tetrix robots, Carnegie Mellon University RobotC, will be few of the applications used to teach concepts of computer programming and robotics.\r\n \r\nThe program is developed by AU's Computer Science and Software Engineering Department, directed by faculty member Daniela Marghitu and taught by graduate students from the department.\r\n", format: "Elementry-High Scool CS Camp", street: "345 W Magnolia", longitude: -85.4872, latitude: 32.6065, contact_email: "marghda@auburn.edu", phone: "334-844-6386", languages: "---\n- Alice\n- Microsoft kodu\n- Robot c\n", country: nil},
