  {name: "ASCEND", city: "Oakland", state: "CA", zip_code: 94601, site_url: "http://efcps.org/our-schools/ascend/", ed_level: "---\n- Middle School\n", bio: "We are currently teaching HTML5 and Javascript to 7 and 8th grade students in East Oakland as part of a technology course twice a week for an hour. We are currently using codeavengers.org. In the future we will be teaching Scratch to younger grades and iOS to middle schoolers. ", format: "Middle School CS Program", street: "3709 E. 12th st.", longitude: -122.222, latitude: 37.7741, contact_email: "nieto.paco@gmail.com", phone: "5105303656", languages: "---\n- HTML\n- Javascript\n- Mobile apps (ios)\n- Scratch\n", country: nil},
  {name: "The Software Entrepreneurs Club", city: "Hillsboro", state: "OR", zip_code: 97123, site_url: "http://www.ourfinesthour.info", ed_level: "---\n- High School\n", bio: "We (the Software Entrepreneurs Club Mentors) work with a group of high school students, called the Software Entrepreneurs Club (the SEC), in Hillsboro, Oregon.  We have recently published our first Windows 8 app to the Windows Store.  Our app is a volunteer and donation management system, for use by schools and non-profits, worldwide.  Our app, called Our Finest Hour (OFH), has been made possible by a handful of Microsoft employees who have had it within their respective powers to grant the SEC access to WP7 phones, Windows 8 (Samsung) tablets and design dollars (thru MAAP), software licenses and Azure hosting (thru BizSpark).\r\n\r\nIn return for these donated hardware, software, and hosting resources, we have created (and published) our first Windows 8 OFH app and we are working on our first WP7 OFH app.  Both apps are early prototypes, which will continually become more product worthy as we pursue our iterative software development methodology.  Our Finest Hour is a multi-year project, which will soon start to produce recurring revenue for the SEC, to be used for further product development and club-sponsored college scholarships.\r\n\r\nWe first started teaching mobile software development on WP7 smartphones in the high school classroom in 2011-2012, funded by a $20K grant from Intel.  We had limited success in our development efforts, but we had enough success to encourage us to start an after-school software development club, called the SEC.\r\n\r\nWe started the SEC this year as the 2nd phase of our experiment to see what a group of high school students can achieve when given:\r\n\r\n- technical leadership and mentoring\r\n\r\n- an after school program that is not bell-driven (when the bell rings, students leave the classroom) and is based upon each student's desire to achieve tasks, without receiving grades to measure their successes\r\n\r\n- donations of relevant hardware, software, and services\r\n\r\n- encouragement to design and create product worthy mobile software products, without formal software development schooling\r\n\r\n- the opportunity to compete for SEC sponsored college scholarships that are based largely on each student's contributions to SEC products\r\n\r\nWe have a club roster of almost 50 students, with weekly team participation ranging from 19 to 27 students.  High school students have a very active schedule these days, and we feel honored to have such a high weekly participation rate from our team members.  In the next couple of years, we will be growing our team to encompass students from our other 3 high schools in the Hillsboro School District.  We also plan to start working with high schools from other school districts across America, to help students at other schools to learn from our failures and successes.\r\n\r\nFrom a mentoring perspective, our main goal for the SEC is to help to produce local software development team members who come out of high school with a set of tools upon which they can build successful software development careers.  Our team members are also being encouraged to continue to contribute to the SEC after they graduate from high school.  In addition to software developers, we are working to also provide students with start-up experience in the disciplines of software quality assurance, product documentation, and software marketing and advertising.  We are striving to teach our team members the importance of being able to work closely with each of the disciplines required to bring quality software products to market in a timely manner.\r\n\r\nWe are excited about our results to date.  We delivered our Windows 8 version of OFH within a very tight schedule dictated by Microsoft and we received very positive feedback from our sponsors at Microsoft about our deliverables to date.\r\n\r\nLinks to OFH in the Windows Store, Our Finest Hour's Marketing Video, and Our Finest Hour's entry in Apps for Social Good (a Microsoft contest) are provided as follows:\r\n\r\nhttp://apps.microsoft.com/windows/app/ourfinesthour/e74a5998-c429-4652-9022-5aa459e0aecb\r\n\r\nhttp://vimeo.com/55793109\r\n\r\nhttp://www.netsquared.org/project/our-finest-hour-software-entrepreneurs-club\r\n\r\nWe hope you choose to install and use Our Finest Hour.  We welcome you feedback on our app.\r\n\r\n", format: "High School CS Club", street: "", longitude: -122.99, latitude: 45.5229, contact_email: "secinfo@friller.com", phone: "", languages: "---\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- Mobile apps (ios)\n- Windows 8 apps\n- Windows phone apps\n", country: nil},
  {name: "Institute of Data Processing Management of Nigeria", city: "Alimosho-Iyana Ipaja", state: "Lagos", zip_code: 23401, site_url: "http://www.idpmng.org", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "INTRODUCING THE IDPM PROFESSIONAL PROGRAMME: A KNOWLEDGE AND SKILL UPGRADE STRATEGY FOR LOWER CADRE EMPLOYEES\r\n\r\nIntroduction:\r\nThe institute of Data Processing Management of Nigeria (IDPM) stands for Effective Data Processing and System Management. It is a professional body which is recognized under the companies and Allied Matters Decree 1, of 1990. It is the Nigerian counterpart of IDPM London, now known as the Institute for Management of Information System (IMIS)\r\n\r\nThe IDPM (Institute of Data Processing Management of Nigeria) programme is designed to ease the process of knowledge and skill upgrades. It is particularly useful to employees with lower qualifications who wish to upgrade their knowledge and skill in order to move up the corporate ladder.\r\n\r\nThe programme is self  paced, making it highly suitable to employees who cannot take study leaves. It could be run as part  time, full  time or any other schedule that suits the working condition of the employee.\r\n\r\nCompletion of Part I&II and Part III&IV stages of the course is equivalent to OND (Ordinary National Diploma) and HND (Higher National Diploma) respectively; Graduates of the first stage (Part I&II) and second stage (Part III&IV) of the Professional programme are eligible for Direct Entry into 200 Level University Degree programmes and Post Graduate Degree programmes respectively if so wished.\r\n\r\nCourses that students can further in\r\n\r\nDirect Entry:\r\n\tAccounting, Business Administration, Economics, Computer Economics, Computer Science, Computer Engineering, Business Education, etc\r\n\r\nPost Graduate Diploma (PGD):\r\n\tManagement Information System, Business Management, Public Administration, DP/Marketing Management,  DP/Management Accounting, Information Technology, etc \r\n\r\nUniversities where IDPM Certificates are recognised\r\n\tOlabisi Onabanjo University, Ambrose Alli University, Ekiti State University, Crescent University, Obafemi Awolowo University, Ladoke Akintola University, St. Clement University; Australia, University of Applied Science; Port-Novo, European-America University; New York, (Ghana Campus & Nigeria Satellite ) Walden University, London Sikkim Manipal University; India (Ghana Campus) etc.\r\n\r\nProfessional Bodies around the world where IDPM Certificates are recognised\r\nAssociation for Computer Machinery (ACM); New York USA, Institute of Management Information System (IMIS); London, Institute of Engineering and Technology (IET); United Kingdom, The Institute of Electrical and Electronics Engineers (IEEE); USA, Nigeria Institute of Management (NIM); Nigeria, Chartered Institute of Commerce (CIC); Nigeria, Chartered Institute of Certified Secretaries and Reporters (CICSR), Nigeria. etc\r\nNB:\r\nWe have only listed Universities in which Graduates of the programme are currently offering courses; you are encouraged to make enquiries into other Universities not listed independently.\r\n\r\nRequirements:\r\nIntending students are required to have Five (5) O  Level Credits, although students still awaiting their results may be considered. \r\n\r\nMore than a Course\r\nAt IDPM we take our students through rigorous Quantitative, Verbal and Analytical training to make them better equipped to face the challenges of the modern world. We prepare them not only for the Labour market but also to become worthy entrepreneurs through our management courses. \r\n\r\nFinally, we make them well rounded by applying hands  on computer techniques to problem solving and financial management.\r\n\r\nOur Training Staff\r\nWith our army of Graduates from reputable universities, members of world class professional institutes and holders of international certifications; our students are in great hands.\r\n\r\nFor more details contact:\r\n\r\nSnr. Analyst Adebayo Sulaiman AIDPM\r\nLagos State Coordinator, National Database Manager\r\n08122769953, 08035188256\r\nwww.idpmng.org; info@idpmng.org\r\n", format: "6 months regular full time or part-time CS classes ", street: "5, Ige str., Aboru Rd (Omosola Hospital)", longitude: nil, latitude: nil, contact_email: "info@idpmng.org", phone: "+2348122769953", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- PHP\n- Python\n- Scratch\n", country: nil},
  {name: "Mentors ", city: "Lucknow", state: "UP", zip_code: 226001, site_url: "http://www.wethementors.com", ed_level: "---\n- Middle School\n- High School\n- College\n", bio: "I manage a small programming hub where I teach computer science to senior secondary and higher secondary students. I make it a point to relate the programming concepts to the real world so that one who has never studied programming can easily understand. It's a steady process of logic building in young minds where I strive to open their minds to reasoning. ", format: "CS Program Class", street: "", longitude: 80.9484, latitude: 26.8537, contact_email: "contact@wethementors.com", phone: "+919839125238", languages: "---\n- C++\n- Computer science fundamentals - both hardware and software\n- Java\n", country: nil},
  {name: "St Bernard's College ", city: "Lower Hutt", state: "Wellington", zip_code: 5010, site_url: "http://www.sbc.school.nz", ed_level: "---\n- High School\n- College\n", bio: "Year 11-14 Computing (ages 15-18) / NCEA LEVEL 1-3 - using www.codeavengers.com - 10 weeks of web: html, css and javascript. 10 weeks of programming scratch and python. we are considering mobile app dev with web or android app inventor. Have plan to integrate projects around games design using BLENDER,  UNITY, GAMEMAKER, WWW.GAMEFROOT.COM & Scratch. Basic intro to databases with Access and mySql with phpmyadmin. I have registered as an iOS developer so am interested in high school resources to teach iOS dev.", format: "using www.codeavengers.com - 10 weeks of web: html, css and javascript. 10 weeks of programming scratch and python. we are considering mobile app dev with web or android app inventor.", street: "183 Waterloo Road, Lower Hutt", longitude: 174.917, latitude: -41.2104, contact_email: "mharrison@sbc.school.nz", phone: "+6445609250", languages: "---\n- Gml in gamemaker.\n- HTML\n- Javascript\n- Python\n- Scratch\n", country: nil},
