  {name: "Loveless Academic Magnetic Program (LAMP) High School", city: "Montgomery", state: "AL", zip_code: 36108, site_url: "http://www.loveless.mps-al.org/", ed_level: "---\n- High School\n", bio: "The Loveless Academic Magnet Program (LAMP) provides highly motivated students with the opportunity to develop knowledge, creativity, and academic skills through participation in advanced studies in English, mathematics, science, social studies, foreign languages, computer science, and a wide array of interest electives.  The stringent college preparatory curriculum prepares students who are interested in pursuing careers in medicine, applied science, government and similar areas of distinction for admission to the most prestigious college programs in the nation.   The Loveless curriculum, which includes 16 Advanced Placement courses and a variety of academic competitive teams, provides students with the opportunity to gain superior educational preparation through intensified classroom and community experiences.  A sports program, under the guidance of the Alabama High School Athletic Association, is based upon student interest.\r\n\r\nAcceptance into Loveless is based upon academic records indicating demonstrated ability to complete higher-level academic courses, maintain disciplined study and work habits, and acceptable conduct and attendance.   Ninth-grade applicants should have completed Intro Algebra (Algebra 1 preferred).  Tenth-grade applicants should have completed Algebra 1 (Geometry preferred).  Upon review of the student's academic records and completion of a personal interview, candidates are selected for enrollment based upon space availability.\r\n\r\nStudents must maintain, for the current school year, a weighted academic average of 2.5 or better in the academic core courses (English, history, math, science and foreign languages) and acceptable conduct and attendance records. \r\n", format: "High School CS Program", street: "921 W Jeff Davis Ave", longitude: -86.3232, latitude: 32.3661, contact_email: "Roy.Black@mps.k12.al.us", phone: "(334) 269-3839", languages: "---\n- C++\n- HTML\n- Java\n- Mobile apps (ios)\n- Scratch\n", country: nil},
