  {name: "St. Patrick's Episcopal Day School", city: "Washington", state: "DC", zip_code: 20007, site_url: "http://www.stpatsdc.org/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Video Game Design class after school. Scratch programming integrated into projects in the general curriculum. Twitter: @MrFichter. Interested in incorporating Python.", format: " Scratch programming integrated into projects in the general curriculum. Video Game Design class after school.", street: "4700 whitehaven pkwy nw", longitude: -77.0912, latitude: 38.9159, contact_email: "", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "Bentonville High School", city: "Bentonville", state: "AR", zip_code: 72712, site_url: "https://www.google.com/search?q=bentonville+high+school+bentonville", ed_level: "---\n- High School\n", bio: "Advanced Placement Computer Science course - 5 days a week high school course to prepare for the College Board advanced placement exam. Teaches the Java language", format: "AP Computer Science", street: "Southeast J Street", longitude: -94.1971, latitude: 36.3537, contact_email: nil, phone: nil, languages: "---\n- Java\n", country: nil},
  {name: "Princess Anne HIgh School", city: "Virginia Beach", state: "VA", zip_code: 23462, site_url: "http://www.princessannehs.vbschools.com", ed_level: "---\n- High School\n", bio: "AP Computer Science A is equivalent to the first semester college level computer science course using Java as the programming language.  The course covers object-oriented design, basic programming concepts, arrays, two-dimensional arrays and the ArrayList data structure.  Students work with the Grid World case study as an example of a large programming project.", format: "High School AP Computer Science A", street: "4400 Virginia Beach Blvd", longitude: -76.1273, latitude: 36.8444, contact_email: "jeharris@vbschools.com", phone: "757-648-5600", languages: "---\n- Java\n", country: nil},
  {name: "Princess Anne High School", city: "Virginia Beach", state: "VA", zip_code: 23462, site_url: "http://www.princessannehs.vbschools.com", ed_level: "---\n- High School\n", bio: "IB Standard Level Computer Science focuses on software development, fundamentals of computer systems and the relationship between computing systems and society.  Students are expected to acquire mastery of the specified aspects of Java. Suitable mechanisms include encapsulation, polymorphism and inheritance, although other structured approaches are possible. Mastery of a particular aspect (or mechanism) of computer science is defined as the ability to use that aspect appropriately for some non-trivial purpose that is well documented. Mastery will be demonstrated through work submitted in the program dossier.", format: "High School IB Standard Level Computer Science", street: "4400 Virginia Beach Blvd", longitude: -76.1273, latitude: 36.8444, contact_email: "jeharris@vbschools.com", phone: "757-648-5600", languages: "---\n- Java\n", country: nil},
  {name: "Princess Anne High School", city: "Virginia Beach", state: "VA", zip_code: 23462, site_url: "http://www.princessannehs.vbschools.com", ed_level: "---\n- High School\n", bio: "IB Higher Level Computer Science course focuses on software development, fundamentals of computer systems and the relationship between computing systems and society. The higher level (HL) is extended to include: computer mathematics and logic; advanced data structures and algorithms; further system fundamentals; and file organization. Students are expected to acquire mastery of the specified aspects of Java. Suitable mechanisms include\r\nencapsulation, polymorphism and inheritance, although other structured approaches are possible. Mastery of a particular aspect (or mechanism) of computer science is defined as the ability to use that aspect appropriately for some non-trivial purpose that is well documented. Mastery will be\r\ndemonstrated through work submitted in the program dossier.", format: "High School IB Higher Level Computer Science", street: "4400 Virginia Beach Blvd", longitude: -76.1273, latitude: 36.8444, contact_email: "jeharris@vbschools.com", phone: "757-648-5600", languages: "---\n- Java\n", country: nil},
  {name: "Minuteman High School", city: "Lexington", state: "MA", zip_code: 2421, site_url: "http://www.minuteman.org", ed_level: "---\n- High School\n", bio: "The Programming & Web Development Major integrates Computer Programming, Web Design and Development, Graphic Design and Development, 3D Animation, Game Design, Computer Maintenance and Repair, and Computer Applications with Business Communication Skills. \r\n\r\nStudents will develop the ability to organize and manage programming, web, graphic, and/or 3D animation projects, learn advanced interpersonal and business relations skills, and develop an understanding of business attitudes essential to participate in the multinational marketplace as productive college students, workers, and consumers. All learners are challenged to meet high standards and high expectations while receiving the necessary supports for success. The programs focus is on preparing students for a variety of career opportunities where technical knowledge and skills are integrated with business concepts and academics. We also understand the importance of human relations, self management, teamwork, and leadership.", format: "High School CS Programing", street: "758 Marrett Road", longitude: -71.2689, latitude: 42.4457, contact_email: "", phone: "781.861.6500  ext. 213 ", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Python\n", country: nil},
  {name: "Princess Anne HIgh School", city: "Virginia Beach", state: "VA", zip_code: 23462, site_url: "http://www.princessannehs.vbschools.com", ed_level: "---\n- High School\n", bio: "Computer Programming is a year-course designed to introduce students to the fundamentals of programming using Alice and the Java programming langurage. Although students may have had previous computer experience, little or no programming knowledge is assumed.  Students will use object-oriented techniques to design and implement Alice and java programs.  The course includes the history of computing, hardware and software, problem solving, computer graphics, functions, control structures, loop structures, strings and arrays.  The principles of object-oriented programming are emphasized throughout the course", format: "High School Computer Programming", street: "4400 Virginia Beach Blvd", longitude: -76.1273, latitude: 36.8444, contact_email: "jeharris@vbschools.com", phone: "757-648-5600", languages: "---\n- Alice\n- Java\n", country: nil},
