  {name: "Brunswick High School", city: "Brunswick", state: "ME", zip_code: 4011, site_url: "http://www.brunswick.k12.me.us/bhs/", ed_level: "---\n- High School\n", bio: "Introduction to Game Design using Python is a semester long course and prerequisite to Advanced Placement Computer Science (APCS). The Python course teaches algorithms and problem solving strategies common to all programming environments using simple games. After students have taken Python they can take APCS. APCS is a year long course that is similar in content to an introductory college course in Computer Science, but at a more manageable pace for High School.", format: "High School CS Programing semester and year long", street: "116 Maquoit Road", longitude: -69.9799, latitude: 43.8851, contact_email: "", phone: "", languages: "---\n- Graphic design using photoshop ; some web design; semester and year long courses\n  in\n- HTML\n- Java\n- Python\n", country: nil},
  {name: "Start Code", city: "Atlanta", state: "GA", zip_code: 30329, site_url: "http://www.startcode.net", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Start Code offers after-school, homeschool, and weekend programs that teach computer programming and technology to students currently in grades 4-12.  We focus on the creativity and exploration of technology that gives students the skills and direction to create tomorrow.  Our students learn a variety of development tools including Scratch, Python, and Java while having fun making games, stories, and digital art.", format: "K-12 Basic CS Programing", street: "2991 North Druid Hills Road", longitude: -84.3094, latitude: 33.8144, contact_email: "", phone: "", languages: "---\n- Java\n- Python\n- Scratch\n", country: nil},
  {name: "Norwood Elementary School", city: "Peoria", state: "IL", zip_code: 61604, site_url: "http://teacherweb.com/IL/Norwood63/MrsJamesTechnology/apt1.aspx", ed_level: "---\n- Middle School\n", bio: "Instruction is for all students in grades 5th-8th, plus a 1 hour per week enrichment course for a mix of 6th, 7th & 8th grade students. In the enrichment course we are learning about Binary Code and programming with Kodu from Microsoft. All students receive intensive technology instruction aligned with the Common Core. Students work to achieve keyboarding fluency, practice their research skills and writing through a variety of Webquests and projects. Students become proficient in the use of Microsoft Word, PowerPoint, Excel and Publisher. Computer programming consists of Scratch for the younger grades and Etoys for older students.", format: "Daily Technology Instruction for Grades 5th-8th.", street: "6521 W. Farmington Rd.", longitude: -89.6973, latitude: 40.7004, contact_email: "", phone: "", languages: "---\n- Etoys\n- HTML\n- Kodu\n- Mobile apps (android)\n- Scratch\n", country: nil},
