  {name: "Norfolk Academy", city: "Norfolk", state: "VA", zip_code: 23502, site_url: "http://norfolkacademy.org", ed_level: "---\n- Middle School\n", bio: "When: All day for 5 days starting Monday, June 17th.\r\nAges: Entering 6th - 9th grade\r\n\r\n\r\nFrom the course description:\r\nComputers are everywhere, and sometimes it can seem unbelievable that they can do what they do.  They can understand words, display pictures and video, and even make sounds.  Most people know that someone, somewhere, programmed each computer to do what it does, but the computer code behind these programs can seem strange and even intimidating at first.  This course will dive into computers to explore the way they work and the code that runs them, using the small, inexpensive Raspberry Pi computer.  Well learn just how text gets into the computer, how people have used text to tell computers what to do (i.e. what programming languages are), learn the basics of the Python programming language, and finally read and modify the code behind a few fun games written in Python.  Students will learn how to understand technology by breaking it down into accessible pieces.  In the process, theyll discover the fun of using computer code as an outlet for their creativity. A Raspberry Pi computer, activity kit, and extra projects are included, so students can continue learning and creating afterwards, and a growing number of online educational resources for the Pi are available as well.  The only prerequisites for this course are curiosity, creativity and drive!", format: "Middle School-Summer Camp", street: "1585 Wesleyan Dr.", longitude: -76.1931, latitude: 36.8742, contact_email: "", phone: "", languages: "---\n- Python\n- Scratch\n", country: nil},
