  {name: "Universidad Nacional Mayor de San Marcos", city: "Lima", state: "Lima", zip_code: 0, site_url: "http://www.unmsm.edu.pe", ed_level: "---\n- College\n", bio: "Computing Science Professional, UNMSM-PE 1985, UFRGS-BR 1989. IT Specialist at BCRP and Teacher in UNMSM.", format: "College Level CS Program", street: "Jr. Miro Quesada 441", longitude: nil, latitude: nil, contact_email: "msperu21@gmail.com", phone: "5116132071", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- PHP\n- Python\n- Scratch\n", country: nil},
  {name: "University of Twente, Faculty of Behavioural Sciences", city: "Enschede", state: "OV", zip_code: nil, site_url: "http://www.utwente.nl/en/education/bs/", ed_level: "---\n- College\n- Vocational\n", bio: "Why should a psychologist (student) ever learn programming?\r\nThere are quite a few reasons why you should:\r\n\r\nYou want to write your bachelor thesis in experimental psychology?\r\n- Program your own experimental designs.\r\nYou are interested in media psychology, e-learning or human-computer interaction?\r\n- Program your own interactive prototypes of websites, multimedia apps asf.\r\nYou are dealing with statistical analysis on complex data sets?\r\n- Do powerful data analysis beyond what SPSS offers.\r\nYou are a creative person and like arts?\r\n- Express your ideas by own pieces of interactive art.\r\nYou are a technophile person and love computers?\r\n- Make the most out of it by writing your own programs.\r\n\r\nThe course introduces programming to third year Psychology students. The course aims at a gentle, illustrative and non-intimidating introduction to common programming concepts. The course introduces the programming language Processing, a simplified Java, targeted at artists and designers. Besides its Java heritage, Processing has the advantage of being graphical. Students can produce nice looking drawings and animations with ease, instead of being bound to the command line.\r\n\r\nAfter about 6 weeks, students have acquired basic programming skills, up to developing small interactive programs and writing object-oriented code. For the remaining two weeks students choose one of three workshops, which focus on one particular purpose for programming within Psychology: (1) programming psychological experiments, (2) scientific programming and (3) programming interactive media.", format: "College CS Programming for Psychologists", street: "Universiteit Twente  Drienerlolaan 5  7522 NB ", longitude: 6.85358, latitude: 52.2412, contact_email: "m.schmettow@utwente.nl", phone: "", languages: "---\n- Java\n- Processing\n", country: nil},
