  {name: "Gettysburg College Computer Science", city: "Gettysburg", state: "PA", zip_code: 17325, site_url: "http://cs.gettysburg.edu/", ed_level: "---\n- College\n", bio: "The computer science curriculum, offered by the Department of Computer Science, enables a student to study systematic approaches to problem solving within a computing environment. In the course of this study, the student develops the practice of clear thinking and logical reasoning, while learning to analyze information processing tools and systems. Within this study there is an emphasis on the human factors associated with computing in the modern world.", format: "CS College Courses", street: "300 N. Washington St./Campus Box 402", longitude: -77.2311, latitude: 39.8309, contact_email: "tneller@gettysburg.edu", phone: "7173376630", languages: "---\n- Assembly (various)\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n- Mobile apps (ios)\n- PHP\n- Python\n- Scheme\n", country: nil},
  {name: "North Warren Regional High School", city: "Blairstown", state: "NJ", zip_code: 7825, site_url: "http://www.northwarren.org", ed_level: "---\n- High School\n", bio: "Exploring Computer Science is designed to introduce students to the breadth of the field of computer science through an exploration of engaging and accessible topics. Rather than focusing the entire course on learning particular software tools or programming languages, the course is designed to focus on the central ideas of computing and computer science and help students understand why certain tools or languages might be utilized to solve particular problems. \r\n\r\nNote: Exploring Computer Science is based partly on a course created by the Los Angeles Unified School District. Their mission was to create a course that teaches a wide range of computing topics in a way that encourages all students, including minority students, to embrace computer science. You can find more information about their project at the following site.   http://www.exploringcs.org/", format: "High School CS Programing", street: "10 Noe Rd", longitude: -74.986, latitude: 40.9812, contact_email: "sbaier@northwarren.org", phone: "9087520787", languages: "---\n- Alice\n- HTML\n- Java\n- Javascript\n- Mobile apps (android)\n", country: nil},
