  {name: "Tahoma High School", city: "Kent", state: "WA", zip_code: 98042, site_url: "http://mshess.com", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "College Exploration of Computer Science Principles (for the non-techie),\r\nAP Computer Science A (CSI),\r\nCollege Computer Programming II (CSII)", format: "CS programing", street: "18200 SE 240th Street", longitude: -122.1, latitude: 47.3871, contact_email: "chess@tahomasd.us", phone: "425-413-6200", languages: "---\n- HTML\n- Java\n- Mobile apps (android)\n- Processing\n- Scratch\n", country: nil},
  {name: "Columbus School for Girls", city: "Columbus", state: "OH", zip_code: 43209, site_url: "http://columbusschoolforgirls.org", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "The Columbus School for Girls One Laptop Per Child Service Learning Project engages high school girls in service through computer science. What started out as a service trip has expanded to many different student-driven projects that use computer science as a vehicle to improve the world. \r\n\r\nStudents learn Etoys, repair and refurbish XO laptops, and prepare to teach Etoys to elementary school students. The service aspect of this course engages girls with technology in a deeply meaningful way. The service becomes the objective rather than the computer programming or the hardware and software troubleshooting. \r\n\r\nA secondary gain, but a primary goal, is that students are being introduced to Computer Science in a way that is attractive, engaging, and meaningful. The numbers of women in computer science have plummeted in the past decade, and remain low, so recruiting and retaining women into CS is an urgent need. This project helps to address the initial recruiting aspect of the \"pipeline problem\" by embedding the computer science into the goal of teaching and service. The science becomes something students learn along the way. ", format: "Intro to CS Programing and Repair", street: "", longitude: -82.934, latitude: 39.9557, contact_email: "", phone: "", languages: "---\n- Etoys\n- Python\n", country: nil},
