  {name: "Whitefish Bay High School", city: "Whitefish Bay", state: "WI", zip_code: 53217, site_url: "http://www.wfbschools.com/", ed_level: "---\n- High School\n", bio: "Our Computer Science sequence is designed to introduce students to computing and computer science.  The course will introduce students to programming, and will also give them an understanding of the fundamental concepts of computing, its breadth of application, and its potential for transforming the world.  Students will engage in computational thinking through programing and non-programming activities.  ", format: "High School Beginner CS Programing", street: "1200 East Fairmount Avenue", longitude: -87.8959, latitude: 43.1079, contact_email: "", phone: "414 963-3928", languages: "---\n- Scratch\n", country: nil},
  {name: "Wofford College", city: "Spartanburg", state: "SC", zip_code: 29369, site_url: "http://www.wofford.edu/computationalscience/", ed_level: "---\n- College\n", bio: "Computational Science is a fast-growing interdisciplinary field that is at the intersection of the sciences, computer science, and mathematics. Wofford's Emphasis in Computational Science is for Wofford College science, computer science, and mathematics B.S. majors.  The program requires five courses and an internship involving computation in the sciences.", format: "Emphasis in Computational Science", street: "429 N. Church Stl", longitude: -81.9345, latitude: 34.9589, contact_email: "shifletab@wofford.edu", phone: "864-597-4528", languages: "---\n- C++\n- HTML\n- Perl\n- Python\n", country: nil},
