  {name: "Waupaca High School", city: "Waupaca", state: "WI", zip_code: 54981, site_url: "http://www.waupaca.k12.wi.us/hs/", ed_level: "---\n- High School\n", bio: "Programming I Semester 1 \r\nThis course introduces the student to the world of writing computer programs. You will learn the basics of creating your own computer programs. Students use an object oriented computer programming language to author approximately forty different computer projects. Students learn about variables, control structures, loops, arrays, classes, data members, disk files and\r\nmethods. If you are thinking about a career in engineering, computer science, business, mathematics, or science this course is a must.\r\n\r\nPROGRAMMING II  Semester 2\r\nThis course is a continuation of Programming I. Students design programs that incorporate graphics, database techniques and expert systems. Programming II prepares the serious student for a future career in computer science. Students who complete Programming I and \r\nProgramming II receive one credit from FVTC. If you are thinking about a career in engineering, computer science, business, mathematics, or science this course is a must.\r\n\r\nWebdesign 1 Semester\r\nIn this course you will learn how to create web pages from scratch. Students learn how to use several computer scripting\r\nand programming languages including: HTML, JavaScript, CSS, PHP and MySQL. You will learn web page design elements such as creating headers, navigation menus, digital retouching, CSS-based layout, typography, home page and navigation design, animations, mouse commands, site maps, and color palettes. If you are thinking of a career in computer science, business, or engineering this course is for you.", format: "CS programing", street: "E2325 King Road", longitude: -89.11, latitude: 44.3358, contact_email: "polo@waupacaschools.org", phone: "7152584131 ext 1225", languages: "---\n- C#\n- HTML\n- Javascript\n- PHP\n", country: nil},
