  {name: "Institute for Mathematics and Computer Science (IMACS) - Plantation, FL", city: "Plantation", state: "FL", zip_code: 33317, site_url: "http://www.imacs.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Computer Programming and Virtual Robotics - (a) Computer Programming: Students learn to write computer programs with LOGO, a graphic-based computer programming language developed at MIT. With individualized guidance, students are challenged by projects designed by the IMACS Curriculum Development Group. (This class also serves as the ideal introduction to the more advanced university-level Computer Science class.) (b) Virtual Robotics: Students use a toolbox of wheels, gears and sensors to design, build and program robots. The robots themselves operate in a virtual world that mirrors the physical world, complete with friction and laws governing conservation of momentum and energy. Students learn to succeed in this course by analyzing and working through the challenging problems they encounter.\r\n\r\nUniversity Computer Science - The IMACS Computer Science program is second to none in its ability to engage talented secondary school students with challenging, university-level curriculum that focuses on computational thinking and go well beyond just coding. Students who complete this sequence of classes develop a deep understanding of core concepts while becoming fluent in four programming languages (Scheme, Haskell, Python and Java). The IMACS approach provides students with a unique academic advantage in college and beyond.\r\n\r\nAP Computer Science - A comprehensive Java programming course leading to the Advanced Placement Computer Science exam. This course is quali\u001Fed through the College Board's rigorous AP Course Audit process.", format: "afterschool and weekend program", street: "7435 NW 4th Street", longitude: -80.2476, latitude: 26.1267, contact_email: "parentrelations@imacs.org", phone: "954.791.2333", languages: "---