  {name: "Fountain Valley High School", city: "Fountain Valley", state: "CA", zip_code: 92708, site_url: "https://canvas.instructure.com/courses/781764", ed_level: "---\n- High School\n", bio: "This full-year introductory course in Computer Science emphasizes object-oriented programming methodology with a concentration on problem solving and algorithm development. This course is meant to be the equivalent of a first-semester college-level course in Computer Science and also includes the study of data structures, design and abstraction. Prepares students for the AP Computer Science exam; bell schedule course", format: "High School CS Programing", street: "17816 Bushard Street", longitude: -117.962, latitude: 33.7042, contact_email: "seggert@hbuhsd.edu", phone: "", languages: "---\n- Java\n", country: nil},
  {name: "Heritage High School", city: "Brentwood", state: "CA", zip_code: 94513, site_url: "http://libertyunion.schoolwires.net/heritage/site/default.asp?", ed_level: "---\n- High School\n", bio: "Computer Programming - Computer Programming is designed to focus on problem-solving skills, critical thinking, and computer ethics.  Students learn to design (structured) algorithms to solve (programming) problems using Visual Basic.  The coverage of algorithms and design techniques is general enough to enable the student to use this course as a foundation for structured program solving in any language.  Programming is taught through lectures, demonstration, analysis, and programming projects generally related to math, science, and business.\r\n\r\nAP-Computer Science - This is considered a college level introductory course in computer science using JAVA as the programming language.  A large part of the course is built around the development of computer programs or parts of programs that correctly solve a given problem.  The course also emphasizes the design issues that make programs understandable, adaptable, and, when appropriate, reusable.  At the same time, the development of useful computer programs and program modules is used as a context for introducing other important concepts in computer science, including the development and analysis of algorithms, the development and use of fundamental data structures, and the study of standard algorithms and typical applications.", format: "High School CS Programing", street: "101 American Ave.", longitude: -121.756, latitude: 37.9219, contact_email: "", phone: "", languages: "---\n- Java\n- Visual basic\n", country: nil},
  {name: "Granada High School", city: "Livermore", state: "CA", zip_code: 94550, site_url: "http://www.granadahigh.com/", ed_level: "---\n- High School\n", bio: "Exploring Computer Science A & B: Are you wondering where you fit in in the world of technology? Then Exploring Computer Science (ECS) is the class for you!  In this elective, two trimester course, you will learn a wide variety of topics critical for any career in the 21st century: how we interact with computers and how they change our world; programming and web design; robotics and problem solving; data analysis and computer ethics; in short, a bit of everything.  ", format: "High School CS Programing", street: "400 Wall Street", longitude: -121.788, latitude: 37.6748, contact_email: "ckinnard@lvjusd.k12.ca.us", phone: "925-606-4800", languages: "---\n- Python\n- Scratch\n", country: nil},
  {name: "Granada High School", city: "Livermore", state: "CA", zip_code: 94550, site_url: "http://www.granadahigh.com", ed_level: "---\n- High School\n", bio: "Introduction to Computer Programming/Game Design 1: This course is a one-trimester elective course that introduces students to the field of computer science and game design using the Visual Basic (VB) programming language.  Students will learn fundamental constructs of computer programming such as data types and variables, arrays, conditional and iterative control, and event processing. Students will apply these constructs to game theory and game design.  (Note: Game Design 2, 3, and 4 are under development and will be offered in 2013 and 2014)", format: "High School CS Programing", street: "400 Wall Street", longitude: -121.788, latitude: 37.6748, contact_email: "ckinnard@lvjusd.k12.ca.us", phone: "925-606-4800", languages: "---\n- Visua basic\n", country: nil},
  {name: "Granada High School", city: "Livermore", state: "CA", zip_code: 94550, site_url: "http://www.granadahigh.com", ed_level: "---\n- High School\n", bio: "Computer Science and Software Engineering: This course is a Project Lead the Way pilot course (http://www.pltw.org/) emphasizing the power of computational thinking and analytical inquiry. The 4 units of study are 1) Graphics and Computer Science which covers concepts such as iteration, objects, classes, events, and code efficiency. 2) Web Design and Information Technology including code writing, networking concepts, privacy, and security. 3) Information Science which introduces discrete mathematics, probability and association, and data visualization. 4) Software Engineering where students predict solutions and develop strategies for handling large projects. ", format: "High School CS Programing", street: "400 Wall Street", longitude: -121.788, latitude: 37.6748, contact_email: "ckinnard@lvjusd.k12.ca.us", phone: "925-606-4800", languages: "---\n- HTML\n- Javascript\n- Python\n- Scratch\n", country: nil},
  {name: "Santa Monica High School", city: "Santa Monica", state: "CA", zip_code: nil, site_url: "http://www.smmusd.org", ed_level: "---\n- High School\n- Vocational\n", bio: "Computer programming\r\nIC3- Internet Core Computing", format: "Regional Occupational CS Program ", street: "601 Pico Blvd", longitude: -118.485, latitude: 34.0114, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Javascript\n", country: nil},
  {name: "Granada High School", city: "Livermore", state: "CA", zip_code: 94550, site_url: "http://www.granadahigh.com/", ed_level: "---\n- High School\n", bio: "Advanced Placement (AP) Computer Science: This two trimester course expands on programming basics that students learned in one of the prerequisite courses. We delve deep into programming concepts and computer science, and use the Java language to develop and analyze algorithms, develop and use data structures, recognize and adapt standard algorithms and typical applications, and understand basic hardware and software components of computer systems. Students learn object-oriented programming by studying a large, game-based program and prepare for the Computer Science Advanced Placement test.", format: "High School CS Programing", street: "400 Wall Street", longitude: -121.788, latitude: 37.6748, contact_email: "ckinnard@lvjusd.k12.ca.us", phone: "925-606-4800", languages: "---\n- Java\n", country: nil},
  {name: "Granada High School", city: "Livermore", state: "CA", zip_code: 94550, site_url: "http://www.granadahigh.com/", ed_level: "---\n- High School\n", bio: "Computer Programming: A one-trimester course for students seeking to broaden their computer programming skills learned in the introductory course. Students will learn C++ and will deepen their understanding of data types, conditional statements, algorithms and data structures.", format: "High School CS Programing", street: "400 Wall Street", longitude: -121.788, latitude: 37.6748, contact_email: "ckinnard@lvjusd.k12.ca.us", phone: "925-606-4800", languages: "---\n- C++\n", country: nil},
  {name: "Northern Arizona university", city: "Flagstaff", state: "AZ", zip_code: 86011, site_url: "http://nau.edu/sbs/communication/", ed_level: "---\n- College\n", bio: "Visual Communication \r\nTerm : Spring 2013 \r\nCatalog Year : 2012-2013\r\nVC 351 - Interactive Design I\r\nReturn to search\r\n\r\nDescription: Studio course. Experimental and professional use of the computer as a tool for interative design. Focuses on technique, style, and concepts. Projects using web-based and interactive media. 1 hr. lecture, 4 hrs. lab. Letter grade only. Course fee required.\r\n\r\nUnits: 3 \r\n\r\n\r\nRequirement Designation: \r\n\r\nPrerequisite: VC 101, VC 251, and ART 135 with grades of C or better \r\n", format: "College Level CS Program", street: "Box 5619", longitude: -111.671, latitude: 35.1594, contact_email: "c.s.johnson@nau.edu", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
  {name: "Centennial High School", city: "Corona", state: "CA", zip_code: 92881, site_url: "http://www.cnusd.k12.ca.us//Domain/2611", ed_level: "---\n- High School\n", bio: "Videp Game Design\r\nThis yearlong course teaches students the knowledge, skills, and abilities necessary to create games in the C# programming language using the Microsoft XNA Framework. Games are created in the Microsoft Windows Environment using the Microsoft XNA framework which includes Microsoft Visual Studio 2008 and all games created will be played on the XBOX 360. Objectives of the course include but are not limited to understanding the principles of testdriven game development, using state machines when creating a program and how program states are expressed on a state diagram, comprehending software engineering terms such as\r\ncoupling, cohesion, and encapsulation, and comprehending the reasons behind code re factoring. During the course of the first semester students will test and earn their Microsoft Technology Associate  Software Development Fundamentals\r\nCertificate. Finally, by the conclusion of the course, students will develop, create, and test their own game from start to finish.\r\n\r\nIntermediate Video Game Design\r\nThis yearlong course teaches students intermediate knowledge, skills, and abilities necessary to create games in the C# programming language using the Microsoft XNA Framework 4.0, and also includes an introduction to 3D gaming using the Unity 3D development engine. In this project-based learning course, games created in the Microsoft Windows Environment using Microsoft Visual Studio 2010 and Unity 3D are designed to be played on the XBOX 360. Objectives of the course include but are not limited to objects, properties of objects, programming structure, decision and data structures, iteration, looping, recursion, arrays, simple text file input, and more complex functions. During the course of the year students will test and earn their Microsoft Technology Associate  Software Development Fundamentals and/or Microsoft Technology Associate  Gaming Development Fundamentals Certificate. At the end of the year, students will create their own 3D game world using Unity 3D. Topics include learning the interface, Asset Workflow, Creating Scenes, and Publishing on various platforms including iOS, Android, Xbox360, and Windows Mobile. Finally during the course of the school year, students will create, publish and play their own gaming project. This course is recommended for students who would like to pursue a advanced degree in video game design, or work in the video gaming industry.\r\n\r\nJava Programming\r\nThe purpose of this course is to expose the student to the various principles of the object-orientated computer programming language of Java. It will train each student in programming methodology in order to produce exceptional computer-based solutions to real-world problems. The course is based on the standard Java library classes from the AP Java subset; in addition, it provides an in-depth study of programming methodology, algorithms, data structures, and polymorphism. Finally, by taking this course students will enhance their critical thinking skills.\r\nUpon completion of this course, the student will be able to do the following:\r\n Write and debug programs in the Java programming language\r\n Understand and use object-orientated programming techniques and data structures to solve complex problems.\r\n Analyze a problem, develop a flowchart programming plan, implement the plan, and revise the plan to produce a high level-programming product.\r\n Use a top-down approach to programming using a high-level computing language, Java.\r\n Create program documents\r\n Seamlessly adapt to other similar programming languages offered at the college level.", format: "High School CS Programing", street: "1820 S. Rimpau Ave.", longitude: -117.545, latitude: 33.8586, contact_email: "bpkenney@cnusd.k12.ca.us", phone: "951-739-5670", languages: "---\n- C#\n- Java\n- Javascript\n", country: nil},
  {name: "Albany High School", city: "Albany", state: "CA", zip_code: 94706, site_url: "http://ahs510.org", ed_level: "---\n- High School\n", bio: "We offer a series of classes as well as after schools programs including:\r\n- Beginning CS with Scratch/BYOB\r\n- AP Computer Science\r\n- Web Development/Software Engineering\r\n- AfterSchool Program for girls called Technovation", format: "High School CS Program", street: "603 Key Route Blvd", longitude: -122.293, latitude: 37.8958, contact_email: "smorris@ausdk12.org", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Scratch\n", country: nil},
  {name: "Oakland Technical High School", city: "Oakland", state: "CA", zip_code: 94611, site_url: "http://oaklandtech.com/staff", ed_level: "---\n- High School\n", bio: "The Computer Science and Technology Academy at Oakland Technical High School is for students  who enjoy using computers and want to learn more about them. Students begin by enrolling in Exploring Computer Science in 10th grade Students begin by enrolling in Exploring Computer Science in 10th grade, a course specifically designed for socially diverse group of students and introduce the students to the breadth of the field of computer science. The computer academy program will develop in students the computational thinking practices of algorithm development, study of computer principles, their hardware and software designs, their applications, and their impact on society.\r\n\tAt the end of 10th grade, students will be sufficiently well-rounded to continuing learning more about programming, database design, web development, and networking.\r\n\tStudents who complete all three years of the program will have at least three different options. First, those who choose to work immediately after high school gradation will have sufficient academic and practical skills to get an entry level computer related job. Next, we are coordinating a program with Peralta Colleges, so that students can continue their studies at Alameda or any of the Peralta Colleges, preparing them for more technical and higher paying jobs. Lastly, for those students who plan to pursue a career in computer science or engineering, or any other position that requires a four year university degree, we offer a balanced preparation that ensures the students will complete all necessary requirements through articulation.\r\n\r\nThe Courses taught include:\r\n\r\nExploring Computer Science is designed to introduce students to the breadth of the field of computer science. The goal of Exploring Computer Science is to develop in students the computational thinking practices of algorithm development, problem solving and programming within the context of problems that are relevant to the lives of todays students. Students will also be introduced to topics such as interface design, limits of computers and societal and ethical issues of software engineering.\r\n\r\nComputer programming 1\r\nThe Computer Programming 1 course covers the fundamentals of database design and programming using oracle object relational database management system as part of the second year computer academy curriculum. In the second semester they begin the CS principles course where they take on the 9 big CS ideas as outlined in the College Boards principles course.\r\n\r\nComputer Programming 2 / APCSA\r\nThis course builds on the strong foundation of structured programming which the students have built over the years to train them on the concepts of object-oriented programming using the JAVA programming language. They will build their own classes as well as use ready-made classes to simplify work with strings, arraylist, stacks, and queues.\r\n\r\n", format: "High School CS Program", street: "4351 Broadway", longitude: -122.255, latitude: 37.8323, contact_email: "emmanuel.onyeador@ousd.k12.ca.us", phone: "5104505400", languages: "---\n- HTML\n- Java\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "City College of San Francisco", city: "San Francisco", state: "CA", zip_code: 94112, site_url: "http://www.ccsf.edu/cs", ed_level: "---\n- College\n- Vocational\n", bio: "Whether you are just starting out in college or you are a seasoned IT professional looking to update your skills, the Computer Science Department at City College of San Francisco has the right program for you! We offer courses in:\r\n    Computer Programming\r\n    Unix/Linux\r\n    Internet Programming\r\n    Databases\r\n    Mobile App Development\r\n    Information Science\r\n    Multimedia\r\n\r\nIn addition to our A.S. Degree in CS, we offer the following certificates:\r\n    Android App Programming\r\n    Computer Programming: C++\r\n    Computer Programming: Java\r\n    Computer Programming: Visual Basic with Database\r\n    Computing Skills for Scientists\r\n    Database Programming: MySQL/Open Technologies\r\n    Database Programming: Oracle\r\n    iPhone App Programming\r\n    LAMP Administration\r\n    LAMP Fundamentals\r\n    Unix/Linux Administration", format: "Semester-long and short-term courses in day, evening, and online. You can take just a course or two, pursue a certificate, get an Associate's Degree, or transfer to a four-year school.", street: "50 Phelan Ave, Batmale 456", longitude: -122.441, latitude: 37.7225, contact_email: "chunter@ccsf.edu", phone: "415-239-3655", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Objective-c\n- PHP\n- Perl\n- Python\n- Ruby\n- Sql\n- Visual basic\n", country: nil},
  {name: "City College of San Francisco", city: "San Francisco", state: "CA", zip_code: 94112, site_url: "http://www.ccsf.edu/cs", ed_level: "---\n- College\n- Vocational\n", bio: "Whether you are just starting out in college or you are a seasoned IT professional looking to update your skills, the Computer Science Department at City College of San Francisco has the right program for you! We offer courses in:\r\n    Computer Programming\r\n    Unix/Linux\r\n    Internet Programming\r\n    Databases\r\n    Mobile App Development\r\n    Information Science\r\n    Multimedia\r\n\r\nIn addition to our A.S. Degree in CS, we offer the following certificates:\r\n    Android App Programming\r\n    Computer Programming: C++\r\n    Computer Programming: Java\r\n    Computer Programming: Visual Basic with Database\r\n    Computing Skills for Scientists\r\n    Database Programming: MySQL/Open Technologies\r\n    Database Programming: Oracle\r\n    iPhone App Programming\r\n    LAMP Administration\r\n    LAMP Fundamentals\r\n    Unix/Linux Administration", format: "College CS Program", street: "50 Phelan Ave, Batmale 456", longitude: -122.441, latitude: 37.7225, contact_email: "chunter@ccsf.edu", phone: "415-239-3655", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Objective-c\n- PHP\n- Perl\n- Python\n- Ruby\n- Sql\n- Visual basic\n", country: nil},
  {name: "John Jay High School", city: "San Antonio", state: "TX", zip_code: 78227, site_url: "http://www.nisd.net/jay/", ed_level: "---\n- High School\n", bio: "Large 5A public high school.  We offer Computer Science 1 PreAP, Computer Science 1AP, Computer Science 2PreAP, Computer Science 3 H.", format: "High School CS Program", street: "7611 Marbach Rd", longitude: -98.6401, latitude: 29.4181, contact_email: "Robert.Harris@nisd.net", phone: "210-397-2700", languages: "---\n- Java\n", country: nil},
  {name: "Captain Nichola Goddard School", city: "Calgary", state: "AB", zip_code: 0, site_url: "http://schools.cbe.ab.ca/b662/", ed_level: "---\n- Middle School\n", bio: "The school has two after school clubs available that work on programming skills. Both clubs have a focus on creative learning, computational thinking and integrating and creating software based on non-traditional interfaces for video games.\r\n\r\nIn the Junior Video Game Design Club (Grade 4 and 5) students work on building the basics of computational learning. This club uses Scratch and Gamestar Mechanic. For the 2012/2013 school year, Junior Club meets on Wednesdays from 3:00 - 4:00. \r\n\r\nThe Senior Video Game Design Club (Grade 6-8) has a beginners component that also begins with programming through Scratch. The plan is that students can be matched with mentors in order to support learning any language that they are interested, once they have a basic understanding of the programming processes.  Currently we have students working on learning how to use Scratch, Alice 3D, as well as setting up and maintaining a school Minecraft.edu server. \r\n\r\nOur 2013 projects include using LEGO WeDO sensors and motors, Makey Makey, the Microsoft Kinect and Scratch to create interactive programs and games that are not dependent on keystrokes or the mouse in order to work. This club meets on Thursdays from 3:00 - 4:00.\r\n\r\nAt the moment, this club is only available to students who attend our school.", format: "Programming and Game Design Club", street: "405 Panatella Boulevard N.W. ", longitude: -114.091, latitude: 51.1629, contact_email: "samartin@cbe.ab.ca", phone: "403-817-3300 ", languages: "---\n- Alice\n- Scratch\n", country: nil},
  {name: "New Braunfels High School", city: "New Braunfels", state: "TX", zip_code: 78130, site_url: "http://www.nbisd.org", ed_level: "---\n- High School\n", bio: "I teach three coding courses to full time students during a full day school program.  No afterschool or summer classes are offered.  I am the only programming teacher in our district.  My classed are described below:\r\nWeb Page Mastery - HTML5 and CSS code is used to create web pages.  Adobe Dreamweaver CS6 is our web authoring software.\r\n\r\nMobile Application Development - XML code is used to create Apps for Android platform using an Eclipse SDK and Android emulator.  iOS platform uses Apple developer tools.\r\n\r\nAP Computer Science A - Course uses the Java programming language to teach object oriented programming to students.  This course is the vehicle for students to learn the content to take the AP Computer Science Exam A for college level placement.  This is a AP College Board approved course.", format: "High School CS Program", street: "2551 Loop 337 North", longitude: -98.1511, latitude: 29.7175, contact_email: "btrollinger@nbisd.org", phone: "830-627-6066", languages: "---\n- HTML\n- Java\n- Mobile Apps\n", country: nil},
  {name: "TechKnowHow Summer Camps", city: "Foster City", state: "CA", zip_code: 94404, site_url: "http://www.techknowhowkids.com", ed_level: "---\n- Middle School\n", bio: "Game Design Studio involves an introduction to computer programming using GML to code actions in a 2d adventure game.  GML is a scripting language with similarities to Java and C#.\r\nStudents create scripts for character movement, scoring, timers and displays, completing a working game.  Its an introductory course which aims to elicit a student's interest in programming.\r\nWeek-long classes offered in Burlingame, Cupertino, Fremont, Palo Alto, Pleasanton and San Francisco.", format: " Summer Camp entitled Game Design Studio; introduction to programming using GML (Game Maker language)", street: "553 Pilgrim Dr Suite D", longitude: -122.269, latitude: 37.5636, contact_email: "", phone: "6506380500", languages: "---\n- Gml (gamemaker language)\n", country: nil},
  {name: "Calapooia Middle School", city: "Albany", state: "OR", zip_code: 97322, site_url: "https://sites.google.com/site/mrsetherton/", ed_level: "---\n- Middle School\n", bio: "I currently teach programming in two ways--in school elective and a summer camp open to any student who would like to participate. Both options are further explained through my class website.", format: "CS programing Camp/ in school elective", street: "830 24th Ave. SE ", longitude: -123.092, latitude: 44.6185, contact_email: "", phone: "541-967-4555", languages: "---\n- Alice\n- Gamemaker\n- Ruby\n- Scratch\n", country: nil},
  {name: "University of Alabama", city: "Tuscaloosa", state: "AL", zip_code: 35487, site_url: "http://outreach.cs.ua.edu/camps/", ed_level: "---\n- Middle School\n- High School\n", bio: "- The University of Alabama Department of Computer Science will host a series of computer science camps in Summer 2013. \r\n- Students will be taught multiple topics of computer science while learning to program a computer in several exciting contexts (robotics control and smartphone apps). \r\n-  The Computer Science Camps are taught in a manner that encourages self-exploration across multiple projects.\r\n- The high school camps are offered to rising sophomores through seniors. All camps are taught by UA faculty in our computer science labs.\r\n- Both commuter and dorm-based (high school only) options are provided. Those students from outside of the commuting range to Tuscaloosa may reside in our dorms throughout the week. Students from across Alabama and the USA are invited, as well as international students.\r\n- The camps begin at 9am and end at 4pm each day of the week. Students will be given an hour lunch break with planned social events.\r\n- Registration deadline: April 26, 2013 \r\n- Dates:\r\nMiddle School: \r\n Week 1 (July 8-12): Game Programming and Robotics\r\n  \r\nHigh School:\r\n Week 1 (July 15-19):  Intro to Programming with Java\r\n Week 2 (July 22-26):  Smartphone and Robotics Programming\r\n", format: "CS Program Camp Middle/High School", street: "University of Alabama, Box 872090", longitude: -87.5482, latitude: 33.2072, contact_email: "gray@cs.ua.edu", phone: "", languages: "---\n- Java\n- Lego labview\n- Scratch\n", country: nil},
  {name: "Pioneer Charter School of Science", city: "Everett", state: "MA", zip_code: 2149, site_url: "http://pioneercss.org", ed_level: "---\n- Middle School\n- High School\n", bio: "AP Computer Science (5 times a week)\r\nIntro to Programming in Java\r\n", format: "Middle/High School CS Program", street: "51 Summer st.", longitude: -71.0512, latitude: 42.4083, contact_email: "fsadik@pioneercss.org", phone: "(617)389-7277 ", languages: "---\n- C++\n- Java\n", country: nil},
