  {name: "Simpson College", city: "Indianola", state: "IA", zip_code: 50125, site_url: "http://simpson.edu/", ed_level: "---\n- College\n", bio: "Simpson College is a 4-year liberal arts college. The Computer Science department offers majors in Computer Science and Computer Information Systems. Both majors take a 2-semester sequence of programming classes.\r\n\r\nFurther details at the departmental website:\r\nhttp://simpson.edu/computer-science/", format: "Undergraduate Liberal-Arts College", street: "301 N C St", longitude: -93.565, latitude: 41.3624, contact_email: "mark.brodie@simpson.edu", phone: "515-961-1833", languages: "---\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Perl\n- Python\n- Visual basic\n", country: nil},
  {name: "Trinity University", city: "San Antonio", state: "TX", zip_code: 78212, site_url: "http://www.trinity.edu", ed_level: "---\n- College\n", bio: "Trinity has a full offering of Computer Science courses as part of the major in CS. Our department was the first undergraduate CS department in the state of Texas, founded in 1970. We are dedicated to giving students a high quality learning environment with small class sizes and the individual attention needed to help them master the field. As part of a broader liberal arts education, a CS degree from Trinity gives students the technical skills they need for the field combined with the critical thinking and communication skills they need to advance in the workplace.", format: "College courses", street: "One Trinity Place", longitude: -98.4824, latitude: 29.4649, contact_email: "mlewis@trinity.edu", phone: "210-999-7022", languages: "---\n- C\n- C#\n- C++\n- Haskell\n- Java\n- Python\n- Scala\n- Scheme\n", country: nil},
