  {name: "IMACS - Institute for Mathematics and Computer Science", city: "Raleigh", state: "NC", zip_code: 27613, site_url: "http://www.imacs.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Computer Programming and Virtual Robotics - (a) Computer Programming: Students learn to write computer programs with LOGO, a graphic-based computer programming language developed at MIT. With individualized guidance, students are challenged by projects designed by the IMACS Curriculum Development Group. (This class also serves as the ideal introduction to the more advanced university-level Computer Science class.) (b) Virtual Robotics: Students use a toolbox of wheels, gears and sensors to design, build and program robots. The robots themselves operate in a virtual world that mirrors the physical world, complete with friction and laws governing conservation of momentum and energy. Students learn to succeed in this course by analyzing and working through the challenging problems they encounter.\r\n\r\n\r\n\r\n\r\nUniversity Computer Science - The IMACS Computer Science program is second to none in its ability to engage talented secondary school students with challenging, university-level curriculum that focuses on computational thinking and go well beyond just coding. Students who complete this sequence of classes develop a deep understanding of core concepts while becoming fluent in three programming languages (Scheme, Haskell, and Python). The IMACS approach provides students with a unique academic advantage in college and beyond.", format: "Elementry-High Scool CS Program", street: "10224 Baileywick Road", longitude: -78.6974, latitude: 35.912, contact_email: "ncinfo@imacs.org", phone: "(919) 786-0246", languages: "---\n- Haskell\n- Logo\n- Python\n- Scheme\n", country: nil},
