  {name: "Sir John A. Macdonald Secondary School", city: "Hamilton", state: "ON", zip_code: 0, site_url: "http://sjam.ca/cs", ed_level: "---\n- High School\n", bio: "Introduction to Computer Studies, Open (ICS2O): This course introduces students to computer programming. Students will plan and write simple computer programs by applying fundamental programming concepts, and learn to create clear and maintainable internal documentation. They will also learn to manage a computer by studying hardware configurations, software selection, operating system functions, networking, and safe computing practices. Students will also investigate the social impact of computer technologies, and develop an understanding of environmental and ethical issues related to the use of computers.\r\n\r\n\r\nIntroduction to Computer Science, University Level (ICS3U): This course introduces students to computer science. Students will design software independently and as part of a team, using industry-standard programming tools and applying the software development life-cycle model. They will also write and use subprograms within computer programs. Students will develop creative solutions for various types of problems as their understanding of the computing environment grows. They will also explore environmental and ergonomic issues, emerging research in computer science, and global career trends in computer-related fields.\r\n\r\nIntroduction to Computer Programming, College Level (ICS3C): This course introduces students to computer programming concepts and practices. Students will write and test computer programs, using various problem-solving strategies. They will learn the fundamentals of program design and apply a software development life-cycle model to a software development project. Students will also learn about computer environments and systems, and explore environmental issues related to computers, safe computing practices, emerging technologies, and postsecondary opportunities in computer-related fields.\r\n\r\nWeb Desgin, Open (IDC3O): In this course, you will learn how to design and create interactive websites that include text, graphic images, commerce, and multimedia components such as audio, video, Flash, and shopping carts. You will create pages using HTML, Javascript, CSS, and use available code editors such as Adobe Dreamweaver and image editors such as Adobe Photoshop and Adobe Fireworks.\r\nComputer Science, University Level (ICS4U): This course enables students to further develop knowledge and skills in computer science. Students will use modular design principles to create complex and fully documented programs, according to industry standards. Student teams will manage a large software development project, from planning through to project review. Students will also analyse algorithms for effectiveness. They will investigate ethical issues in computing and further explore environmental issues, emerging technologies, areas of research in computer science, and careers in the field.\r\n\r\nComputer Programming, College Level (ICS4C): This course further develops students computer programming skills. Students will learn object-oriented programming concepts, create object-oriented software solutions, and design graphical user interfaces. Student teams will plan and carry out a software development project using industry-standard programming tools and proper project management techniques. Students will also investigate ethical issues in computing and expand their understanding of environmental issues, emerging technologies, and computer-related careers.", format: "Daily programming course", street: "130 York Blvd", longitude: nil, latitude: nil, contact_email: "cs@sjam.ca", phone: "905-528-8363", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n", country: nil},
