  {name: "Milwaukee School of Engineering", city: "Milwaukee", state: "WI", zip_code: 53202, site_url: "http://www.msoe.edu", ed_level: "---\n- College\n", bio: "MSOE offers ABET accredited degrees in Software Engineering and Computer Engineering.  Course descriptions for in major courses in the freshman year are included below.\r\n\r\nSE-1011: Software Development I  This course provides an introduction to object-oriented software development using the Java programming language. Emphasis is placed on translating written problem descriptions into robust software solutions. Topics covered include Java program structure, algorithmic problem solving and modularization, I/O statements, control constructs, looping techniques, class libraries, user defined classes and methods, arrays, and ArrayLists.  Course website: http://msoe.us/taylor/se1011\r\n\r\nSE-1021: Software Development II  This course continues the study of objected oriented software development using the Java programming language. Students design, document and implement software classes and incorporate these classes into larger software applications. Topics covered include abstraction, encapsulation, declaring and implementing abstract data types, interfaces, inheritance, polymorphism, and simple event-driven programming. Course Website: http://msoe.us/taylor/se1021\r\n\r\nCS-2852: Data Structures  This course covers the organization of data and the algorithms that act upon them.  The topics of arrays, linked lists, stacks, queues, trees, sets, and hash tables are introduced. Fundamentals of algorithm performance are also introduced, with an emphasis placed on time complexity analysis. Laboratory activities include implementation of data structures as well as the application of data structures from standard libraries. Course Website: http://msoe.us/taylor/cs2852\r\n\r\nCE-1900: Digital Logic I  This course introduces combinational logic analysis and design. The topics include digital signals, binary numbers, logic gates, logic families, combinational building blocks, Boolean algebra, combinational circuit analysis, and combinational circuit design techniques. Emphasis is placed on the VHDL hardware description language as a vehicle for circuit description and simulation. Laboratory exercises allow the student to design, implement, and test a wide range of digital circuits using standard logic families and programmable logic devices. Course Website: https://faculty-web.msoe.edu/meier/ce1900/\r\n\r\nCE-1910: Digital Logic II  This course introduces sequential logic analysis and design. Sequential systems create outputs that depend on the current system inputs as well as a history of past inputs. Thus, these systems exhibit memory behavior. The topics include flip-flops, registers, counters, shift-registers, algorithmic state machines, and memories. Emphasis is placed on the VHDL hardware description language as a vehicle for circuit description and simulation. Laboratory exercises allow the student to design, implement, and test a wide range of digital circuits using standard logic families and programmable logic devices. Course Website: https://faculty-web.msoe.edu/meier/ce1910/\r\n", format: "Full university CS curriculum", street: "1025 N Broadway", longitude: -87.9086, latitude: 43.0442, contact_email: "", phone: "414 277-7339", languages: "---\n- Java\n- Vhdl\n", country: nil},
