  {name: "Longwood Institute for Teaching through Technology & Innovative Practices", city: "South Boston", state: "VA", zip_code: 24592, site_url: "http://www.ittip.org", ed_level: "---\n- Middle School\n- High School\n", bio: "In HP catalyst project, middle school students are learning Scratch and coding with Arduino in after-school settings and on Saturdays.  We completed NSF project where high school students learned computer science concepts with Scratch, C# and scripting in Unity 3D.", format: "Saturdays, after-school, summer", street: "606 Broad st", longitude: -78.903, latitude: 36.7027, contact_email: "manotalaiver@gmail.com", phone: "4345170717", languages: "---\n- Arduino\n- C#\n- Javascript\n- Scratch\n", country: nil},
  {name: "Roswell High School", city: "Roswell", state: "GA", zip_code: 30075, site_url: "http://www.fultonschools.org/teacher/Lee", ed_level: "---\n- High School\n", bio: "http://fultonschools.org/teacher/lee/\r\n\r\nCourse Information:\r\n\r\nMr. Lee teaches four courses at this time.  Please read the course descriptions below.\r\n\r\n \r\n \r\n\r\n\r\n\r\nComputer Applications\r\n\r\n\r\nCourse #07.4411000    \r\n   \r\n\r\n \r\n\r\nKnowing how to use computer applications software is a basic skill for everyone.  Students in this course become proficient in word processing, database, spreadsheet, publishing, and presentation software.  Essentially, we will be studying the Microsoft Office Suite which includes MS Word, Access, Excel, and Powerpoint software.  Given time, we will also explore Publisher and some web page development.\r\n\r\n\r\n\r\nThis course is recommended for any student interested in taking further computing classes.    \r\n\r\n \r\n\r\nComputer Applications Syllabus\r\n\r\n \r\n \r\n\r\n\r\n\r\nComputing in the Modern World\r\n\r\nCourse #11.4130000   (be careful not to confuse course number with Fundamentals of Web Site Design below)\r\n\r\n\r\n \r\n\r\n \r\n\r\nThe goal of this course is to provide all students with an introduction to the principles of computer science and its place in the modern world. This course should also help students to use computers effectively in their lives, thus providing a foundation for successfully integrating their own interests and careers with the resources of a technological society.\r\n\r\n \r\n\r\nTopics include hardware maintenance and design, networking, web page development, and programming.\r\n\r\n\r\n\r\nComputer Applications is highly recommended before taking this class.\r\n\r\n\r\n\r\nComputing in the Modern World Syllabus  \r\n\r\n  \r\n \r\n\r\n\r\n\r\nFundamentals of Web Site Design & Development\r\n\r\nCourse #11.4310000    (be careful not to confuse course number with Computing in the Modern World above)\r\n\r\n\r\n \r\n\r\n \r\n\r\nStudents in this course learn how to design web sites.  Included are site planning, page layout, graphic design, and the use of markup languages.  Forms and scripts are used to add interactivity and database access to web sites.  Additionally, the student will explore the use of leading edge software including Adobe PhotoShop, Dreamweaver, and Flash.\r\n\r\n \r\n\r\nComputer Applications is highly recommended before taking this class.\r\n\r\n \r\n\r\nFundamentals of Web Site Design Syllabus\r\n\r\n \r\n \r\n\r\n\r\n\r\nAP Computer Science A with Java\r\n\r\nCourse #11.2160010    \r\n\r\n\r\n \r\n\r\n \r\n\r\nThe AP Computer Science A course is designed to provide students with a learning experience equivalent to that of an introductory college course in Computer Science. The AP Computer Science A course emphasizes object-oriented programming methodology with a concentration on problem solving and algorithm development, and includes the study of data structures, design, and abstraction.  Other topics covered include an overview of the history of computing, basics of computing systems, ethics in computing, syntax/semantics in JAVA, subroutines, selection, repetition, classes and their methods, and an introduction to the GridWorld Case Study.\r\n\r\n \r\n\r\nThis course follows the AP course description written by The College Board.  This is a two-semester course that will culminate in the Advanced Placement Examination in Computer Science A.\r\n\r\n \r\n\r\nAt present, the programming language utilized for the AP Computer Science A course is Java.\r\n\r\n \r\n\r\nA grade of B or higher in Algebra 2 is the prerequisite for this particular course of study.\r\n\r\n \r\n\r\nStudents interested in taking AP Computer Science should have all of the following;\r\n\r\no    Prior experience with the rigors of an AP course load.\r\n\r\no    A PSAT Math score of 600 or higher.\r\n\r\no    Taken Computer Applications or have a high degree of familiarity with computers\r\n\r\no    A good work ethic.\r\n\r\n\r\n\r\nAP Computer Science A with Java Syllabus\r\n \r\n", format: "AP Computer Science", street: "11595 King Road", longitude: -84.381, latitude: 34.0632, contact_email: "Lee@fultonschools.org", phone: "", languages: "---\n- Alice\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Scratch\n", country: nil},
