  {name: "The Academy at Central", city: "High Point", state: "NC", zip_code: 27262, site_url: "http://www.academyatcentral.com", ed_level: "---\n- High School\n", bio: "Small school- early college model <15 students in class, 145 students enrolled in school.\r\n\r\nComputer Programming I- This course is designed to introduce the concepts of programming, application development, and writing software solutions in the Visual Studio environment. Emphasis is placed on the software development process, principles of user interface design, and the writing of a complete Visual Basic program including obtaining and validating user input, logical decision making and processing, graphics, and useful output. Mathematics is reinforced. \r\n\r\nComputer Programming II-This course is designed to teach students advanced programming concepts, including class structures, multimedia programming, advanced arrays, and file structures. Students will apply course concepts through the development of XNA Game Studio computer games. Mathematics is reinforced. Games are coded on the XBox and Windows Phone 7/8.", format: "Daily programming course", street: "700 Chestnut Dr", longitude: -80.0224, latitude: 35.9562, contact_email: "cromptj@gcsnc.com", phone: "336-885-7905", languages: "---\n- C#\n- Mobile Apps\n- Visual basic\n", country: nil},
  {name: "San Diego PyLadies", city: "San Diego", state: "CA", zip_code: 92121, site_url: "http://www.pyladies.com/", ed_level: "---\n- High School\n- College\n", bio: "PyLadies is an international mentorship group with a focus on helping more women become active participants and leaders in the Python open-source community. Our mission is to promote, educate and advance a diverse Python community through outreach, education, conferences, events and social gatherings.\r\n\r\nPyLadies also aims to provide a friendly support network for women and a bridge to the larger Python world. Anyone with an interest in Python is encouraged to participate!", format: "Hackathons and meetups for women and girls", street: "9710 Scranton Road #160", longitude: -117.201, latitude: 32.8974, contact_email: "juliet@predictablywell.com", phone: "", languages: "---\n- Arduino\n- Python\n- Raspberry py\n", country: nil},
  {name: "Storming Robots", city: "Somerville", state: "NJ", zip_code: 8876, site_url: "http://www.stormingrobots.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- Vocational\n", bio: "Utilize Robotics to teach programming structure. \r\nFor Gr.3 to 6: Use Robolab and Heavily focus on flowchart design. \r\nFor Gr. 7 to 12: \r\na) Start them with RobotC;\r\nb) For those who meet the minimum requirement, they will learn C/C++ programming focusing on analysis and algorithms, not just learning the language. Heavily  project-based.  We find application based approach is the best way to instill programming and analysis skill.  Some of our students engage in Artificial Intelligence algorithm such as Sieve Prime  number generator, N-Queen Problem, Huffman Encoding, Depth First Search Recursion, Flood Fill Algorithm, etc. \r\nc) For the most advanced students, we teach Arduino - Sketch C programming. Again, it is 100% application/project based.\r\n\r\nOur model has proven itself successful via our students' accomplishment in various levels of robotics competitions which require vigorous software programming and computational skills. \r\n\r\nWe do not employ conventional teaching and grading method. Students do not get promoted to the next level until they demonstrate mastery of the current level. Students' levels are not guaged by tests and home work assignment, but via their accomplishment of projects which embody the iterative software development cycle. ", format: "Other", street: "3322 Rt. 22 West, Suite 402", longitude: -74.7013, latitude: 40.6078, contact_email: "admin@stormingrobots.com", phone: "908-595-1010", languages: "---\n- Arduino\n- C++\n", country: nil},
