  {name: "Walsingham Academy Lower School", city: "Williamsburg", state: "VA", zip_code: 23187, site_url: "http://walsingham.org", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Programming is taught to grades 1-5 every week during the fourth quarter.  For grades 6-7, there is a dedicated Programming class, using Game Maker, which meets every sixth school day for 50 minutes.  \r\n\r\nGrades 1-2 use the Bee-Bot to learn simple programming with Logo.  In grade 3, they use Logo for more complex turtle graphics.  Grade 4 learns Scratch, and Grade 5 starts on Alice.  ", format: "Programming--once per week", street: "1100 Jamestown Road", longitude: -76.7284, latitude: 37.2574, contact_email: "scroushore@walsingham.org", phone: "", languages: "---\n- Alice\n- Game maker with gml\n- Logo\n- Scratch\n", country: nil},
