  {name: "The Computer School MS 245", city: "New York", state: "NY", zip_code: 10024, site_url: "http://www.thecomputerschool.org", ed_level: "---\n- Middle School\n", bio: "Introduction to programming concepts and languages taught to the 6th and 7th grade using Scratch and Microworlds. Advanced computer elective students learn and use Alice, Python, Javascript, HTML web authoring.\r\nRobotics after school program programs their robots using RoboLab (RCX bricks) or Processing using the Arduino platform.\r\nMakerspace club had a number of different boards that we use, Pico, Arduino, MakeyMakey, to make our projects interactive.", format: "Digital Media classes, Advanced Computer elective, Robotics club, Makerspace", street: "100 W 77th St", longitude: -73.9778, latitude: 40.7811, contact_email: "rudzitis@thecomputerschool.org", phone: "", languages: "---\n- Alice\n- Arduino\n- HTML\n- Javascript\n- Logo\n- Python\n- Scratch\n", country: nil},
