  {name: "Eastland Career Center", city: "Groveport", state: "OH", zip_code: 43125, site_url: "http://www.eastland-fairfield.com/", ed_level: "---\n- High School\n", bio: "Courses:\r\nProgramming and Software Development I (Juniors)\r\nProgramming and Software Development II (Seniors)\r\n\r\nDescription of Program:\r\nThe Programming and Software Development program provides students with an overview of computing technologies. Students learn computer terminology, hardware components, networking basics, and database management in addition to programming in Visual Basic.NET, HTML using text editors, and Java.\r\n\r\nMajor Goals of Program:\r\nBy the time a student graduates, they should be able to write a functioning, well-commented, and thoroughly designed piece of software. They should also be able to produce office documents using productivity software, create databases and queries, and identify technology components. \r\n\r\nMethods of Delivery (related instruction, lab instruction, projects, internships, etc.):\r\nMaterial is introduced whole group settings using a variation of lecture and demonstration. The content is project-based and students are expected to produce work to show reinforcement of topics discussed. There are a limited number of internships available to select students during junior year.\r\n", format: "Other", street: "4465 South Hamilton Rd.", longitude: -82.8876, latitude: 39.8843, contact_email: "", phone: "(614) 836-5725", languages: "---\n- Alice\n- HTML\n- Java\n- Javascript\n- Visual basic\n", country: nil},
