  {name: "Westminster College", city: "Salt Lake City", state: "UT", zip_code: 84105, site_url: "http://www.westminstercollege.edu/computer_science/", ed_level: "---\n- College\n", bio: "Our curriculum is a synergistic blend of theory and practical experience. Our classes are small, and full-time professors teach all classes as well as lab sessions. This allows an unusually high degree of personal attention from the faculty, as well as opportunities to interact frequently with other students and work together on class projects. You will work both individually as well as take part in group projects in all classes. Upon graduation, computer science graduates typically pursue employment as software engineers developing software systems, although others pursue opportunities as system architects as well as database administrators. \r\n\r\nOur full course catalog is online at:\r\nhttp://www.westminstercollege.edu/registrar/index.cfm?parent=278&detail=9950", format: "Full university CS curriculum", street: "1840 South 1300 East", longitude: -111.854, latitude: 40.7319, contact_email: "", phone: "", languages: "---\n- C\n- Java\n- Python\n", country: nil},
