  {name: "Gwynedd-Mercy College", city: "Gwynedd", state: "PA", zip_code: 19437, site_url: "http://www.gmc.edu/academics/arts_sciences/cit/", ed_level: "---\n- College\n", bio: "Bachelor of Science in Computer Information Science\r\n\r\nCurriculum Information *\r\n\r\nCore Requirements  48 credits \r\n\r\nCIS 104 Programming I\r\n\r\nCIS 110 Information Systems\r\n\r\nCIS 114 Web Design I\r\n\r\nCIS 203 Systems Analysis & Design\r\n\r\nCIS 204 Programming II \r\n\r\nCIS 215 Intro to Relational Databases\r\n\r\nCIS 230 Intro to Networking \r\n\r\nCIS 301 Algorithms and Data Structures \r\n\r\nCIS 304 Event-Driven Programming \r\n\r\nCIS 321 Computer Organization\r\n\r\nCIS 330 Network Admin & Security\r\n\r\nCIS 410 Operating Systems\r\n\r\nCIS 420 Mobile Applications Development\r\n\r\nCIS 325 Database Admin & Security*\r\n\r\nCIS Elective\r\n\r\nCIS 4000 Capstone\r\n\r\n* Required for Business Option - ELECTIVE for other options\r\n\r\n\r\n\r\nStudents now chose one of our 3 Exciting New Professional \r\nOptions:\r\n\r\nCIS and Computer Forensics  15 credit option\r\n\r\nCIS 240 Cybercrime \r\n\r\nCIS 340 Computer Forensics\r\n\r\nCRJ 102 Intro to Criminal Justice\r\n\r\nCRJ 405 Criminal Investigations\r\n\r\nCRJ 437 Forensics CSI\r\n\r\n\r\n\r\nCIS and Web Design & Multimedia  15 credit option\r\n\r\nCIS 424 Web Design II\r\n\r\nCIS 350 Multimedia I\r\n\r\nCIS 450 Multimedia II\r\n\r\nCOM 202 Visual Communication\r\n\r\nCOM 205 Media Technology\r\n\r\n\r\n\r\nCIS and Business (pre-MBA)  15 credit option\r\n\r\nACC 105 Principles of Accounting I\r\n\r\nACC 106 Principles of Accounting II \r\n\r\nBUS 101 Introduction to Business\r\n\r\nBUS Elective \r\n\r\nBUS Elective\r\n\r\n\r\n\r\nCredit Requirement \r\n\r\nA minimum of 126 credits is required for the BS degree.", format: "object-oriented, event-driven, structured, and mobile applications programming courses as well as gaming, graphic design, web design, and database courses to name just some of our CS course offerings. Check us out on our website link for the full curricul", street: "1325 Sumneytown Pike", longitude: -75.2429, latitude: 40.1963, contact_email: "ford.l@gmc.edu", phone: "", languages: "---\n- Alice\n- C++\n- HTML\n- Java\n- Mobile Apps\n- PHP\n", country: nil},
  {name: "Tolland High School", city: "Tolland", state: "CT", zip_code: 6084, site_url: "http://www.tolland.k12.ct.us/", ed_level: "---\n- High School\n", bio: "All classes are 80 minutes per day/5 days per week\r\n - 2 quarters.  They count as full year courses\r\n\r\n1) Intro to Computers (1/2 applications & 1/2 programming)\r\n2) Programming 1 - Visual Basic, Pseudocode, HTML\r\nTaught every year - above\r\nOn books 2013-2014 school year\r\n3) Programming 2 - JAVA\r\n4) Web Design\r\n5) 21st Century technology.  Using programming skills learned in earlier courses students find problem in community - suggest solution to client, design, write, debug and deliver a solution to the client.  Based on HFOSS progject at college level.\r\n6) Videography - (English&Tech) cross credit.  Students learn to story-board, shoot and edit film for production.  \r\n7) Computer Semina class.  Programming - independent study.\r\n", format: "Daily programming course", street: "Eagle Hill", longitude: -72.3437, latitude: 41.8709, contact_email: "edillard@tolland.k12.ct.us", phone: "", languages: "---\n- App inventor\n- C++\n- HTML\n- Java\n- Mobile Apps\n- Visual basic\n", country: nil},
