  {name: "North Kingstown High School", city: "North Kingstown", state: "RI", zip_code: 2852, site_url: "http://www2.nksd.net/education/staff/staff.php?sectionid=1276&", ed_level: "---\n- High School\n", bio: "Offered by the teacher in a public high school within the school's curriculum, are a number of courses in the areas of business, personal finance and investments, and technology - with the latter to include communications using digital media, information technology, and software engineering.  In particular, 'Introduction to Information Technology and Software Engineering' is a course that first establishes a foundation in the history of computing and the operations of computers.  Students study the 5 stages of computing, the future of computing (cognitive computing and cloud,...), the www and network topology making up the Internet, then venturing into the principles of software design (GUI, and development methods (e.g. Waterfall, OO).  After building a common understanding of the computing world and its future, the second half of the course is focused on the engineering of softwate to include programming.  Languages include native html, JavaScript, Python, and Alice for object.  Other languages can be added as the course progresses based on industry value and interest.            ", format: "Introduction to IT and SW Engineering (SW methods and development)", street: "150 Fairway Drive", longitude: -71.4486, latitude: 41.5559, contact_email: "richard_garland@nksd.net", phone: "", languages: "---\n- Alice\n- HTML\n- Javascript\n- Python\n", country: nil},
