  {name: "Cushing Academy", city: "Ashburnham", state: "MA", zip_code: 1430, site_url: "http://www.cushing.org", ed_level: "---\n- High School\n", bio: "This is an introduction to computer programming class for students not yet ready for (or interested in) taking our AP level programming course.  After looking at computer hardware and operating systems (and a little computer history) we focus on learning basic programming concepts using Javascript and HTML.  Each student also installs an AMP stack on their laptops to learn about databases and web services. ", format: "Other", street: "39 School Street", longitude: -71.914, latitude: 42.6335, contact_email: "", phone: "", languages: "---\n- HTML\n- Javascript\n- PHP\n", country: nil},
