  {name: "University of South Carolina", city: "Columbia", state: "SC", zip_code: 29201, site_url: "http://sc.edu", ed_level: "---\n- College\n", bio: "Students in the Integrated Information Technology  program at the University of South Carolina receive an in-depth background in information technologies in five major areas: computer networking, database systems, corporate training and development, web development, and project management. In the computer networking area, students learn about networking theory, hardware, configuration, design, installation, and network operating system administration. In the database systems area, students learn to create and maintain databases through courses in Access, Visual Basic, and Oracle SQL.  The training area covers corporate training and training systems development. In web development, students learn to create web sites using HTML and Javascript as well as content management systems such as Joomla and Drupal.  Students get extensive coursework and experience in information systems project management.\r\nStudents may take electives in specialized IT areas such as mainframe computing, information security management, and hospitality technology.  To maximize the learning experience, all IIT students must complete an internship and a capstone course that incorporates all the major IT subject areas.", format: "University IT curriculum", street: "1301 Gervais St Suite 1010", longitude: -81.0316, latitude: 34.0024, contact_email: "brookshire@sc.edu", phone: "", languages: "---\n- HTML\n- Javascript\n- Jcl\n- Sql\n", country: nil},
