  {name: "Worcester Preparatory School", city: "Berlin", state: "MD", zip_code: 21811, site_url: "http://worcesterprep.org", ed_level: "---\n- Middle School\n- High School\n", bio: "My goal is to infuse programming exposure into all of my Tech classes not just the Official Programming classes.\r\n6th Grade Computer Class Introductory Programming -Alice, Stagecast Agent Cubes,Sratch, Minecraft Modding\r\n Elective Class - Grade 9-12-Everything from Web Design,Unity  PHP, Java, CSS JQuery, 3D Rendering with various programs, HTML 5 etc...\r\nWeb Design -Grades 9 and 12\r\n\r\nMany kids come in after school and I am always available by Google Docs, phone, email or text. \r\n\r\nI also have students collaborate on projects for my Web Design Company and we offer web hosting, and run an Online Radio Network and program our websites and offer technical support so that they can have a practical use for their coding skills.\r\n\r\n", format: "Other", street: "508 S. Main St.", longitude: -75.2234, latitude: 38.3164, contact_email: "nancy@cosmicthings.com", phone: "302-249-1191", languages: "---\n- Alice\n- C++\n- HTML\n- Java\n- Javascript\n- Logo\n- PHP\n- Python\n- Scratch\n- See above description\n", country: nil},
  {name: "MassBay Community College", city: "Wellesley", state: "MA", zip_code: 2481, site_url: "http://www.massbay.edu", ed_level: "---\n- College\n", bio: "MassBay covers ACM CS1 in 2 semesters using Java as the programming language (CS 120 Programming I and CS 200 Programming II). These courses are offered every semester.  In addition we offer CS 208 Data Structures and CS 225 Software Design, a capstone course. All courses meet about 5 hours a week in a laboratory environment where students are expected to program to solve problems.\r\nWe also offer CS0. an introduction to CS for CIS majors.  This course has a programming component that may use Python, JavaScript or Scratch.\r\nMassBay offers a scripting course (CS 118) for students in Web and IT programs.", format: "Full university CS curriculum", street: "50 Oakland Street", longitude: -71.2633, latitude: 42.3119, contact_email: "ssteigerescobar@massbay.edu", phone: "7812392220", languages: "---\n- .net with vb\n- C\n- Java\n- Javascript\n- Python\n- Scratch\n", country: nil},
  {name: "Edmonds Community College", city: "Lynnwood", state: "WA", zip_code: 98275, site_url: "http://www.edcc.edu/cs/default.php", ed_level: "---\n- College\n- Vocational\n", bio: "CS 102 - Introduction to Computer Animation\r\n\r\n5.0 Credits\r\nIntroduces some basic techniques and tools of computer animation and sound production. Students develop their own unique computer character sprites, and create a short interactive computer animation with accompanying sound and music\r\n\r\nCS 115 - Introduction to Programming\r\n\r\n5.0 Credits\r\nAn introductory course in programming using VB.NET. No previous programming experience is expected. Topics include designing, creating and debugging interactive, event-driven programs with a graphical user interface and developing problem-solving skills\r\n\r\nCS& 131 - Computer Science I C++\r\n\r\n5.0 Credits\r\nIntroduction to programming for students majoring in Computer Science, technical or engineering fields. Covers the fundamental syntax and constructs of the C/C++ programming languages and general concepts of programming\r\n\r\nCS 132 - Computer Science II C++\r\n\r\n5.0 Credits\r\nIntermediate concepts of object-oriented program design and implementation using the C++ language. Topics include class design, polymorphism, composition, common algorithms, and the general use of object-oriented programming principles and algorithms for sorts and searches\r\n\r\nCS 133 - Computer Science III C++\r\n\r\n5.0 Credits\r\nC++ Data Structures. Topics include: data structures such as list, stacks, queues, various binary trees and iterators; single, multiple and virtual inheritance, polymorphism, the STL and object- oriented design techniques \r\n\r\nCS 135 - C and C++ Review I\r\n\r\n5.0 Credits\r\nPart 1 of a two-quarter sequence. A review of the fundamental concepts of the C and C++ languages. Topics include program flow constructs, functions, references and pointers, operator overloading, file I/O, classes, and object oriented design \r\n\r\nCS 136 - C and C++ Review II\r\n\r\n5.0 Credits\r\nPart II of a two-quarter sequence. Basic characteristics of C/C++ and the use of C++ for Windows graphics and game programming. Advanced features of C++ such as Template Library, exception handling, bit operations, and the use of C++ to implement 2D graphics techniques\r\n\r\nCS& 141 - Computer Science I Java\r\n\r\n5.0 Credits\r\nIntroduction to Java programming. Topics include basic Java syntax, data types, control structures, methods, object representation using classes, graphics, Applets and arrays, all within a framework of general object oriented programming principles\r\n\r\nCS 142 - Computer Science II Java\r\n\r\n5.0 Credits\r\nIntermediate Java programming. Topics include algorithm development, searching/sorting, complexity/efficiency, recursion, user interface design, class relationships including composition and inheritance and an introduction to abstract data types\r\n\r\nCS 143 - Computer Science III Java\r\n\r\n5.0 Credits\r\nJava Data Structures. Topics include data structures such as lists, stacks, queues and various binary trees, inheritance and interfaces, using standard collection classes and algorithms and Generics\r\n\r\nCS 161 - Introduction to Computer Game Development\r\n\r\n5.0 Credits\r\nFundamentals of computer game programming, including a survey of computer game categories and platforms, major game components, an overview of the game development process, and an introduction to game graphics programming using the Windows API \r\n\r\nCS 162 - Graphics and Game Programming I\r\n\r\n5.0 Credits\r\nIntroduction to the Microsoft DirectX game and graphics libraries and their use in the development of Windows based games, animation, and other graphics applications\r\n\r\nCS 163 - Graphics and Game Programming II\r\n\r\n5.0 Credits\r\nFundamental concepts used in 2D graphics and animation, as well as the techniques and tools needed to create a game application using the DirectX 2D graphics and animation library\r\n\r\nCS 185 - Two-Dimensional Game Development Project\r\n\r\n5.0 Credits\r\nTechniques and tools used to create non-graphic game components such as joystick I/O, sound, video, networking, and artificial intelligence. Students integrate these components into a 2D game project\r\n\r\nCS 215 - Intermediate Visual Basic.NET\r\n\r\n5.0 Credits\r\nIntermediate topics of visual program design and implementation using Visual Basic.NET. Topics include arrays, object-oriented programming, files and streams, error handling and debugging SQL, database programming with ADO.NET, and multimedia\r\n\r\nCS 216 - Advanced Visual Basic.NET Programming\r\n\r\n5.0 Credits\r\nIntroduces advanced topics of visual program design and implementation using Visual Basic.NET. Topics include database programming and SQL, ADO.NET, data structures and collections, ASP.NET and Web services, and networking\r\n\r\nCS 217 - Internet Programming with .NET\r\n\r\n5.0 Credits\r\nDesign, implementation and deployment of applications, web services, and components in an enterprise environment. Uses the latest tools and languages supported by the .NET framework\r\n\r\nCS 218 - Introduction to C#\r\n\r\n5.0 Credits\r\nIntroduces the C# programming language. Topics include basic C# syntax, data types, control structures, methods, object representation using classes and arrays, all within a framework of general object-oriented programming principles\r\n\r\nCS 225 - UNIX Shell Programming\r\n\r\n5.0 Credits\r\nAn intermediate course that extends previous experience with the Bourne/bash shells to program scripts used to automate system administrative tasks. Topics include environment/user defined variables, branches, loops, menus, user interaction, and functions\r\n\r\nCS 226 - Advanced UNIX: Perl\r\n\r\n5.0 Credits\r\nIntroduction to the Perl language and its use in UNIX scripting. Topics include scalar, list, hash and reference variables, control structures, formats, regular expressions, file and process input/ output, subroutines, Object-Oriented Perl, and Perls relationship to other languages\r\n\r\nCS 271 - Three-Dimensional Game Development I DirectX\r\n\r\n5.0 Credits\r\nFirst of a three-course sequence. Introduction to 3D game programming using the latest version of the Microsoft 3D API. Topics include a review of 3D mathematics, transformation pipeline, initializing Direct 3D, vertex and index buffers, and single and multi-texture effects\r\n\r\nCS 272 - Three-Dimensional Game Development II DirectX\r\n\r\n5.0 Credits\r\nSecond of a three-course sequence covering 3D game programming using the latest version of the Microsoft 3D API. Topics include camera management systems, texture compression, advanced texturing and alpha blending, loading GILES levels, and advanced 3D rendering techniques\r\n\r\nCS 273 - Three-Dimensional Game Development III DirectX\r\n\r\n5.0 Credits\r\nThird of a three-course sequence covering 3D game programming using the latest version of the Microsoft 3D API. Topics include D3DX meshes, progressive meshes, hierarchies, and frame based and mesh hierarchy based animation \r\n\r\nCS 274 - Three-Dimensional Game Development IV DirectX\r\n\r\n5.0 Credits\r\nCourse covers 3D game programming using the latest version of the DirectX API. Topics include particle systems, shadows, reflections, curved surface representations, collision detection and spatial partitioning\r\n\r\nCS 283 - Artificial Intelligence for Game Developers\r\n\r\n5.0 Credits\r\nData structures and algorithms used in computer game AI. Includes a discussion of the two most general aspects of game AI including pathfinding and decision making. Pathfinding topics include grid traversal and search algorithms, pathfinding with A*, and waypoint networks. Decision making topics include finite state machines, scripting, and squad level AI \r\n\r\nCS 285 - Three-Dimensional Game Development Project\r\n\r\n5.0 Credits\r\nApplication of basic 3D game concepts, techniques, and tools to the design and creation of a 3D game\r\n\r\n", format: "First 2 years+ of University CS Curriculum ", street: " 20000 68th Ave W", longitude: -122.325, latitude: 47.8177, contact_email: "pbladek@edcc.edu", phone: "", languages: "---\n- Alice\n- Android\n- Awk\n- C\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Perl\n- Visual basic\n", country: nil},
