  {name: "Medina County Career Center", city: "Medina", state: "OH", zip_code: 44321, site_url: "http://www.mcjvs.edu/ui/Prospective_Students/Software_Engineering_Website_Development", ed_level: "---\n- High School\n- Vocational\n", bio: "In short the programming curriculum consist of: Microsoft development platform focusing on ASP.NET C#.NET, XHTML, JavaScript, JQuery, database using Access and SQL Server, Android Mobile Development using Google ADT (Java/XML). See website for a more complete description", format: "Daily programming course", street: "1101 west liberty street ", longitude: -81.9006, latitude: 41.1519, contact_email: "bologna@mcjvs.org", phone: "330 725 8461 x208", languages: "---\n- .net platform. why is the .net platform conspicuously absent?\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n", country: nil},
  {name: "Academy of Aerospace and Engineering", city: "Hartford", state: "CT", zip_code: 6106, site_url: "http://www.crecschools.org/our-schools/academy-of-aerospace-engineering/", ed_level: "---\n- High School\n", bio: "We teach AP CS A, CB CS Principles and run Robotics club.  We have teams participating in the Technovation Challenge.", format: "CS Principles ", street: "15 Vernon Street", longitude: -72.684, latitude: 41.7512, contact_email: "cuche@crec.org", phone: "8607576363", languages: "---\n- App inventor\n- HTML\n- Java\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Marquette University", city: "Milwaukee", state: "WI", zip_code: 53201, site_url: "http://www.mscs.mu.edu", ed_level: "---\n- College\n", bio: "COSC 1010. Introduction to Computer Programming. 4 cr. hrs.\r\nIntroduction to abstraction, algorithmic thinking, simulation and testing for computer-based problem solving. Students will learn a high-level programming language and use tools developed by computer scientists and software engineers to solve problems. No prior programming experience is assumed. 3 hrs. lecture, 2 hrs. lab. Two years of college preparatory mathematics required.\r\n\r\nCOSC 1020. Object-Oriented Software Design. 4 cr. hrs.\r\nSoftware development using Java. Topics include classes and interfaces as design patterns, the Java API, current object-oriented design methodologies, an introduction to the Internet and the development of Web applications. Projects involve the development of graphical interfaces and net-centric applications. 3 hrs. lecture, 2 hrs. lab. Prereq: COSC 1010 or advanced placement.\r\n\r\nCOSC 3250. Operating Systems. 3 cr. hrs.\r\nFundamental concepts of operating systems including process control and scheduling, synchronization, memory management, file systems, device control, and the boot process. Includes module on C programming language. Course may consist of a 3 hr. lecture or a 2 hr. lecture and 2 hr. lab. Prereq: COSC 2200 and COSC 2100 or COSC 2010.\r\n\r\nCOSC 3410. Programming Languages. 3 cr. hrs.\r\nA comparative study of programming paradigms and representative programming languages. Topics include binding times, control of data, control of execution, execution environment, the role of language as an organizational tool, modularization, and the concept and significance of universal programming languages.  Includes module on Scheme programming language.  Prereq: COSC 2100 or COSC 2010.\r\n\r\nCOSC 3977. Problem Solving -- Programming. 1 cr. hr.\r\nStudents will study and implement computing problems, examine their solutions, apply classical algorithms, and formulate strategies for teamwork and problem solving in a programming contest environment. This course is a preparation for the ACM International Collegiate Programming Contest. S/U grade assessment. Prereq: Cons. of instr.", format: "Full university CS curriculum", street: "P.O. Box 1881", longitude: -87.92, latitude: 43.03, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n- Scheme\n", country: nil},
