  {name: "South Lyon High School", city: "South Lyon", state: "MI", zip_code: 48178, site_url: "http://www.slcs.us/HS.html", ed_level: "---\n- High School\n", bio: "This course is an introduction to computer programming, through the use of the Visual Basic Language. You will be introduced to ideas such as objects, properties, events,\r\ncontrols, databases, variables, if-then statements, menus, procedures, loops, debugging, etc.", format: "Daily programming course", street: "1000 N. Lafayette", longitude: -83.6507, latitude: 42.4706, contact_email: "firestonem@slcs.us", phone: "248.573.8150", languages: "---\n- Visual basic\n", country: nil},
