  {name: "Attleboro High School", city: "Attleboro", state: "MA", zip_code: 2703, site_url: "http://www.attleboroschools.com/schools/attleboro_high_schools/index.php", ed_level: "---\n- High School\n", bio: "The AP Computer Science A course is an introductory course in computer science. Because the design and implementation of computer programs to solve problems involve skills that are fundamental to the study of computer science, a large part of the course is built around the development of computer programs that correctly solve a given problem. These programs should be understandable, adaptable, and, when appropriate, reusable. At the same time, the design and implementation of computer programs is used as a context for introducing other important aspects of computer\r\nscience, including the development and analysis of algorithms, the development and use of fundamental data structures, the study of standard algorithms and typical\r\napplications, and the use of logic and formal methods. In addition, the responsible use of these systems is an integral part of the course.", format: "AP Computer Science", street: "100 Rathbun Willard Drive", longitude: -71.302, latitude: 41.9394, contact_email: "", phone: "", languages: "---\n- Java\n", country: nil},
