ation and publishing,  Logical Thinking through Zoombinis, Kodu Programming\r\n\r\nLevel Four: TTL3, Sumdog Math Games, Cyber Surf Island, Virtual Library for Kids, Fact Monster, Google Earth, National Geographic for Kids, Free-Rice-Vocabulary, Digital Citizenship, Computer Basics: What's Inside the Box? MixoMatic in ToonsTunes, Pentatonic Scales, InfoPlease Encyclopedia, Safe on the Internet, Wordle \"Word Clouds\", Doodle for Google, Shel Silverstein Art, Intel's Introduction to the Digital World, Digital Citizenship, Computer Basics: What's Inside the Box?, Dictionary of Computer Terms, Basic Troubleshooting for Kids,  Digital Storytelling using Scholastic Keys: tools for writing, communication and publishing, Logical Thinking through Zoombinis, Kodu Programming and Scratch,  4th Grade Project\r\n\r\nLevel Five: TTL3, Sumdog Math Games, Cyber Surf Island, Virtual Library for Kids, Fact Monster, Google Earth, National Geographic for Kids, Free-Rice-Vocabulary, Digital Citizenship, Computer Basics: What's Inside the Box? MixoMatic in ToonsTunes, Pentatonic Scales, InfoPlease Encyclopedia, Safe on the Internet, Wordle \"Word Clouds\", Doodle for Google, Shel Silverstein Art, Intel's Introduction to the Digital World, Digital Citizenship, Computer Basics: What's Inside the Box?, Dictionary of Computer Terms, Basic Troubleshooting for Kids,  Digital Storytelling using Scholastic Keys: tools for writing, communication and publishing. Logical Thinking through Zoombinis, Alice, Logo, Kodu Programming and Scratch,  5th Grade Project\r\n\r\nNote: Levels 6, 7 and 8 move upstairs to the Upper Computer Lab with Ms. Lida Pasquini.\r\n\r\nQuestions?  Please contact Ms. Karen at 760-547-0701", format: "Weekly Computer Science Class", street: "4070 Mission Avenue", longitude: -117.317, latitude: 33.2324, contact_email: "techlab@omms.org", phone: "760-547-0701", languages: "---\n- Alice\n- Kodu\n- Logo\n- Scratch\n", country: nil},
