  {name: "Learn to Discover", city: "La Selva Bch", state: "CA", zip_code: 95076, site_url: "http://www.learntodiscover.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- Vocational\n", bio: "In addition to the the computer language courses indicated below, Learn to Discover, a nonprofit organization, offers a wide variety of other technology-based courses, including Robotics (LEGO MINDSTORMS NXT and other robotics platforms), Simple Machines and Mechanisms, Electronics,  Animation (2D, 3D and Clay), Theme Park Design, Video Production, Web Design and Construction, 3D Design, Video and Board Game Design, Digital Art and Photography, Career Simulations, Google Literature Trips, Computer Literacy (Microsoft Word, Excel, PowerPoint, etc.), and many more. Our mission is to make learning about science, technology, engineering, math, design & art fun, engaging and relevant, and give kids a chance to experience a wide variety of subject matter. Each class features a guest speaker with passion, who answers questions and presents connections to what the kids have been learning with the real world.", format: "Programming classes all day + summer camps", street: "27 Alta Drive", longitude: -121.851, latitude: 36.9466, contact_email: "brian@learntodiscover.org", phone: "8316629700", languages: "---\n- Alice\n- And more ...\n- App inventor\n- Arduino\n- C++\n- Enchanting\n- HTML\n- Java\n- Javascript\n- Kodu\n- Logo\n- Mobile Apps\n- Nxt-g\n- Processing\n- Robotc\n- Scratch\n", country: nil},
