  {name: "Arvada West High School", city: "Arvada", state: "CO", zip_code: 80004, site_url: "https://sites.google.com/a/jeffcoschools.us/mr-pugliese/", ed_level: "---\n- High School\n", bio: "Introduction to Computer Programming: This class focuses on issues of software design and the processes that developers go through to create software. The class covers the development cycle using HTML. Students will create a web site following this process.\r\n\r\nThe second unit of the class explores the history of computers and elements of computer hardware.\r\n\r\nThe final unit uses Scratch, developed by MIT, to teach object oriented programming. In this unit students will develop a computer game or other interactive program.\r\n\r\nAdvanced Computer Programming: This class is a seminar in computer programming. Students choose projects and courses of study each semester. For students just starting out in this class, the emphasis is on learning how to write programs using the Java programming language. In the past students have worked on such projects as designing and creating Java-based games, setting up a Linux server, developing 3D games,  and developing smartphone apps.", format: "Daily programming course", street: "11595 Allendale Drive", longitude: -105.129, latitude: 39.8097, contact_email: "", phone: "", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Mount Si High School", city: "Snoqualmie", state: "WA", zip_code: 98065, site_url: "http://www.mountsihighschool.com", ed_level: "---\n- High School\n", bio: "Introduction to Robotics Engineering. Uses ROBOTC (C-based language) and LEGO Mindstorms/TETRIX robotics kits to teach programming. Students design, build, program and test robots to successfully complete a variety of scaffolded challenges throughout the year. Students also explore engineering design concepts through an end-of-year capstone project that tackles real-world problems.", format: "Robotics Engineering", street: "8651 Meadowbrook Way SE", longitude: -121.814, latitude: 47.5236, contact_email: "warrenk@svsd410.org", phone: "425-831-8159", languages: "---\n- Robotc\n", country: nil},
