  {name: "Healdsburg High School", city: "Healdsburg", state: "CA", zip_code: 95448, site_url: "http://hhs-healdsburgusd-ca.schoolloop.com/cms/page_view?d=x&piid=&vpid=1268488799945", ed_level: "---\n- High School\n", bio: "Exploring Computer Science v3 developed by LAUSD and UCLA. Comprised of six units of study: 1) Human Computer Interaction, 2) Web Design, 3) Introduction to Programming using Scratch, 4) Robotics, 5) Problem Solving, 6) Programming (using Python)", format: "Exploring Computer Science", street: "1024 Prince St", longitude: -122.868, latitude: 38.6214, contact_email: "mefram@husd.com", phone: "707-431-3420", languages: "---\n- HTML\n- Python\n- Scratch\n", country: nil},
  {name: "Great Minds Robotics", city: "Los Angeles", state: "CA", zip_code: 91356, site_url: "http://www.buildcoolrobots.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Our method for teaching kids computer programming is simple and effective. We teach students basic concepts of programming using LEGO Mindstorms NXT robots and specialized programming languages, such as NXT-G (a visual language) and RobotC (a text-based language).  Students advance in our program at their own pace, and as their knowledge and understanding of programming grows, we introduce them to real-world object-oriented languages, such as C# and Java. Student can program more than just robots  concepts we teach are necessary for creating real-world applications that run on Windows PCs and phones, Xbox 360s, Macs, iPhones and iPads, Android phones and tablets, and more. \r\nClasses offered 7 days per week.  Please refer to schedule on our website or call 818-292-8008.", format: "year round program", street: "18801 Ventura Blvd., Suite 110", longitude: -118.543, latitude: 34.1721, contact_email: "info@buildcoolrobots.com", phone: "818-292-8008", languages: "---\n- Asp.net\n- C\n- C#\n- C++\n- Java\n- Javascript\n- Mobile Apps\n- Nxt-g\n- Robotc\n- Sql\n- Xml\n- Xna\n", country: nil},
  {name: "Kenwood Academy", city: "Chicago", state: "IL", zip_code: 60615, site_url: "http://Kenwoodacademy.org", ed_level: "---\n- High School\n", bio: "Computer Science\r\nAP Computer Science\r\nRobotics", format: "Daily programming course", street: "5012 South Blackstone", longitude: -87.5905, latitude: 41.8038, contact_email: "jjquinn@cps.edu", phone: "773-453-6007", languages: "---\n- Alice\n- C++\n- HTML\n- Javascript\n- Python\n- Ruby\n- Scratch\n", country: nil},
  {name: "Mt. Hood Community College", city: "Gresham", state: "OR", zip_code: 97030, site_url: "http://www.mhcc.edu", ed_level: "---\n- College\n", bio: "Computer Science Orientation\r\n4 credit (quarter system) lecture and lab course based on CS0 curriculum. Introduces programming with Python, and has extensive exposure to algorithms and logic of programming structures.\r\n\r\nComputer Science I\r\nBased on first half of CS1 curriculum; 4 credits (lecture and lab, lecture may be online). Uses C++ as programming language with heavy emphasis on design techniques and modular programming. \r\n\r\nComputer Science II\r\nBased on second half of CS1 curriculum; 4 credits (lecture and lab, lecture may be online). Uses C++ as programming language. Continues through introduction to classes and object-oriented programming. Simple data structures such as array-based and pointer-based linked lists. Thorough design and testing practices emphasized.\r\n\r\nData Structures\r\nBased on CS2 curriculum. 4 credits, lecture and lab. Data structures and abstract data types, including algorithms. Object-oriented C++ programming throughout. Significant use of recursive algorithms for linked lists, queues, binary (search) trees and graphs. Sorting algorithms.\r\n\r\nJava I and Java II\r\nIntroduction to programming using Java. Less computer science oriented, emphasizing good design, programming and testing practices throughout. 4 credits each, lecture and lab. \r\n", format: "Selected University CS courses", street: "26000 SE Stark Street", longitude: -122.396, latitude: 45.5165, contact_email: "david.todd@mhcc.edu", phone: "(503) 491-7198", languages: "---\n- C++\n- Java\n- Python\n", country: nil},
