  {name: "Santa Fe High School", city: "Santa Fe", state: "NM", zip_code: 87505, site_url: "http://www.sfps.info", ed_level: "---\n- High School\n", bio: "Computer Science for All is a computational science course open to high school students. This semester long course uses computer modeling as an introduction to computer science and computational thinking while exposing students to the breadth of applicability of computer science to solving real-world problems. Computer programming exercises and activities in an agent-based modeling environment (NetLogo) lead up to building a computational science project that meets the criteria set by the Supercomputing Challenge. Students will become familiar with the iterative design, build, and test development cycle common to computer science and engineering, and learn computer science constructs, processes and tools while creating models of local phenomena as complex systems.  Students will also learn mathematics for modeling, probability and statistics, and data analysis techniques", format: "AP Computer Science", street: "2100 yucca st", longitude: -105.974, latitude: 35.6513, contact_email: "droger@sfps.info", phone: "505-467-2484", languages: "---\n- Netlogo\n", country: nil},
