  {name: "GUTS y GIRLS", city: "Santa Fe", state: "NM", zip_code: 87501, site_url: "http://gutsygirls.net/", ed_level: "---\n- Middle School\n", bio: "We teach computer programming through project work in using a number of applications: Scratch, HTML/CSS, Javascript, Processing, Starlogo TNG, NetLogo, DesignBlocks, PicoCrickets, and Sewn Circuits/Arduinos.  GUTS y Girls offers a Saturday workshop series in Santa Fe and summer intensive workshops in Santa Fe, Albuquerque, and Las Cruces.", format: "Afterschool program", street: "Santa Fe Institute 1399 Hyde Park Road", longitude: -105.909, latitude: 35.7003, contact_email: "gutsygirls@santafe.edu", phone: "", languages: "---\n- Arduino\n- HTML\n- Javascript\n- Netlogo\n- Processing\n- Scratch\n- Starlogo tng\n", country: nil},
  {name: "Waukesha County Technical College", city: "Pewaukee", state: "WI", zip_code: 53072, site_url: "http://www.wctc.edu", ed_level: "---\n- College\n- Vocational\n", bio: "152-107 Intro to Programming\r\nLearn fundamental object-oriented programming (OOP) concepts: classes, objects, methods, properties, event handling, control logic, data structures, algorithms, concurrency and problem solving, with minimal exposure to language semantics. A unique drag-and-drop, graphical environment is provided, which results in mistake-free code generation. Hone problem-solving skills while exploring concepts visually, and then see how these concepts translate to code. This is a common, required course for programmer analysts, network specialists and computer support specialists. Degree-tailored language semantics will be introduced in the final weeks of the course.\r\n\r\n152-134 Java Programming\r\nGet a rigorous introduction to the Java J2SE programming language and object-oriented (OOP) programming concepts such as class responsibilities, composition, inheritance, interfaces, encapsulation and polymorphism. Design and build java desktop applications and applets using Sun Microsystems J2SE Java Development Kit and popular Integrated Development Environments. Explore the Java API (standard class libraries) and techniques for building graphical user interfaces and business logic.\r\n\r\n152-169 JavaScript\r\nThis course is an introduction to programming fundamentals using JavaScript. JavaScript is a client-side scripting language used for creating dynamic web applications. Fundamentals covered include variables, decisions, functions, events, loops and arrays. Use these fundamentals by applying them to a range of programs that solve personal and business problems with hands-on exercises. Cascading style sheets (CSS), hypertext markup language (HTML) and the document object model (DOM) will also be discussed. (If you have never programmed before, please take 152-107 first.)\r\n\r\n152-109 .Net Web Development\r\nThis course introduces the server-side of web application development, featuring the ASP.NET object model and the VB.Net programming language to build dynamic, database-connected web applications that are the foundation of modern e-commerce and e-Business functionality. Special emphasis is placed on client-server, n-tier application design and database architecture, programming and connectivity. Design, develop, implement and maintain a significant web application project. Other server-side application development environments (PHP, Cold Fusion, Perl, Java) will also be discussed and contrasted, along with client-side JavaScript, Cascading Style Sheets (CSS), Dynamic HTML (DHTML), XHTML and XML. Emphasis is placed on hands-on programming.\r\n\r\n152-135 Advanced Java Programming\r\nAdvanced Java Programming is an architecturally focused and programming intensive course in object-oriented analysis and design (OOA/DO). The course focuses on industry standard design patterns (GoF) and architectural best practices (programming to interfaces and using composition, e.g.) that lead to improved software quality, flexibility and maintainability. Agile software development methodologies such as the Rational Unified Process (RUP), Model-driven Development (MDD) and Test-driven Development (TDD) are also explored in depth. While the majority of information is presented in a Java context, some samples are also provided in VB.Net and C# to show that the concepts may be applied to any object-oriented language. Other advanced topics, such as multithreading, data structures, database programming and connectivity, and deployment practices, are also explored.\r\n\r\n152-137 Mobile iOS App Development\r\nGet introduced to the exciting world of iPhone application development. Discussion topics include the iPhone SDK, the Cocoa Touch Framework, the Model View Controller (MVC) paradigm, the Objective C programming language, the Development tools ? XCode and Interface Builder, the iPhone Simulator, and core animation and graphic development for iPhone applications. This course is intended for anyone interested in learning more about iPhone applications, and how they are developed and used to increase productivity personally and professionally.\r\n\r\n152-198 Distributed Java\r\nThis course introduces advanced, distributed application development for both desktop and web-based systems, using the Java language and the Java Standard and Enterprise development kits. A distributed application is one where a program is divided into components and these components run on different computer systems. A web application is a common example of a distributed application. Advanced web development in Java is a key learning objective for this course. Students will learn to build enterprise class applications using server-side technologies including Java Servlets, JavaBeans, Enterprise Java Beans (EJB) and Web Services. In addition, advanced client-side programming using JavaScript and Cascading Stylesheets will be explored, including programming AJAX functionality. For distributed desktop development Java Remote Method Invocation will be explored. This course will also touch on popular open source frameworks such as Struts, Spring, Grails and Google Web Toolkit.\r\n\r\n152-140 Android Application Development\r\nThis course introduces you to Android Device application development. Discussion topics include the Google SDK, the Android programming environment, architecture, and tools. Students will create applications using XML-Based Layouts, Widgets, Containers and Lists. This course is intended for anyone interested in learning more about Android applications, how they are developed and used to increase productivity personally and professionally.\r\n\r\n152-129 PHP1/Web Development\r\nThis PHP programming course provides the knowledge necessary to design and develop dynamic, database-driven web pages using PHP. PHP is a language written for the web, quick to learn, easy to deploy and provides substantial functionality required for e-commerce. This course introduces the PHP framework and syntax, and it covers in depth the most important techniques used to build dynamic web sites. Perform hands-on practice with a MySQL database to create database-driven HTML forms and reports.\r\n\r\n152-139 Web Development/PHP2\r\nThis PHP course is a continuation of the first that places emphasis on e-commerce skills including user authentication, data validation, dynamic data updates and shopping cart implementation. Also learn how to configure PHP on the Apache Web Server. Comprehensive lab exercises provide facilitated hands-on practice crucial to developing competence and confidence with the new skills being learned.", format: "Full university CS curriculum", street: "800 Main St. L120", longitude: -88.2572, latitude: 43.0693, contact_email: "kehlert@wctc.edu", phone: "262-691-5242", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
