  {name: "Middleton Middle School", city: "Middleton", state: "ID", zip_code: 83644, site_url: "http://ctatmms.weebly.com/alice-programming.html", ed_level: "---\n- Middle School\n", bio: "In our 8th Grade Computer Technology classes we teach programming using Alice2.3, App. Inventor, and SwishMax2 (a Flash clone). MMS is on a trimester calendar giving 3 different groups of students an opportunity to be exposed to these application. There are plans in the near future to make the transition to Alice3 and increase the presence of Java in our program.", format: "Other", street: "511 W Main St", longitude: -116.631, latitude: 43.7064, contact_email: "bsanti@msd134.org", phone: "208-585-3251", languages: "---\n- Alice\n- App inventor\n- HTML\n- Javascript\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Park Slope Collegiate", city: "Brooklyn", state: "NY", zip_code: 11215, site_url: "http://www.parkslopecollegiate.org/", ed_level: "---\n- High School\n", bio: "Computer Programming is a one year course taught by Lev Fruchter with an emphasis on understanding technology through narratives, particularly literature and film.\r\n\r\nThe 1st Fall part of the course introduces the fundamentals of digital hardware, software and networks with projects created in Scratch, HTML and BASIC.\r\n\r\nThe 2nd Spring half is a course in Python and the principles of effective programming.", format: "Daily programming course", street: "237 7Av", longitude: -73.9801, latitude: 40.6682, contact_email: "", phone: "", languages: "---\n- Basic\n- Python\n- Scratch\n", country: nil},
