  {name: "Alabama Computer Science Camps", city: "Tuscaloosa", state: "AL", zip_code: 35401, site_url: "http://outreach.cs.ua.edu/camps/", ed_level: "---\n- Middle School\n- High School\n", bio: "The Department of Computer Science at the University of Alabama hosts a multi-week series of Computer Science summer. Students are taught multiple topics of Computer Science while learning to program a computer in several exciting contexts (robotics control and smartphone apps). The Computer Science camps are taught in a manner that encourages self-exploration across multiple projects.", format: "Summer Camp", street: "Campus Drive West", longitude: -87.5448, latitude: 33.215, contact_email: "gray@cs.ua.edu", phone: "205 348 2847", languages: "---\n- Java\n- Mobile Apps\n", country: nil},
  {name: "Beowulf Boot Camp", city: "Baton Rouge", state: "LA", zip_code: 70803, site_url: "http://www.cct.lsu.edu/events/beowulf-boot-camp-2013", ed_level: "---\n- High School\n- College\n", bio: "This exciting course offers students and teachers a unique opportunity to work with advanced research technology not usually available in a typical classroom setting.\nDuring Beowulf Boot Camp 2013, students will work hands-on with a number of LSU professors as they learn how to build and use supercomputers. Open to Louisiana High School Students, Baton Rouge Community College Students, and Louisiana Teachers", format: "Summer Camp", street: nil, longitude: -91.18, latitude: 30.41, contact_email: nil, phone: "225 578 0595", languages: "---\n- Python\n", country: nil},
  {name: "DigiPen ProjectFUN Workshops", city: "Redmond", state: "WA", zip_code: 98052, site_url: "https://projectfun.digipen.edu/summer-workshops/", ed_level: "---\n- High School\n", bio: "DigiPen Institute of Technology, the leader in video game development education, hosts summer workshops designed to introduce middle school, high school, and college students of all experience levels to the fundamentals of game programming, 3D computer animation and robotics. For over 15 years, we have offered our exciting two-week workshops at our college campus in Redmond, Washington, and at partner sites across the U.S. Come join the FUN!", format: "Summer Camp", street: "150th Avenue Northeast", longitude: -122.141, latitude: 47.6545, contact_email: "workshops@digipen.edu", phone: "425 558 0299", languages: "---\n- Mobile Apps\n", country: nil},
  {name: "DigiPen", city: "Redmond", state: "WA", zip_code: 98052, site_url: "http://www.digipen.edu", ed_level: "---\n- College\n", bio: "DigiPen Institute of Technology has been dedicated to educating students interested in the field of interactive entertainment since 1988. Interactive digital entertainment is at the vanguard of technological innovation, and DigiPen leads the way to a serious career in this field and beyond. Our comprehensive program has been ranked the number one program in the world for Game Development by Electronic Gaming Monthly. DigiPen offers the following degrees: Bachelor of Science in Real-Time Interactive Simulation, Bachelor of Science in Computer Engineering, Bachelor of Fine Arts in Production Animation, and Master of Science in Computer Science. DigiPen's Redmond, Washington campus is located in the heart of one of the game industry's major development centers that is home to over 60 game development companies including Nintendo and Microsoft. With cooperation of major game industry leaders like Nintendo and Microsoft, DigiPen ensures that the educational experience is one that truly prepares students for the rigors of the industry.", format: "Full university CS curriculum", street: "150th Avenue Northeast", longitude: -122.141, latitude: 47.6545, contact_email: nil, phone: nil, languages: "--- []\n", country: nil},
  {name: "CodeNow", city: "Washington", state: "DC", zip_code: 20001, site_url: "http://CodeNow.org", ed_level: "---\n- High School\n", bio: "CodeNow is a DC based non-profit focused on teaching underrepresented high school students foundational skills in computer programming through free extra curricular off campus trainings. This is essential because it lowers the barriers normally associated with programming by opening the door at an earlier stage when youths are just beginning to explore their options and opportunities.", format: "Multi-week workshop", street: "U Street Northwest", longitude: -77.0248, latitude: 38.9169, contact_email: "Ryan@CodeNow.org", phone: nil, languages: "---\n- Ruby\n", country: nil},
  {name: "Lake County Schools C++ Game Programming Course", city: "Grayslake", state: "IL", zip_code: 60030, site_url: "http://www.techcampus.org/programs/game_java_c_programming", ed_level: "---\n- High School\n- College\n", bio: "Lake County Schools Technology Campus provides vocational/technical trains over 1500 high school students in Lake County Illinois. The C++ Game Programming Program based heavily on computer science and mathematics. Program participants are eligible for up to 8 college credits and participate in a rigorous program curriculum based on resource provided by DigiPen University. Enrollment FAQs here: http://www.techcampus.org/about/frequently_asked_questions", format: "Daily programming course", street: "West Washington Street", longitude: -88.0167, latitude: 42.3581, contact_email: "rfrench@techcampus.org", phone: "847 543 6041", languages: "---\n- C++\n", country: nil},
  {name: "Los Angeles Southwest College - CS and IT", city: "Los Angeles", state: "CA", zip_code: 90047, site_url: "http://www.lasc.edu", ed_level: "---\n- College\n", bio: "The Computer Science and Information Technology discipline at Los Angeles Southwest College offers an associate degree and certificate programs in computer science. It is currrently offering or developing the following certificate programs: Certified Internet Webmaster Associate, Homeland Security-Computer Science, Computer Forensics, Computer Animation for the Gaming Industry, and Green Nanotechnology.", format: "Full university CS curriculum", street: "West Imperial Highway", longitude: -118.308, latitude: 33.9309, contact_email: "hicksje@lasc.edu", phone: "323 241 5387", languages: "---\n- C++\n", country: nil},
  {name: "Purdue -  Adventures in Computer Science Summer Camp", city: "West Lafayette", state: "IN", zip_code: 47906, site_url: "http://www.cs.purdue.edu/outreach", ed_level: "---\n- Middle School\n", bio: "Purdue Adventures in CS Camp is open to students who are entering grades 6,7,or 8 by the Fall of 2012. No previous computer science or programming expertise is necessary, but campers should be comfortable using a computer. The camp will take an in-depth look at computer science concepts such as programming, cryptography, and robotics, and how they are used every day to make a difference in our world. Using programs such as Python, Alice, and Web design software, students will explore hands-on applications. Students will also participate in a PicoCricket design studio challenge.", format: "Summer Camp", street: "University Street", longitude: -86.9167, latitude: 40.4274, contact_email: "mindy@purdue.edu", phone: "765 494 7802", languages: "---\n- Alice\n- Python\n", country: nil},
