  {name: "IT is for Girls", city: "Greensboro", state: "NC", zip_code: 27412, site_url: "http://www.uncg.edu/bae/isom/wit/", ed_level: "---\n- High School\n", bio: "The \"IT is for Girls\" workshop and summercamp of UNC Greensboro is aimed at increasing awareness about IT education and careers among high-school girls in grades 9 to 11, in collaboration with Guilford County Schools. Through hands-on activities, participants learn to create animations, interactive narratives, and video games using SCRATCH software from MIT, design web pages, explore computer and internet security, and investigate fun ways to visualize data. During lunch, working IT women professionals, from area firms and UNCG speak about education, career paths and opportunities in IT, balancing work and personal life, and how to be successful in technology careers.", format: "Summer camp", street: "Spring Garden Street", longitude: -79.8104, latitude: 36.066, contact_email: "Lsiyer@uncg.edu", phone: "336 334 4984", languages: "---\n- Mobile Apps\n- Scratch\n", country: nil},
