  {name: "STEM Academy @ Oregon State University", city: "Corvallis", state: "OR", zip_code: 97331, site_url: "http://academy.engr.oregonstate.edu", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "We run 17 STEM summer camps, including five computer science camps: 1. Introduction to Lego Robotics Camp (2 sessions)--for 2nd & 3rd grade 2. Video Game Design Camp(2 sessions)--for 5th-8th grade 3. Computer Graphics Camp--for 9th-12th grade A major goal of these camps is to expose students to computer science and teach them it can be a creative and engaging field.", format: "Summer camp", street: "Southwest Jefferson Way", longitude: -123.279, latitude: 44.5629, contact_email: "catherine.law@oregonstate.edu", phone: "541 737 1822", languages: "--- []\n", country: nil},
  {name: "TechPlayzone Technology Camp", city: "Riverview", state: "FL", zip_code: 33569, site_url: "http://www.techplayzone.com/techplay/camp/camp.html", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Technology Camps are offered during the Winter, Spring, and Summer Breaks for students in the Tampa Bay Area. Tech Camps feature innovative themes each season for students interested in Video Game Creation, Web Animation, and Digital Movie Making. Camp attendees use their creativity and innovation to create \"social impact\" games, web pages, and digital movies.", format: "Afterschool program", street: "Boyette Road", longitude: -82.2722, latitude: 27.8538, contact_email: "dbagleymom@gmail.com", phone: "813 684 7329", languages: "--- []\n", country: nil},
  {name: "TechPREP", city: "Stony Brook", state: "NY", zip_code: 11794, site_url: "http://www.stonybrook.edu/techprep/", ed_level: "---\n- Middle School\n- High School\n", bio: "TechPREP is a multi-track program targeted at 6th grade through high school students, parents, and administrators. A consortium of organizations will deliver an integrated program including a technology demonstration center, classroom teaching, and awareness-building and experimental events. Our aim is to connect young women with college students and local business people. A cohort of 6th, 7th, and 8th grade young women will be introduced to the practical aspects of computing, mathematics and physics, and engineering, through a series of Saturday programs and followed up with a two week summer day camp. The age group is chosen because continued achievement and a foundation of eventual success in the sciences starts early in a student's education.", format: "Summer camp", street: nil, longitude: -73.1175, latitude: 40.9183, contact_email: "glicata0409@gmail.com", phone: "631 632 6947", languages: "--- []\n", country: nil},
  {name: "Youth APPLab and UpliftDC", city: "Washington", state: "DC", zip_code: 20003, site_url: "http://www.upliftdc.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Youth APPLab and UpliftDC teaches computer science and software development through the creation of smartphone applications (apps) to youth who live and attend school in Washington, CC.", format: "Summer camp", street: "D Street Southeast", longitude: -76.9835, latitude: 38.8843, contact_email: "leshell@upliftdc.org", phone: "202 758 2005", languages: "---\n- Alice\n- Java\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Lincoln-West High School", city: "Cleveland", state: "OH", zip_code: 44011, site_url: "http://http://www.cmsdnet.net/schools/schoollist/school%20detail/lincolnwest.aspx", ed_level: "---\n- High School\n", bio: "Courses offered:\r\n1-Programming and Software Development which consists of two year courses, Oracle Database Fundamentals and Database Programming with SQL in first year and Java programming and Programming with Alice in second year", format: "Daily programming course", street: "3202 West 39th Street", longitude: -81.7107, latitude: 41.4556, contact_email: "joacomplab@yahoo.com", phone: "", languages: "---\n- Alice\n- HTML\n- Java\n- Python\n", country: nil},
  {name: "feynlabs", city: "London", state: nil, zip_code: 0, site_url: "http://www.feynlabs.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Feynlabs aims to teach the concepts of programming languages to kids (as opposed to a specific programming language). By abstracting the common elements of programming languages, our aim is to enable learners to rapidly learn any programming language.\r\n\r\nOur work has been covered in academic journals and also in leading education blogs like Edutopia. In the first six months of the launch of our page of Facebook, we have 40K fans. Currently, we are conducting trials in some schools in the UK and Europe.\r\n\r\nFeynlabs is creating a set of unique techniques to teach computer science to kids based on\r\n\r\na) Teaching the concepts of Programming Languages to kids and\r\n\r\nb) Fostering an interest in Computer Science using the Raspberry Pi and other devices.\r\n\r\nc) Sharing content. We are a social enterprise because we share content with schools using Open source principles (i.e. for free)\r\n\r\nAs pedagogy, I would consider it the re-application of Constructivist principles to the learning of Programming Languages and teaching of Computer Science in the age of the Internet.\r\n\r\nIf I were to ask: What was the first programming language you learned?\r\nDepending on which era you started computing, the answer could be Basic in the 80s, Pascal in the 90s, Java/JavaScript at the turn of the century  But the point is: its always a specific programming language you began with. Fast forward a few years  if you did end up studying computer science, you studied the Concepts of Programming Languages or the Philosophy of Computer science at the Masters level for a computer science course\r\n\r\nWhat if you could switch the two? \r\n\r\nWhat if you could teach concepts of programming languages upfront  even to kids?\r\n\r\nThis seemingly simple switch has many advantages.\r\nLearners have a fast on-ramp and interest. They learn at a unique pace and keep up interest. They see how programming applies to real life problems at a very early stage of their learning and they learn complex concepts of programming within a wider context\r\n\r\nThus, our end goal is not to teach programming. Rather, it is to enable the participants to rapidly master any programming language and in doing so, explore computer science.\r\n\r\nFeynlabs is addressing a unique (not yet addressed) problem  which I can encapsulate as How do we take learners from 0 to 60 fast? i.e. accelerate the computer science learning at an early stage so that learners dont get bogged down and can quickly see the vista i.e. the big picture vision. \r\n\r\nFrom a learning standpoint this would useful because once the participant can see the big picture and they can add their own unique contribution/imagination to learning\r\n\r\nThis leads to a different conversation in teaching. Instead of discussing endless variants of IF-THEN-ELSE statements and FOR loops, we have the freedom to explore the beauty and interconnectedness of Computer Science at an early stage. We can talk of hardware and software and algorithms holistically. We can introduce the principles of Systems thinking. We can prepare kids for the next way of computing by looking at a variety of computing devices (not just PCs). \r\n\r\nThus, Feynlabs is preparing learners for a career in Computer Science.\r\n\r\nWe focus on Raspberry Pi and Python as teaching platforms (but also work with others) \r\n", format: "Other", street: "futuretext landmark house, 17 hanover square", longitude: -0.144766, latitude: 51.5143, contact_email: "info@feynlabs.com", phone: "", languages: "---\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Python\n- Raspberry pi (platform)\n- Scratch\n", country: nil},
  {name: "Human Coders Formations", city: "Paris", state: "IdF", zip_code: 75116, site_url: "http://formations.humancoders.com", ed_level: "---\n- Vocational\n", bio: "Des formateurs passionns, des technologies modernes, des formations humaines.\r\n\r\nAu programme :\r\n\r\nRuby on Rails 4 jours\r\nApprenez  dvelopper une application Ruby on Rails de qualit rapidement !\r\n\r\nRuby 3 jours\r\nApprendre  dvelopper avec le langage Ruby\r\n\r\nTests avec Ruby on Rails 1 jour\r\nEcrivez des tests RSpec lisibles, maintenables et rapides\r\n\r\nGit 2 jours\r\nVersionnez votre code comme jamais auparavant !\r\n\r\nSymfony 2 3 jours\r\nFormez-vous  l'un des frameworks web PHP les plus connus au monde\r\n\r\nNode.js 3 jours\r\nDcouvrez la puissance du Javascript cot serveur\r\n\r\nPlay! Framework 3 jours\r\nRetrouvez la joie de faire du dveloppement Web en Java !\r\n\r\nJava dbutant 4 jours\r\nDcouvrez le formidable cosystme de la plateforme Java !\r\n\r\nJava avanc 3 jours\r\nDcouvrez les aspects les plus avancs du langage Java\r\n\r\nHTML5 3 jours\r\nMatriser la nouvelle norme du web\r\n\r\nExtensions Chrome 2 jours\r\nRepoussez les limites des navigateurs avec les extensions Chrome\r\n\r\nSass et Compass 2 jours\r\nDcuplez vos comptences CSS avec Sass et Compass\r\n\r\nAppcelerator Titanium 3 jours\r\nCrez des applications mobiles natives et cross-platform pour iOS et Android\r\n\r\nPython 4 jours\r\nIntroduction complte et pratique au langage de programmation Python\r\n\r\nDjango 4 jours\r\nApprenez  dvelopper des applications web dans les rgles de l'art avec le framework Django !", format: "Daily programming course", street: "3 rue copernic", longitude: 2.29106, latitude: 48.8689, contact_email: "camille@humancoders.com", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n- Ruby\n", country: nil},
