  {name: "Zatna-Pingry- Programming Scratch", city: "Basking Ridge", state: "NJ", zip_code: 7920, site_url: "http://zatna.com/index.php/summer-camps/summer-2013/big-blue-summer-at-the-pingry-school", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Pingry Hi-Tech camps are designed to provide students with an early advantage in computer science and engineering skills which they can use throughout their lives. In a supportive, age appropriate environment, we provide a dynamic experience for students who embrace intellectual challenges. We help students enhance their sense of logic while inspiring the curiosity that is essential in continuing the discovery and learning process. The computer science and engineering skills our campers will acquire from Pingry Hi-Tech camps will allow them to analyze, plan and solve different problems. As computer science and engineering skills are no longer limited to the realm of tech professionals, the earlier your child is exposed to and masters these skills, the greater the competitive advantage for them, regardless of the careers they will pursue later in life. This program is designed for campers with no  robotics experience. The camp will use Lego Mindstorms NXT robots to give a first introduction to robotics. Campers will work with structurally sound building techniques, different types of sensors and motors, and elementary robotics programming using the NXT software. >> Participants: Grades 2-6 >> Dates: July 15th-July 19th >> Location: The Pingry School, Martinsville Campus, Smith Middle School M121 >> Time: 9:00 AM  4:30 PM >> Price: $600", format: "Summer camp", street: "131 Martinsville Road", longitude: -74.5422, latitude: 40.688, contact_email: "mfacciani@pingry.org", phone: "908-647-5555", languages: "---\n- Lego mindstorms nxt\n", country: nil},
  {name: "Zatna-Pingry Programming Alice", city: "Basking Ridge", state: "NJ", zip_code: 7920, site_url: "http://zatna.com/index.php/summer-camps/summer-2013/big-blue-summer-at-the-pingry-school", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Pingry Hi-Tech camps are designed to provide students with an early advantage in computer science and engineering skills which they can use throughout their lives. In a supportive, age appropriate environment, we provide a dynamic experience for students who embrace intellectual challenges. We help students enhance their sense of logic while inspiring the curiosity that is essential in continuing the discovery and learning process. The computer science and engineering skills our campers will acquire from Pingry Hi-Tech camps will allow them to analyze, plan and solve different problems. As computer science and engineering skills are no longer limited to the realm of tech professionals, the earlier your child is exposed to and masters these skills, the greater the competitive advantage for them, regardless of the careers they will pursue later in life. Designed for campers with some robotics experience. The camp will reinforce basic engineering skills with a strong emphasis on programming. Campers will build advanced robots with custom programs using the NXT software. >> Participants: Grades 4-9 >> Dates: July 29th-August 2nd >> Location: The Pingry School, Martinsville Campus, Smith Middle School M121 >> Time: 9:00 AM  4:30 PM >> Price: $600", format: "Summer camp", street: "131 Martinsville Road", longitude: -74.5422, latitude: 40.688, contact_email: "mfacciani@pingry.org", phone: "908-647-5555", languages: "---\n- Lego mindstorms nxt\n", country: nil},
  {name: "BFOIT", city: "Berkeley", state: "CA", zip_code: 94704, site_url: "http://www.bfoit.org/itp/itp.html", ed_level: "---\n- Middle School\n- High School\n", bio: "BFOIT, a project of the International Computer Science Institute, supports historically underrepresented ethnic minorities and women in their desire to become leaders in the fields of computer science, engineering and information technology. The intent is to provide youth with knowledge, resources, practical programming skills and guidance in their pursuit of higher education and production of technology.", format: "Summer camp", street: "1947 Center Street, Suite 600", longitude: -122.271, latitude: 37.87, contact_email: "orpheus@bfoit.org", phone: "510-685-0861", languages: "---\n- Logo\n- Scratch\n", country: nil},
