  {name: "Montverde Academy", city: "Montverde", state: "FL", zip_code: 34756, site_url: "http://montverde.org", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "Advanced Placement Computer Science (APCS)\r\n\r\nApproved by the college board. Students completing an AP course and score and three or more on the AP exam receive college credit from participating schools.\r\n\r\nAPCS covers the basics of computer science; from first steps in learning to program in Java, to advanced topics such as inheritance, sorting and searching.", format: "AP Computer Science", street: "17235 7th Street", longitude: -81.6748, latitude: 28.5979, contact_email: "", phone: "407-469-2561", languages: "---\n- Java\n", country: nil},
  {name: "Barrington High School- Intro to Game Design", city: "Barrington", state: "IL", zip_code: 60015, site_url: "http://www.barrington220.org/site/Default.aspx?PageID=1588", ed_level: "---\n- High School\n", bio: "This is an introductory course in computer programming that begins by exploring the concepts of how computers work, how information is processed, and how programs allow the user to define and control a process. Starting with the animation of 3-D objects, and later by developing sophisticated computer games, students will learn higher level algorithmic thinking in a structured programming environment. Students will utilize easy to understand computer interfaces (ie drag and drop) without having to learn a specific computer programming language syntax. No prior programming experience is necessary.\r\n\r\n\r\n", format: "Daily programming course", street: "616 West Main Street", longitude: -88.1478, latitude: 42.1564, contact_email: "tbredemeier@barrington220.org", phone: "847-756-2427", languages: "---\n- Alice\n- Gamemaker language (gml)\n", country: nil},
  {name: "Barrington High School-Intro to Robotics", city: "Barrington", state: "IL", zip_code: 60015, site_url: "http://www.barrington220.org/site/Default.aspx?PageID=1592", ed_level: "---\n- High School\n", bio: "This is an introductory course in language specific computer programming that begins with programming the movement of robots on a computer screen, followed by learning to program free standing robots. In this class students will learn to write their own computer programs from an object-oriented perspective. Number systems key to computer programming, flowcharting, algorithm development, structured programming, and step-wise refinement will follow. Students will study and learn to write programs in the Java programming language, with an emphasis on problem solving techniques. This class provides a solid programming foundation that students will find beneficial for AP Computer Science the following year. No prior programming experience is necessary.  \r\n\r\n", format: "Daily programming course", street: "616 West Main Street", longitude: -88.1478, latitude: 42.1564, contact_email: "tbredemeier@barrington220.org", phone: "847-756-2427", languages: "---\n- Java\n", country: nil},
  {name: "Academy for Technology and the Classics", city: "Santa Fe", state: "NM", zip_code: 87508, site_url: "http://www.atcschool.org/", ed_level: "---\n- Middle School\n", bio: "Project GUTSGrowing Up Thinking Scientificallyis an afterschool program that engages middle school students in scientific research with the aim of increasing the number of students prepared for high school science classes and careers in computing and engineering.  Students explore topics relevant to their communities through the lens of complex adaptive systems and use agent-based modeling (in StarLogo TNG) and simulation to study the topics thereby intertwining locally relevant study with cutting edge work in complex systems. For more info, see http://www.projectguts.org/node/about", format: "Afterschool club", street: "Avan Nu Po Road", longitude: -106.012, latitude: 35.5838, contact_email: nil, phone: "(505) 473 4282", languages: "--- []\n", country: nil},
  {name: "Barrington High School- AP CS", city: "Barrington", state: "IL", zip_code: 60015, site_url: "http://www.barrington220.org/site/Default.aspx?PageID=1595", ed_level: "---\n- High School\n", bio: "AP Computer Science introduces students to the formal concepts of object-oriented computer programming, including program design, control structures, data structures and algorithms using the Java programming language. It is a year-long course designed to be comparable to a first year college level computer programming class. During the first semester students will gain an understanding of the history of computing, and the nature of hardware and software; the software design process, and the basics of object-oriented programming, as well as the ethical considerations of computer science. They will also gain a familiarity with Java classes, objects, and data types; basic Java syntax; constructor, accessor, and mutator methods; decision and looping statements; and logical operators, among others. During the second semester students will have the opportunity to further develop and refine their programming skills by focusing on the techniques of data abstraction, including encapsulation and inheritance. In particular, the emphasis is on the organization of information and the implementation of common data structures such as arrays and array lists, as well as various searching and sorting methods through such structures. Students also explore recursion and the close relationship between data structures and algorithms including basic complexity analysis and comparisons between several different methods. \r\n", format: "Daily programming course", street: "616 West Main Street", longitude: -88.1478, latitude: 42.1564, contact_email: "tbredemeier@barrington220.org", phone: "847-756-2427", languages: "---\n- Java\n", country: nil},
  {name: "Barrington High School", city: "Barrington", state: "IL", zip_code: 60015, site_url: "http://www.barrington220.org//site/Default.aspx?PageID=7803", ed_level: "---\n- High School\n", bio: "This course extends the concepts of AP Computer Science A by providing a survey of data structures and introduces and develops methods for designing and implementing abstract data types using the Java programming language. The main focus is on how to build and encapsulate data objects and their associated operations. In particular, the emphasis of this course is on the organization of information; the implementation of common data structures such as lists, stacks, queues, trees, and graphs, including linked structures, hash tables, and heaps, as well as elementary methods of complexity analysis applied to algorithms that manipulate dynamic and static data structures.  This class covers the remaining topics found in the former AP Computer Science AB curriculum, and is designed to model a college level semester course in advanced data structures.\r\n\r\n", format: "Daily programming course", street: "616 West Main Street", longitude: -88.1478, latitude: 42.1564, contact_email: "tbredemeier@barrington220.org", phone: "847-756-2427", languages: "---\n- Java\n", country: nil},
  {name: "Thinkersmith", city: "Eugene", state: "OR", zip_code: 97404, site_url: "http://www.thinkersmith.org", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Currently, our most popular program is Thinkersmith Traveling Circuits.  Winner of the 2013 Google RISE Award, Traveling Circuits comes right into your school, organization or library to teach computer science in a fun and entertaining way.  We bring everything needed, and teach the lesson in 30 minute to 50 minute segments.  \r\n\r\nVisit http://www.thinkersmith.org/travelingCircuits.php to schedule one today.", format: "Other", street: "P.O. Box 42186", longitude: -123.131, latitude: 44.0996, contact_email: "info@thinkersmith.org", phone: "541-632-4096", languages: "---\n- Basic programming concepts\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Scratch\n", country: nil},
