  {name: "Bloomfield High School", city: "Bloomfield", state: "NM", zip_code: 87413, site_url: "http://bhs.bsin.k12.nm.us", ed_level: "---\n- High School\n", bio: "Computer Science for All - a computational science course open to high school students. This semester long course uses computer modeling as an introduction to computer science and computational thinking while exposing students to the breadth of applicability of computer science to solving real-world problems. Computer programming exercises and activities in an agent-based modeling environment (NetLogo) lead up to building computational science projects. Students will become familiar with the iterative design, build, and test development cycle common to computer science and engineering, and learn computer science constructs, processes and tools while creating models of local phenomena as complex systems.  Students will also learn mathematics for modeling, probability and statistics, and data analysis techniques.", format: "Daily programming course", street: "North 1st Street", longitude: -107.978, latitude: 36.7167, contact_email: nil, phone: "505 634 3400", languages: "---\n- Java\n", country: nil},
