  {name: "CodeNow", city: "New York", state: "NY", zip_code: 10013, site_url: "http://codenow.org", ed_level: "---\n- High School\n", bio: "CodeNow is a non-profit, focused on teaching underrepresented high school students foundational skills in computer programming. We do this through free, extracurricular, off campus trainings. We work with students who receive the free or reduced-cost lunch, with an emphasis on girls. Our program is essential because it lowers the barriers normally associated with technology by giving students exposure to programming at an early age when they are beginning to explore their options and opportunities.  Since launching in February of 2011, CodeNow has completed four cohorts of phase one of its program in Washington D.C.  Providing more than 3,000 hours of free training to students in the programming language Ruby. In March 2013 , CodeNow will launch its first training in New York City. \r\nOver a six week period students will receive 40+ hours of in person training held on the weekends and 10 hours of homework. During which they have an opportunity to earn a netbook by arriving on time, finishing homework and completing projects. After the training students are encouraged to participate in the alumni community where they are invited to attend monthly meetups and field trips. As alumni they receive mentoring and assistance finding internships.", format: "Multi-week workshop", street: "154 Grand Street", longitude: -73.9989, latitude: 40.7201, contact_email: "info@codenow.org", phone: "", languages: "---\n- Ruby\n", country: nil},
