  {name: "Skema Education", city: "Reykjavik", state: "Capital Region", zip_code: 101, site_url: "http://www.skema.is", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "Skema is a start-up company in Iceland founded by Rakel Solvadottir in july 2011.\r\n\r\nSkema believes it has a unique answer to the lack of tech people. The solution is to start as early as in primary school to plant a seed with the children that technology can be; fun, interesting, and anyone can become a technical wizard. Young children do not have preconceived ideas like adults about technology, and are ready to try anything as long as it is fun and interesting. This is why Skema wants to spark interest in technology by teaching children how to program their own computer games. In order to achieve the desired results, Skema has developed its own methodology on how to teach children and even adults computer programming. The methodology is continuously improved in cooperation with academia and in-house research team.", format: "Afterschool program", street: "Menntavegur 1", longitude: -21.925, latitude: 64.1235, contact_email: "rakel@skema.is", phone: "+354 8621139", languages: "---\n- Alice\n- C++\n- HTML\n- Java\n- Javascript\n- Kodu\n- Lua\n- Mobile Apps\n- Python\n", country: nil},
