  {name: "Platte Valley High School", city: "Kersey", state: "CO", zip_code: 80644, site_url: "http://hs.plattevalley.k12.co.us/", ed_level: "---\n- High School\n", bio: "Operating Systems - Kodu, Mosync, Flex\r\nSoftware Development (Programming):  Java, C++\r\nWeb Publishing : HTML 5, Flash Action Scripting, PHP\r\nAdvanced Web Publishing: HTML 5, PHP\r\nAdvanced Systems: Ardiuno, Mobile Apps ( Mosync, Flex, PHP,Robot C, Java, C++, Kodu... Independent Research Developed Projects with Presentation)\r\n", format: "Daily programming course", street: "910 Campbell St", longitude: -104.555, latitude: 40.3884, contact_email: "dhorn@staff.pvs.k12.co.us", phone: "9703368726", languages: "---\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Kodu\n- Mobile Apps\n- PHP\n- Robot c\n", country: nil},
  {name: "Hofsstadaskoli - Skema Methodology", city: "Garabr", state: "Capital Region", zip_code: 210, site_url: "http://www.hofsstadaskoli.is", ed_level: "---\n- Middle School\n", bio: "Every 5th grade students learns the first steps in programming with the Skema Methodology in a 7 week session (once a week). \r\n\r\nSkema believes it has a unique answer to this dilemma. The solution is to start as early as in primary school to plant a seed with the children that technology can be; fun, interesting, and anyone can become a technical wizard. Young children do not have preconceived ideas like adults about technology, and are ready to try anything as long as it is fun and interesting. This is why Skema wants to spark interest in technology by teaching children how to program their own computer games. In order to achieve the desired results, Skema has developed its own methodology on how to teach children and even adults computer programming. The methodology is continuously improved in cooperation with academia and in-house research team.\r\n\r\nwww.skema.is", format: "Programming integrated in other classes", street: "Skolabraut 1", longitude: -21.9028, latitude: 64.0945, contact_email: "", phone: "", languages: "---\n- Alice\n", country: nil},
