  {name: "Steer ", city: "London", state: nil, zip_code: 0, site_url: "http://www.steer.me", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "Steer is devoted to teaching the fundamentals of web design and development. At our space in Clerkenwell, we give you the skills you need to create awesome websites and apps. Get a fantastic new career, create your own start-up, or make an idea come to life online.\r\n\r\nWe teach practical Javascript and jQuery, Ruby on Rails, HTML and CSS, user experience and responsive web design. Our courses range from all-day intensive classes, to 2 hour evening classes held once a week.\r\n\r\nOur courses are for anyone who is interested in learning web development and design, whether you're a complete beginner or are looking to advance the skills you already have.\r\n\r\nAll-day workshops:\r\n\r\nLearn jQuery, 3 day workshop, Monday 18th March - Wednesday 20th March.\r\nLearn HTML and CSS, 3 day workshop, Monday 25th March - Wednesday 27th March.Learn HTML and Front-End Web Development, 5 day workshop, Monday 8th April - Friday 12th April.\r\nRuby on Rails, 5 day workshop, Monday 22nd April - Friday 26th April.\r\nLearn User Experience Design, 1 day workshop, Saturday 27th April.\r\nResponsive Web Design and Designing for the Mobile Web, 1 day workshop, Saturday 4th May.\r\nLearn jQuery, 3 day workshop, Monday 6th May - Wednesday 8th May.\r\n\r\nAfterschool / Afterwork programs:\r\n\r\nLearn HTML and CSS, evening program 6.30pm - 8.30pm, every Tuesday for 8 weeks, starting Tuesday 26th March.\r\nLearn jQuery, evening program 6.30pm - 8.30pm, every Wednesday for 8 weeks, starting Wednesday 27th March.\r\nLearn Ruby on Rails evening program 6.30pm - 8.30pm, every Thursday for 8 weeks, starting Thursday 28th March\r\n", format: "All-day workshop (up to 1 week)", street: "4th Floor, 151-153 Farringdon Road", longitude: -0.109578, latitude: 51.5239, contact_email: "amelia@steer.me", phone: "0800 011 9644", languages: "---\n- Css\n- HTML\n- Javascript\n- Mobile Apps\n- Ruby\n", country: nil},
  {name: "HTL Rankweil", city: "Rankweil", state: "Vbg.", zip_code: 6830, site_url: "http://www.htl-rankweil.at", ed_level: "---\n- High School\n", bio: "You can take the department of electronics and in the first two years you won't have much coding. But in the 3rd year you learn to code in C# and in the 4th year you get to learn php and sql (condsidering sql as a language). In your last year you will have a big final project where you can pick any subject and go on it with a team of about 3. This can be in just any language and any combination.", format: "Programming integrated in other classes", street: "Negrellistrae 24", longitude: 9.63454, latitude: 47.2708, contact_email: "", phone: "", languages: "---\n- C#\n- HTML\n- PHP\n", country: nil},
  {name: "City Institute", city: "Sydney", state: "NSW", zip_code: 2000, site_url: "http://www.cityinstitute.edu.au", ed_level: "---\n- Vocational\n", bio: "Website design, Web development", format: "Daily programming course", street: "Level 4, 22 Market Street", longitude: 151.205, latitude: -33.8708, contact_email: "info@cityinstitute.com.au", phone: "61292790041", languages: "---\n- C++\n- HTML\n- Javascript\n- PHP\n", country: nil},
  {name: "App Academy", city: "New York", state: "NY", zip_code: 10003, site_url: "http://appacademy.io", ed_level: "---\n- Vocational\n", bio: "App Academy is an intensive, full-time, web development class in San Francisco and New York City.\r\n\r\nOver nine weeks, you'll learn all the skills needed to begin a career as a web developer. Through hands-on projects, we train you to build modern Ruby on Rails web applications.\r\n\r\nProgramming experience isn't required; you will need lots of tenacity and a passion for building cool stuff.\r\n\r\nApp Academy is as low-risk as we can make it.\r\n\r\nYou only pay us if you find a job as a developer after the program. In that case, the fee is 15% of your first year salary, payable over the first 6 months after you start working.\r\n\r\nWe're in this together; we only succeed if the program works for you.\r\n\r\n93% of our graduates have offers or are working in tech jobs now at an average salary of $83,000. Hiring companies include: Facebook, Zendesk, Twilio, Carbon Five and Thoughtbot.", format: "Multi-week workshop", street: "770 Broadway", longitude: -73.9914, latitude: 40.7308, contact_email: "kush@appacademy.io", phone: "", languages: "---\n- Javascript\n- Ruby\n", country: nil},
  {name: "App Academy SF", city: "San Francisco", state: "CA", zip_code: 94105, site_url: "http://appacademy.io", ed_level: "---\n- Vocational\n", bio: "App Academy is an intensive, full-time, web development class in San Francisco and New York City. Over nine weeks, you'll learn all the skills needed to begin a career as a web developer. Through hands-on projects, we train you to build modern Ruby on Rails web applications. Programming experience isn't required; you will need lots of tenacity and a passion for building cool stuff. App Academy is as low-risk as we can make it. You only pay us if you find a job as a developer after the program. In that case, the fee is 15% of your first year salary, payable over the first 6 months after you start working. We're in this together; we only succeed if the program works for you. 93% of our graduates have offers or are working in tech jobs now at an average salary of $83,000. Hiring companies include: Facebook, Zendesk, Twilio, Carbon Five and Thoughtbot.", format: "Multi-week workshop", street: "160 Folsom Street", longitude: -122.392, latitude: 37.7896, contact_email: "kush@appacademy.io", phone: "", languages: "---\n- Javascript\n- Ruby\n", country: nil},
  {name: "Lagafellsskoli - Skema Methodology", city: "Mosfellsbr", state: "Capital Region", zip_code: 270, site_url: "http://www.lagafellsskoli.is", ed_level: "---\n- Middle School\n", bio: "Every 5th grade student learns the first steps in computer programming with the Skema Methodology in a 10 week long course (3 times a week).\r\n\r\nSkema believes it has a unique answer to this dilemma. The solution is to start as early as in primary school to plant a seed with the children that technology can be; fun, interesting, and anyone can become a technical wizard. Young children do not have preconceived ideas like adults about technology, and are ready to try anything as long as it is fun and interesting. This is why Skema wants to spark interest in technology by teaching children how to program their own computer games. In order to achieve the desired results, Skema has developed its own methodology on how to teach children and even adults computer programming. The methodology is continuously improved in cooperation with academia and in-house research team. www.skema.is", format: "Daily programming course", street: "Laekjarhlid", longitude: -21.7251, latitude: 64.1646, contact_email: "rakel@skema.is", phone: "+354 8621139", languages: "---\n- Alice\n", country: nil},
  {name: "Ideaventions", city: "Oakton", state: "VA", zip_code: 22124, site_url: "http://www.ideaventions.com", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "Ideaventions is a science and technology enrichment center geared to children ages 3 to 13. We teach a range of science, technology, engineering and mathematics classes throughout the year at our Science Center located at the Hunter Mill Plaza in Oakton, Virginia. We also run science camps, do after-school programs at local schools, develop new STEM curriculum and lots more. Ideaventions is a place where no idea is too crazy and where children, the adults of tomorrow, learn that anything is possible with a little creativity.\r\n\r\nOur hands-on labs are led by experienced teachers who emphasize divergent thinking and seek to harness a childs natural curiosity about our world. Our programs are designed to share and nurture childrens love for the sciences.\r\n\r\nCurrent Schedule Available at http://www.ideaventions.com/Labs.html", format: "Afterschool program", street: "2952-H Chain Bridge Road", longitude: -77.3014, latitude: 38.8808, contact_email: "info@ideaventions.com", phone: "(703) 255-7202", languages: "---\n- Arduino\n- C\n- Gamemaker\n- HTML\n- Java\n- Javascript\n- Lego mindstorms\n- Lego wedo\n- Python\n- Scratch\n", country: nil},
