  {name: "IntroComp", city: "Vitoria", state: "ES", zip_code: 29075, site_url: "http://www.inf.ufes.br/~pet/projetos/introcomp/", ed_level: "---\n- High School\n", bio: "O IntroComp proporciona a oportunidade de conhecer e se desenvolver na rea da computao, ensinando o aluno a pensar algoritmicamente e resolver problemas de forma eficiente, fcil e divertida. Este  o primeiro passo para adquirir capacidade de desenvolver tecnologias computacionais. Por meio da arte da programao o aluno aprender conceitos essenciais para sua formao intelectual ainda no aprendidos no ensino mdio. Conhecer de verdade a abrangncia da computao e suas tecnologias e o potencial de codificar programas.", format: "Multi-week workshop", street: "Av. Fernando Ferrari, 514, Goiabeiras", longitude: -40.3016, latitude: -20.282, contact_email: "monitores.introcomp@gmail.com", phone: "2740092139", languages: "---\n- C\n- C++\n- HTML\n- Javascript\n", country: nil},
