  {name: "ForgeJS", city: "Seattle", state: "WA", zip_code: 98115, site_url: "http://forgejs.com", ed_level: "---\n- Vocational\n", bio: "ForgeJS is a new Seattle based organization dedicated to teaching full stack JavaScript application development. ForgeJS is announcing a series of three intensive weekend workshops.\r\n\r\n\r\nAdvanced JavaScript, March 22-24, is a launch pad for developers who haven't gone beyond jQuery and the DOM, covering skills, concepts and patterns foundational to building large scale JavaScript applications. Node, March 29-31, covers the foundations of backend development with Express, socket.io and workflow management with Grunt, in addition to presenting an accessible first look at the Node API and the concepts needed to master it. Backbone, April 5-7, covers all the core concepts of client-side, event driven JavaScript web application development using one of the most flexible, popular JavaScript MVC libraries.\r\n\r\n\r\nEach weekend features world class mentors in an intimate setting (enrollment is limited to 24 students) and is rooted in hands on, project-based learning: you'll be coding from the minute the workshops start, with breaks for conceptual overviews and food catered onsite. All events are hosted at HUB Seattle, in Pioneer Square. \r\n\r\n\r\nVisit forgejs.com to register and find out more.", format: "All-day workshop (up to 1 week)", street: "220 2nd Ave South", longitude: -122.331, latitude: 47.6007, contact_email: "info@forgejs.com", phone: "", languages: "---\n- Javascript\n", country: nil},
