  {name: "Flatiron School", city: "New York", state: "NY", zip_code: 10010, site_url: "http://flatironschool.com", ed_level: "---\n- Vocational\n", bio: "The Flatiron school is a 12 week, full time, intensive program, designed to turn you into a web developer. \r\n\r\nWe're a school for passionate people who want to love what they do.\r\n\r\nPrior to arriving to campus, you will complete 4 weeks (80-100 hours in total) of pre-work assignments at home. This, plus the following 12 weeks of immersive campus learning, amounts to a 16 week commitment.\r\n\r\nThe goal of the program will be to give you the equivalent skillset and experience of an entry-level Ruby developer. That means you'll be an internet swiss-army knife, equipped with all the tools needed to build applications. You don't need any programming experience to attend, just a strong desire to create and a whole lot of grit.", format: "Multi-week workshop", street: "33 West 26th St", longitude: -73.9901, latitude: 40.7445, contact_email: "info@flatironschool.com", phone: "(347) 729-7911", languages: "---\n- Bash\n- HTML\n- Javascript\n- Ruby\n- Sql\n", country: nil},
