  {name: "Savannah College of Art and Design", city: "Atlanta", state: "GA", zip_code: 30309, site_url: "http://www.scad.edu/", ed_level: "---\n- College\n", bio: "SCAD offers an Interactive Design and Game Development major, focusing on all aspects of game design, game development, game art, and programming. We've been rated as one of the top 10 Game Design schools in the nation by Princeton review. We also have campuses in Savannah, GA; Hong Kong, China; and Lacoste, France.", format: "Programming integrated in other classes", street: "1600 Peachtree Street NE", longitude: -84.3898, latitude: 33.7975, contact_email: "", phone: "", languages: "---\n- Arduino\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Processing\n", country: nil},
  {name: "Bitmaker Labs", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://www.bitmakerlabs.com", ed_level: "---\n- Vocational\n", bio: "Bitmaker Labs is an immersive 9-week web development training program located in Toronto, Canada. We take absolute beginners and teach them the skills necessary to be creative computer programmers. We use a combination of lectures, classwork, one-on-one mentoring, group exercises, pair programming, and hackathons to fully immerse students in the material. And by the end of the program, they will have spent more than 600 hundred hours learning, practicing, and creating.\r\n\r\nBitmaker Labs focuses on employability and craftsmanship. The goal of the program is to place students in jobs by ensuring they have a deep understanding of software and the principles used to create it. Weve assembled a roster of hiring partners who are eager to offer web development apprenticeships, which lead to full-time positions as junior developers.", format: "Other", street: "20 Duncan Street", longitude: -79.3886, latitude: 43.648, contact_email: "contact@bitmakerlabs.com", phone: "", languages: "---\n- Angularjs\n- Coffee script\n- Css\n- HTML\n- Haml\n- Javascript\n- Ruby\n- Ruby on rails\n- Sass\n", country: nil},
