  {name: "University of Washington", city: "Seattle", state: "WA", zip_code: 98195, site_url: "http://www.summeryouth.washington.edu", ed_level: "---\n- High School\n", bio: "Girls, Computing, and Collaboration \r\n\r\nIn this class, you will learn to problem-solve, debug the scientific method, and hone other STEM-oriented skills. You'll play a computer-based puzzle game with your classmates, helping a broken robot named Gidget to save animals and clean up a chemical spill. Once you've mastered the game, you will then create your own puzzles to share with your classmates, friends and family.  ", format: "Daily programming course", street: "University of Washington", longitude: -122.309, latitude: 47.656, contact_email: "youth@pce.uw.edu", phone: "206-543-2310", languages: "---\n- Gidget\n", country: nil},
