  {name: "DALEWARES INSTITUTE OF TECHNOLOGY", city: "Lagos", state: "Lagos", zip_code: 23401, site_url: "http://www.dalewaresinstitute.com/", ed_level: "---\n- College\n", bio: "Dalewares Institute of Technology came into existence in June 2007 as a result of a major change in policy direction in the area of education by the Federal Government of Nigeria. The government having come full circle realized that in order to transform the Nigerian economy, private sector participation can no longer be ignored in manpower development and transformation of the Nigerian citizen in various endeavous especially in entrepreneurial abilities . The Federal Ministry of Education under the then Hon. Minister, Ms Obi Ezekwesili came up with the Innovative Enterprise Institutions (IEIs) and Vocational Enterprise Institutions (VEIs) in collaboration with the National Board for Technical Education (NBTE) as an offshoot of the Technical and Vocational Education and Training (TVET) \r\n\r\nThe Institute was therefore conceived by its Board of Governing Council under the chairmanship of Mr. Olusegun Babalola under the IEI/VEI scheme to train and develop students and to award to them on completion the National Innovation Diploma (NID) / National Diploma (ND) to its graduating students The accreditation further confers on the institution, the added bonus of being listed in the Joint Admission and Matriculation Board (JAMB) prospectus as a bonafide approved Polytechnic institution. All intending students would therefore be required to sit for the JAMB examination to be able to secure admission for its courses. \r\n\r\nDalewares Institute of Technology,an industry focused polytechnic is a first of its kind in sub-Saharan Africa (excluding the Republic of South Africa), that is granted license to run a full on-campus two (2) year program in the following ICT based programs which includes Multimedia Technology, Software Engineering, Hardware Engineering and Network and System Security. This course is expected to train students and other interested candidates with other higher qualifications to become professionals. \r\n\r\nThe Institution is privately run, fee-paying, with the objective of providing quality training services to the Nigerian knowledge market in the area of Information Technology by building a strong brand that will be international in scope, with strong alliances The emphasis is on capacity building to explore the full potential of the individual and to bridge the knowledge gap presently existing in the IT world. Furthermore, research and developmental programs are expected to go hand in hand with the training.\r\n", format: "Daily programming course", street: "25 FUNSHO WILLIAMS AVE", longitude: 3.36448, latitude: 6.51474, contact_email: "info@dit.edu.ng", phone: "+234 - 7646636/07027950783", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Structure query language\n- Vb. net c\n", country: nil},
  {name: "Matic Technolgy", city: "Indore", state: "MP", zip_code: 452001, site_url: "http://www.prosatya.com", ed_level: "---\n- Vocational\n", bio: "A division of Matic Technology. Classes are taken by 8+ Years Experienced Php Programmer with vast knowledge on various PHP and PHP Frameworks and technologies. The Faculty has served several MNCs at Metro Cities as Lead Developer\r\n\r\nMission\r\nOur Mission to provide a world class training and placement service to it industry and Student. Also create certified developer in the industry PHP, MYSQL, ZEND , MAGENTO, WORDPRESS, JOOMLA. \r\nAlso Builld and Hire the technology expert developer to provide development and consultancy service over the globe.\r\n\r\nDescription\r\nTraining provided by experienced Developer and Consultant \r\nTraining start from live projects then explains the basic structure\r\nFree Placement Assistance\r\nJob Oriented Industrial Training\r\nTraining by experienced programmers\r\nHelp in preparation of project reports\r\nPractice of interview questions.\r\nPre Placement Guide and Suggestion\r\nResume Review and forward the entire consultant all over India.\r\nGuaranteed Interview Calls from Top IT companies from world\r\nPersonalized Interview Guidance", format: "All-day workshop (up to 1 week)", street: "109 Mourya Center 16 Race Cource Road", longitude: nil, latitude: nil, contact_email: "info@matictechnology.com", phone: "07314284822", languages: "---\n- Ajax\n- HTML\n- Javascript\n- Logo\n- Mobile Apps\n- Mysql\n- PHP\n- Perl\n", country: nil},
