  {name: "Detroit Rails", city: "Detroit", state: "MI", zip_code: nil, site_url: "http://detroitrails.eventbrite.com", ed_level: "---\n- Vocational\n", bio: "Saturday, March 16, 2013 from 10:00 AM to 6:00 PM (EDT) is the the Intro To Rails full day class. We have the space from 10am - 6pm all to ourselves. Instruction will begin as soon as we are all settled and will last approximately 2-3 hours with the remaining time available for you to hack and create.\r\nYou will begin building a real Rails App from scratch (with our help, of course) and pushing it live to Herkoku with GitHub.\r\nSome programming experience is recommended, but you don't have to be a Code Ninja. The emphasis is on learning by doing. We will be working with the command line, HTML, CSS and the Ruby on Rails Framework. Bring your own computer! We have experience with Windows, Linux and iOS machines.\r\nClass will be led by the awesome Mike Evans! Mike is the Code for America Brigade Captain, Heavy lifter at Forrst and Boss Man at pishposh.tv.\r\nIf you're a complete code noob, don't fret. We have a bevy of resources to help you get up to speed. Just let us know and we'll make it happen!\r\n\r\nDetroitRails is a web developer school in Detroit. We build web developers. One Stack Trace at a time. 10-week Bootcamp starting in 2013.\r\nFind us on Twitter @DetroitRails & on the web at detroitrails.co\r\nJoin our Meetup Group www.meetup.com/DetroitRails", format: "Daily programming course", street: "1253 Woodward Avenue  Detroit, MI 48226", longitude: -83.0486, latitude: 42.3336, contact_email: "thefounder@detroitrails.co", phone: "243-835-3350", languages: "---\n- Css\n- HTML\n- Javascript\n- Ruby\n", country: nil},
  {name: "The YMC", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://www.theymc.com/", ed_level: "---\n- College\n- Vocational\n", bio: "The YMC is a Not-for-Profit organization that has been in operation since 2008.\r\n\r\nThe YMCs mandate is to make technology learning resources available to everyone everywhere regardless of geography, age, gender, background, future-ground, or anything else that could distinguish human beings apart.\r\n\r\nThese resources take the form of workshops, classes, hackathons, lightning talks, conferences, videos, online learning tools, or any other kind of event that brings people together to learn.", format: "Multi-week workshop", street: "106 Front St East", longitude: -79.3704, latitude: 43.6498, contact_email: "mark@theymc.com", phone: "", languages: "---\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
  {name: "ProcessingSP", city: "So Paulo", state: "So Paulo", zip_code: 5054, site_url: "http://www.navax.net.br/blog", ed_level: "---\n- High School\n", bio: " Bsico de Programao Criativa com Processing.\r\nO curso aborda recursos bsicos de programao como uso de variveis, repeties, decises e estruturas de dados.\r\n\r\nDurao: 16 horas (quatro aulas aos sbados)", format: "Multi-week workshop", street: "Rua So Gall, 110", longitude: -46.6992, latitude: -23.5378, contact_email: "navax0@gmail.com", phone: "", languages: "---\n- Processing (java)\n", country: nil},
  {name: "Harlem Village Academies High School - ScriptEd, Inc. ", city: "New York", state: "NY", zip_code: 10027, site_url: "http://scriptednyc.org", ed_level: "---\n- High School\n", bio: "ScriptEd is a nonprofit organization that brings computer programming instruction to students in high-needs schools.  Courses are taught twice weekly (either during the school day or after-school depending on the school) by volunteers from the tech industry.  ScriptEd students also participate in field trips, job shadowing and apprenticeship opportunities. ScriptEd's Foundations course teaches HTML, CSS and Javascript, and its subsequent practicum courses will teach students additional languages.  ScriptEd's programming is currently offered in two high schools in Harlem, NY, and will expand to additional schools next Fall.", format: "Other", street: "35 West 124th Street", longitude: -73.9441, latitude: 40.8063, contact_email: "mcouvares@scriptednyc.org", phone: "", languages: "---\n- HTML\n- Javascript\n", country: nil},
  {name: "Code Savvy", city: "Minneapolis", state: "MN", zip_code: nil, site_url: "http://www.codesavvy.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- Vocational\n", bio: "Code Savvy is a new, not-for-profit organization in Minnesota dedicated to inspiring and enabling kids and adults to become code-savvy, that is, to understand the kind of creative thinking that goes into coding, and to try out programming computers and devices.   \r\n\r\nWe are especially keen to bring more diversity -- gender and ethnic diversity -- to the coding profession and to computer science, because creative problem-solving relies on diverse backgrounds and viewpoints.\r\n\r\nThere are many fantastic projects and organizations dedicated to help people learn to code, so Code Savvy's first priority is to bring some of these to Minnesota, and help them grow.   Current projects are the Technovation Challenge  and a Twin Cities Coder Dojo. Future projects include after-school code clubs for middle school kids, and coding workshops for women.", format: "Other", street: "multiple sites", longitude: -93.2667, latitude: 44.9833, contact_email: "info@codesavvy.org", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n- Ruby\n- Scratch\n", country: nil},
  {name: "  H. L. Institute of Computer Applications", city: "AHMEDABAD ", state: " GUJARAT", zip_code: 380009, site_url: "http://hlica.ac.in/", ed_level: "---\n- College\n", bio: "Development in Information and Communication Technology (ICT) continues to change the way we work and live. We live in a networked world surrounded by rapidly developing ICTs. ICT systems are all around us  in homes, offices, banks, hospitals, colleges, schools etc.  supporting services that we rely on every day.\r\n \t \t \r\nThe Course\r\n \t1)\tWith the advances in technology several new subjects/topics have emerged in last few years which have been included at appropriate level. These are:\r\n \t \t Dynamic HTML and XML\r\n Advanced Visual and Windows Programming (VB.Net/.Net Technology)\r\n Advanced JAVA\r\n Computer Network Security\r\n Data Ware housing and Data Mining\r\n Enterprise Applications\r\n Software Engineering\r\n Object-Oriented Methodology and Unified Modeling Language\r\n E-Commerce (ASP.net/Web Application Development)\r\n Software Project Management\r\n Multimedia Tools\r\n Scientific Tools\r\n \t \t \r\n \t2)\tComposition of various disciplines considered is as follows:\r\n \t \t Computer Science/Information Technology - 71%\r\n Mathematics/Statistics - 12%\r\n Soft Skill - 12%\r\n Management - 5%\r\n \t \t \r\n \t3)\tThe overall learning load for the students in each trimester has been decided such so as to provide him/her with enough flexibility to take up additional study related assignments or participate in some local/state/national level academic events.\r\n \t \t \r\n \t4)\tThe feedback from the faculty and also the relevance from industry has been considered. The sequencing of subjects is also made such that any pre-requisite knowledge if required is already gained before moving to higher trimester.\r\n \t \t \r\nDuration\r\n \t3 Years ( 9 Trimesters )\r\n \t \t \r\nPrerequisite at entry / Eligibility\r\n \tStudents seeking admission to this course should have passed HSC  GSEB / CBSE / ISCE / IB or equivalent examination in March/April  2010 at first attempt, with at least 50% for general category students and 40% for reserved category students. In addition, the candidate should have taken the following subjects at the higher secondary level:\r\n English (higher or lower level) (Compulsory) and\r\n Mathematics/ Statistics/ Accountancy / Physics (Any one subject)", format: "Daily programming course", street: "H.L.INSTITUTE OF COMPUTER APPLICATIONS A.G.TEACHER'S COLLEGE CAMPUS, POST BOX NO. 4205 NAVRANGPURA", longitude: nil, latitude: nil, contact_email: "", phone: "079) 26402987", languages: "---\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Vb.net\n", country: nil},
  {name: "Technovation Challenge", city: "Saint Paul", state: "MN", zip_code: nil, site_url: "http://www.codesavvy.org/p/technovation.html", ed_level: "---\n- Middle School\n- High School\n", bio: "The Technovation Challenge engages small teams of high school or middle school girls to dream up, design, code and pitch mobile phone apps.   Working with professional women mentors (usually after school), all-girl teams develop a real-world combination of technical and entrepreneurial skills:\r\n\r\n    how to identify a problem, research and design a useful app\r\n    how to code a working app from scratch\r\n    how to develop a business plan and make a presentation to a panel of venture capitalists and other audiences\r\n    confidence,  collaboration, patience, focus and creative problem-solving  \r\n\r\nTechnovation Challenge provides a life-changing experience to girls  an experience through which they succeed in a field they never thought they could contribute to, let alone succeed.\r\n\r\n For the 2013 challenge, girls have to develop an app that solves a problem in their local community.", format: "Afterschool program", street: "multiple sites", longitude: -93.09, latitude: 44.9537, contact_email: "info@codesavvy.org", phone: "", languages: "---\n- Mobile Apps\n", country: nil},
  {name: "Lipscomb University", city: "Nashville", state: "TN", zip_code: 37204, site_url: "http://technology.lipscomb.edu", ed_level: "---\n- College\n", bio: "We offer 6 degrees in the computing disciple--CS, IT Applications, IT Management, Web Development, Informatics, Information Security.  There is a lot of overlap in courses in different areas so we have only listed those unique to the area.\r\n\r\nCS Courses available--choice depend upon concentration\r\n   Introduction to Computer Science\r\n   Introduction to Computer Programming\r\n   Object-Oriented System Design and Programming\r\n   Data Structures and Algorithms\r\n   Database Management Systems\r\n   Computer Organization\r\n   Principles of Software Engineering\r\n   Introduction to GUI Programming and Graphics\r\n   Mobile Device Programming\r\n   Programming Challenges\r\n   Game Development I\r\n   Game Development II\r\n   Collaborative Serious Games Development\r\n   Operating Systems\r\n   Mobile and Distributed Computing Systems\r\n   Numerical Methods \r\n   Special Topics in Computer Science\r\n   Design and Analysis of Algorithms\r\n   Comparative Programming Languages\r\n   Internship in Computer Science\r\n   Future Mobile and Social Computing Systems\r\n   Independent Study in Computer Science\r\n   Senior Seminar in Computer Science\r\n   Compiler Construction\r\n   Fundamentals of Automata and Formal Language Theory\r\n   Computability and Complexity Theory\r\n   Algorithmic Graph Theory\r\n   Database Theory and Applications\r\n   Artificial Intelligence\r\n \r\nInformation Security\r\n   Fundamentals of Information Security\r\n   Introduction to Policy and Procedures\r\n   Crytography\r\n   Introduction to Business Continuity and Recovery Planning\r\n   Internship in Information Security\r\n   Senior Seminar in Information Security\r\n   Ten Day Travel Course in Information Security\r\n   Database Security\r\n   Network Security\r\n\r\nInformation Technology--Web Development Classes are also here\r\n   Graphic Design Studio\r\n   Future of Computing\r\n   Web Application Development I\r\n   User Interface Design\r\n   Fundamentals of Database Concepts and Data Analytics\r\n   Fundamentals of Data Communications and Network Management\r\n   Web Application Development II\r\n   Web Server Technologies\r\n   Network Principles\r\n   Wireless Networks and Mobile Systems\r\n   Network Administration\r\n   Database Administration\r\n   Systems Analysis and Design\r\n   Project Management\r\n   Special Topics in Information Technology\r\n   Internship in Information Technology\r\n   Independent Study in Information Technology\r\n   Senior Seminar in Web Development\r\n   Modern Telecommunications\r\n   Management of Information Technology\r\n   Senior Project\r\n\r\nInformation Technology Management\r\n   Internship in Computing & Informatics\r\n   Information Ethics and Policy\r\n   Data Mining & Analysis\r\n   Information Systems Application\r\n   Principles of Technology Management\r\n   Data & Knowledge Management\r\n   Telecommunications Network Management\r\n   Decision Support Systems\r\n   Information Systems Management\r\n   Intro. to HealthCare Informatics\r\n   \r\nInformatics\r\n   Internship in Computing and Informatics\r\n   Principles of Informatics\r\n   Information Ethics and Policy\r\n   Data Mining and Analysis\r\n   HCI Evaluation Methods\r\n   Information Structures\r\n   Research Methods in Informatics\r\n   Decision Support Systems\r\n   Information Systems Management\r\n   Intro. to Health Care Informatics\r\n\r\n   \r\n", format: "Full university CS curriculum", street: "One University Park Drive", longitude: -86.7981, latitude: 36.1056, contact_email: "becky.tallon@lipscomb.edu", phone: "615-966-5824", languages: "---\n- C#\n- C++\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n- Ruby\n", country: nil},
  {name: "Code Savvy", city: "Ramsey", state: "MN", zip_code: nil, site_url: "http://www.codesavvy.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- Vocational\n", bio: "Code Savvy is a not-for-profit organization in Minnesota dedicated to inspiring and enabling kids and adults to become code-savvy, that is, to understand the kind of creative thinking that goes into coding, and to try out programming computers and devices.   \r\n\r\nWe are especially keen to bring more diversity -- gender and ethnic diversity -- to the coding profession and to computer science, because creative problem-solving relies on diverse backgrounds and viewpoints.\r\n\r\nThere are many fantastic projects and organizations dedicated to help people learn to code, so Code Savvy's first priority is to bring some of these to Minnesota, and help them grow.   Current projects are the Technovation Challenge  (high school girls design and code mobile apps) and a Twin Cities Coder Dojo (free, open mentored, coding environment for kids 10-16).   Future projects include afterschool code clubs for middle school students, and coding workshops for adult women. ", format: "Other", street: "multiple sites", longitude: -93.201, latitude: 44.9375, contact_email: "info@codesavvy.org", phone: "", languages: "---\n- Arduino\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n- Ruby\n- Scratch\n", country: nil},
