  {name: "University of Washington", city: "Seattle", state: "WA", zip_code: 98195, site_url: "http://www.summeryouth.washington.edu", ed_level: "---\n- Middle School\n", bio: "Computer Game Programming\r\n\r\nLearn to create your own computer games and animation. Start with Scratch MIT to learn computer programming concepts through a drag-and-drop interface. Move on to Kodu from Microsoft Research, which provides visual building blocks to create sophisticated 3D games. Develop games through storyboards, images, logic and program flow.\r\n", format: "Daily programming course", street: "University of Washington", longitude: -122.309, latitude: 47.656, contact_email: "youth@pce.uw.edu", phone: "206-543-2310", languages: "---\n- Kodu\n- Scratch\n", country: nil},
