  {name: "New York Code & Design Academy", city: "New York", state: "NY", zip_code: 10011, site_url: "http://www.nycda.com", ed_level: "---\n- Vocational\n", bio: "The New York Code & Design Academy offers hands-on, intensive courses designed to teach aspiring programmers and designers how to build their own fully functioning websites and apps. Beginning with our Introduction to Web Design & Development, we demystify the languages and processes of web development and democratize the experience of learning to code. Taught by some of New Yorks leading industry professionals, our project-based courses introduce students to a collaborative learning environment where they will learn the dominant web languages of HTML, HTML5, CSS, Javascript, and Ruby on Rails.\r\n\r\nThe New York Code & Design Academy was founded on the belief that understanding the languages that power the internet are critical to maintaining a competitive edge in todays digital economy. Whether you are an entrepreneur with an idea for the next great company or a working professional looking to augment your digital skill set, the New York Code & Design Academy will teach you to build your own websites and apps and provide you with an understanding of the process of software development.", format: "Multi-week workshop", street: "225 W 14th St", longitude: -74.0007, latitude: 40.7393, contact_email: "info@nycda.com", phone: "917-968-4477", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Ruby\n", country: nil},
