  {name: "Wyomissing Area High School", city: "Wyomissing", state: "PA", zip_code: 19610, site_url: "http://www.wyoarea.org", ed_level: "---\n- High School\n", bio: "This course is an introduction to computer science with the Visual Basic programming language. Students design and debug interactive programs that use graphics, animation, audio, and robots. Students improve their problem-solving skills, deductive reasoning, mental focus and stamina to become agile learners.", format: "Daily programming course", street: "630 Evans Ave", longitude: -75.97, latitude: 40.3248, contact_email: "", phone: "", languages: "---\n- Visual basic\n", country: nil},
  {name: "University of Washington - UW in the High School", city: "Seattle", state: "WA", zip_code: 98195, site_url: "http://www.uwhs.washington.edu/uwhs/", ed_level: "---\n- High School\n- College\n", bio: "Through the UW in the High School (UWHS) program, high school students can complete University of Washington courses  and earn UW credit  in their own classrooms with their own teachers. Students and teachers use UW curriculum, activities, texts, tests, and grading scales. \r\n\r\nThree UW Computer Science courses are offered:\r\n\r\nComputer Science Principles (CSE 120)\r\nIntroduces fundamental concepts of computer science and computational thinking. Includes logical reasoning, problem solving, data representation, abreaction, the creation of \"digital artifacts\" such as web pages and programs, managing complexity, operation of computers and networks, effective web searching, ethical, legal, and social aspects of information technology. \r\n\r\nComputer Programming I (CSE 142) \r\nBasic concepts for programming-in-the-small abilities and concepts including procedural programming (methods, parameters, return values), basic control structures (sequence, if/else, for loop, while loop), file processing, arrays and an introduction to defining objects. \r\n\r\nComputer Programming II (CSE 143) \r\nConcepts of data abstraction and encapsulation including stacks, queues, linked lists, binary trees, recursion, instruction to complexity, and use of predefined collection classes. \r\n\r\nInterested high school administrators and teachers can review the steps to bring UW Computer Science coursework to their schools, and contact the UWHS office. \r\n\r\nhttp://www.uwhs.washington.edu/uwhs/teachers/\r\n\r\n\r\n\r\n\r\n", format: "Full university CS curriculum", street: "Box 359485", longitude: -122.352, latitude: 47.6248, contact_email: "uwhs@pce.uw.edu", phone: "206-685-6404", languages: "---\n- Java\n", country: nil},
  {name: "University of Washington-Programming Java", city: "Seattle", state: "WA", zip_code: 98195, site_url: "http://www.summeryouth.washington.edu", ed_level: "---\n- High School\n", bio: "Computer Programming in Java\r\n\r\nLearn the fundamentals of programming and develop your own programs using computer graphics. Study how computers work: Java vocabulary, data types including objects, mathematical computations and conditionals. Prepare to take Advanced Placement Computer Science, C++ and other programming languages.  For students with little or no programming experience.\r\n", format: "Daily programming course", street: "University of Washington", longitude: -122.309, latitude: 47.656, contact_email: "youth@pce.uw.edu", phone: "206-543-2310", languages: "---\n- Java\n", country: nil},
  {name: "The Iron Yard Academy", city: "Greenville", state: "SC", zip_code: 29601, site_url: "http://www.theironyard.com/academy/the-iron-yard-academy", ed_level: "---\n- Vocational\n", bio: "What will you be capable of by the end of the class?\r\n\r\nYou will be qualified as a professional, junior-level JavaScript and front-end engineer.\r\n\r\nJoin a startup and get a solid prototype off the ground quickly and efficiently\r\nBuild digital products for web development shop, agency, etc.\r\nBuild non-trivial, fast, efficient, production-quality apps\r\nBuild gorgeous websites\r\nMost importantly, learn how to learn\r\nYou won't know absolutely everything there is to know, but we will ensure that you know how to learn it if you need to.\r\n\r\nExcerpts from the curriculum\r\nHere's just a small sample from the curriculum. You'll\r\n\r\nlearn HTML, CSS, and JavaScript from the ground up\r\nbecome awesome at using Git for version control\r\nget totally comfortable working with command line tools\r\nlearn to write jQuery plugins from scratch\r\nget hands-on experience with the newest HTML5 tech\r\nbuild non-trivial, production quality JS apps with Backbone.js\r\nwork with languages that compile down to JS, like CoffeeScript and ClojureScript\r\nlearn your way around Rails, with a focus on what's important to know for frontend work in Rails apps.\r\nbuild apps that run lean and fast on both desktop and mobile browsers\r\nand much more ;)\r\nWhat kind of students are we looking for?\r\nBefore we get into specifics, we need to let you know that this class is going to be challenging. Material will get really hard, really quickly. All of the work is very do-able, but if you think you're going to develop professional level skills in a cushy 40 hour week, this isn't the place for you. (We estimate you'll put in about 60.) We're family people, so our goal is for you to work as hard as possible in class so you can find balance in a great job when you're done.\r\n\r\nWe're really excited about the different types of people who are going to apply, and we don't have stereotypes of what a developer is like. Here are a few things we'll look for:\r\n\r\nHard worker - Like we said above, this won't be a walk in the park. Prepare for a rigorous course.\r\nSelf motivated - If you need to be managed, this isn't the place for you.\r\nWorks well with others - you'll be assigned to groups for projects, and each person's role will be crucial.\r\nInterested in learning, even if you know some code Even if you know basics, you might have to unlearn some things. We'll start from the ground up as a team, and there won't be room for egos.\r\nGraceful problem solver - We'll work on some hard stuff, and patience is a must.\r\nReady to have fun - We work hard, play hard, and laugh every single day. We do the best work we possibly can, but we make sure not to take ourselves too seriously.\r\nWhat will the schedule look like?\r\nMonday through Thursday:\r\n\r\nClass starts at 9am\r\n9am - 12pm: lecture time\r\n12pm - 1pm: lunch\r\n1pm - ?pm: lab work\r\nSome days might include afternoon lectures\r\nLectures: Lessons will be fast-paced, interactive, and funny. Hopefully. The goal is for you to absorb a whole lot of information, then apply it on a real project during lab.\r\nLunch: Working hard requires resting hard, so we try to enjoy lunch as much as possible - whether we're heating leftovers or heading to Barley's for a slice and a pint. From our space you can walk or bike to the river, parks, amazing coffee, tasty food, or craft beer, and we like to take advantage of that access.\r\nLab work: In lab you'll be working on real websites and apps that real people will use - not scripted assignements. We're partnering with the city, non-profits, and other organizations who have problems that we can help solve. (Life in Greenville is a great example.) You'll have access to the space 24 hours a day, just in case you need to burn some midnight oil.\r\nFridays:\r\n\r\nCatch up day\r\nOpen lab time with the instructor (9am-5pm)\r\nTime with The Iron Yard Mentors when they're in town\r\nFridays will be a chance to breathe, take a break from intense lectures, and catch up if you need to. If Iron Yard Mentors are in town, we'll be able attend their talks and spend time with them when possible. (They're awesome people with a lot to offer. See for yourself.) We'll also strongly encourage you to contribute to open source projects, build your own stuff, and learn new languages. When you're done with your work from class, of course.", format: "Daily programming course", street: "411 University", longitude: -82.3989, latitude: 34.8401, contact_email: "academy@theironyard.com", phone: "", languages: "---\n- HTML\n- Javascript\n", country: nil},
  {name: "Learn2Code", city: "Bratislava", state: nil, zip_code: 81109, site_url: "http://www.learn2code.sk", ed_level: "---\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Learn2Code is 12-weeks program that learn people how to code and create web applications and projects in Ruby and Ruby on Rails. It's designed for complete beginners with a lot of passion, for people with ideas for business. We offer them not only way how to learn code, but also possibility to start their own business with the support of our partners. We want to make community of IT skilled people that push our society forward.\r\n\r\nClass schedule:\r\n\r\nMonday, Wednesday, Friday from 5 pm - 8 pm\r\n\r\nWe have only one course so far, Creating web applications, which consists of 3 modules:\r\n\r\n1. HTML/CSS/jQuery\r\n2. Ruby, Ruby on Rails\r\n3. Workshop/Project", format: "Multi-week workshop", street: "Grsslingova 4", longitude: 17.1141, latitude: 48.1434, contact_email: "debnar@learn2code.sk", phone: "+421 948 828 228", languages: "---\n- HTML\n- Javascript\n- Ruby\n", country: nil},
