  {name: "Mount Douglas Secondary School", city: "Victoria", state: "BC", zip_code: 0, site_url: "http://mdinfotech.net", ed_level: "---\n- High School\n", bio: "Information Technology 9/10: Topics include game programming in C++ and web design using XHTML 1.0 and CSS.\r\n\r\nICTP 11 - Programming: This course introduces students to basic programming in Java and interactive web desgin using XHTML, CSS and Javascript.\r\n\r\nICTP 12 - Programming: Learn to program Space Invaders! This is a programming course that will prepare you for a career in Computer Science or Software Engineering.  You will create a graphical game using object oriented programming in Java and an interactive website using PHP, Javascript, XHTML and CSS.", format: "Daily programming course", street: "3970 Gordon Head Rd ", longitude: -123.317, latitude: 48.4713, contact_email: "wear@mdinfotech.net", phone: "250 477 6977", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n", country: nil},
