  {name: "Tech Kids Unlimited", city: "New York", state: "NY", zip_code: 10036, site_url: "http://techkidsunlimited.org", ed_level: "---\n- Middle School\n- High School\n", bio: "Tech Kids Unlimited is a technology program for special needs kids ages 7 to 18.  In small workshops at Pace University, NYU-Polytechnic Institute and the JCC in Manhattan, students with differences learn 21st technology skills such as programming, i-stop animation, arduino, Photoshop, Illustrator, ProTools and more.\r\n\r\n", format: "Multi-week workshop", street: "Seidenberg School of CS--163 Williams St", longitude: -74.0059, latitude: 40.7101, contact_email: "beth@techkidsunlimited.org", phone: "9173347880", languages: "---\n- Arduino\n- HTML\n- Javascript\n- Mobile Apps\n- Python\n", country: nil},
