  {name: "DevJumpstart", city: "Austin", state: "TX", zip_code: 78701, site_url: "http://www.devjumpstart.com", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "The ultimate vision of our company is to have a nationwide school for web based technologies that bring together the conventional education system and leaders within the technology industry. The technical field is clearly growing at a rapid rate and the demand for developers is considerably larger than the number of qualified candidates.  A large majority of students graduate from college without marketable hard skills.  These students often find themselves struggling to find employment regardless of their undergraduate degrees.  With this company, not only will we be filling the industry need for new developers, but we will offer opportunities to people who are looking them.\r\n\r\nDevJumpstart is a school system based in Austin Texas in which students with no technical backgrounds learn to develop software.  Within 10 weeks, our program will have our students ready to apply to entry-level positions for startups within Austin. Our curriculum is based off of research conducted with Austin based startups.  When conducting this research we approached a number of prominent startups and asked them what hard skills they needed developers to have.  As a result, we will help our students get job placement by working closely with Austin based startups.\r\n\r\n", format: "Daily programming course", street: "701 Brazos Street", longitude: -97.7405, latitude: 30.2686, contact_email: "ravi@devjumpstart.com", phone: "", languages: "---\n- Backbone\n- Css\n- Ember\n- HTML\n- Javascript\n- Nodes\n- Ruby\n", country: nil},
