  {name: "IBAS Academy", city: "Kolkata", state: "WB", zip_code: 700129, site_url: "http://www.phptrainingkolkata.co.in", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "IBAS Academy is a government registered programming language training institute in Kolkata. Offer Php/My-Sql, Advanced Php, Core Java, J2EE, and Web Designing training including live international project and placement assistance. We also organize final year project, summer, industrial, intern, vocational training for BE, BTech, BCA, MCA students.\r\n\r\nWe are open 10am to 7pm from Monday to Sunday.\r\n\r\n1. PHP/Mysql Training\r\n[Duration : 3 Month, Course Fee : 7,000 INR]\r\n\r\n2. Core Java Training\r\n[Duration : 2 Month, Course Fee : 3,500 INR]\r\n\r\n3. Advanced Java Training\r\n[Duration : 2 Month, Course Fee : 3,500 INR]\r\n\r\n4. Java Enterprise Application (J2EE) Training\r\n[Duration : 2 Month, Course Fee : 4,500 INR]\r\n\r\n5. Web Designing Training\r\n[Duration : 4 Month, Course Fee : 10,000 INR]\r\n", format: "Daily programming course", street: "Chandangarh, Madhyamgram", longitude: 88.4529, latitude: 22.6947, contact_email: "info@ibasacademy.com", phone: "+919804815656", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Logo\n- PHP\n", country: nil},
  {name: "Youth Digital Studio", city: "Durham", state: "NC", zip_code: 27707, site_url: "http://youthdigitalstudio.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "After school and summer camp advanced computer classes for children and teens. From our studio, based in Durham, NC we offer classes in App design, Game Design, Game Development, Computer Programming, and Mod Design for the popular game Minecraft*, and Graphic, Web, and Film classes. Whether in a summer camp or in an after school class students are exposed to ground breaking technology in immersion driven, project based classes. \r\n", format: "Afterschool program", street: "5318 New Hope Commons Drive", longitude: -78.9932, latitude: 35.9553, contact_email: "info@youthdigitalstudio.com", phone: "919 766 0691", languages: "---\n- C++\n- HTML\n- Java\n- Mobile Apps\n- PHP\n", country: nil},
  {name: "Pixel Academy", city: "Brooklyn", state: "NY", zip_code: 11201, site_url: "http://www.pixelacademy.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "The Pixel Academy is a community of kids and teens that are passionate about learning 21st Century Skills. Members get access to thousands of dollars worth of state of the art technology, from virtual reality goggles and 3D Printers to self-teaching guitars and a custom-built sound studio. Assisted by our expert staff, Pixel members are able to explore and master new and relevant subjects that traditional schools aren't able to provide like Video Game Design, 3D Printing, Arduino Programming, App Development, Film Making, Music Writing, and so much more.", format: "Afterschool program", street: "212 Smith St.", longitude: -73.9922, latitude: 40.6845, contact_email: "workshops@pixelacademy.org", phone: "866-771-6837", languages: "---\n- Actionscript\n- Arduino\n- HTML\n- Javascript\n- Kodu\n- Mobile Apps\n- Objective-c\n- PHP\n- Scratch\n- Unityscript\n", country: nil},
  {name: "Real Programming 4 Kids", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://www.realprogramming.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Real Programming 4 Kids offers game programming classes and summer camps in 7 Ontario, Canadian cities; Toronto, Oakville, Richmond Hill, Oshawa, London, Waterloo and Ottawa.\r\n\r\nRP4K offers Saturday and evening classes during the school year in addition to summer programming camps in the 7 aforementioned Canadian cities.\r\n\r\nWe offer classes in Alice, Visual Basic, Java, C#, XNA and C++. \r\n\r\nThere are never more than 4 students per instructor.\r\n\r\nWe believe that kids learn programming best when they're learning how to program a video game! We use Visual Basic and Java to teach kids and teens how to program classic arcade games. We also have an advanced Java Minecraft Mod course and a Java Android Mobile game programming course. We use C# XNA to teach game programming for the Xbox 360.\r\n\r\nAll new students are allowed to participate in a FREE 45 minute Visual Basic or C# trial class. This helps pinpoint what level they can start at.\r\n\r\nThere information on our website at www.realprogramming.com", format: "Summer camp", street: "301 - 255 Glenlake Avenue", longitude: -79.4645, latitude: 43.6577, contact_email: "rp4kelliott@gmail.com", phone: "4164699676", languages: "---\n- Alice\n- C# and xna.\n- C++\n- Java\n- Mobile Apps\n- Visual basic\n", country: nil},
