  {name: "The Charter School of Wilmington", city: "Wilmington", state: "DE", zip_code: 19804, site_url: "http://charterschool.org", ed_level: "---\n- High School\n", bio: "Computer Science Fundamentals (graduation requirement)\r\n   History of CS, Boolean Algebra, Overview of Hardware and Software, Social Media Discussions, Security issues, Introduction to Java; and\r\n\r\nIntroduction to Programming and Algorithms\r\n    Basic to Intermediate Constructs in Java through OOP, Arrays, Sorting and Searching Algorithms.\r\n\r\nData Structures\r\n   Ground up programming of single, double linked lists, Stacks, Binary Search Trees, Queues, Heap, etc. through dynamic data structures and the methods that create and utilize them.\r\n\r\nIntroduction to Software Engineering\r\n    Project Based with students gaining teamwork experience using Scrum and other available tools for constructing and managing larger coding systems.\r\n\r\nHuman and Computer Interaction (HCI): Research and Publication\r\n   Students research in the field of HCI, write and submit for publication to National or International Conferences or journals under blind review.\r\n\r\n\r\nApplied Discrete Mathematics and Structures\r\n     Discrete Math concepts along with accompanying coding techniques to illustrate the structures presented.\r\n\r\nWeb Application Development\r\n    Server and client side development of interactive web pages and sites.\r\n", format: "Daily programming course", street: "100 N. Dupont Rd", longitude: -75.5843, latitude: 39.7282, contact_email: "dbrown@charterschool.org", phone: "3026512727 x309", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n", country: nil},
