  {name: "Ranken Technical College", city: "St. Louis", state: "MO", zip_code: 63113, site_url: "http://www.ranken.edu", ed_level: "---\n- College\n", bio: "Focusing on Internet and Web-based programming with experience in Web design, students will utilize industry-standard applications such as Microsoft's Visual Studio and Adobe DreamWeaver; and learn hand-coded HTML, CSS, JavaScript, T-SQL, and the Microsoft .NET framework. Students will use a variety of programming languages to design, develop, and maintain software applications to help businesses solve real-world problems and discover new opportunities via data-driven Web-based applications.", format: "Daily programming course", street: "4431 Finney Avenue", longitude: -90.2487, latitude: 38.653, contact_email: "eagudmestad@ranken.edu", phone: "3142863691", languages: "---\n- .net\n- Css\n- HTML\n- Java\n- Javascript\n- Jquery\n- Sql\n", country: nil},
  {name: "Phillips Exeter Academy", city: "Exeter", state: "NH", zip_code: 3833, site_url: "http://www.exeter.edu/academics/72_6506.aspx", ed_level: "---\n- High School\n", bio: "Phillips Exeter Academy offers a full Computer Science curriculum.  All four-year students are required to take at least one term of computer science.  We do *not* teach the AP curriculum, though all students do well on it.\r\n\r\nTopics covered include web site design with PHP and/or Javascript, software engineering with Java, creating Mobile Applications for iOS and/or Android, robotics, and special topics courses (recent special topics courses have included: Operating Systems, Concurrency, Complexity Theory, formal proof of sequential programs, digital electronics, artificial intelligence and security).", format: "Other", street: "20 Main Street", longitude: -70.9518, latitude: 42.9812, contact_email: "bsea@exeter.edu", phone: "", languages: "---\n- Assembler\n- C\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Objective-c\n- PHP\n- Processing\n- Python\n- Scratch\n", country: nil},
