  {name: "Guild of Scratchery - Spring Break Enrichment", city: "Houston", state: "TX", zip_code: 77025, site_url: "http://www.guildofscratchery.com/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Give your children the skills to deepen their understanding of computers and empower them to innovate in the world of tomorrow. Learn introductory programming with Scratch, a highly engaging computer programming language developed by MIT. Make your own animated adventure, music video, interactive game, or anything you can imagine. Students will learn to create multimedia-rich programs from \"Scratch\" to finish through the process of design.\r\n\r\nClass Fees: $245\r\n\r\nRecommended Age: 10 - 14\r\n\r\nClass Time: Monday - Friday 1 - 4 pm\r\n\r\nClass Dates: March 11 - 15\r\n\r\nLocation:\r\nWest University Recreation Center, Multi Purpose 2\r\n4210 Bellaire Blvd.\r\nWest University Place, TX 77025\r\n \r\nRegister now at www.westutx.gov/reg for\r\nActivity Number 103301 Computer Programmming from Scratch.\r\nFor more information visit www.guildofscratchery.com", format: "Afterschool program", street: "4210 Bellaire Blvd", longitude: -95.4463, latitude: 29.7066, contact_email: "info@guildofscratchery.com", phone: "", languages: "---\n- Scratch\n", country: nil},
