  {name: "Schlerrechenzentrum Meien e.V.", city: "Meissen", state: "SN", zip_code: 1662, site_url: "http://www.srz-meissen.net/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Das Schlerrechenzentrum Meien e.V. ist der Computerclub fr computerinteressierte Kinder, Jugendliche und Eltern von 8 - 108 Jahren, die sich in Ihrer Freizeit mit Gleichgesinnten austauschen und weiterbilden wollen.\r\n\r\nWir bieten ein umfangreiches Kursprogramm rund um den PC, Internet, Grafik, Programmiersprachen usw... Aber auch Spiel und Spa kommen nicht zu kurz.\r\n\r\nUnsere Rumlichkeiten in der Sparkasse Meien liegen sehr zentral und gut erreichbar am Bahnhof und Busbahnhof Meien.\r\n\r\nDas Schlerrechenzentrum Meien gehrt dem Landesverband Schsischer Jugendbildungswerke e.V. an und ist Mitglied im Kreisjugendring Meien. ", format: "Other", street: "Dr.-Eberle Platz 5c", longitude: 13.4796, latitude: 51.1638, contact_email: "srz01@onlinehome.de", phone: "03521728662 ", languages: "---\n- Actionscript\n- C++\n- Css\n- HTML\n- Java\n- Javascript\n- Linux\n- PHP\n- Python\n- Ruby\n", country: nil},
  {name: "Nightingale-Bamford School", city: "New York", state: "NY", zip_code: 10128, site_url: "http://www.nightingale.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "We offer a vast amount of classes in Computer Science.  Starting in Kindergarten with Robotics, our Robotics program (we currently use LEGO) runs through the Middle School.  In the Lower School we also teach Kodu and Scratch.  In Middle School, we teach Kodu, Java(using Greenfoot) and JavaScript.  Moving into Upper School, we offer programming in JavaScript, HTML5, CSS, and App Inventor as well as offering independent studies in Computer Science!", format: "Daily programming course", street: "20 East 92nd Street", longitude: -73.9568, latitude: 40.7849, contact_email: "", phone: "", languages: "---\n- Alice\n- Css\n- HTML\n- Java\n- Javascript\n- Kodu\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Academia San Ignacio de Loyola", city: "San Juan", state: "PR", zip_code: 969, site_url: "http://www.asiloyola.org", ed_level: "---\n- Elementary\n", bio: "Microsoft Kodu and Scratch is part of the Computer Class Curriculum in Academia San Ignacio de Loyola, an Elementary School. The Computer Class schedule is twice a week.", format: "Other", street: " 1908 Narciso Santa Mara", longitude: nil, latitude: nil, contact_email: "msoto@asiloyola.org", phone: "7877658190", languages: "---\n- Kodu\n- Scratch\n", country: nil},
  {name: "Unifran", city: "Franca", state: "So Paulo", zip_code: 1440135, site_url: "http://www.unifran.br/site/home/index.php", ed_level: "---\n- High School\n", bio: "O curso de bacharelado em Sistemas de Informao da Unifran tem como objetivo formar gestores estratgicos que possuam, alm de profundos conhecimentos em computao, noes fundamentais de administrao. Aps o curso, o profissional ter capacidade de planejamento, anlise, utilizao e avaliao de tecnologias de informao (TI) aplicadas s reas administrativas e industriais, em organizaes pblicas e privadas.\r\n\r\nSua formao o habilita para o desenvolvimento de alta tecnologia em computao, com nfase no desenvolvimento de programas comerciais, aplicativos para a internet e gerao de sistemas multimdia. Para isso, o curso oferece conhecimentos sobre desenvolvimento de sistemas de ferramentas como Delphi, Visual Basic, .NET, Java, C++ e programao para internet usando ASP, PHP, HTML e Flash.\r\n\r\nO gestor estratgico em sistemas de informao pode atuar como projetista de sistemas de informao, analista de sistemas e de negcios, administrador de bancos de dados, administrador e gerente de redes de computadores, gerente de rea de informtica, bem como empresrio e consultor na rea de tecnologia de informao.\r\n\r\nO laboratrio para o desenvolvimento de sistemas possui mais de 300 computadores avanados, o que auxilia no desenvolvimento de projetos de pesquisa em reas de tecnologia de ponta, alm de convnios acadmicos com a Oracle, Microsoft, Furukawa e Borland. O quadro de professores titulados completa as vantagens do curso que prepara o aluno para entrar no mercado de trabalho ainda no primeiro ano. ", format: "Full university CS curriculum", street: "Dolores Maciel de Almeida", longitude: -47.39, latitude: -20.5157, contact_email: "paulo.sh@live.com", phone: "", languages: "---\n- .net and flash\n- Asp\n- C++\n- Delphi\n- HTML\n- Java\n- PHP\n- Visual basic\n", country: nil},
  {name: "Lakewood High School / CTEC of Licking County", city: "Hebron", state: "OH", zip_code: 43025, site_url: "http://www.c-tec.edu/HS/index.php/computer-information-systems-cis", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "The Computer and Information Systems (CIS) program at Lakewood High School is great program that teaches students about all of the different areas of IT, with an emphasis on web programming and traditional programming. A two-year program, CIS allows students to improve their tech skills while earning both high school and transferable college credit. Students who complete CIS continue into either 2 or 4 year college computer courses after graduation. \r\n", format: "Full university CS curriculum", street: "9331 Lancer Rd.", longitude: -82.4365, latitude: 39.957, contact_email: "mvukovic@c-tec.edu", phone: "740-364-2832", languages: "---\n- Actionscript\n- C++\n- HTML\n- Javascript\n- PHP\n- Python\n- Visual basic .net\n", country: nil},
  {name: "TeknoLab Sandved Skole", city: "Sandnes", state: "Rogaland", zip_code: nil, site_url: "http://teknolabsandved.blogspot.no/", ed_level: "---\n- Middle School\n", bio: "Ungdomsskole", format: "Afterschool program", street: "Gamle Asheimvei 9", longitude: 5.7163, latitude: 58.8407, contact_email: "oyvind@aardal.com", phone: "90116331", languages: "---\n- C#\n- HTML\n- Java\n", country: nil},
  {name: "Algonquin Regional High School", city: "Northborough", state: "MA", zip_code: 1532, site_url: "http://web.nsboro.k12.ma.us/algonquin/faculty/mathteachers/forhan/forhan.htm", ed_level: "---\n- High School\n", bio: "Course Listings:\r\n \tPython programming\r\n \tIntroduction to Computer Programming\r\n \tC++ I Programming\r\n \tC++ II Programming\r\n \tGame Development Using XNA\r\n \tAP Computer Science\r\n        HTML/Webpage Development\r\nStudents interested in programming can also join our Computer Programming Team! This is a place where you can explore many different interests in the field of computer programming. \r\n\r\n Students in that club also attend regional programming competitions throughout New England. \r\n\r\nThere are multiple types of activities we will do in programming club.\r\n First, there is learning and/or improving your programming skills in any way\r\nyou want. You can spend time during meetings working on software you are\r\nwriting. This is helpful because you can talk to fellow programmers for help.\r\nWe will also be practicing for competitions.\r\n We also compete in programming competitions with teams from other schools and have one most of the regional events. These are competitions where you will go with the team to solve interesting and challenging programming problems. Also, free pizza and ice cream.\r\n\r\n Additionally, we annually take on the challenge of writing a piece of software as a whole team, often in the form of a video game. This will require\r\nyou to use all your skills, not just programming! This can include art, music, story-writing, math, or anything you can imagine that can be added as an\r\nelement in a video game.\r\nBut I don't know how to code! How do I start?\r\nThat is not a problem. Learning a programming language is fun and rewarding. In programming club, we primarily use the languages C++ and Java. It is easy to\r\npick up on the basics from online tutorials and you can learn a lot from others\r\nin the club.                                                            <br>      \r\n01 IF (day == THURSDAY && time == 2:00)<br>\r\n02 GOTO room[D111]<br>\r\n03 GOSUB CODE<br>\r\n04 END<br>\r\n\r\nIf you have any questions related to this team or the programming curriculum at ARHS, feel free to contact \r\nMr. Forhan( dforhan@nsboro.k12.ma.us ).", format: "AP Computer Science", street: "79 Bartlett Street", longitude: -71.6129, latitude: 42.3253, contact_email: "danielforhan@gmail.com", phone: "", languages: "---\n- C++\n- Game development using c# and xna\n- HTML\n- Java\n- Mobile Apps\n- Python\n- Scratch\n", country: nil},
