  {name: "Digital Media Academy", city: "Los Gatos", state: "CA", zip_code: 95032, site_url: "http://www.DigitalMediaAcademy.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "World's Best Tech Camp!\r\n\r\nFounded by educators from Stanford University, and led by former education and entertainment creators from Apple Education and Walt Disney Studios - DMA delivers a world-class learning experience. \r\n\r\nLearn video game design using Alice, iPhone and iPad App development, Google Android app development, robotics programming using Arduino, computer programming using Java or C+++, Minecraft, website design, and so much more. \r\n\r\nBeginning to advanced campers age 6-18 learn by doing with hands-on instruction from industry professionals and technology educators with real-world experience. DMA builds and develops STEM (Science, Technology, Engineering, and Math) skills.\r\n\r\nAt DMA, students get the campus experience of a prestigious university like Stanford, Harvard, UCLA, Yale, University of British Columbia, and University of Toronto (just to name a few) while making friends and learning with others who share the same interests. We have small class sizes (8:1 ratio max) guaranteeing a personalized experience.\r\n\r\nCreate the future at DMA! ", format: "Summer camp", street: "718 University Ave., Suite 115", longitude: -121.975, latitude: 37.237, contact_email: "info@DigitalMediaAcademy.org", phone: "866-656-3342", languages: "---\n- Alice\n- Arduino\n- C# (c sharp)\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Objective c\n- Python\n- Robot c\n- Scratch\n", country: nil},
