  {name: "Covenant College", city: "Lookout Mountain", state: "GA", zip_code: 30750, site_url: "http://www.covenant.edu/academics/undergrad/cs", ed_level: "---\n- College\n", bio: "Covenant College's Department of Computer Science offers a major in computer science, which is the broadest and most established of the computing disciplines. Our course work is based on the ACM / IEEE CC 2001 Curriculum Guidelines for Undergraduate Degree Programs in Computer Science. The program requires 40 credit hours of COS courses as well as a supporting course in quantitative methods for a total of 44 credit hours. We also offer a minor in computer science.", format: "Full university CS curriculum", street: " 14049 Scenic Highway", longitude: -85.3743, latitude: 34.9568, contact_email: "john.hunt@covenant.edu", phone: "706-419-1534", languages: "---\n- Java\n- Python\n", country: nil},
  {name: "King's Schools", city: "Seattle", state: "WA", zip_code: 98133, site_url: "http://www.mhthompson.com/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "We offer a wide range of computer science courses for complete novices to experts.  For the expert we offer AP Computer Science (Java), and UW in the High School CSE 142 and CSE 143 (Java).  For novices we offer Web Design (HTML & CSS) and an intro to programming using C# called Game Design.  For those wanting a hands-on approach, we offer a robotics elective using NXT Mindstorms.  For secondary students that want to dive very deep into real-time multi-threaded embedded coding, we have active FIRST Tech Challenge (FTC) robotics teams. Elementary students can experience programming K-6 in FIRST JrFLL and FLL on after school teams.  ", format: "AP Computer Science", street: "19303 Fremont Ave N", longitude: -122.352, latitude: 47.7688, contact_email: "mhthompson@crista.net", phone: "", languages: "---\n- C#\n- Css\n- HTML\n- Java\n- Lego nxt mindstorms\n- Mobile Apps\n- PHP\n- Robotc\n", country: nil},
  {name: "Wizbots Creative Robotics Labs-CA", city: "Palo Alto", state: "CA", zip_code: 94070, site_url: "http://www.wizbots.com", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Wizbots after school Imagineering Labs engage kids in product design, tech challenges, team games, and open-ended creativity. Access to a wide range of materials, including sophisticated programming and robotics components (based on LEGO Mindstorm NXT), ensures kids of all abilities can be challenged and successful while advancing their powers of innovation. Each season, kids attend the Lab once a week, for 90 minutes at a time. You can find our labs in over 35 participating schools throughout the San Francisco Bay Area.  Please visit our website to see all available locations.", format: "Afterschool program", street: "Palo Alto", longitude: -122.171, latitude: 37.3612, contact_email: "info@wizbots.com", phone: "", languages: "---\n- Nxtg\n", country: nil},
  {name: "Wizbots Creative Robotics Summer Camps", city: "Palo Alto", state: "CA", zip_code: 94306, site_url: "http://www.wizbots.com", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Wizbots Imagineering Summer Camps engage kids in product design, tech challenges, team games, and open-ended creativity. Access to a wide range of materials, including sophisticated programming and robotics components (based on LEGO Mindstorm NXT), ensures kids of all abilities can be challenged and successful while advancing their powers of innovation. All Summer Labs run Monday through Friday, and are led by experienced staff with plenty of trained assistants to make sure kids get the help and supervision they need. Our summer camps are located in San Carlos, Palo Alto and Mountain View. Please visit our website for details.", format: "Summer camp", street: "Palo Alto", longitude: -122.124, latitude: 37.4178, contact_email: "info@wizbots.com", phone: "6505210444", languages: "---\n- Nxtg\n", country: nil},
