  {name: "Gage Park", city: "Chicago", state: "IL", zip_code: 60609, site_url: "http://www.gageparkhs.org", ed_level: "---\n- High School\n", bio: "Our robotics team designs, builds, and programs FTC robots for each years competition. We also do projects and activities with Arduino, scratch, high powered rocketry, roller coasters, rc aircraft, electronics, bridge building and other STEM activities. \r\n\r\nOur program is sponsored by Advance Wheel Co. who houses the center inside its' manufacturing facility, Jenskovec Machining and Engineering, and its' coach and teacher, Marc Irwin, who doubles as Prof. Gadget. Prof. Gadget provides training and entertaining programs to motivate and inspire schools and students in the use of LEGO robotic material and STEM learning.\r\n\r\n  ", format: "Robotics club", street: "5335 S Western Blvd", longitude: -87.6834, latitude: 41.796, contact_email: "mirwin66@gmail.com", phone: "6305406626", languages: "---\n- Arduino\n- C++\n- Labview\n- Nxt-g\n- Python\n- Robotc\n- Scratch\n", country: nil},
