  {name: "IFCE - Instituto Federal do Cear - Campus Crato", city: "Crato", state: "Cear", zip_code: 63115, site_url: "http://www.eafcrato.gov.br", ed_level: "---\n- High School\n- College\n", bio: "O curso de Bacharelado em Sistemas de Informao (SI), do Instituto Federal do Cear  Campus Crato, tem como objetivo oferecer uma formao slida em automao e gesto dos sistemas de informao das organizaes. Alm de uma ampla formao em reas relacionadas a Sistemas de Informao, tem uma nfase significativa na gesto das organizaes e estudos humansticos.\r\n\r\nO curso procura tambm dar ao aluno uma viso abrangente do ambiente organizacional e da sociedade. A graduao  direcionada para fornecer excelncia acadmica e garantir que o aluno possa compreender as necessidades de um mundo em constante mudana, onde a facilidade de processar e utilizar informao de forma rpida, atravs dos sistemas de informao,  cada vez mais urgente.", format: "Full university CS curriculum", street: "Rodovia CE 292, KM 15, Gislia Pinheiro", longitude: nil, latitude: nil, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n- Javascript\n- PHP\n- Python\n- Scratch\n", country: nil},
  {name: "Bright Learning Academy", city: "Winter Park", state: "FL", zip_code: 32792, site_url: "http://Brightlearning.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Instruction includes Linux and Ubuntu (our network is built on EdUbuntu and LTSP) with a special emphasis on equipping students skills needed for their future distance ed adventures. We use Moodle as a framework for delivering courses centered around sites such as Khan Academy, Code Academy, IXL etc.. We provide computer training at two levels - one that covers all the web programming areas such as MySql, Php, CPanel, HTML, HTML5, JavaScript, CSS etc and another level that teaches web applications such as word processors, Blog Talk Radio, graphics, spreadsheets, powerpoint and more. We also include studies in networking, clustering and \"supercomputing\" through such devices as the Raspberry Pi and Virtual machines.", format: "Daily programming course", street: "7300 Aloma Ave", longitude: -81.2906, latitude: 28.6081, contact_email: "robert@Brightlearning.org", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
