  {name: "Blinn College", city: "Bryan", state: "TX", zip_code: 77802, site_url: "http://cit.blinn.edu", ed_level: "---\n- College\n- Vocational\n", bio: "The AAS degree, certificates and award provide students with academic, technical and workplace skills such as critical thinking, problem solving, and oral and written communications. Courses cover the fundamentals of personal computers, networking, and security using CompTIA standards; the installation, configuration and administration of Linux and Windows servers, Cisco switches and routers; and Apache and PHP web, and MySQL database programming and servers.", format: "Other", street: "2423 Blinn Blvd", longitude: -96.35, latitude: 30.6631, contact_email: "rnelson@blinn.edu", phone: "979-209-7430", languages: "---\n- HTML\n- Mysql\n- PHP\n", country: nil},
