  {name: "Tierra Bonita Elementary", city: "Poway", state: "CA", zip_code: 92064, site_url: "http://www.powayusd.com/pusdtbes/cs/index.htm", ed_level: "---\n- Elementary\n", bio: "Programming concepts that are presented:\r\nBoolean logic\r\nvariables\r\niteration\r\nconditionals\r\n\r\nLearning to program is all about learning the concepts. If you have a good understanding of concepts, it's easy to switch between languages.\r\n\r\nWe use a program called Scratch. Scratch uses its own language  with keywords that are similar to other languages. \r\n\r\nAreas of scratch:\r\nStage\r\nBackstage  where actors/sprites hang out\r\nScript\r\nCostumes\r\nBackgrounds\r\n", format: "Other", street: "14678 Tierra Bonita Road", longitude: -117.028, latitude: 32.98, contact_email: "tbeskids@gmail.com", phone: "858-748-8540", languages: "---\n- Scratch\n", country: nil},
  {name: "PS/MS 219", city: "Flushing", state: "NY", zip_code: nil, site_url: "http://www.psms219.org", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n", bio: "Robotics \r\nWeb designing", format: "Robotics club", street: "144-39 Gravett Road Flushing NY 11367", longitude: -73.8242, latitude: 40.735, contact_email: "", phone: "", languages: "---\n- Basic\n- Logo\n", country: nil},
  {name: "Adventure/Herman", city: "San Jose", state: "CA", zip_code: 95123, site_url: "http://www.adventurestemprogram.com/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Adventure/Herman's CodeAcademy is excited to teach coding to elementary and middle school students. The club meets once a week and provides students with the tools needed to develop coding skills across platforms. Our students learn at their own pace, and decide which skills they need to advance their knowledge.\r\n", format: "Afterschool program", street: " 5955 Blossom Ave", longitude: -121.84, latitude: 37.2394, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n", country: nil},
  {name: "Verona High School", city: "Verona", state: "NJ", zip_code: 7044, site_url: "http://www.veronaschools.org/vhs", ed_level: "---\n- High School\n", bio: "Courses Offered at Verona High School include:\r\n\r\nFUNDAMENTALS OF COMPUTER SCIENCE\r\n1 Semester, 2.5 credits\r\nPrerequisite: None\r\nStudents learn the fundamentals of software engineering. Students will design, code, and test computer programs using the Alice programming language. Alice is an innovative 3D programming environment developed by Carnegie Mellon University in which beginner students can create an animation to tell a story, to create an interactive game, or to create a working model a real-world situation. Alice uses 3D graphics and a drag-and-drop interface to facilitate a more engaging, less frustrating introduction to Computer Science.\r\n\r\nAP COMPUTER SCIENCE Full Year, 5 credits Prerequisite: Fundamentals of Computer Science or Supervisor Approval\r\nStudents will use the Java programming language to learn object-oriented programming with a concentration on problem solving and algorithm development. This course is aligned with the College Boards Advanced Placement Computer Science A course and examination and is the equivalent of a first-semester college-level course in Computer Science. Students will write, run and debug object-oriented software, develop and select appropriate algorithms and data structures to solve problems, and learn to read and understand large programs consisting of many software components. Student must take the AP exam to earn AP course credit.\r\n\r\nHONORS ADVANCED TOPICS IN COMPUTER SCIENCE\r\nFull Year, 5 credits\r\nPrerequisite: AP Computer Science\r\nThis course uses an interdisciplinary approach, where students apply their computer science knowledge to solve real-world problems in other disciplines. The course highlights the role of computing in applied mathematics, engineering, the physical and biological sciences, finance, and computer science itself, emphasizing how these disciplines are intertwined in the modern world. Students will apply their knowledge of software engineering developed in prior computer science courses to solve classic problems in these disciplines. Students will also learn how to use more advanced data structures and algorithms in solving these problems.\r\n\r\nSOFTWARE ENGINEERING: MOBILE DEVICES\r\n1 Semester, 2.5 credits\r\nPrerequisite: Honors Advanced Topics in Computer Science\r\nThis course introduces mobile application development for the Android platform. Students will learn skills for creating and deploying Android applications, with particular emphasis on software engineering topics including software architecture, software process, usability, and deployment. Students will create and deploy an Android application as the culminating activity of the course.\r\n\r\nSOFTWARE ENGINEERING: GAME DEVELOPMENT\r\n1 Semester, 2.5 credits\r\nPrerequisite: Honors Advanced Topics in Computer Science\r\nStudents will use software engineering skills developed in prior coursework to develop 2-D and 3-D games. Computer game development requires many facets of Computer Science, including Computer Graphics, Algorithms, Data Structures, Networking, and Human-Computer Interaction. It also requires knowledge of other disciplines including Economics, Mathematics, Physics, and Psychology. Students will create and deploy 2-D or 3-D game as the culminating activity of the course.", format: "AP Computer Science", street: "151 Fairview Ave", longitude: -74.2435, latitude: 40.8469, contact_email: "rwertz@veronaschools.org", phone: "9735716750", languages: "---\n- Alice\n- Java\n- Mobile Apps\n", country: nil},
  {name: "Hoven Trainings", city: "Mohali", state: "PB", zip_code: 160062, site_url: "http://www.hoven.in", ed_level: "---\n- College\n- Vocational\n", bio: "C#, DOTNET, C++, PHP, Core JAVA, Advanced JAVA, Android", format: "Summer school CS program", street: "Hoven, Phase X Market", longitude: 76.7308, latitude: 30.678, contact_email: "sales.hoven@gmail.com", phone: "", languages: "---\n- Advanced java\n- Android\n- C#\n- C++\n- Core java\n- Dotnet\n- Java\n- PHP\n", country: nil},
  {name: "'Yes We Can' Community Center", city: "Westbury", state: "NY", zip_code: 11590, site_url: "http://www.northhempsteadny.gov/content/7354/7125/7183/11249/default.aspx", ed_level: "---\n- Middle School\n- High School\n- College\n", bio: "Udacity CS101\r\nStart: 9/2013.   Have a nice summer.\r\n\r\nThis program introduces Computer Science and software development through the udacity.com CS101 course.  It is nominally an 8-week course, self-paced, based on short video clips and many small quizzes, which are just for practice. No prior experience is assumed. You'll be introduced to the Python programming language and by the end of the course, you'll have written your own web-search engine. \r\n\r\nThe course is self-paced so you proceed at whatever speed you are comfortable with, and we're available to answer questions and to keep you motivated. The Yes We Can Community Center (Garden St., New Cassel) provides the computers and networking that you'll need. You should bring a paper notebook and pen, and be prepared to commit to stick with the course, several hours per week. Along the way, we hope you have fun. By the end, you will have earned a certificate of completion, and have learned if computer science is a field that interests you. The Web has plenty of follow-on courses, so you can continue with software development and Computer Science if you find you like it.\r\n\r\nFor CS101, we'll help you with the material and we hope you'll help your fellow learners taking the course. The course has an online forum where you can ask and answer questions posed by CS101 students from all around the world. The course is in English and all members of the North Hempstead community center are welcome to study with us. It's all online, no textbook is required.\r\n\r\nEver wished your teacher had a Pause and Rewind button? Well, in this course they do!\r\n\r\nUnsure if this course will interest you? Well, come out and take a look. Tell us what you seek and ask us about CS101.\r\n\r\nAre you a self-starter?  If you have Internet access and a PC, feel free to dive into the course on your own.  The forum is available to help you. \r\n\r\nhttp://rdrewd.blogspot.com/search/label/udacity \r\n\r\nhas articles that might interest you.", format: "Other", street: "141 Garden St.", longitude: -73.5671, latitude: 40.7588, contact_email: "r.drew.davis@gmail.com", phone: "516-782-2675", languages: "---\n- Python\n", country: nil},
  {name: "Digital Media Academy at UBC (University of British Columbia)", city: "Vancouver", state: "BC", zip_code: 0, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/the-university-of-british-columbia/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Your child or teen will love the Digital Media Academy camps at UBC in Vancouver, Canada, where they can combine summer fun with cool topics such as game design, digital filmmaking, animation, and game modding. There are so many options available at our British Columbia camps that kids aged 6 to 18 are bound to find their ideal summer camp that will keep them entertained while learning new computer skills. Whether they attend the day camp or stay overnight, University of British Columbia (UBC) provides an exciting taste of college life in a safe and supportive environment. Kids and teens will learn how to make their own film, game, or digital art at summer camp with enthusiastic, energetic staff, while also making new friends with other campers through fun activities.", format: "Summer camp", street: "2329 West Mall", longitude: -123.253, latitude: 49.2613, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "TC Roberson", city: "Asheville", state: "NC", zip_code: 28803, site_url: "http://www.buncombe.k12.nc.us/Domain/2828", ed_level: "---\n- High School\n- College\n", bio: "Advanced Placement Computer Science course - 5 days a week high school course to prepare for the College Board advanced placement exam. Teaches the Java language ", format: "AP Computer Science", street: "250 Overlook Rd", longitude: -82.5353, latitude: 35.4854, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n- Javascript\n", country: nil},
  {name: "Digital Media Academy at Stanford", city: "Stanford", state: "CA", zip_code: 94305, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/stanford-university/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Kids and teens in the San Francisco Bay Area will enjoy the day and residential overnight summer camps at Stanford University, hosted by Digital Media Academy. Whether teens take on a new challenge in digital filmmaking or robotics, or whether kids sign up for 3D game design or cartoon creation, they will love learning more about their favorite activities while making friends with others who share their interests. Kids ages 6 to 18 will have a great pre-college experience at Stanford, where Digital Media Academy camps combine entertainment and learning in a supportive, safe environment.", format: "Summer camp", street: "450 Serra Mall", longitude: -122.169, latitude: 37.4283, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at UC Berkeley", city: "Berkeley", state: "CA", zip_code: 94720, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/university-of-california-berkeley/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "For students who want a pre-collegiate experience at a college theyre interested in attending or just wanting to get away for the summer and explore a new city, Digital Media Academy offers the best of both worlds.\r\n\r\nLearn on the University of Californias Berkeley campus, eat in the same dining halls as UC Berkeley students and campers ages 12+ can even stay overnight. See the gold nugget thats believed to set off the California Gold Rush in Bancroft Library or pet the lions outside of Durant Hall. Digital Media Academy selected UC Berkeley not only because of its cutting-edge programs and acclaimed research, but because of its scenic location in the San Francisco Bay Area.", format: "Summer camp", street: "110 Sproul Hall", longitude: -122.259, latitude: 37.8723, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Fire Tech Camp", city: "London", state: nil, zip_code: nil, site_url: "http://www.FireTechCamp.com", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Fire Tech Camp is running day camps during term breaks and summer holidays to teach kids foundations of computer science.  Courses available this spring and summer include video game programming, mobile app development and robotics.  Build something amazing!", format: "All-day workshop (up to 1 week)", street: "Exhibition Road", longitude: -0.174115, latitude: 51.4982, contact_email: "info@firetechcamp.com", phone: "07798928057", languages: "---\n- Appshed\n- Arduino\n- Enchanting\n- Game salad\n- Mindstorms\n- Mobile Apps\n", country: nil},
