  {name: "Shorecrest Prep School", city: "St. Petersburg", state: "FL", zip_code: 33703, site_url: "http://www.shorecrest.org", ed_level: "---\n- High School\n", bio: "Shorecrest Upper Division uses Arduino and Raspberry Pi to learn C, PHP, Scratch, and Processing.  We spend a quarter on C learning the basics of programming, a quarter on PHP and HTML to learn web design programming and then put them together for the last two quarters to learn Arduino, Electronics, Processing and Schematics.  ", format: "Daily programming course", street: "5101 First Street Northeast", longitude: -82.6322, latitude: 27.8195, contact_email: "", phone: "", languages: "---\n- Arduino\n- C\n- HTML\n- PHP\n- Processing\n- Python\n- Scratch\n", country: nil},
  {name: "Ithaca College", city: "Ithaca", state: "NY", zip_code: 14850, site_url: "http://www.ithaca.edu/hs/depts/cs/", ed_level: "---\n- College\n", bio: "From the fine arts to the natural sciences, computers are used to enable creativity, enhance skills, and explore new horizons. The Department of Computer Science at Ithaca College embraces this vital and exciting definition of computing and computers. \r\n\r\nYou don't see yourself as the stereotypical computer programmer? Neither do we! If your interest is in computing as a way to make a career or make a difference, we encourage you to major in CS and minor in another area.", format: "Full university CS curriculum", street: "953 Danby Road", longitude: -76.496, latitude: 42.4196, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Objective-c\n- PHP\n- Python\n", country: nil},
  {name: "Stark State College", city: "North Canton", state: "OH", zip_code: 44720, site_url: "http://www.starkstate.edu/academic-programs/computer-science-engineering-tech", ed_level: "---\n- College\n", bio: "Nearly every facet of our lives today is affected by computers. Positions for personnel with computer skills are growing as organizations of all sizes need help to manage overwhelming amounts of information. Stark State College offers practical education to prepare graduates to fill this need.\r\n\r\nThe divisions curriculum is continuously updated to keep pace with the advances in the computer field and to provide timely education in a wide range of computer-related topics. In addition, students get hands-on experience in the classroom and in open labs with industry-approved computer hardware and software.\r\n\r\nSome Programs include:\r\nComputer Science and Engineering\r\nComputer Science and Engineering - Mobile App Development Major\r\nComputer Programming and Database\r\nWeb Design and Development", format: "Full university CS curriculum", street: "6200 Frank Ave. NW", longitude: -81.4393, latitude: 40.871, contact_email: "", phone: "330.494.6170", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n", country: nil},
  {name: "Mount Vernon High School", city: "Mount Vernon", state: "OH", zip_code: 43050, site_url: "http://www.mvcsd.us", ed_level: "---\n- High School\n", bio: "Allows students to actively learn HTML/CSS/JavaScript in one semester, and Visual Basic Design and Programming in another. Students will become active in projects and could start their career in Application Programming or Web Design with our class. Please call the number located above for more information.", format: "Daily programming course", street: "300 Martinsburg Road", longitude: -82.4754, latitude: 40.3805, contact_email: "kwiles@mvcsd.us", phone: "(740) 393-5900", languages: "---\n- Css\n- HTML\n- Javascript\n- Visual basic\n", country: nil},
  {name: "MTSSR", city: "Bandar seri begawan", state: "", zip_code: 0, site_url: "http://www.mtssr.edu.bn/", ed_level: "---\n- College\n- Vocational\n", bio: "Maktab Teknik Sultan Saiful Rijal (MTSSR) or Sultan Saiful Rijal Technical College was established in 1985 as a result of a merger between the Sekolah Bangunan Sultan Saiful Rijal (1970) and the Pusat Latehan Teknikal Brunei (1977).\r\n\r\nThe College is directly under the Technical Education Department, Ministry of Education. The Principal reports to the director of Technical Education Department (for detailed Ministry of Education Organisation Chart, please refer to www.moe.gov.bn).\r\n\r\nInternally, the Principal is responsible for the College administration. The Principal is assisted by two Deputy Principals; Deputy Principal (Administration) and Deputy Principal (Education & Training), and supported by Head of Department.\r\n\r\nThe College is one of the fastest growing technical institutions in Brunei Darussalam.\r\n\r\nToday, MTSSR is a full-fledged premier technical institution offering a wide range of courses in vocational and technical field.", format: "Daily programming course", street: "Simpang 125 Jalan Muara Bandar Seri Begawan BB2313 Negara Brunei Darussalam", longitude: nil, latitude: nil, contact_email: "", phone: "(673) 2331077", languages: "---\n- HTML\n- Java\n- Visual basic\n", country: nil},
