  {name: "Stanwood High School", city: "Stanwood", state: "WA", zip_code: 98292, site_url: "http://shsweb.stanwood.wednet.edu/", ed_level: "---\n- High School\n", bio: "I teach two programming classes right now:\r\n\r\n1) Introduction to Computer Programming and Game Design. \r\n2) Application Development for iPhone. \r\n\r\nThe Game Design course is an introductory level class for beginners. It is designed to teach programming principles in a fun and engaging way. The iPhone App class is a little more difficult, but still accessible for beginners if they are up for a challenge. I often recommend that students take the Game Design class first, then take the App class. ", format: "Daily programming course", street: "7400 272nd Street NW", longitude: -122.334, latitude: 48.2431, contact_email: "nhanson@stanwood.wednet.edu", phone: "(360) 629-1300", languages: "---\n- C++\n- Objective-c\n", country: nil},
