  {name: "Loyola Catholic Secondary School", city: "Mississauga", state: "ON ", zip_code: 0, site_url: "http://www.dpcdsb.org/LOYOL", ed_level: "---\n- High School\n", bio: "COMPUTER STUDIES COURSES \r\nDid you know that many university and college programs require students take a computer course in their first year that require knowledge in word processing, spreadsheets, database management and web page design. Many also require students take at least one programming course and it is highly recommended. Taking a computer studies course at Loyola C.S.S. students learn animation, web page design, networking database management, programming, game programming and planning, environmental stewardship and many programming languages. Computer Studies at Loyola fulfills the group 3 elective requirement for graduation. NOTE: Religion is counted as a Group 1 now you have more choices!!!!\r\nAn underscore _ = section i.e. ICS201, 1 indicates section number, section numbers are not listed below\r\nICS20_  - Introduction to Computer Studies, Grade 10, open\r\nICS3C_   - Introduction to Computer Programming , Grade 11 College\r\nICS3U_   Introduction to Computer Science, Grade 11 University\r\nICS4C_   Computer Programming, Grade 12 College\r\nICS4U_   Computer Science, Grade 12 University\r\nIDC4UW  - Interactive Web Development, Grade 12 University/College (no pre-requisite any course required)\r\n", format: "Daily programming course", street: "4010 Sladeview Cres.", longitude: nil, latitude: nil, contact_email: "lssteach15@hotmail.com", phone: "905-820-9822 EXT. 66218", languages: "---\n- Alice\n- Gamemaker\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Mysql\n- PHP\n- Python\n- Robocode\n- Scratch\n", country: nil},
