go\n- Python\n- Scheme\n", country: nil},
  {name: "American River College", city: "Sacramento", state: "CA", zip_code: nil, site_url: "http://www.arc.losrios.edu/", ed_level: "---\n- College\n", bio: "This program is a comprehensive exposure to programming\r\nlanguages, algorithms and problem solving in preparation\r\nfor upper division computer science courses. The Computer\r\nScience degree includes substantial course work in\r\nmathematics as is required by most university computer\r\nscience programs.", format: "Daily programming course", street: "4700 College Oak Drive", longitude: -121.329, latitude: 38.6939, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n", country: nil},
