  {name: "South Kent School-Intro CS", city: "South Kent", state: "CT", zip_code: 6785, site_url: "http://southkentschool.org/", ed_level: "---\n- High School\n- College\n", bio: "Introduction to Computing\r\nThis college-level computer-programming course is taught at South Kent School.   Students taking this course will have the opportunity to earn 3 college credits in computer engineering through Syracuse University.  SKS students will receive the benefit of discounted college tuition. \r\n\r\nThe course covers computing concepts, principles of programming, applications of computing concepts, and problem solving in engineering and computer science. Topics include programming basics, structures, functions, arrays, pointers, logic and object oriented programming.  Projects will include the creation of a video game and iPad app. Students interested in the fields of engineering or computer science should consider this course. Introduction to Computing is a full year course.\r\n\r\n\r\n\r\n\r\n", format: "Full university CS curriculum", street: "40 Bulls Bridge Road", longitude: -73.4748, latitude: 41.6779, contact_email: "", phone: "", languages: "---\n- C++\n", country: nil},
