  {name: "University Of Karachi", city: "Karachi", state: "Sind", zip_code: 75270, site_url: "http://www.uok.edu.pk/dcs-ubit", ed_level: "---\n- College\n- Vocational\n", bio: "University of Karachi, Department of Computer Science(UBIT) is the most reputed institute of Pakistan.\r\nThe Department of Computer Science offers BSCS as well as BSSE degree and teaches 120 BSCS students in the morning shift from 8:00am to 2:00pm,120 BSCS students,60 BSSE students in the evening shift from 3:00pm to 8:30pm.\r\nDays: Monday to Friday.\r\nStudents are enrolled on aptitude test basis.", format: "Full university CS curriculum", street: "UNIVERSITY OF KARACHI", longitude: 67.1209, latitude: 24.94, contact_email: "dcs@uok.edu.pk", phone: "99261300-06 Ext: 2462", languages: "---\n- C\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
