  {name: "Ideaventions-Middle School", city: "Oakton", state: "VA", zip_code: 22124, site_url: "http://www.ideaventions.com", ed_level: "---\n- Middle School\n", bio: "The kids asked and we listened! By the end of this camp, kids will have built an arcade game from the ground up. And the small and big games that will turn the ideaventions exhibit area into an arcade in September! \r\n\r\nOur project teams will consist of the game developers (Scratch for our younger campers and Game Maker for our older team) and arcade cabinet engineers and graphic designers. Of course, we can always design and develop mechanical games.", format: "Summer camp", street: "2952-H Chain Bridge Road", longitude: -77.3014, latitude: 38.8808, contact_email: "info@ideaventions.com", phone: "7032557202", languages: "---\n- Arduino\n- Gamemaker\n- Scratch\n", country: nil},
  {name: "Ideaventions", city: "Oakton", state: "VA", zip_code: 22124, site_url: "http://www.ideaventions.com", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "Current Schedule http://ideaventions.com/Labs.html\r\n\r\nideaventions is a science and technology enrichment center geared to children ages 3 to 13. We teach a range of science, technology, engineering and mathematics classes throughout the year at our Science Center located at the Hunter Mill Plaza in Oakton, Virginia. We also run science camps, do after-school programs at local schools, develop new STEM curriculum and lots more. ideaventions is a place where no idea is too crazy and where children, the adults of tomorrow, learn that anything is possible with a little creativity.\r\n\r\nOur hands-on labs are led by experienced teachers who emphasize divergent thinking and seek to harness a childs natural curiosity about our world. Our programs are designed to share and nurture childrens love for the sciences.", format: "Afterschool program", street: "2952-H Chain Bridge Road", longitude: -77.3014, latitude: 38.8808, contact_email: "info@ideaventions.com", phone: "7032557202", languages: "---\n- Arduino\n- C\n- Gamemaker\n- HTML\n- Java\n- Javascript\n- Lego mindstorms\n- Lego wedo\n- Python\n- Scratch\n", country: nil},
  {name: "Rock Valley College", city: "Rockford", state: "IL", zip_code: 61114, site_url: "http://www.rockvalleycollege.edu/Academics/CIS/index.cfm", ed_level: "---\n- College\n", bio: "Rock Valley College offers a variety of Computer Science college-level programming classes. \r\n\r\nC++, Java, C#, iOS, Android, and VisualBasic are offered in a variety of formats. \r\n\r\nWe also offer an Associates in Applied Science (A.A.S.) degree in Programming", format: "Full university CS curriculum", street: "3301 N. Mulford Rd", longitude: -88.9956, latitude: 42.3081, contact_email: "r.gocken@rockvalleycollege.edu", phone: "815 921 3101", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
  {name: "Boulder Country Day", city: "Boulder", state: "CO", zip_code: 80301, site_url: "http://www.bouldercountryday.org", ed_level: "---\n- Middle School\n", bio: "Middle School Introduction to Programming Class teaches basic programming concepts and provides opportunities for students to discover the power of code.  Teaches Python, SmallBASIC, and Scratch, and Alice.", format: "Daily programming course", street: "4820 Nautilus Ct. N", longitude: -105.202, latitude: 40.0631, contact_email: "ghernan@bouldercountryday.org", phone: "3035274931", languages: "---\n- Alice\n- Python\n- Scratch\n- Smallbasic\n", country: nil},
  {name: "Mountlake Terrace High School", city: "Mountlake Terrace", state: "WA", zip_code: 98043, site_url: "http://www.edmonds.wednet.edu/mths", ed_level: "---\n- High School\n- College\n", bio: "The STEM Magnet High School at Mountlake Terrace High\r\n3 courses:\r\n Intro to Computer Programming;\r\n Computer Science Principles;\r\n AP Computer Science A;\r\n\r\nFIRST Robotics Team 1778;\r\nFIRST FTC Teams: 3018, 3940, 4434(all girls team) ", format: "AP Computer Science", street: "21801 44th Ave W", longitude: -122.29, latitude: 47.8021, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n- Processing\n- Scratch\n", country: nil},
  {name: "Cabrillo College", city: "Aptos", state: "CA", zip_code: 95003, site_url: "http://www.cabrillo.edu", ed_level: "---\n- College\n", bio: "Computer Science is the study of computers and computing. It is the intelligence and creativity of the computer scientist that is responsible for the technological innovations that have so radically transformed every aspect of our society and our lives. Computer science is a fascinating and challenging subject that deals with big questions like, \"What is intelligence and can we reproduce it in a machine?\" Or, \"How do we make sense out of the billions of gigabytes of data on the Internet?\" As a computer science student, you will explore these exciting topics and many more.\r\nThere is also a class \"Intro to Programing\" for non-majors.", format: "Daily programming course", street: "6500 Soquel Drive", longitude: -121.925, latitude: 36.9884, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n", country: nil},
  {name: "Ohana Institute", city: "Panama City Beach", state: "FL", zip_code: 32461, site_url: "http://www.ohanainstitute.org", ed_level: "---\n- Middle School\n- High School\n", bio: "Intro to Technology course helps students develop a knowledge of the fields of technology so that they can; 1. Be more informed of what is available, and 2. Learn what interests them so that they continue their technology education with a better focus. They will learn the purpose behind each field, and how they each fit into the broader picture of the connected world. One of the peices to this course is coding.", format: "Other", street: "82 Barrett Sq.", longitude: -86.016, latitude: 30.2798, contact_email: "Ohana Institute", phone: "8502311140", languages: "---\n- HTML\n- Kodu\n- PHP\n- Scratch\n", country: nil},
  {name: "Cerritos College", city: "Norwalk", state: "CA", zip_code: 90650, site_url: "http://www.cerritos.edu/", ed_level: "---\n- College\n", bio: "The Computer and Information Sciences Department offers programs which prepare students to meet the challenges of the Information Technology (IT) industry as well as transfer to a four-year college or university.\r\nWe have programs to prepare you to work as a software developer, systems analyst, system administrator/operator, networking technician, database administrator, and web site/page designer.", format: "Daily programming course", street: "11110 Alondra Blvd.", longitude: -118.098, latitude: 33.8841, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n", country: nil},
  {name: "Littleton High School", city: "Littleton", state: "NH", zip_code: 3561, site_url: "http://www.littletonschools.org/", ed_level: "---\n- High School\n", bio: "Web page Designed using HTML code.", format: "Daily programming course", street: "102 School St.", longitude: -71.7722, latitude: 44.311, contact_email: "", phone: "", languages: "---\n- HTML\n", country: nil},
  {name: "Marlboro High School", city: "Marlboro Township", state: "NJ", zip_code: 7746, site_url: "http://frhsd.com", ed_level: "---\n- High School\n", bio: "Every Wednesday from 3 PM to 4 PM, we meet and create coding projects using PHP, HTML, and JavaScript.", format: "Afterschool program", street: "95 N Main St", longitude: -74.2461, latitude: 40.3294, contact_email: "phil@fishbe.in", phone: "", languages: "---\n- HTML\n- Javascript\n- PHP\n", country: nil},
  {name: "Digital Media Academy at UCLA", city: "Los Angeles", state: "CA", zip_code: 90095, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/university-of-california-los-angeles/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Youth and teens looking for an unforgettable summer camp experience will love Digital Media Academys summer camps at UCLA. Teens can combine their love of action sports with filmmaking, pre-teens can learn to create Hollywood visual effects on film, and kids can enjoy adventures in 2D and 3D game creation. Combined with fun enrichment activities for boys and girls, Digital Media Academys summer computer camps will engage both youth and high school students. Options for both day camps and residential overnight camps give your family flexibility if you want to combine camp with a family vacation in Southern California, enjoying the attractions of Los Angeles, Santa Monica, Anaheim, or Beverly Hills. Digital Media Academy Film camps are accredited by Stanford University Continuing Studies.", format: "Summer camp", street: "405 Hilgard Ave", longitude: -118.443, latitude: 34.0707, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at UC Irvine", city: "Irvine", state: "CA", zip_code: 92617, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/university-of-california-irvine/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "For students who want a pre-collegiate experience at a college theyre interested in attending or just wanting to get away for the summer and explore a new city, Digital Media Academy offers the best of both worlds.\r\n\r\nLearn on the University of Californias Irvine campus, eat in the same dining halls as UCI students and campers ages 12+ can even stay overnight. Digital Media Academy selected UCI not only because of its cutting-edge programs and acclaimed research, but because of its scenic Southern California locationthe university is just minutes from the Pacific Ocean. While visiting the campus see buildings used in such films as Oceans Eleven and Conquest of the Planet of the Apes.", format: "Summer camp", street: "510 Aldrich hall #5", longitude: -117.843, latitude: 33.6488, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at UCSD", city: "San Diego", state: "CA", zip_code: 92093, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/university-of-california-san-diego/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Digital Media Academys summer camps at UCSD offer the perfect blend of challenge and fun. Teens and pre-teens can combine their passion for skateboarding or surfing with filmmaking to produce  and star in  their own action film, while kids can explore their interests in music and video production, 3D game development, or digital art and photography. These computer camps offer something for every interest. Teens and youth will learn valuable skills, make new friends, and enjoy a pre-college experience by spending part of their summer with Digital Media Academy on the campus of one of Americas best universities.", format: "Summer camp", street: "9500 Gilman Dr", longitude: -117.242, latitude: 32.8806, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at UT Austin", city: "Austin", state: "TX", zip_code: 78712, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/the-university-of-texas-at-austin/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Digital Media Academys summer camps at UCSD offer the perfect blend of challenge and fun. Teens and pre-teens can combine their passion for skateboarding or surfing with filmmaking to produce  and star in  their own action film, while kids can explore their interests in music and video production, 3D game development, or digital art and photography. These computer camps offer something for every interest. Teens and youth will learn valuable skills, make new friends, and enjoy a pre-college experience by spending part of their summer with Digital Media Academy on the campus of one of Americas best universities.", format: "Summer camp", street: "1 University Station", longitude: -97.7336, latitude: 30.3714, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "College of St. Scholastica", city: "Duluth", state: "MN", zip_code: 55811, site_url: "http://www.css.edu/Academics/Business-and-Technology/Undergraduate-Areas-of-Study/Computer-Information-Systems.html", ed_level: "---\n- College\n", bio: "Computer Science/Computer Information Systems at St. Scholastica is an innovative alternative to the computer science programs offered at many colleges and universities. Students in the program learn current and emerging computer technologies and the means to apply these system technologies in solving organizational problems.", format: "Full university CS curriculum", street: "1200 Kenwood Ave", longitude: -92.1041, latitude: 46.8164, contact_email: "", phone: "218-723-6000", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
  {name: "Digital Media Academy at UT Austin", city: "Austin", state: "TX", zip_code: 78712, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/the-university-of-texas-at-austin/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "At Digital Media Academy summer camps at UT Austin, kids and teens get to explore their interests, have fun with other kids, and create a project that is uniquely theirs. These tech camps, for one or multiple weeks with options for day camp or overnight/sleepaway camp, will give young people a chance to try their hand at a wide range of projects under the direction of experienced industry professionals who love teaching kids. Whether they choose to explore filmmaking, game development, music and video production, web design, or cartoon creation, your kids will enjoy Texas-sized fun in a safe and supportive environment.\r\n", format: "Summer camp", street: "1 University Station", longitude: -97.7336, latitude: 30.3714, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at U of Chicago", city: "Chicago", state: "IL", zip_code: 60637, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/the-university-of-chicago/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "If your child or teen is looking for a summer camp that will give them a chance to learn more about digital media while having fun in the Windy City, Digital Media Academys summer computer camps will provide an amazing experience they wont forget. With day camp or residential camp programs, teens and pre-teens in the Digital Media Academy summer camps can explore game programming with Python or C++, digital filmmaking, 3D game development, music and video production, or 3D role playing games and strategy. Kids ages 6-8 and 9-12 will embark on adventures in comic creation, digital photography, and web design. At the University of Chicago, Digital Media Academy campers will enjoy a pre-college experience while producing digital projects of their very own.", format: "Summer camp", street: "5801 South Ellis Avenue", longitude: -87.6014, latitude: 41.7898, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at U of Toronto", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/university-of-toronto/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "For students who want a pre-collegiate experience at a college theyre interested in attending or just wanting to get away for the summer and explore a new city, Digital Media Academy offers the best of both worlds.\r\n\r\nLearn on the University of Toronto campus, eat in the same dining halls as U of T students and ages 12+ can even stay overnight. Digital Media Academys tech camp at the University of Toronto is critically acclaimed. DMA selected the University of Toronto not only because of the campus heritage and history, but because of its location. If youre looking to inspire your son or daughter, or get them on the fast track for a career, look no furtherDMA is the best tech camp in Canada.", format: "Summer camp", street: "172 St George St", longitude: -79.4004, latitude: 43.6681, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at Georgia Tech", city: "Atlanta", state: "GA", zip_code: 30332, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/georgia-tech/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "For students who want a pre-collegiate experience at a college theyre interested in attending or just wanting to get away for the summer and explore a new city, Digital Media Academy offers the best of both worlds.\r\n\r\nLearn on the Georgia Tech campus, eat in the same dining halls as GT students and campers ages 12+ can even stay overnight. Digital Media Academy selected Georgia Tech not only because of its sterling reputation among engineering schools, but because of its superior campus location in the heart of Atlanta.\r\n", format: "Summer camp", street: "225 North Ave NW", longitude: -84.3951, latitude: 33.7724, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at George Washington University", city: "Washington", state: "DC", zip_code: 20052, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/george-washington-university/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Its an exciting time to be a young person in DC, and Digital Media Academy summer camps at GW multiply the fun factor. Teens, pre-teens and kids can choose from an amazing variety of camps, including action sports filmmaking, programming with C++, game design, role playing games, art and digital photography, or robotics. Beyond the computer lab, teens and kids can explore the nations capital with their fellow campers during DMA-organized group excursions. With options for day camps and residential overnight programs, Digital Media Academy summer camps at George Washington give your family the flexibility to plan a vacation in the DC area while your teen or kid enjoys this unique summer enrichment experience.\r\n", format: "Summer camp", street: "2100 M Street #310", longitude: -77.0468, latitude: 38.905, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at Swarthmore College", city: "Swarthmore", state: "PA", zip_code: 19081, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/swarthmore-college/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Summer camp at Swarthmore with Digital Media Academy beckons for those teens and kids who love learning new computer skills. Whether they choose day or sleepaway options, campers at Swarthmore get plenty of hands-on experience to create their own unique digital projects. Teens can choose from camps focused on programming with JAVA, 3D game creation, digital filmmaking or other programs. Kids ages 6-12 can choose their own adventures such as acting and movie making, game creation, or robotics. With so many choices, there is something for every kid and teen. Your child will love these summer enrichment camps.\r\n", format: "Summer camp", street: "500 College Ave", longitude: -75.3545, latitude: 39.9041, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at Drexel", city: "Philadelphia", state: "PA", zip_code: 19104, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/drexel-university/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Summer camp with Digital Media Academy at Drexel will give your teen or child a unique opportunity to learn game development for the iPhone, flash scripting for web design, digital art and Photoshop, robotics, or any one of many other camp options. These summer camps, with day or overnight options, allow teens, pre-teens, and kids ages 6 to 18 to express their creativity and produce their own projects using state-of-the-art equipment. In addition, for those teens who want in-depth knowledge, Digital Media Academys two-week programs in game design and filmmaking provide an intensive learning experience for teens. Whatever camp they choose for summer enrichment, your kids will have a grand adventure at Drexel with Digital Media Academy.", format: "Summer camp", street: "3141 Chestnut St", longitude: -75.187, latitude: 39.9538, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at Concordia New York", city: "Bronxville", state: "NY", zip_code: 10708, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/new-york-city-concordia-college/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Kids and teens in the New York City area will enjoy the summer day camp program at Concordia College, hosted by Digital Media Academy. Whether teens take on a new challenge in digital filmmaking or robotics, or whether kids sign up for 3D game design or cartoon creation, they will love learning more about their favorite activities while making friends with others who share their interests. Kids ages 6 to 18 will have a great pre-college experience at Concordia, where Digital Media Academy camps combine entertainment and learning in a supportive, safe environment.\r\n", format: "Summer camp", street: "171 White Plains Rd", longitude: -73.8207, latitude: 40.9425, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at Marymount Manhattan", city: "New York", state: "NY", zip_code: 10021, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/marymount-manhattan/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "For students who want a pre-collegiate experience at a college theyre interested in attending or just wanting to get away for the summer and explore a new city, Digital Media Academy offers the best of both worlds.\r\n\r\nLearn on the Marymount Manhattan College campus, eat in the same dining hall as its students and campers ages 12+ can even stay overnight. Digital Media Academy selected MMC not only because of its impeccable reputation as a liberal arts college, but also because of its superior campus location within New York City.\r\n", format: "Summer camp", street: "221 E 71st St", longitude: -73.9601, latitude: 40.7687, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
  {name: "Digital Media Academy at Yale University", city: "New Haven", state: "CT", zip_code: 6520, site_url: "http://www.digitalmediaacademy.org/locations/kids-teens-locations/yale-university/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "The world's #1 pre-college summer art and technology camp for kids and teens. Choose film camp, game design camp, iPhone programming, robotics, app development & more!\r\n\r\nToday, Yale has matured into one of the worlds great universities and was recently named the top university in the U.S. by U.S. News and World Report. Its 11,000 students come from all fifty American states and from 108 countries. Yales 260 buildings include contributions from distinguished architects of every period in its history. Styles range from New England Colonial to High Victorian Gothic, from Moorish Revival to contemporary.\r\n", format: "Summer camp", street: "Yale", longitude: -72.9221, latitude: 41.3165, contact_email: "info@digitalmediaacademy.org", phone: "18666563342", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scheme\n- Scratch\n", country: nil},
