  {name: "Warren Mott High School", city: "Warren", state: "MI", zip_code: 48092, site_url: "http://www.wcs.k12.mi.us/wmhs/", ed_level: "---\n- High School\n", bio: "The class offered at Warren Mott High School is a common web design, semester long course. This course can be taken as many times as the student wishes. In this class students learn HTML5 basics, CSS, as well as learning to use the programs Adobe Photoshop/Dreamweaver CS5. There is also the option for the students to learn Javascript/jQuery. (Often times this is learned in the Web Design 2+ courses). In Web Design 1, students follow simple instructions used to help them along the learning process of HTML5 and CSS. They then use that knowledge to create their own, simple website. This website is completely of their own design and they have complete freedom on which topic is chosen. They may even use an aspect of the WMHS website to work on, and if it's good enough, it may even be edited and used. In the Web Design 2+ courses students work on various aspects of the WMHS Website. The Warren Mott High School website is completely student driven, as each and every page is coded and filled with information by the students. ", format: "Daily programming course", street: "3131 Ryan Road", longitude: -83.0676, latitude: 42.5133, contact_email: "", phone: "", languages: "---\n- Css\n- HTML\n- Java\n- Javascript\n", country: nil},
