  {name: "Jackson Hole Middle School", city: "Jackson", state: "WY", zip_code: 83001, site_url: "http://tcsd.org", ed_level: "---\n- Middle School\n", bio: "Computer Creations is a one quarter class at JH Middle School.  We explore computer science using Scratch, developed by MIT's Media Lab.  This class is currently offered only to 8th grade students as one of the Encore options.\r\n\r\nWeb creations is another one quarter class at JH Middle School that gives students an introduction to coding web pages using HTML.  ", format: "Other", street: "P O Box 568", longitude: -110.762, latitude: 43.4799, contact_email: "bsanchez@tcsd.org", phone: "307-732-3777", languages: "---\n- HTML\n- Scratch\n", country: nil},
  {name: "Green River Community College", city: "Auburn", state: "WA", zip_code: 98092, site_url: "http://www.greenriver.edu", ed_level: "---\n- College\n- Vocational\n", bio: "At Green River Community College, we offer the following academic programming courses through our Computer Science department:\r\nCS 120: Introduction to Programming (Python), CS& 141: Introduction to Computer Science - Java, CS 145: Java 2, CS& 131: Introduction to Computer Science - C++, and CS 132: C++ Data Structures.\r\n\r\nIn addition, Green River Community College offers the following professional-technical programming courses through our Information Technology department:\r\nIT 102: Programming for IT Professionals (C#), IT 121: Introduction to HTML (HTML and CSS), IT 201: Fundamental Database Design (SQL), IT 203: Web Client Development (JavaScript), IT 282: Android Application Development (Java), IT 283: iOS Application Development (Objective-C), IT 385: Scripting for Windows and Linux (PowerShell and BASH)\r\n\r\nPlease visit our website at www.greenriver.edu and browse our Catalog for course descriptions and our Course Schedule for current course offerings.", format: "Daily programming course", street: "12401 SE 320th Street", longitude: -122.179, latitude: 47.3135, contact_email: "khang@greenriver.edu", phone: "", languages: "---\n- Bash\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Powershell\n- Python\n- Sql\n", country: nil},
  {name: "University of Melbourne", city: "Parkville", state: "VIC", zip_code: 3010, site_url: "http://msi.unimelb.edu.au", ed_level: "---\n- College\n", bio: "Melbourne offers a range of flexible options to study IT at the undergraduate level. Choose from three IT majors, IT breadth subjects or a Concurrent Diploma. Whatever your undergraduate program, Melbourne has an IT option for you.\r\n\r\nStudy Options\r\n\r\nBachelor of Science: Informatics Major\r\n\r\nInformatics is about using computers to work with digital information: gathering, using, storing, retrieving, and visualising information and data. It's the study of tools and technologies to solve problems in all types of settings, like finance and economics, journalism, biology, health, engineering, communication.\r\n\r\nBachelor of Science: Computing & Software Systems Major\r\n\r\nThe Computing and Software Systems major is designed for students who wish to develop considerable technical expertise, including exposure to a variety of programming paradigms, an understanding of the software development life-cycle and other key computing topics.\r\n\r\nBachelor of Science & Bachelor of Environments: Geomatics Major\r\n\r\nA Geomatics major will develop your knowledge of spatial measurement and analysis for both the human and natural environment. Your studies will integrate disciplines such as the mapping sciences, geographic information systems, remote sensing, geodesy and surveying.\r\n", format: "Full university CS curriculum", street: "Gratton St", longitude: 144.958, latitude: -37.7998, contact_email: "13melb@unimelb.edu.au", phone: "+61 3 9035 5511", languages: "---\n- C++\n- HTML\n- Java\n- Python\n", country: nil},
