  {name: "Cerro Cosa College", city: "Ridgecrest", state: "CA", zip_code: 93555, site_url: "http://www.cerrocoso.edu/", ed_level: "---\n- College\n", bio: "The Computer Science Associate in Science Degree (60 units total, 31 units in the major) is designed to prepare students for transfer to a four-year institution to continue studies in Computer Science or comparable programs. Upon completion of the degree, the student will be able to demonstrate and understanding of the fundamental mathematical and scientific principles underlying computing and information processing, apply knowledge of the principles of computer science to a variety of problems, and understand the fundamentals of computer organization, architecture, and data structures.", format: "Daily programming course", street: "3000 College Heights Blvd", longitude: -117.671, latitude: 35.5676, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n", country: nil},
  {name: "Chaffey College", city: "Rancho Cucamonga", state: "CA", zip_code: 91737, site_url: "http://www.chaffey.edu/", ed_level: "---\n- College\n", bio: "The Computer Information Systems (CIS) Program is designed to prepare students for entry-level employment positions and careers in information technology, to upgrade current skills for those already employed, to provide a foundation for students who plan to transfer to a four-year educational program in CIS, or to provide computer competency for non-CIS majors.\r\n\r\nThe CIS Program at Chaffey College continuously strives to meet the overwhelming industry need for trained\r\ninformation technology personnel. The program offers many classes and certificates that enable students to meet job and career goals. The Chaffey College Information Technology Center enables the CIS Program to offer a schedule of classes to meet the increasing need for trained information technology professionals. Several classes and certificate programs are available online.\r\n\r\n\r\nGainful Employment Disclosure Information\r\n\r\n\r\n\t\r\n\t\r\n", format: "Daily programming course", street: "5885 Haven Avenue ", longitude: -117.575, latitude: 34.1463, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Ruby\n- Visual basic\n", country: nil},
