  {name: "Cristo Rey New York High School - ScriptEd, Inc. ", city: "New York", state: "NY", zip_code: 10029, site_url: "http://scriptednyc.org", ed_level: "---\n- High School\n", bio: "ScriptEd is a nonprofit organization that brings computer programming instruction to students in high-needs schools.  Courses are taught twice weekly (either during the school day or after-school depending on the school) by volunteers from the tech industry.  ScriptEd students also participate in field trips, job shadowing and apprenticeship opportunities. ScriptEd's Foundations course teaches HTML, CSS and Javascript, and its subsequent practicum courses will teach students additional languages.  ScriptEd's programming is currently offered in two high schools in Harlem, NY, and will expand to additional schools next Fall.", format: "Other", street: "112 E 106th St", longitude: -73.9471, latitude: 40.7928, contact_email: "mcouvares@scriptednyc.org", phone: "", languages: "---\n- HTML\n- Javascript\n", country: nil},
