  {name: "Wonder-Space Computer & Technology Summer Camp", city: "Houston", state: "TX", zip_code: 77027, site_url: "http://www.wstechcamp.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Wonder-Space Computer & Technology Summer Camp was created 10 years ago by a Rice graduate who saw the need for a \"space\" where kids could develop hi-tech skills and unleash their imagination in a fun yet educational environment. Each year we continue to make changes to WSTechCamp to improve each camper's experience so that their passion for technology can evolve into practical and technical skills that they can use in every day life. \r\nEverything from our curricula to our counselors is focused on giving children and teens an opportunity to explore their talents and feel confident about their accomplishments. We offer 25+ weekly courses for campers ages 6-17 varying from Game Design to Xcode Programming. WSTechCamp now has 8 locations: Houston, The Woodlands, Downtown & North Austin, Dallas, Chicago, Washington DC and Potomac (MD). We are completely dedicated to motivate our future generations driven by their love for technology. We truly believe that if they can dream it, they can DO IT!", format: "Summer camp", street: "2900 Weslayan, Suite 545", longitude: -95.4422, latitude: 29.7385, contact_email: "info@wonder-space.com", phone: "7135292241", languages: "---\n- C++\n- Java\n- Ruby\n- Scratch\n- Xcode\n", country: nil},
