  {name: "City College of San Francisco", city: "San Francisco", state: "CA", zip_code: 94112, site_url: "http://www.ccsf.edu/NEW/", ed_level: "---\n- College\n", bio: " CCSFs Computer Science Department chair and 14 other faculty offer some 60 courses, 9 certificates and two AS degrees to some 1,200 students per semester in traditional computer science programming technologies.  75% of CS students enroll in core introductory programming courses and are just starting college, 55% of those taking evening or Saturday classes have at least a Bachelor's degree, 35% of students are currently working in the computer industry, and 31% of students are full-time.  The main department office is on the Ocean Campus, Batmale Hall, Room 456.  Call (415) 239-3963 for more information\r\n\r\n", format: "Daily programming course", street: " 50 Phelan Avenue", longitude: -122.453, latitude: 37.7272, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Xhtml\n", country: nil},
