  {name: "The Mount Washington School", city: "Baltimore", state: "MD", zip_code: 21209, site_url: "http://sunraa.github.com/mwscratch", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Programming With Scratch is designed to be a 10-week introduction to basic programming concepts for 4th through 7th graders. This after-school session will be held from February 6th, 2013 to April 10th, 2013 and the class will meet once a week on Wednesdays from 3:15pm to 4:15pm at the Mount Washington School Upper Building computer lab. Each class session will consist of about 15-20 minutes of lecture where we will cover specific programming, math, or software engineering topics. We will then use the remainder of the session (about 45 minutes) to build the assignment of the day. The primary emphasis is on how to use programming to solve problems.\r\n\r\nMathematical concepts will be covered as necessary but a basic fluency in the following is recommended: cartesian coordinate systems, geometry, concept of negative numbers, and some pre-algebra. You will be taught all the math you need to know. \r\n", format: "Afterschool program", street: "1801 Sulgrave Ave", longitude: -76.6549, latitude: 39.3658, contact_email: "sunraa@hotmail.com", phone: "6176292577", languages: "---\n- Scratch\n", country: nil},
