  {name: "Summit Technology Academy", city: "Lee's Summit", state: "MO", zip_code: 64086, site_url: "http://sta.leesummit.k12.mo.us/software.php", ed_level: "---\n- High School\n", bio: "Summit Technology Academy is a shared-time academy.   There is a morning session and an afternoon session offered to students so they can still access their core classes back in their home high school.  The sending school districts pay the tuition to attend the Academy.  The Academy follows the Project Lead the Way curriculum for computer software engineering.  This course will introduce computer science concepts, code writing, networking concepts, privacy, security, discrete mathematics, probability, data visualization, computability and artificial intelligence.  Students will use environments such as Scratch, HTML, CSS, PHP, MySQL, AppInventor, Python or Processing.", format: "Daily programming course", street: "777 NW Blue Parkway", longitude: -94.3963, latitude: 38.9316, contact_email: "elaine.metcalf@leesummit.k12.mo.us", phone: "816-986-3410", languages: "---\n- HTML\n- Mobile Apps\n- Processing\n- Python\n- Scratch\n", country: nil},
  {name: "Peabody Charter Elementary School", city: "Santa Barbara", state: "CA", zip_code: 93105, site_url: "http://www.peabodycharter.org", ed_level: "---\n- Elementary\n", bio: "Beginning Computer Science\r\n", format: "Afterschool program", street: "3018 Calle Noguera", longitude: -119.728, latitude: 34.4423, contact_email: "jrodriguez@peabodycharter.org", phone: "8055631172", languages: "---\n- Python\n", country: nil},
  {name: "Strath Haven High School", city: "Nether Providence Township", state: "PA", zip_code: 19086, site_url: "http://www.wssd.org/shhs", ed_level: "---\n- High School\n", bio: "Courses offered:\r\nIntro to Computer Science (MIT App Inventor, Python, html)\r\nThis course serves as an introductory computer science course. The major thrust is on computer programming, using MITs App Inventor, Python, and Java, though other computer science topics are explored, such as human-computer interaction, problem solving, and computing applications.\r\n\r\n\r\nAP Computer Science (Java)\r\n\r\nAdvanced Programming (Java, C++)\r\nThis course provides an opportunity for students to study advanced data structures and algorithms. Object-Oriented Programming is emphasized. In C++, files, dynamic data structures such as pointers and linked lists, stacks, queues, and binary trees are studied. In Java, classes, interfaces, and polymorphism are introduced. \r\n\r\nVideo Game Design (Scratch, Java)\r\nStudents dive into the creative game-making process, from theory to project completion. Current software is used to create complex, realistic video games, including health meters, collision detection, multiple levels, and\r\ncharacter behaviors.\r\n\r\nAdvanced Video Game Design (Java, C#)\r\nIn this course, the world of computer games is explored through hands-on applications and modern programming techniques. Students will develop their own game from initial idea through finished product. \r\n\r\nMultimedia Web Design (html, JavaScript)\r\nThis course is project-based, utilizing numerous multimedia and Web-based technologies. With a focus on computergenerated projects, students work individually or in groups with digital technologies and the internet. Student gain experience in a number of software packages, including software from the Adobe Creative Suites. Students explore HTML, web design, web based presentation software, and other current topics. As a culminating project, students develop a professional quality website.", format: "AP Computer Science", street: "205 S. Providence Road", longitude: -75.3717, latitude: 39.8964, contact_email: "kmclead@wssd.org", phone: "610-892-3470 ", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scratch\n", country: nil},
  {name: "Second Baptist School", city: "Houston", state: "TX", zip_code: 77057, site_url: "http://www.secondbaptistschool.org", ed_level: "---\n- High School\n", bio: "Objective C & Mobile App Programming\r\n\r\nThis course introduces students to an object-oriented model of programming for the iOS and Mac OS X operating systems. This course shows how programs can be broken into classes and objects. Unlike conventional procedural programming, we will reverse engineer our programs, by assigning specific procedures to a created object. By emphasizing design, this course shows how to implement programs and evaluate design to develop an optimal program. Objective C is primarily used in Mac OS X and iOS environments in which students are expected to design, implement, and debug their object-oriented programs.", format: "Daily programming course", street: "6410 Woodway", longitude: -95.4982, latitude: 29.7557, contact_email: "bskidmore@secondbaptistschool.org", phone: "713-365-6065", languages: "---\n- Java\n- Mobile Apps\n", country: nil},
