  {name: "RECT - Romeo Engineering and Technology Center ", city: "Washington", state: "MI", zip_code: 48094, site_url: "http://mrskarengardnersclassroom.weebly.com/mst-computer-programming.html", ed_level: "---\n- High School\n", bio: "MST Computer Programming in Java, a high-level, object-oriented programming language first developed by Sun  Microsystems, now supported by Oracle. It is similar to C++, but has been simplified to eliminate language features that cause common programming errors. Java is a general purpose programming language with a number of features that make the language well suited for use on the Web.  Students in this class are also introduced to creating phone apps and study HTML (web pages).  HTML is short for HyperText Markup Language. HTML is  the authoring language used to create documents on the Web! ", format: "Daily programming course", street: "6200 Jewell Road", longitude: -83.0171, latitude: 42.7327, contact_email: "karen.gardner@romeo.k12.mi.us", phone: "1-586-752-0245", languages: "---\n- HTML\n- Java\n- Mobile Apps\n- Scratch\n", country: nil},
