  {name: "The Ethel Walker School", city: "Simsbury", state: "CT", zip_code: 6070, site_url: "http://www.ethelwalker.org", ed_level: "---\n- High School\n", bio: "Introduction to Computer Science - We teach girls how to solve problems by using computational thinking.  Through the course they learn the process of breaking down problems into small, easily solved problems and create real-world solutions.  The class is designed to allow the girls to think differently, understand how to handle the exceptions, not just the rule and become truly exceptional thinkers.", format: "Daily programming course", street: "230 Bushy Hill Road", longitude: -72.834, latitude: 41.8494, contact_email: "", phone: "", languages: "---\n- HTML\n- Javascript\n- Logo\n- Python\n", country: nil},
  {name: "S.Teja Singh Kandhari Sen. Sec. School", city: "Patiala", state: "PB", zip_code: 147001, site_url: "http://www.civilplay.tk/", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "We Provide Private tuitions Including Code. At just 1000-2500 indian ruppees per course.", format: "Other", street: "B37/538 galli sarup chand vakil near anardana chownk", longitude: 76.3951, latitude: 30.3206, contact_email: "playcivil@gmail.com", phone: "+919988994441", languages: "---\n- C++\n- Cascadingh stylesheets\n- HTML\n- Java\n- Javascript\n- PHP\n", country: nil},
  {name: "Friends Select School", city: "Philadelphia", state: "PA", zip_code: 19103, site_url: "http://www.friends-select.org/default.aspx?relid=33637", ed_level: "---\n- High School\n", bio: "Courses:Computer Science, \r\nAdvanced Computer Science, \r\nRobotics, \r\nIntro to Electronics", format: "AP Computer Science", street: "1651 Benjamin Franklin Parkway", longitude: -75.1678, latitude: 39.9559, contact_email: "", phone: "", languages: "---\n- Alice\n- HTML\n- Java\n", country: nil},
  {name: "The Marvelwood School", city: "Kent", state: "CT", zip_code: 6757, site_url: "http://www.marvelwood.org", ed_level: "---\n- High School\n", bio: "Introduction to Computing\r\n\r\nThe course covers concepts and application of programming, and problem solving. Topics include programming basics, functions/subroutines, arrays, program flow (loops, conditionals) and basic I/O functions. The focus of the course is to introduce students to the world of programing -- with emphasis on how programing is used in business and not necessarily on game programing, but elements of that genre are explored.  This is a year-long course, broken into three sections.  \r\n\r\nThe first section covers HTML/JavaScript through the use of student-created projects using Microsoft's Visual Web Developer Express platform. The students learn how to use the Integrated Development Environment (IDE) to build web pages, and to incorporate JavaScript into those pages.  The course covers the commonly used page elements such as text boxes, radio buttons, check boxes, buttons, and discusses the JavaScript programming language and how it is used within web pages. To illustrate the concepts, students build web pages for fictional companies (e.g. restaurant surveys).\r\n\r\nThe second section covers Visual Basic using Microsoft's Visual Basic .Net Express platform.  The students learn how to use the Integrated Development Environment (IDE) to develop fully functional windows-based programs. The course covers the commonly used windows-based elements such as text boxes, buttons, drop down lists, menus, dialog boxes, as well as the Basic programming language.  To illustrate the concepts, the students create their own Notepad (a simple text editor) and a functional, lightweight web browser.\r\n\r\nThe third section covers Visual C# using Microsoft's Visual C# .Net Express platform. The students learn how to use this Integrated Development Environment (IDE) to develop fully functional windows-based programs.  The course covers the commonly used windows-based elements such as text boxes, buttons, drop down lists, menus, dialog boxes, as well as the C# programming language. To illustrate the concepts, the students create their own calculator and a lightweight version of Windows Media player -- an application that will let the students organize and play music files.", format: "Daily programming course", street: "476 Skiff Mountain Rd", longitude: -73.4585, latitude: 41.7823, contact_email: "tim.smith@marvelwood.org", phone: "8609270047", languages: "---\n- HTML\n- Javascript\n- Visual basic\n- Visual c#\n", country: nil},
  {name: "Governor's Institutes of Vermont", city: "South Burlington", state: "VT", zip_code: 5403, site_url: "http://www.giv.org", ed_level: "---\n- High School\n", bio: "The Governor's Institute on Information Technology is a one-week hands-on residential camp for Vermont high school students interested in getting into more depth with information technology.  Focus areas students can select include coding and cyber-security, graphic design or game design. Students are nominated by their schools to attend.  Sliding scale funding makes it affordable for all Vermont students.   ", format: "Summer camp", street: "4049 Williston Road #4", longitude: -73.1383, latitude: 44.4578, contact_email: "karen@giv.org", phone: "802-865-4448", languages: "---\n- Alice\n- C++\n- HTML\n- Languages vary by year and student interest.\n", country: nil},
  {name: "Allegany College of Maryland", city: "Lavale", state: "MD", zip_code: 21502, site_url: "http://www.allegany.edu/x227.xml", ed_level: "---\n- College\n", bio: "Courses offered online and at all three campus locations in Bedford County, PA, Somerset, PA and Cumberland, MD. 2-year transfer options in Computer Science, Information Systems, 2-year career programs, 1-year certificates and Letters of Recognition (LOR's) in programming. Courses include Java, C++, PHP, Visual Basic, HTML, Adobe Coldfusion.", format: "Full university CS curriculum", street: "12401 Willowbrook Rd", longitude: -78.7322, latitude: 39.6498, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- PHP\n", country: nil},
  {name: "Greater Altoona CTC", city: "Altoona", state: "PA", zip_code: 16602, site_url: "http://www.gactc.edu", ed_level: "---\n- Vocational\n", bio: "This three or four year course teaches students four different programming languages under the CIP Code 11.0201.  Students in grades nine through twelve from local school districts are allowed to attend this course as an elective.  In conjunction with the Oracle Corporation, a more rigorous curriculum named the Oracle Academy is taught in the second or third year.", format: "Daily programming course", street: "1500 Fourth Ave", longitude: -78.397, latitude: 40.5085, contact_email: "frank.cristillo@gactc.edu", phone: "814.505.1314", languages: "---\n- Cobol\n- Rpg\n- Sql\n- Visual basic\n", country: nil},
  {name: "Centriq Training - TechSmart KC Application Developer Program", city: "Leawood", state: "KS", zip_code: 66206, site_url: "http://www.centriq.com", ed_level: "---\n- Vocational\n", bio: "Centriqs TechSmart KC Application Developer program is an accelerated, hands-on four month training program that provides students that have little or no technology experience with the programming skills required to obtain an entry-level programming job in Kansas City. The program focuses on Microsofts C# .NET programming language. Classes are 8:30- 4:30 five days a week for approximately four months. Classes are limited to 11 students.  Students receive a laptop as part of the program and are required to create and present a secure ASP.NET web form application project and a secure ASP.NET MVC application project in order to complete the program. The TechSmart KC Application Developer program is comprised of the following five day classes:\r\n\tC# .NET Fundamentals 1\r\n\tC# .NET Fundamentals 2\r\n\tHTML/CSS/jQuery\r\n\tASP1: ASP Fundamentals\r\n\tASP2: Membership and State Management\r\n\tRelational Database Design & SQL\r\n\tASP3: Data Driven Applications\r\n\tASP4: Data Driven Applications and LINQ\r\n\tASP5: Web Services, jQuery & C# Advanced\r\n\tASP.NET - Alternative Frameworks\r\n\tMobile Development\r\n\tProject Week 1: Web Forms\r\n\tProject Week 2: MVC Project & Presentation\r\n", format: "Other", street: "8700 State Line Road, Suite 200", longitude: -94.6092, latitude: 38.9691, contact_email: "rmondry@centriq.com", phone: "913-322-7044", languages: "---\n- C# .net\n- HTML\n- Mobile Apps\n", country: nil},
  {name: "College of Alameda", city: "Alameda", state: "CA", zip_code: 94501, site_url: "http://alameda.peralta.edu/", ed_level: "---\n- College\n", bio: "The CIS program at College of Alameda prepares you for entry-level business opportunities requiring the use of computer applications, such as word processing, spreadsheet, database management, and geographical information systems (GIS) programs.  Our CIS program prepares you for transfer to a university.  Advanced students take programming courses, help desk and networking courses, help desk and networking courses, and web publishing courses.", format: "Daily programming course", street: "555 Ralph Appezzato Memorial Parkway ", longitude: -122.279, latitude: 37.7807, contact_email: "", phone: "", languages: "---\n- C#\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "College of San Mateo", city: "San Mateo", state: "CA", zip_code: 94402, site_url: "http://collegeofsanmateo.edu/", ed_level: "---\n- College\n", bio: "Computer and Information Science offers extraordinary career opportunities to individuals who possess fluency in the English language, solid keyboarding skills, and a desire to work with computers on a daily basis. Students in the Computer and Information Science program at College of San Mateo are trained primarily on PC microcomputers and receive the finest training and experience available in areas such as programming, data communications, applications development, network support, end-user support, and hardware/systems support. This training is intended to lead to employment in the computing industry, or transfer to a baccalaureate institution for continued study in the field, and to provide advanced study for computing professionals. Career opportunities include applied scientist, communications technician, computer maintenance technician, computer operator, data base specialist, documentation specialist, information specialist, Local Area Network (LAN) administrator, PC specialist, programmer, software engineer, software technician, systems analyst, systems test engineer, technician support representative, and as sales personnel skilled in marketing methods for computer systems. While some students secure employment following completion of the A.S. degree or Certificate program, many transfer to four-year universities to complete a bachelor's degree in a computer-related field.\r\n", format: "Daily programming course", street: "1700 W. Hillsdale Boulevard", longitude: -122.335, latitude: 37.5351, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n", country: nil},
  {name: "Copper Mountain College", city: "Joshua Tree", state: "CA", zip_code: 92252, site_url: "http://www.cmccd.edu/", ed_level: "---\n- College\n", bio: "PROGRAM  STUDENT LEARNING OUTCOMES\r\nUpon successful completion of this program students will be\r\nable to:\r\n1. Produce computer applications using structured programming\r\ntechniques and object oriented design. (Institutional SLOs: Critical\r\nThinking and Information Competency)\r\n2. Critically apply, analyze, and evaluate fundamental concepts of\r\nsoftware applications and hardware development. (Institutional SLOs:\r\nCritical Thinking and Information Competency)\r\n3. Articulate the historical evolution of computer systems,\r\nincluding the legal, moral, and ethical issues associated with\r\ncomputers. (Institutional SLOs: Critical Thinking and Ethics)\r\n4. Design and create solutions to a real world situation using the\r\nappropriate software. (Institutional SLOs: Information Competency)", format: "Daily programming course", street: "6162 Rotary Way ", longitude: -116.213, latitude: 34.1415, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Visual basic\n", country: nil},
  {name: "College of the Siskiyous", city: "Weed", state: "CA", zip_code: 96094, site_url: "http://www.siskiyous.edu", ed_level: "---\n- College\n", bio: "The Computer Science program provides training in four important fields:  PC Networks/ Hardware/Software, Web Design, Game Design, and Computer Programming.  The Associate of Science degree is offered for the Computer Science transfer major.  College of the Siskiyous is proud of the fact that we are able to offer up-to-date hardware and software which is on a continuous replacement plan.  In addition, the college utilizes a high-speed connection to the Internet.  Each student receives a network account with access to many programs, high-speed printers, and the Internet.  With a skilled and dedicated faculty, College of the Siskiyous offers many opportunities to anyone interested in the latest technology. ", format: "Daily programming course", street: "800 COLLEGE AVENUE", longitude: -122.392, latitude: 41.4095, contact_email: "", phone: "", languages: "---\n- Assembly language programming\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "Columbia Community College", city: "Sonora", state: "CA", zip_code: 95370, site_url: "http://www.columbia.yosemite.edu/", ed_level: "---\n- College\n", bio: "First course in computer programming for students with little or no programming experience. Covers computer architecture, data representation, file systems and networks, software development methods (structured and object-oriented design), and basic problem-solving using analysis, documentation, algorithm design and control structures. Programming using scripting languages such as JavaScript and Python, and a compiled, object-oriented language such as Java will be introduced. This course is designed for majors and non-majors.", format: "Daily programming course", street: "11600 Columbia College Dr  ", longitude: -120.386, latitude: 38.0287, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Javascript\n- Visual basic\n", country: nil},
  {name: "College of the Siskiyous", city: "Weed", state: "CA", zip_code: 96094, site_url: "http://www.siskiyous.edu", ed_level: "---\n- College\n", bio: "The Computer Science program provides training in four important fields:  PC Networks/ Hardware/Software, Web Design, Game Design, and Computer Programming.  The Associate of Science degree is offered for the Computer Science transfer major.  College of the Siskiyous is proud of the fact that we are able to offer up-to-date hardware and software which is on a continuous replacement plan.  In addition, the college utilizes a high-speed connection to the Internet.  Each student receives a network account with access to many programs, high-speed printers, and the Internet.  With a skilled and dedicated faculty, College of the Siskiyous offers many opportunities to anyone interested in the latest technology. ", format: "Daily programming course", street: "800 COLLEGE AVENUE", longitude: -122.392, latitude: 41.4095, contact_email: "", phone: "", languages: "---\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "Consumnes River College", city: "Sacramento", state: "CA", zip_code: 95823, site_url: "http://www.crc.losrios.edu/", ed_level: "---\n- College\n", bio: "CRC computer information science programs include study in computer programming, information systems security, computer networking, management information systems, and computer applications. A wide range of degree and certificate programs are available to meet the needs of transfer students who plan to complete a four-year degree as well as career/technical students who plan to enter the workforce. Several of the programs are designed to promote a career ladder from certificate to associate degree to university transfer. Other programs are designed to upgrade the skill set of working IT professionals. All program options are designed with advice from business and industry representatives and conform to industry standards. For more information, refer to specific information about each program in the pages that follow. Transfer students should see a counselor to develop an educational plan based upon the specific requirements of the intended transfer institution.", format: "Daily programming course", street: "8401 Center Parkway", longitude: -121.422, latitude: 38.4536, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "Crafton Hills College", city: "Redlands", state: "CA", zip_code: 92399, site_url: "http://www.craftonhills.edu", ed_level: "---\n- College\n", bio: "The objective of this certificate is to provide students the knowledge and skills necessary for employment in entry-level positions in the field of Programming or to continue to pursue a four-year degree in Computer Information Systems or Computer Science. The Programming Certificate indicates the student has acquired knowledge of various programming languages including basic language structures, syntax, debugging, and application development. ", format: "Daily programming course", street: "11711 Sand Canyon Road ", longitude: -117.106, latitude: 34.0403, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "Cuyamaca College", city: "El Cajon", state: "CA", zip_code: 92019, site_url: "http://www.cuyamaca.edu/", ed_level: "---\n- College\n", bio: "Upon completion of the Computer Programing certificate, students will be able to:\r\n\r\n    Develop a software solution following the systems development life cycle (SDLC) including problem analysis, solution design, implementation, testing, evaluation and recommendation for improvement.\r\n    Be proficient in at least one high-level programming language and an ability to use that language to implement software solutions in a variety of settings following the SDLC.\r\n    Recognize the need to maintain currency with software industry changes in the computing profession.\r\n", format: "Daily programming course", street: "900 Rancho San Diego Parkway", longitude: -116.941, latitude: 32.7465, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n", country: nil},
  {name: "Cypress College", city: "Cypress", state: "CA", zip_code: 90630, site_url: "http://www.cypresscollege.edu/", ed_level: "---\n- College\n", bio: "The Computer Information Systems Department will prepare you to function as information professional in a world that is being constantly transformed by technology.\r\n\r\nWe offer lecture, hands-on approach, online, and self-paced courses.", format: "Daily programming course", street: "9200 Valley View Street", longitude: -118.028, latitude: 33.83, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "De Anza College", city: "Cupertino", state: "CA", zip_code: 95014, site_url: "http://www.deanza.edu/", ed_level: "---\n- College\n", bio: "De Anza's Computer Information Systems department has been a leading educational institution in Silicon Valley since the college was founded. Over the years it has developed a rich and diverse series of courses in many areas. It offers several programs to support the needs of students and professionals in Silicon Valley. ", format: "Daily programming course", street: "21250 Stevens Creek Blvd.", longitude: -122.045, latitude: 37.3192, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n- Perl\n", country: nil},
  {name: "El Camino College", city: "Torrance", state: "CA", zip_code: 90506, site_url: "http://www.elcamino.edu/", ed_level: "---\n- College\n", bio: "Computer Science courses are designed primarily for students who wish to transfer to a four-year institution with a major in Computer Science, Physics, Mathematics, Engineering, or another technical major which will be concerned with the study or application of computer concepts. The courses offered provide instruction in UNIX as well as high-level languages (PASCAL, FORTRAN, C, C++), PC assembly languages and advanced programming concepts. It should be noted that all Computer Science courses have a math prerequisite.", format: "Daily programming course", street: " 16007 Crenshaw Blvd", longitude: -118.327, latitude: 33.8845, contact_email: "", phone: "", languages: "---\n- C\n- C++\n- Fortran\n- Pascal\n", country: nil},
  {name: "Children's Creativity Museum", city: "San Francisco", state: "CA", zip_code: 94103, site_url: "http://www.creativity.org", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Game Design Summer Camp at the Children's Creativity Museum:\r\n\r\nCampers will learn fundamental programming concepts while creating their own simple video games using Scratch, a kid-friendly programming language developed by M.I.T.\r\n\r\nAGE RANGE: 9-12\r\nDATES: August 19  August 23, 2013\r\nHOURS: 9:00am - 1:00pm\r\nCOST: $300/week\r\n(Extended care hours available: $85/week or $25/day, 1:00-3:30pm)\r\n\r\nFor more information visit www.creativity.org/camps", format: "Summer camp", street: "221 Fourth Street", longitude: -122.402, latitude: 37.783, contact_email: "education@creativity.org", phone: "415.-820-3330", languages: "---\n- Scratch\n", country: nil},
