  {name: "Bucks County Community College", city: "Newtown", state: "PA", zip_code: 18940, site_url: "http://bucks.edu", ed_level: "---\n- College\n", bio: "Bucks offers Associate of Arts transfer degree programs in Computer Science and Information Science & Technology. Occupational programs include A.A. degrees in Networking Technology and Digital Game & Simulation Design, an Associate of Applied Science degree in Information Technology Studies, and certificate programs in Computer Forensics, Computer Hardware Installation & Maintenance, and Computer Networking Technology.", format: "Full university CS curriculum", street: "275 Swamp Rd", longitude: -74.9671, latitude: 40.2391, contact_email: "computers@bucks.edu", phone: "215-968-8000", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Visual basic\n", country: nil},
  {name: "CoderDojo Greenville", city: "Greenville", state: "SC", zip_code: 29601, site_url: "http://www.theironyard.com/academy/kids", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "At CoderDojo Greenville, young people learn how to code, develop websites, apps, programs, games and even robots.\r\n\r\nWeb programming: https://vimeo.com/58981618\r\n\r\nElectronics programming: https://vimeo.com/58981617\r\n\r\nAlong with a handful of rockin volunteers, we've launched CoderDojo: Greenville  a place where young people can learn the ins-and-outs of technology, from code to circuit boards. On top of the courses, theyll tour tech companies, bring in guest speakers, and host fun events for participants.", format: "Afterschool program", street: "2 North Main", longitude: -82.3987, latitude: 34.8508, contact_email: "coderdojo@theironyard.com", phone: "", languages: "---\n- HTML\n- Javascript\n- Ruby\n- Scratch\n", country: nil},
