  {name: "Hack Reactor", city: "San Francisco", state: "CA", zip_code: 94142, site_url: "http://hackreactor.com", ed_level: "---\n- Vocational\n", bio: "Hack Reactor runs from 9am to 8pm, six days a week. Days alternate between structured introductions to projects/exercises and all-day hackathons where you complete the previous days projects and code on whatever else interests you.", format: "Daily programming course", street: "944 market st", longitude: -122.409, latitude: 37.7835, contact_email: "", phone: "", languages: "---\n- Coffee script\n- HTML\n- Jasmine\n- Javascript\n- Jquery\n- Node.js\n- Ruby\n", country: nil},
  {name: "LaSalle Computer Learning Center - Tampa Campus", city: "Tampa", state: "FL", zip_code: 33607, site_url: "http://www.lasallecomputer.com", ed_level: "---\n- Vocational\n", bio: "LaSalle Computer Learning Center teaches computer programming and web design classes to adults. Classes are small, instructor-led and hands-on. All classes map to industry recognized certifications. Call for more information. ", format: "Other", street: "1111 N Westshore Blvd., Suite 110", longitude: -82.5232, latitude: 27.9539, contact_email: "", phone: "813-288-0110", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- Visual basic and .net.\n", country: nil},
  {name: "Wallingford Elementary School", city: "Nether Providence Township", state: "PA", zip_code: 19086, site_url: "http://www.wssd.org/site/default.aspx?DomainID=531", ed_level: "---\n- Elementary\n", bio: "Students in grades 1-5 learn to program using Scratch in a variety of venues for a variety of purposes.  Some come during a lunchtime \"club,\" others learn during math or reading classes into which using Scratch is integrated.", format: "Programming integrated in other classes", street: "20 S. Providence Rd.", longitude: -75.3733, latitude: 39.902, contact_email: "dwile@wssd.org", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "Ar-We-Va", city: "Westside", state: "IA", zip_code: 51467, site_url: "http://www.ar-we-va.k12.ia.us", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "We only have 1 section of this class called Computer Applications.  We bring in many aspects of working with computers applications.  It has changed to doing a lot with online programs and computer programming.  We have done Alice and Khan Academy.  Khan is now also being used in the elementary as well by me with my K-5 students.  ", format: "Daily programming course", street: "108 Clinton Street", longitude: -95.1008, latitude: 42.0755, contact_email: "brunner@ar-we-va.k12.ia.us", phone: "7126634313", languages: "---\n- Alice\n- Scratch\n", country: nil},
  {name: "McClintock Middle School", city: "Charlotte", state: "NC", zip_code: 28212, site_url: "http://www.mcclintockscots.com", ed_level: "---\n- Middle School\n", bio: "The students use computer science software, robotics and tools to develop programming skills and content to create games, programs, art, robotic tasks and animations. The students learn programming languages to develop software programs and use code for physical computing and robots.  As students move through the content and grade levels, they learn newer languages to complete similar and complex tasks with increase language complexity. The students learn to use the hardware and software of different computers and robots along with the languages. The students will gain a basic understanding of different programming languages and software as well as complete projects that involve creative, tinkering and using the open source mentality. The students use Scratch, Khan Academy, LEGO Mindstorms and other languages.", format: "Daily programming course", street: "2101 Rama Rd.", longitude: -80.7672, latitude: 35.1809, contact_email: "david.taylor@cms.k12.nc.us", phone: "980-343-6425", languages: "---\n- Javascript\n- Lego mindstorm\n- Scratch\n", country: nil},
  {name: "The Webinstitute", city: "New Delhi", state: "DL", zip_code: 110058, site_url: "http://www.webinstitute.in", ed_level: "---\n- High School\n- College\n", bio: "Webinstitute.in is an effort by Dulcet Solutions Pvt Ltd to create awareness about web and related technologies all over the country. Through a series of talks, seminars and workshops (both long and short ones), we have so far taught 1000 students. \r\nCurrently, this is what we are teaching:\r\n1.\tWeb Development In a Day\r\n2.\tMobile Web  Application Development in 2 days.\r\n3.\tJava in 2 days\r\n4.\tHTML 5 for Beginners (2 Days)\r\n\r\napart from the long programs. Our workshops have received a lot of acclaim from our participants and we now feel that web technologies MUST be taught in schools as well. We are currently building a new website dedicated for schools. \r\n\r\n\r\n\r\n\r\n\r\n", format: "All-day workshop (up to 1 week)", street: "502-A, Jaina Tower II", longitude: 77.2051, latitude: 28.6682, contact_email: "info@webinstitute.in", phone: "9818666217", languages: "---\n- HTML\n- Java\n- Javascript\n- PHP\n- Python\n", country: nil},
  {name: "Trinity School at Greenlawn", city: "South Bend", state: "IN", zip_code: 46617, site_url: "http://www.trinityschools.org/greenlawn/academics/technology/", ed_level: "---\n- High School\n", bio: "Over the course of two years (eleventh and twelfth grade) Trinity students learn Alice and Matlab computer programming with a disciplinary approach. \r\n\r\nThe purpose of the programming is to have students create models with which they can interact and explore various physical situations. The students develop interactive tools that deepen their understanding of the physical phenomena and also demystify computers. The Matlab software is also utilized to perform the mathematical analysis for the labs - primarily linear regressions in the junior year. \r\n\r\nMATLAB is also used extensively for its graphing capabilities and as a tool in calculus, differential equations and linear algebra. Students continue to write programs in all parts of the course, as programming, mathematics and science are increasingly integrated.", format: "Daily programming course", street: "107 S. Greenlawn Ave.", longitude: -86.2213, latitude: 41.6759, contact_email: "", phone: "", languages: "---\n- Alice\n- Matlab\n", country: nil},
  {name: "CoderDojo Twin Cities", city: "Minneapolis", state: "MN", zip_code: 55414, site_url: "http://www.coderdojotc.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "CoderDojo is a global movement about providing free and open learning to youth, with an emphasis on computer programming. The Twin Cities chapter was founded to bring this movement to the Minneapolis-Saint Paul area, inspire other chapters, and partner with other organizations to better introduce kids to coding.\r\n\r\nCoderDojo Twin Cities welcomes girls and boys ages 10 to 16 and provides a friendly, supportive learning environment for all kids, from absolute beginners to experienced young programmers. We aim to reduce economic barriers and will provide access to computers during the sessions for those unable to bring a laptop.", format: "Multi-week workshop", street: "1501 East Hennepin Ave", longitude: -93.2303, latitude: 44.9917, contact_email: "hello@coderdojotc.org", phone: "", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- PHP\n- Python\n- Ruby\n- Scratch\n", country: nil},
