  {name: "North Carolina Museum of Natural Sciences: Visual World Investigate Lab", city: "Raleigh", state: "NC", zip_code: 27601, site_url: "http://naturalsciences.org/programs-events", ed_level: "---\n- Middle School\n- High School\n- Vocational\n", bio: "The Visual World Investigate Lab, located in the North Carolina Museum of Natural Sciences: Nature Research Center offers an introductory programming course for the general public. This course is designed to introduce basic programming skills to anyone interested in programming using the free and easy to use development environment, Microsoft Small Basic. Participants will create a new interactive graphical program at each class that can be posted on the internet, allowing them to share their creation with world.\r\n\r\nThe course is open to anyone age 11 and up and takes place on the third or fourth Thursday of every month from 6:30-8:00 PM. The fee is $10 per participant. For more information follow the link provided to the programs and events section of the NC Museum of Natural Sciences and select Computer Programming for Beginners.", format: "Other", street: "11 West Jones St.", longitude: -78.6395, latitude: 35.7823, contact_email: "walt.gurley@naturalsciences.org", phone: "", languages: "---\n- Microsoft small basic\n", country: nil},
