  {name: "ComputerMagix", city: "San Jose", state: "CA", zip_code: 95129, site_url: "http://www.ComputerMagix.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "We love to show the wonders in computer technology to kids and enable them to express their creativity with powerful computational technologies.  We have both summer camp programs and after school programs.  The upcoming summer camp programs includes: \r\n \r\n-Computer Wonderland Camps, 07/08-07/12 . (Grade k-6)\r\n-Magic Touch Tech Camp (Computer Animation), 07/15-07/19 . (Grade k-12)\r\n-Magic Touch Tech Camp (Game Development I), 07/22-07/26 . (Grade k-12)\r\n-Magic Touch Tech Camp (Game Development II), 07/29-08/02 . (Grade k-12)\r\n-Magic Touch Photoshop Camp (Graphics I), 08/05-08/09 . (Grade 2-12)\r\n-Magic Wizard Tech Camp (Arduino I), 08/12-08/16 . (Grade 6-12)", format: "Summer camp", street: "1600 Saratoga Ave, Suite 427", longitude: -121.99, latitude: 37.2913, contact_email: "info@ComputerMagix.org", phone: "4082193562", languages: "---\n- Alice\n- Arduino\n- Java\n- Javascript\n- Kodu\n- PHP\n- Python\n- Ruby\n- Scratch\n", country: nil},
