  {name: "Academy of Science and Technology", city: "Palm Harbor", state: "FL", zip_code: 34683, site_url: "http://academyofscitech.com/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "The Academy was founded on a very simple premise, to provide children with the foundation needed in todays technologically driven society.\r\n\r\nReading, Writing and Arithmetic are no longer sufficient, todays children also require a very strong understanding of technology and the science which goes behind it. In every discipline, from the arts, to medicine and social studies we see that technology plays a fundamental role in the advancement of that discipline. Technology and it numerous applications are changing the global economy in ways we are only beginning to understand.\r\n\r\nContact us for class details and times.", format: "Afterschool program", street: "857 BKF", longitude: -82.7617, latitude: 28.091, contact_email: "info@academyofscitech.com", phone: "", languages: "---\n- Arduino\n- HTML\n- Javascript\n- Kodu\n- Logo\n- Mobile Apps\n- PHP\n- Ruby\n- Scratch\n", country: nil},
  {name: "South Portland High School", city: "South Portland", state: "ME", zip_code: 4106, site_url: "http://highschool.spsd.org", ed_level: "---\n- Middle School\n- High School\n", bio: "Students primarily at the high school level participate in the FIRST robotics competition. \r\n\"FIRST was founded in 1989 to inspire young peoples interest and participation in science and technology.\" They design \"accessible, innovative programs that motivate young people to pursue education and career opportunities in science, technology, engineering, and math, while building self-confidence, knowledge, and life skills. (http://www.usfirst.org/aboutus/vision).\r\nOne important element of the competition is the programming of the Robot, which is done in either Java or LabView.\r\nPlease check out our website for more information\r\nhttp://riotcrew.org/\r\n", format: "Robotics club", street: "637 Highland Avenue", longitude: -70.2683, latitude: 43.6207, contact_email: "", phone: "", languages: "---\n- Java\n- Labview\n", country: nil},
  {name: "cole secondaire publique Odysse", city: "North Bay", state: "ON", zip_code: 0, site_url: "http://www.cspne.ca/odyssee/", ed_level: "---\n- High School\n", bio: "cole secondaire publique Odysse is a French public school in North Bay, Ontario.\r\nCourses offered: ICS2O, ICS3U and ICS4U, per Ontario Curriculum Standards.\r\nThese courses are available to students every year. We explore programming using a number of platforms including Scratch, Visual Basic, and ActionScript.", format: "Daily programming course", street: "480 avenue Normand", longitude: -79.4384, latitude: 46.3284, contact_email: "", phone: "", languages: "---\n- Actionscript\n- HTML\n- Java\n- Javascript\n- Scratch\n- Visual basic\n", country: nil},
  {name: "South Portland High School", city: "South Portland", state: "ME", zip_code: 4106, site_url: "http://highschool.spsd.org", ed_level: "---\n- High School\n", bio: "Introduction to Computer Science.\r\nThis is an online course available to our high school students.\r\n\r\nhttps://www.virtualhighschool.com/courses/outlines/ics3u.asp\r\n\r\nCourse Description:\r\n\r\nThis course introduces students to computer science. Students will design software independently and as part of a team, using industry-standard programming tools and applying the software development life-cycle model. They will also write and use subprograms within computer programs. Students will develop creative solutions for various types of problems as their understanding of the computing environment grows. ", format: "Daily programming course", street: "637 Highland Avenue", longitude: -70.2683, latitude: 43.6207, contact_email: "", phone: "", languages: "---\n- Java\n", country: nil},
  {name: "Clarkstown High School South", city: "West Nyack", state: "NY", zip_code: 10994, site_url: "http://mrnickels.com", ed_level: "---\n- High School\n", bio: "Computer programming honors and Computer science (AP)", format: "Daily programming course", street: "31 Demarest Mill Road", longitude: -73.9784, latitude: 41.1033, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- 'Visual basic '\n", country: nil},
  {name: "Acera School", city: "Melrose", state: "MA", zip_code: 2176, site_url: "http://aceraschool.org/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Weekly Computer Science classes for students in grades 2-8. Scratch is taught to elementary school students.\r\nAlice is taught to middle school students.\r\nPython is integrated with some math classes and available as an option for interested students.\r\n\r\nOur computer science curriculum is evolving, with the goals of demystifying computers, developing organized thinking, and providing an unlimited runway for interested students  to pursue complex programming projects.", format: "Other", street: "645 Main St., Annex Bldg.", longitude: -71.0662, latitude: 42.4584, contact_email: "Info@aceraschool.org", phone: "781-665-2032", languages: "---\n- Alice\n- Python\n- Scratch\n", country: nil},
  {name: "Ramona Convent Secondary School", city: "Alhambra", state: "CA", zip_code: 91803, site_url: "http://www.ramonaconvent.org", ed_level: "---\n- High School\n", bio: "We offer, as part of regular school program, a series of courses that incorporate programming:\r\nWeb Programming using HTML, HTML5, CSS as well as introduction to using Kompozer \r\nGame Programming using Alice, AgentSheets and AgentCubes, and AppInventor \r\nComputer Animation using ActionScript 2.0 and 3.0\r\nOptional after-school activities include FIRST Robotics and Arduino programming\r\n", format: "Daily programming course", street: "1701 W Ramona Rd", longitude: -118.138, latitude: 34.0718, contact_email: "", phone: "", languages: "---\n- Agentcubes\n- Agentsheets\n- Alice\n- Arduino\n- HTML\n- Scratch\n", country: nil},
  {name: "Elkhorn High School", city: "Elkhorn", state: "NE", zip_code: 68022, site_url: "http://www.elkhornweb.org/ehs", ed_level: "---\n- High School\n", bio: "Programming I is an introduction to teach programming in general and the elements of the Visual Basic Language in particular. Emphasis will be placed on structured programming principles: problem- solving, top-down modular design, structured coding, and programming style. This is an articulated course with Metro Community College.\r\n\r\nProgramming II is an advanced programming course in the Visual Basic Language. Emphasis will be placed on structured programming principles: problem-solving, top-down modular design, structured coding, and programming style. ThisI is an articulated course with Metro Community College.", format: "Daily programming course", street: "1401 Veterans Drive", longitude: -96.2279, latitude: 41.2717, contact_email: "", phone: "", languages: "---\n- Visual basic\n", country: nil},
