  {name: "Technovation", city: "Falcon Heights", state: "MN", zip_code: 55401, site_url: "http://www.codesavvy.org/p/technovation.html", ed_level: "---\n- High School\n", bio: "The Technovation Challenge engages small teams of high school or middle school girls to dream up, design, code and pitch mobile phone apps. Working with professional women mentors (usually after school), all-girl teams develop a real-world combination of technical and entrepreneurial skills:\r\n\r\nhow to identify a problem, research and design a useful app\r\nhow to code a working app from scratch\r\nhow to develop a business plan and make a presentation to a panel of venture capitalists and other audiences\r\nconfidence, collaboration, patience, focus and creative problem-solving\r\n\r\nTechnovation Challenge provides a life-changing experience to girls  an experience through which they succeed in a field they never thought they could contribute to, let alone succeed.\r\n\r\nFor the 2013 challenge, girls have to develop an app that solves a problem in their local community. ", format: "Afterschool program", street: "multiple", longitude: -93.1657, latitude: 44.9911, contact_email: "info@codesavvy.org", phone: "", languages: "---\n- Mobile Apps\n", country: nil},
