  {name: "Decoded", city: "New York", state: "NY", zip_code: 10018, site_url: "http://decoded.co/new-york/", ed_level: "---\n- Vocational\n", bio: "Decoded achieves the impossible: we take people from zero knowledge or skills to coding their own multi-platform app which responds to their location - in a day. We call it digital enlightenment. \r\n\r\nThousands of people from CEOs to school teachers have transformed their understanding of digital through our unique educational experience. \r\n\r\nBased in New York, London and Singapore, Decoded is proud to include Microsoft, Google and nine FTSE-100 companies among our clients, as well as creatives, start-ups, non-profits and politicians. Code is a leveller - anyone and everyone can learn these skills.\r\n\r\nIn the words of a recent attendee: \"Too many training days overpromise and underdeliver. Decoded makes an outrageous promise - learn to code in a day - and then remarkably delivers on it. Astonishing! An unforgettable experience that I know will enhance my work and life with an understanding of what coders actually do and how digital things are made.\"", format: "All-day workshop (up to 1 week)", street: "320 West 37th St", longitude: -73.9934, latitude: 40.7544, contact_email: "info@decoded.co", phone: "", languages: "---\n- HTML\n- Javascript\n", country: nil},
