  {name: "Orange Coast College", city: "Costa Mesa", state: "CA", zip_code: 92672, site_url: "http://www.orangecoastcollege.edu", ed_level: "---\n- College\n", bio: "Orange Coast College has a complete lower-division Computer Science program that will prepare you to transfer to a 4-year University CS program. Courses include introductory courses in Java, C#, VB.NET and Python; a three-course sequence in C++ including Data Structures; courses in Computer Architecture and Software Engineering along with the Theories of Computation.\r\n\r\nIn addition, OCC has a large number of CIS programming courses available, including HTML, CSS, JavaScript and Flash, along with applications courses in MS Office, Dreamweaver, multimedia and video. If your goals include networking and computer operations, we also offer A+, Network+, CISCO, Juniper, Linux and other computer administration career tracks.", format: "Other", street: "2701 Fairview Road", longitude: -117.912, latitude: 33.6719, contact_email: "sgilbert@occ.cccd.edu", phone: "", languages: "---\n- C#\n- C++\n- Flash actionscript 3\n- HTML\n- Java\n- Javascript\n- Python\n- Vb.net\n", country: nil},
