  {name: "Fullerton College", city: "Fullerton", state: "CA", zip_code: 92832, site_url: "http://www.fullcoll.edu/", ed_level: "---\n- College\n", bio: "The employment outlook for computer-based occupations has rebounded, with Orange County projected to have the largest number of available job openings in the field in the nation over the next five years. High-demand specialties include software specialists, database specialists, and networking and programming specialties. Software and computer services are one of the three highest paying industry clusters in the LA/Orange County area, with entry wages averaging $37,000+/year. Emerging industry clusters include computer gaming and entertainment technology, and computer and information security.\r\n", format: "Daily programming course", street: "321 E. Chapman Avenue ", longitude: -117.918, latitude: 33.8742, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n- Xml\n", country: nil},
