  {name: "Golden West College", city: "Huntington Beach", state: "CA", zip_code: 92647, site_url: "http://www.goldenwestcollege.edu/", ed_level: "---\n- College\n", bio: "Students are offered a wide variety of courses which fall into three broad categories:\r\n\r\n    Survey and Computer Literacy.\r\n    Programming languages such as C, Visual Basic, C++, Java, and C#.\r\n    Advanced topics in Operating Systems, Web Programming, Data Structures, and Video Game Development.\r\n", format: "Daily programming course", street: "Huntington Beach, CA 92647", longitude: -118.001, latitude: 33.7223, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "Irvine Valley College", city: "Irvine", state: "CA", zip_code: 92618, site_url: "http://www.ivc.edu/Pages/default.aspx", ed_level: "---\n- College\n", bio: "The Computer Information Science Department in the School of Mathematics, Computer Science and Engineering conducts a program designed for students who are developing computer programming skills in preparation for professional careers and/or transfer to a four-year college or university. Courses are intended to meet the needs of students at various levels of competence, from the novice to the expert. The department acquaints students with the presently available methods of computer science that are useful in solving problems of science, industry, and government; prepares students for the additional formal education and self education required in this ever-developing field; and fosters students' abilities to solve computer science problems.", format: "Daily programming course", street: "5500 Irvine Center Drive ", longitude: -117.779, latitude: 33.6792, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n- Xhtml\n", country: nil},
