  {name: "Long Beach City College", city: "Long Beach", state: "CA", zip_code: 90808, site_url: "http://www.lbcc.edu/", ed_level: "---\n- College\n", bio: "We provide courses to meet every student's needs for today's business world, from Computer & Office Studies (COS) to Information Technology and Computer Science (CS), to Computer Keyboarding/Typing--academic and vocational job skills to meet the professional and personal goals of today's student's.\r\n", format: "Daily programming course", street: "4901 East Carson Street, Long Beach CA 90808", longitude: -118.135, latitude: 33.8329, contact_email: "", phone: "", languages: "---\n- C#\n- C++\n- HTML\n- Java\n- Ruby\n", country: nil},
  {name: "Los Angeles City College", city: "Los Angeles", state: "CA", zip_code: 90029, site_url: "http://www.lacitycollege.edu/index.html", ed_level: "---\n- College\n", bio: "The Computer Science and Information Technology program offers two Associate degrees that students can choose from depending on their career and educational goals. The first, Associate of Science in Computer Science, is designed for students with transfer goals to the Computer Science program at four-year universities. The second, an Associate of Science in Information Systems, is designed to prepare students for careers in exciting Information Technology fields such as programming, software engineering, database administration, computer networking, multimedia, and web technologies. Certificates in Computer Science-Information technology will be issued by the Mathematics department upon application to the department by the student and successful completion of the certificate program. For more/updated information, please contact Roger Wolf, the Chairperson of the Computer Science and Information Systems department, or call (323) 953-4000 (ex. 2680).", format: "Daily programming course", street: "855 N. Vermont Avenue, Los Angeles California 90029", longitude: -118.293, latitude: 34.0876, contact_email: "", phone: "", languages: "---\n- C++\n- Cobol\n- HTML\n- Java\n- Pascal\n- Perl\n- Xml\n", country: nil},
