  {name: "University of Canterbury - Computer Science Club", city: "Christchurch", state: "Canterbury", zip_code: 8041, site_url: "http://www.cosc.canterbury.ac.nz/csclub/", ed_level: "---\n- Middle School\n- High School\n", bio: "The Computer Science Club is a club aimed for students in years 7 to 10 who enjoy working with computers, and wish to learn to program, or extend their programming skills and explore the field of computer science! Students will have the opportunity to have programming tuition (for beginners and more experienced students), listen to talks from experts (both from the university and industry), and work on goals for badges. This club is intended for those who aren't yet doing NCEA but would like to get started on learning about the exciting world of programming and computer science. The only requirement to join the club is enthusiasm to learn more about computing and a positive attitude to learning.\r\n\r\nThe club is run by academic staff and tutors from the department of Computer Science and Software Engineering. The department is known internationally for its work on computer science education (including the popular csunplugged.org), and has been heavily involved in designing standards for computing in NCEA. The club team is working in collaboration with the US-based CS Field Guide group, to develop a project for earning badges by achieving specific goals in the Computer Science Field.\r\n\r\nWe run the club weekly after school, and offer three different days to come. We meet on Mondays, Wednesdays and Thursdays, with an extra girls only club, lead by girls, on Wednesday afternoon. We start at 3:30pm and finish at 5:00pm, however students can arrive from 3:00pm, and stay until 5:30pm. We meet in the Erskine building on the University Campus, there is limited paid coupon parking available (parking is free after 5pm). Come inside to Level 1 (by the cafe) and follow the signs! We meet during school terms and stop during holiday periods.", format: "Afterschool program", street: "Erskine Building, Science Road, Ilam", longitude: 172.581, latitude: -43.5225, contact_email: "jack.morgan@canterbury.ac.nz", phone: "", languages: "---\n- Python\n- Scratch\n", country: nil},
