  {name: "BCIT School of Computing, Part-time Studies", city: "Vancouver", state: "BC", zip_code: 0, site_url: "http://www.bcit.ca/cas/computingparttime/", ed_level: "---\n- College\n", bio: "The British Columbia Institute of Technology (BCIT) is a post-secondary, publicly funded Polytechnic with 5 main campus locations in the Vancouver metropolitan area. \r\n\r\nBCIT grants 2 year full-time applied diplomas with follow-on bachelor degrees and delivers parallel learning outcomes via Part-Time Studies. The institute also provides research and international partnership operations.\r\n\r\nBCIT has over 48,000 full and part-time students enrolled annually covering a wide range of applied technologies in: Aerospace, Business, Computing, Construction, Engineering, Health Sciences, Manufacturing, Media, Trades and Transportation.    \r\n\r\nThe BCIT School of Computing is one of six schools at the institute. Computing, Part-time Studies delivers over 100 individual computing and IT courses every term at our Burnaby and downtown Vancouver locations. \r\n\r\nStudents who have completed high school may earn computing and IT credentials one course at a time at night and on weekends. Every year we have over 5,000 registrations in our \"COMP\" courses alone. BCIT School of Computing graduates enjoy very high career success rates.\r\n\r\n\"Start with just one course\" and work toward a certificate, diploma and a degree entirely part-time.", format: "Full university CS curriculum", street: "555 Seymour Street", longitude: -123.115, latitude: 49.2833, contact_email: "cstpts@bcit.ca", phone: "604-432-8465", languages: "---\n- Ajax\n- Asp.net\n- Bluej\n- C\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Objective-c\n- PHP\n- Perl\n- Python\n- Sql\n- Xml\n", country: nil},
