  {name: "Fraser Woods Montessori School", city: "Newtown", state: "CT", zip_code: 6470, site_url: "http://www.fraserwoods.com", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Computer programming is offered to students starting in first grade, and continues on a weekly basis, through 8th grade.  Students are taught the fundamentals of computer programming as a stand alone discipline and then later on it is presented in conjunction with their academic classes.", format: "Other", street: "173 South Main Street", longitude: -73.2813, latitude: 41.3809, contact_email: "pgans@fraserwoods.com", phone: "2034263390", languages: "---\n- HTML\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Encinal High School", city: "Alameda", state: "CA", zip_code: 94501, site_url: "http://ehs.alamedausd.ca.schoolloop.com/", ed_level: "---\n- High School\n- Vocational\n", bio: "Exploring Computer Science\r\nPrerequisite: Algebra 1\r\nExploring Computer Science is designed to introduce \r\nstudents to the breadth of the field o f computer science \r\nthrough an exploration of engaging and accessible \r\ntopics. Rather than focusing the entire course on learning \r\nparticular software tools or programming languages, \r\nthe course is designed to focus the conceptual ideas of \r\ncomputing and help students understand why certain \r\ntools or languages might be utilized to solve particular \r\nproblems. This is a yearlong course consisting of 6 \r\nunits, approximately 6 weeks each. Assignments and \r\ninstructions are contextualized to be socially relevant and \r\nmeaningful for diverse students.", format: "Daily programming course", street: "210 Central Ave", longitude: -122.289, latitude: 37.7727, contact_email: "mclarkemiller@alameda.k12.ca.us", phone: "510-748-4023", languages: "---\n- Javascript\n- Scratch\n", country: nil},
  {name: "Encinal High School", city: "Alameda", state: "CA", zip_code: 94501, site_url: "http://ehs.alamedausd.ca.schoolloop.com/", ed_level: "---\n- High School\n- Vocational\n", bio: "CS PRINCIPLES\r\nGrades 10-12 credits\r\nPrerequisite: Algebra 1- recommended Exploring \r\nComputer Science\r\nComputing has changed the world in profound ways. It \r\nhas opened up wonderful new ways for people to connect \r\ndesign, research, play, create, and express themselves. \r\nHowever, just using a computer is only a small part of \r\nthe picture. The real transformative and empowering \r\nexperience comes when one learns how to program the computer, to translate ideas into code.\r\nStudents will focus on some of the Big Ideas of \r\ncomputing, such as abstraction, design, recursion, \r\nconcurrency, simulations, and the limits of computation. \r\nStudents will study applications of computing that have \r\nchanged the world, talk about the history of computing, \r\nand where it will go in the future. Throughout the course, \r\nrelevance is emphasized: relevance to the student and to \r\nsociety. ", format: "Daily programming course", street: "210 Central Ave", longitude: -122.289, latitude: 37.7727, contact_email: "mclarkemiller@alameda.k12.ca.us", phone: "510-748-4023", languages: "---\n- Snap\n", country: nil},
  {name: "Cotton Creek Elementary", city: "Westminster", state: "CO", zip_code: 80027, site_url: "http://cotton.adams12.org/", ed_level: "---\n- Elementary\n", bio: "All students in grades K through Five will participate in one hour of learning how to code. ", format: "Other", street: "St Vrain", longitude: -105.046, latitude: 39.8997, contact_email: "batoul.baydoun@adams12.org", phone: "", languages: "---\n- Java\n", country: nil},
  {name: "Encinal High School", city: "Alameda", state: "CA", zip_code: 94501, site_url: "http://ehs.alamedausd.ca.schoolloop.com/", ed_level: "---\n- Middle School\n- High School\n", bio: "Game App Dev. and Robotics\r\nIn this course students will learn about the creation of apps for the andriod and ios platforms. Students will learn how to design and create apps using a variety of tools.\r\nIn the second semester students will learn how to design and program a robot.", format: "Afterschool program", street: "210 Central Ave", longitude: -122.289, latitude: 37.7727, contact_email: "mclarkemiller@alameda.k12.ca.us", phone: "510-748-4023", languages: "---\n- App inventor\n- C#\n- Game salad\n- Javascript\n- Kodu\n- Mobile Apps\n- Snap\n", country: nil},
  {name: "Young Hacks Academy", city: "Colchester", state: "VT", zip_code: 5446, site_url: "http://www.younghacksacademy.com/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Young Hacks Academy is a problem-solving camp for any 10-12 year old that loves to play with technology. Campersor as we call, our \"Agents\"will be tasked daily missions filled with design-based challenges in front of and away from a computer. By weeks end, graduates of Young Hacks Agent Training will have sharpened their powers of creativity and communication, while making some new friends along the way.\r\n", format: "Summer camp", street: "131 Laker Lane", longitude: -73.2148, latitude: 44.541, contact_email: "support@younghacksacademy.com", phone: "", languages: "---\n- Kodu\n- Scratch\n- Starlogo\n", country: nil},
  {name: "University of North Alabama", city: "Florence", state: "AL", zip_code: 35632, site_url: "http://una.edu/", ed_level: "---\n- College\n", bio: "Department of Computer Science and Information Systems\r\n\r\nTwo degree programs offered:\r\n\r\n1. Bachelor of Science Degree in Computer Science\r\n\r\n2. Bachelor of Business Administration Degree in Computer Information Systems (two options):\r\n\r\nOption I: Enterprise Information Systems\r\n\r\nThe Enterprise Information Systems option is designed to prepare students for work in development of large scale computer systems. In addition to programming in the most current programming languages, students will study database systems and communication systems.\r\n\r\nOption II: End User Computing Systems\r\n\r\nThe End-User Computing Systems option is designed to prepare students to work in small business environments and in individual departments of large organizations, and to provide help desk and technical support to users of systems in large organizations. Students will gain skills associated with widely used software application packages, an understanding of how these tools benefit organizations, and how they interface with other systems in the organization.\r\n\r\nSee www.una.edu for more information.", format: "Full university CS curriculum", street: "1 Harrison Plaza", longitude: -87.6791, latitude: 34.8086, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Mobile Apps\n- PHP\n- Python\n", country: nil},
