  {name: "University of California, Davis", city: "Davis", state: "CA", zip_code: 95616, site_url: "http://c-stem.ucdavis.edu", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "The UC Davis Center for Integrated Computing and STEM Education (C-STEM) aims to improve computing, science, technology, engineering, and mathematics (C-STEM) education in both formal and informal programs in K-14. The goal of the C-STEM Center is to provide computing education for all K-12 students and develop students' critical thinking and problem-solving skills through integrated computing and STEM education. The C-STEM Center studies how to use computing and robotics technology to increase student interest and help them learn STEM subjects with an emphasis on Algebra, the gatekeeper for STEM disciplines. The C-STEM Center also studies how to streamline the curriculum on computing education in the context of STEM subjects in elementary, middle, and high schools, as well as the first two years of college. Through various outreach activities including RoboPlay Competitions, the C-STEM Center seeks to inspire students to pursue computing and STEM related careers and post-secondary study.", format: "Programming integrated in other classes", street: "One Shields Avenue", longitude: -121.755, latitude: 38.5398, contact_email: "", phone: "", languages: "---\n- C++\n- C/c++ interpreter ch\n", country: nil},
