  {name: "National University of Singapore Dept of ECE", city: "Singapore", state: nil, zip_code: 117583, site_url: "http://www.ece.nus.edu.sg", ed_level: "---\n- College\n", bio: "Programming for Computer Interfacing: This course teaches students the inner workings of, and how to program, an ARM system-on-chip and interface it to devices and peripherals, e.g. sensors and actuators, using industry standard protocols such as I2C and UART. Uses ARM assembly and C languages and culminates in developing an actual embedded system application.\r\n", format: "Full university CS curriculum", street: "4 Engineering Drive 3", longitude: 103.772, latitude: 1.29858, contact_email: "eletck@nus.edu.sg", phone: "", languages: "---\n- Arm assembly language\n- C\n", country: nil},
  {name: "digital monkey school", city: "Belmont", state: "CA", zip_code: 94002, site_url: "http://www.digitalmonkeyschool.com/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Digital Monkey School was founded in April of 2006. Our mission is innovative Art education, promotion of art and independent development of video games and animation. \r\n\r\nWe teach Digital Art, introducing modern digital Art Creation Tools (like Photoshop, After Effects, 3DStudio Max, Unity, UT3, Game Maker, Maya, Flash and much more) to youngsters and adults. \r\n\r\nWe have different experimental educational programs that are inclusive to a wide range of students of different age groups and skill levels; from young beginners to post graduates and video game professionals.", format: "Afterschool program", street: "720 El Camino Real # 101", longitude: -122.279, latitude: 37.5228, contact_email: "digitalmonkeyschool@gmail.com", phone: "6507034469", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- Python\n- Scratch\n", country: nil},
