  {name: "Engineering and Computer Science", city: "Wellington", state: "Wellington", zip_code: 6014, site_url: "http://www.victoria.ac.nz/ecs/", ed_level: "---\n- College\n", bio: "Victoria University of Wellington offers a four-year Bachelor of Engineering with Honours BE(Hons). There are three specialisations: Electronic and Computer System Engineering, Network Engineering and Software Engineering.\r\n\r\nThe BE focuses on the design and implementation of real-world systems and gives an essential grounding in business and management skills. A work placement in a relevant industry is part of the degree, typically taken in the summers after the second and third years of study. This, along with a group project in your third year and an industry-driven project in your fourth year, gives real-life experience with practical aspects of engineering design and development.\r\n\r\nVictorias BE programme requires you to include three related courses that provide some knowledge and expertise in a field that complements your specialisation. Examples of subjects that you might choose would be Information Systems or Management to give your programme an entrepreneurial leaning, or Asian Studies to prepare yourself for overseas projects.\r\n\r\nThe BE will open a wide range of careers including electronics, robot design, systems development, hardware development, programming, systems management, and research. High-achieving students will be awarded the degree with Honours, enabling direct entry to Masters or PhD study.\r\n", format: "Full university CS curriculum", street: "Cotton Building, Kelburn Parade", longitude: nil, latitude: nil, contact_email: "engineering@vuw.ac.nz", phone: "+64 4 463 5101", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n- Whiley\n", country: nil},
  {name: "Wesley Academy", city: "Houston", state: "TX", zip_code: 77042, site_url: "http://www.wesleyacademy.net", ed_level: "---\n- Elementary\n- Middle School\n", bio: "In Grade 3, students are introduced to what Programming is and what it does, although very little actual programmings is taught. In Grade 4, students are introduced to programming through a class project using Lego Robotics. In Grades 5 and 6, students start to using Scratch Programming to build their own projects. In Grade 7 and 8, students use Code Avengers and the curriculum from Code.org to start learning HTML5, CSS3, and JavaScript. All of these classes are part of the overall technology courses taught at Wesley Academy. Other parts of these courses include basic computer skills, learning how to use and access a network, as well as video editing and other presentation media. ", format: "Programming integrated in other classes", street: "10570 Westpark Dr.", longitude: -95.5542, latitude: 29.7246, contact_email: "twaguespack@wesleyacademy.net", phone: "", languages: "---\n- Css3\n- HTML\n- Javascript\n- Lego robitics\n- Scratch\n", country: nil},
