  {name: "Trinity School at River Ridge", city: "Eagan", state: "MN", zip_code: 55121, site_url: "http://trinityschools.org/riverridge/", ed_level: "---\n- High School\n", bio: "Trinity School at River Ridge offers computer programming to all students as a part of core math-science curriculum. All juniors at Trinity School are given computers and learn to program using MATLAB (short for Matrix Laboratory). They then apply their programming skills throughout the final two years of physics and calculus, using MATLAB to model mathematical situations and real world physics problems.", format: "Daily programming course", street: "601 River Ridge Parkway", longitude: -93.1081, latitude: 44.8594, contact_email: "jbalsbaugh@trinityschools.org", phone: "651.789.2890", languages: "---\n- Alice\n- Matlab\n", country: nil},
  {name: "Digerati Girls", city: "Southfield", state: "MI", zip_code: 48037, site_url: "http://www.digeratigirls.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Creating Workshops, Programs, and Experiential Opportunities to Increase the Number of Women, & Young Girls in Digital Entrepreneurship & Digital Marketing Careers.\r\n\r\nCurriculum options include AppLab, WebLab, MediaLab, IdeaLab where participants create apps, websites, digital marketing and social media products to introduce and STEM and coding skills.\r\n\r\nWorkshops are hosted at local public and private schools, universities, major technology companies and specialized developer shops. ", format: "All-day workshop (up to 1 week)", street: "22200 West Eleven Mile Road #271", longitude: -83.263, latitude: 42.4876, contact_email: "events@digeratigirls.com", phone: "248.633.8514", languages: "---\n- C++\n- HTML\n- Kodu\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Seavus Education & Development Center", city: "Skopje", state: "SK", zip_code: 1000, site_url: "http://sedc.seavus.com", ed_level: "---\n- Middle School\n- High School\n", bio: "SEDC Code Academy is one-year program having 15 hours per week of intensive learning how to code using latest technologies and best practices. You can start as a total beginner and in a full-year length you'll become very advanced in multiple programming languages and platforms with strong skills to create complex software solutions that work in various environments today.", format: "Full university CS curriculum", street: "11 Oktomvri bb", longitude: 21.4326, latitude: 41.9928, contact_email: "hajan.selmani@seavus.com", phone: "+38978499255", languages: "---\n- Asp.net\n- C#\n- Css\n- HTML\n- Javascript\n- Jquery\n- Mobile Apps\n- PHP\n- Sql\n", country: nil},
  {name: "NYC Generation Tech", city: "New York", state: "NY", zip_code: 10005, site_url: "http://www.nycgenerationtech.com", ed_level: "---\n- High School\n", bio: "GenTech is a tech-entrepreneurship program that provides hands-on learning experiences and mentorship opportunities for NYC high school students interested in transforming the world through tech-based innovations. Developed by the Network for Teaching Entrepreneurship (NFTE), the New York City Economic Development Corporation, and supported by Microsoft and other major partners, GenTech is built around the following four components that seek to educate and inspire students to pursue careers in entrepreneurship and technology:\r\n\r\n1) Summer Programming:  In a two-week tech-entrepreneurship bootcamp, students learn about technology fundamentals, including computer programming and 3D printing, as well as how to write a business plan and lean startup methodologies. Students develop basic knowledge of HTML, CSS, and JavaScript and form teams to develop a mobile app and business plan aimed at improving education or the quality of city life for NYC students. Using the foundational skills from the bootcamp, students focus on building out their mobile app and business plans for another six weeks with a mix of evening mentoring sessions and group and independent work. Throughout the summer, students are exposed to the NYC tech startup ecosystem through guest speakers and field trips. (July-August)\r\n\r\n2) Mentorship & Enterprise Discovery:  : Students receive mentorship from local business/technology undergraduate and graduate students during the bootcamp phase. After the bootcamp, each student team is paired with a small team of Tech Mentors from industry-leading tech and business organizations. Tech Mentors provide support, insight, and guidance to students during evening mentoring sessions. Mentoring sessions are held at various tech-related companies throughout NYC.\r\n\r\n3) Demo Night & Awards Ceremony:  In September, students demo and pitch their finished apps and business plans to a panel of prominent judges from the technology and venture capitalist community. Members of the winning team receive cash prizes and all students are honored at an awards ceremony.\r\nHackathons:  During the fall and early winter, GenTech students will participate in mobile app hackathons alongside professional developers and designers so that students can further develop skills in coding and design, gain more experience of working with tech professionals, and continue to build a network within the tech and startup sectors.\r\n\r\n4) Hackathons:  During the fall and early winter, GenTech students participate in mobile app hackathons alongside professional developers and designers so that students further develop skills in coding and design, gain more experience of working with tech professionals, and continue to build a network within the tech and startup sectors.", format: "Summer camp", street: "120 Wall Street, 18 Floor", longitude: -74.0053, latitude: 40.705, contact_email: "nycgenerationtech@nfte.com", phone: "", languages: "---\n- Css\n- HTML\n- Javascript\n", country: nil},
