  {name: "Web Start Women", city: "Cambridge", state: "MA", zip_code: 2142, site_url: "http://webstartwomen.com", ed_level: "---\n- Vocational\n", bio: "Web Start Women is an organization devoted to bringing more women into the web design and development fields. We believe that there are too few women producing awesome content online and we aim to change the ratio by cultivating open, supportive, intimidation-free environments where women and girls of all ages can learn, build, and code together. We offer friendly and affordable classes in a variety of web development topics, run project nights, and host speakers. Visit our Meetup group for a complete schedule of upcoming classes and events.", format: "Multi-week workshop", street: "1 Broadway", longitude: -71.0832, latitude: 42.3627, contact_email: "nicole@webstartwomen.com", phone: "", languages: "---\n- Css\n- Git\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Wordpress\n", country: nil},
