  {name: "University of Pikeville", city: "Pikeville", state: "KY", zip_code: 41501, site_url: "http://www.upike.edu", ed_level: "---\n- College\n", bio: "The computer science program is part of the Division of Mathematics and Natural Sciences. The major in computer science combines a liberal arts education in the areas of science and mathematics and a flexible curriculum of courses in computer science. Students will develop an understanding of the concepts and applications of computer systems.\r\n", format: "Full university CS curriculum", street: "147 Sycamore st", longitude: -82.521, latitude: 37.4789, contact_email: "", phone: "", languages: "--- []\n", country: nil},
