  {name: "Los Angeles Harbor College", city: "Los Angeles", state: "CA", zip_code: 90744, site_url: "http://www.lahc.edu/", ed_level: "---\n- College\n", bio: "Students wishing to transfer in Computer Information Systems (CIS) should pursue an A.A. degree in Business Administration with the advice of a counselor. The A.S. degree in CIS prepares students to enter the workplace directly or advance in their current position. Graduates may be employed in systems analysis, systems integration, network administration, software development and programming, computer support, systems administration, database administration, and web site design and administration. Please visit the website, contact Business Division Chairman, Stan Sandell, or call (310) 233-4181 for more information.", format: "Daily programming course", street: "1111 Figueroa Place ", longitude: -118.281, latitude: 33.7838, contact_email: "", phone: "", languages: "---\n- C++\n- Visual basic\n", country: nil},
  {name: "Los Angeles Mission College", city: "Sylmar", state: "CA", zip_code: 91342, site_url: "http://www.lamission.edu/", ed_level: "---\n- College\n", bio: "Courses in the area of Computer Science offer the student a hands-on approach in a structured working environment which includes applications, installations of software, hardware diagnostics and trouble-shooting, and network set-up. At this time, the Computer Science Associates degree and Certificates curriculum is going under evaluation. Please visit the Computer Science department website for updates, or contact Mari Rettke, the Chair, or call (818) 364-7697 for more information.", format: "Daily programming course", street: "13356 Eldridge Avenue", longitude: -118.42, latitude: 34.3146, contact_email: "", phone: "", languages: "---\n- C\n- C++\n- Cobol\n- Java\n- Pascal\n- Visual basic\n", country: nil},
  {name: "Los Angeles Pierce College", city: "Woodland Hills", state: "CA", zip_code: 91371, site_url: "http://www.piercecollege.edu/", ed_level: "---\n- College\n", bio: "The Computer Science Department offers courses and curricula in several areas of emphasis in the computer field. The department offers three areas of specialization at the associate degree level. They are Programming for Business, Programming for Computer Science, and Computer and Network Technology. Associate degree curricula require the completion of a specific pattern of course work. Any substitutions or variations must have approval of the department. Certificates include: PC Application Specialist, DB Program Specialist, Business Programming, Computer programming, PC Service Technology, Network Technology, Routing Technology, Website Development, and Web Development, Programming, and Scripting. Please contact instructor, Natalia Grigoriants, or call (818) 719-6458 for more information.", format: "Daily programming course", street: "6201 Winnetka Ave.", longitude: -118.58, latitude: 34.1837, contact_email: "", phone: "", languages: "---\n- C\n- C++\n- Java\n- Javascript\n- Visual basic\n", country: nil},
  {name: "Los Angeles Valley College", city: "Los Angeles", state: "CA", zip_code: 91401, site_url: "http://www.lavc.edu/", ed_level: "---\n- College\n", bio: "The Computer Science department has a wide variety of degree and certificate (Computer Science Programming and Interdepartmental Microcomputer Systems) programs are available to prepare students for a career in Computer Science or for transfer to a four year institution. Consult the course catalog for the most up-to-date information on the AS degrees and certificates. Please contact the Department Chair, Ronald Reis, or call (818) 947- 2582 for further information.", format: "Daily programming course", street: "5800 Fulton Avenue ", longitude: -118.422, latitude: 34.1758, contact_email: "", phone: "", languages: "---\n- C\n- C++\n- Java\n- Visual basic\n", country: nil},
  {name: "MiraCosta College", city: "Oceanside", state: "CA", zip_code: 92056, site_url: "http://www.miracosta.edu/", ed_level: "---\n- College\n", bio: "The Computer Science (CS) discipline includes a variety of specialties, such as systems programming, artificial intelligence, robotics, networking, and graphics. In preparation for transfer into more advanced fundamental and specialized areas, students learn basic programming, data structures, and architecture. Computer science majors will also need two or three semesters of calculus and discrete mathematics, depending on their choice of transfer institution. ", format: "Daily programming course", street: " 1 Barnard Drive ", longitude: -117.302, latitude: 33.1915, contact_email: "", phone: "", languages: "---\n- C++\n- Java\n- Python\n- Visual basic\n", country: nil},
  {name: "Mission College", city: "Santa Clara", state: "CA", zip_code: 95054, site_url: "http://www.missioncollege.org", ed_level: "---\n- College\n", bio: " The Computer Information System (CIS) program is designed to provide students with the knowledge and skills required to gain entry level employment as computer programmers, and/or software/system administration technicians.  The program offers students the choice of pursuing an Associate of Science (A.S.) degree in Computer Science, or certificate(s) with general and C/C++/Unix programming and emphasis.\r\n\r\nThe Computer Information Systems department also offers a transfer program.  The courses offered in the transfer program will transfer to California State University/ University of California systems, and other four year colleges.  In addition, the program provides courses to update skills in areas such as programming in C/C++/Unix Systems Administration and networking.   For more information, please call (408) 855-5357 or email.", format: "Daily programming course", street: "3000 Mission College Boulevard Santa Clara, CA 95054-1897", longitude: -121.98, latitude: 37.3913, contact_email: "", phone: "", languages: "---\n- C\n- C++\n- PHP\n- Perl\n- Unix\n- Visual basic\n", country: nil},
  {name: "Modesto Junior College", city: "Modesto", state: "CA", zip_code: 95350, site_url: "http://www.mjc.edu/", ed_level: "---\n- College\n", bio: "The programs in Computer Science and Information Systems provides students with the knowledge, training and hands-on skills to meet the increasing demand for computer specialists in computer science, information systems, database administration, network administration, and web development.  The work of a computer scientist, database administrator, and network analyst include a wide range of specialists.  Job tasks and occupational titles used to describe these workers evolve rapidly, reflecting new areas of specialization or changes in technology, as well as the preferences and practices of employers. Computer Scientists, database administrators, and network analysts are expected to be among the fastest growing occupations over the next ten years.", format: "Daily programming course", street: "435 College Avenue Modesto, CA 95350", longitude: -121.012, latitude: 37.653, contact_email: "", phone: "", languages: "---\n- HTML\n- Visual basic\n", country: nil},
  {name: "Moorpark college", city: "Moorpark", state: "CA", zip_code: 93021, site_url: "http://www.moorparkcollege.edu/", ed_level: "---\n- College\n", bio: " Computer Science is concerned with the design, modeling, analysis, and applications of computer-related systems. The Computer Science program at Moorpark College prepares students for further study in Computer Science. It also provides vocational training necessary to understand, design, implement, and use the software and hardware of digital computers and digital systems. Computer Science degree courses are scheduled in a two-year pattern. Please refer to the PDF posted here for the current rotation of course offerings. The alternation of courses requires that students plan the semesters they will take each course carefully. Please contact an academic counselor to develop an educational plan, (805) 378-142", format: "Daily programming course", street: "7075 Campus Road, Moorpark, CA 93021 ", longitude: -118.835, latitude: 34.3018, contact_email: "", phone: "", languages: "---\n- C#\n- C++\n- HTML\n- Java\n- Xmlc\n", country: nil},
  {name: "Monterey Peninsula College", city: "Monterey", state: "CA", zip_code: 93940, site_url: "http://www.mpc.edu/", ed_level: "---\n- College\n", bio: "MPCs Computer Science and Information Systems Department offers comprehensive programs leading to transfer, vocational and job training in a number of areas.  Degrees and certificates are offered in Computer Information Systems Design, Computer Software Applications and Computer Technology.   The curriculum places emphasis on the general principles, concepts, skills and competencies required for future education and work in this field.  Additional programs are being developed in networking technologies, Web page design and Web master skills.", format: "Daily programming course", street: "980 Fremont St.", longitude: -121.885, latitude: 36.5903, contact_email: "", phone: "", languages: "---\n- C\n- C++\n- HTML\n- Java\n- Visual basic\n- Xhtma\n", country: nil},
  {name: "Moreno Valley College", city: "Moreno Valley", state: "CA", zip_code: 92551, site_url: "http://www.mvc.edu/", ed_level: "---\n- College\n", bio: "The CIS program is an introduction to computer concepts, theory and computer applications and programming. Functions and capabilities of word processors, spreadsheets, databases, presentation graphics and the Internet are covered through lecture, discussion and hands-on computer assignments as part of the Office Technologies (CAT) program. For Information contact: Sabina Fernandez at (951) 571-6125", format: "Daily programming course", street: "16130 Lasselle Street", longitude: -117.205, latitude: 33.8861, contact_email: "", phone: "", languages: "---\n- Assembler\n- C++\n- HTML\n- Java\n- Javascript\n", country: nil},
  {name: "Mount San Antonio", city: "Walnut", state: "CA", zip_code: 91789, site_url: "http://www.mtsac.edu/", ed_level: "---\n- College\n", bio: "College coursework in Computer Information Systems (CIS) opens the door for potential careers in database management, networking and telecommunications, systems administration, programming, network security administration, and data entry. Mt. San Antonio College offers 4 Associate of Science Degrees: Administrative Assistant, Computer: Database Management Systems, Computer Network Administration and Security Management, and Computer Programming. Please contact Department Co-Chairs, Barry Andrews and Vic Zamora, or call (909) 274-4943 for additional information.", format: "Daily programming course", street: " 1100 N. GRAND AVENUE", longitude: -117.848, latitude: 34.045, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "Mt. San Jacinto College", city: "San Jacinto", state: "CA", zip_code: 92583, site_url: "http://www.msjc.edu", ed_level: "---\n- College\n", bio: "MSJCs Computer Information Systems program is designed to\r\nprovide students with the knowledge and skills required to gain entry level employment as computer programmers, and/or software/system administration technicians. The program offers students the choice of pursuing an Associate of Science (A.S.) degree in Computer Information Systems or certificate(s) with emphasis in General Track, Internet Authoring, Networking and Programming. The program also offers a transfer preparation. The courses offered will transfer to California State University/University of California systems, and other four year colleges.", format: "Daily programming course", street: "1499 N. State St", longitude: -116.967, latitude: 33.8068, contact_email: "", phone: "", languages: "---\n- Actionscript\n- C++\n- HTML\n- Java\n- PHP\n- Ruby\n- Visual basic\n- Xml\n", country: nil},
  {name: "Norco College", city: "Norco", state: "CA", zip_code: 92860, site_url: "http://www.norcocollege.edu", ed_level: "---\n- College\n", bio: "Computer Science is hosted in the BEIT Department.  BEIT offers a number of certificate pattern programs. Certificate programs, leading to an associate of science degree require a minimum of 18 units (6 classes or so).\r\n\r\nCertificates can be completed within one and a half to two years and lead to employment!\r\n\r\nEach course required for the certificate must be completed with a \"C\" grade or better and all can be counted toward the degree as well as the major. \r\n\r\nThe Business, Engineering and Information Technology Department at Norco College is home to the following disciplines:", format: "Daily programming course", street: "2001 3rd Street", longitude: -117.569, latitude: 33.9154, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n", country: nil},
  {name: "Ohlone College", city: "Fremont", state: "CA", zip_code: 94539, site_url: "http://www.ohlone.edu/", ed_level: "---\n- College\n", bio: "Ohlone's Computer Science  courses and many A.S. and A.A. Degrees and Certificate options prepare students for employment in the field of computers, networking, and emerging fields in technology as a computer programmer, database administrator, systems administrator, support specialist, network technician, computer engineer, web developer, or related positions.  For more information, please call (510) 979-7471 or email", format: "Daily programming course", street: "43600 Mission Boulevard Fremont, CA 94539-5847", longitude: -121.916, latitude: 37.5277, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Perl\n- Xml\n", country: nil},
  {name: "Orange Coast College", city: "Costa Mesa", state: "CA", zip_code: 92626, site_url: "http://www.orangecoastcollege.edu/", ed_level: "---\n- College\n", bio: "The Computer Science program has a great faculty team. The CS program offers 13 courses related to computer programming, Certificates of Completion and A.S. degree and transfer options.\r\n\r\n\r\nTo learn more about these programs, email Bill Saichek or by phone at (714) 432-5631.", format: "Daily programming course", street: "2701 Fairview Road", longitude: -117.912, latitude: 33.6719, contact_email: "", phone: "", languages: "---\n- .net\n- C++\n- HTML\n- Java\n- Xml\n", country: nil},
  {name: "Palomar College", city: "San Marcos", state: "CA", zip_code: 92069, site_url: "http://www.palomar.edu/", ed_level: "---\n- College\n", bio: "The Computer Science and Information Systems program offers many degree and certificate programs, as well as course work and preparation for transfer to a four-year program of study. Here are some Associate degrees we currently offer: Computer Science, Information Technology, and Networking. And here are some of our certificates offered: Database and Web Technologies. If you need more information, please contact Department Chair, Rand Green, or call (760) 744-1150 x2387.", format: "Daily programming course", street: "1140 West Mission Road", longitude: -117.184, latitude: 33.1507, contact_email: "", phone: "", languages: "---\n- Applescripting\n- C#\n- C++\n- HTML\n- Iphone_sdk\n- Java\n- Java_mobile\n- Mobile Apps\n", country: nil},
  {name: "Pasadena City College", city: "Pasadena", state: "CA", zip_code: 92206, site_url: "http://www.pasadena.edu/", ed_level: "---\n- College\n", bio: "The Business and Computer Technology academic department offers more than 130 courses. More than 20 general business courses cover an assortment of topics including principles of business law, financial management, Business Information Technology, Computer Information Systems, and human relations. In most courses, students have the opportunity to develop and practice their skills in the area of microcomputers. Many courses are offered for both day and evening students. You will even find an Online Certificate Program in Business Information Technology. This is a 27 unit certificate consisting of 12 courses.", format: "Daily programming course", street: " 1570 E. Colorado Blvd.", longitude: -118.119, latitude: 34.1439, contact_email: "", phone: "", languages: "---\n- Bash\n- C\n- C++\n- Fortran\n- HTML\n- Java\n- Pascal\n", country: nil},
  {name: "Riverside City College", city: "Riverside", state: "CA", zip_code: 92501, site_url: "http://www.rcc.edu", ed_level: "---\n- College\n", bio: "The Computer Information Systems department is located in 3 of the colleges affiliated with the Riverside Community College District. Please go to Riverside, Moreno Valley, and Norco to check out the available degrees and certificates. If you need more information, please contact Matthew Barboza, or call (951) 571-6245.", format: "Daily programming course", street: "3845 Market Street", longitude: -117.376, latitude: 33.9821, contact_email: "", phone: "", languages: "---\n- Assembler\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n", country: nil},
  {name: "Viscuit juku", city: "Kohoku Ward", state: "Kanagawa Prefecture", zip_code: 222, site_url: "http://www.digitalpocket.org", ed_level: "---\n- Preschool\n- Elementary\n", bio: "We provide programming classes for ages 4 - 10, using \"Viscuit\", visual programming language developed by Dr. Yasunori Harada at NTT communication science labo.\r\nSorry our website has only Japanese but please feel free for ask us any questions in English.", format: "Afterschool program", street: "Shinohara-kita 1-3-36", longitude: 139.628, latitude: 35.5089, contact_email: "dp_info@digitalpocket.org", phone: "+81-45-642-7150", languages: "---\n- Viscuit\n", country: nil},
  {name: "Sacramento City College", city: "Sacramento", state: "CA", zip_code: 95822, site_url: "http://www.scc.losrios.edu/", ed_level: "---\n- College\n", bio: "SCCs Computer Information Sciences (CIS) Department is within the Business Division.  CIS offerings are divided into 5 categories:  Applications, Networking, Programming, Security, and Web.  There is a common core for 8 different AS degrees.  Additionally, CIS offers 16 Certificates of Achievement and 4 Certificates of Completion.  Further information is available here.  Under the Business Division Dean, 11 quality faculty members teach CIS subjects.  For more information, come by the main campus, Business Building, Room 213, call (916) 558-2581 or email.", format: "Daily programming course", street: "3835 Freeport Boulevard", longitude: -121.486, latitude: 38.5407, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Javascript\n- PHP\n- Xml\n", country: nil},
  {name: "Saddleback College", city: "Mission Viejo", state: "CA", zip_code: 92692, site_url: "http://www.saddleback.edu/", ed_level: "---\n- College\n", bio: "The Computer Science department offers an Associate Degree program is designed to prepare the student for junior-level standing in a Computer Science program at a four-year institution. Students should refer to the Transfer Information link as well as the catalog of the intended transfer institution for specific requirements. For more information, please contact Division Chair, Michelle Rousseau, or call (949) 582-4728.", format: "Daily programming course", street: " 28000 Marguerite Parkway", longitude: -117.665, latitude: 33.5506, contact_email: "", phone: "", languages: "---\n- Ajax\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Visual basic\n- Xml\n", country: nil},
  {name: "San Bernardino Valley College", city: "San Bernardino", state: "CA", zip_code: 92410, site_url: "http://www.valleycollege.edu/", ed_level: "---\n- College\n", bio: "Courses offered by the Computer Science Department are interactive, featuring hands-on experience with the colleges computer hardware and software. The courses cover a range of topics in the computer field with an emphasis on software engineering and information processing. The Computer Science curriculum may culminate in either an Associate of Science degree or a certificate. The degree program prepares students to transfer to a four-year institution with a major in computer science or a related discipline. Students planning to transfer to a four-year institution and major in computer science should consult with a counselor regarding the transfer process and lower division requirements. For more information, please contact the Department Chair, Roger Powell, or call (909) 384-8910.", format: "Daily programming course", street: "701 South Mount Vernon Ave ", longitude: -117.314, latitude: 34.0885, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Visual basic\n", country: nil},
  {name: "York University", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://finearts.apps01.yorku.ca/fasi/2013-boot-camp/art-electronics-arduino-boot-camp/", ed_level: "---\n- High School\n- College\n", bio: "Art & Electronics: Arduino Boot Camp: \r\n\r\nThis four-day, full-time boot camp will be teach participants how to create interactive electronic art using Arduino, the open-source electronics platform used by artists, designers and hobbyists around the world.\r\n\r\nParticipants will create projects that enable computers and other hardware to interact with the real world through a series of hands-on workshops.\r\n\r\nThrough the application of practical skills, participants will learn about electronics, programming and physical computing and how these practices fit into the world of digital media art.\r\n\r\nAll participants will receive their own Arduino Starter Kit by participating in the workshop  yours to keep!\r\n\r\nRegistration and complete details are available online through the website.\r\n\r\nDates: July 15-18, 2013, 9:30AM  3:30PM\r\nFees: $350 plus HST\r\nMaximum Number of Participants: 15", format: "Summer camp", street: "4700 Keele Street", longitude: -79.4984, latitude: 43.7742, contact_email: "fasi@yorku.ca", phone: "416-736-2100 ext 44538", languages: "---\n- Arduino\n", country: nil},
  {name: "York University", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://finearts.apps01.yorku.ca/fasi/2013-boot-camp/art-code-digital-art-boot-camp/", ed_level: "---\n- High School\n- College\n", bio: "Art & Code: Digital Art Boot Camp: Creative coding uses media-based programming environments that enable artists and non-programmers to create a wide range of digital media art. This four-day, full-time workshop will be aimed at high school students interested in learning how to make interactive art with creative coding.\r\n\r\nParticipants will be introduced to a variety of programming platforms that are currently used to create: mobile & locative media, interactive screen-based art, media installations, video games, and interactive web-based experiences.\r\n\r\nComplete registration and program details available on the website.\r\n\r\nDates: July 8-11, 2013\r\nFees: $300 plus HST\r\nMaximum Number of Participants: 15", format: "Summer camp", street: "4700 Keele Street", longitude: -79.4984, latitude: 43.7742, contact_email: "fasi@yorku.ca", phone: "416-736-2100 ext 44538", languages: "---\n- Java\n- Max\n- Processing\n", country: nil},
  {name: "Wenatchee High School", city: "Wenatchee", state: "WA", zip_code: 98801, site_url: "http://whs.wsd.wednet.edu", ed_level: "---\n- High School\n", bio: "Intro to Computer Programming offers students a chance to learn to program in Java by writing simulations, games, and interactive tools. Students also get to try other types of programming by experimenting with programming tools and seeing what is new in the world of code.\r\n\r\nProjects in Computer Programming gives students a time to take what they've learned in the intro class and write their own program as an individual or team. They can work on a mobile app, web apps, robotics programming or any other programming topic they are interested in.", format: "Daily programming course", street: "1101 Millerdale Ave", longitude: -120.327, latitude: 47.4116, contact_email: "", phone: "", languages: "---\n- Java\n- Mobile Apps\n", country: nil},
  {name: "Discover Your World S.T.E.M Mentors", city: "Snellville", state: "GA", zip_code: 30078, site_url: "http://www.discoveryourworldk12.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Discover Your World is an afterschool Program that supports and encourage elementary students to explore Math, Science, and Technology. The hands on inquiry based activities/lessons are in direct correlation with national and state standards.  \r\n During the after school program students spend some of their time participating in enrichment activities that support the instruction that is provided during the regular school day. Discover Your Summer is an extension to the afterschool program. Students are actively involved in a variety of activities that include; creating solar ovens, learning how to filter and purify water, building model rockets, exploring chemical reactions, intro to coding, and much more. With math, science, and technology, the possibilities are endless. It is our mission to also expose and encourage more minorities to explore the STEMs arena. The most rewarding aspect of this program is to see the children in ACTION and DOING Math, Science, & Technology. Students love to create structures with Legos and tap into their innovative minds. Our students love to make connections and investigate how science relates to their everyday lives. \r\n\r\n\r\nClass schedules vary. Please contact us for details.", format: "Other", street: "2035 Westside Court", longitude: -84.0534, latitude: 33.8466, contact_email: "discoveryourworldk12@yahoo.com", phone: "770-778-4591", languages: "---\n- Scratch\n", country: nil},
  {name: "Clermont Northeastern High School", city: "Batavia", state: "OH", zip_code: 45103, site_url: "http://www.cneschools.org", ed_level: "---\n- High School\n", bio: "Programming 1 - Introductory programming course teaching concepts such as variables, assignment statments, loops, conditionals, methods, and objects. The course uses Alice and Greenfoot. ", format: "Daily programming course", street: "5327 Hutchinson Rd", longitude: -84.0931, latitude: 39.1642, contact_email: "hoeppner_s@cneschools.org", phone: "", languages: "---\n- Alice\n- Java\n", country: nil},
