  {name: "thisKidCanCode", city: "Memphis", state: "TN", zip_code: 38103, site_url: "http://www.thiskidcancode.com", ed_level: "---\n- Middle School\n- High School\n", bio: "Mission: Changing lives through technology acumen\r\n\r\nFocus: Our goal is to change lives by providing computer programming apprenticeships and workshops, which will provide exposure to and remove barriers associated with: college, careers, and entrepreneurship.\r\n\r\nWorkshops will also tap into the creativity of each participant and foster their entrepreneurial spirit; as participants will learn how to create technology and not just use it. \r\n\r\nSee website for registration and details. http://www.thiskidcancode.com", format: "Afterschool program", street: "66 S Main Suite 305", longitude: -90.0532, latitude: 35.1433, contact_email: "info@thiskidcancode.com", phone: "", languages: "---\n- Css\n- HTML\n- Java\n- Javascript\n- Jquery\n- PHP\n", country: nil},
  {name: "Keene Adventist Elementary School", city: "Keene", state: "TX", zip_code: 76059, site_url: "http://www.kaes4kids.com", ed_level: "---\n- Middle School\n", bio: "Class meets twice a week for 40 minutes each.\r\nIncludes web design, html coding, Alice 2 & Scratch.", format: "Daily programming course", street: "302 Pecan St", longitude: -97.3225, latitude: 32.3971, contact_email: "dgwilson@txsda.org", phone: "817-645-9125", languages: "---\n- Alice\n- HTML\n- Scratch\n", country: nil},
  {name: "Bronx Academy for Software Engineering", city: "New York", state: "NY", zip_code: 10458, site_url: "http://bronxsoftware.org", ed_level: "---\n- High School\n", bio: "BASE is a public high school in New York City that focuses on computer science and programming. Students take CS all four years, and graduates will not only have technical skills but will own the design thinking process that is so critical to success regardless of their path after graduation. Even more importantly, we see software engineering and coding as ways of empowering all of us to understand ourselves and our communities better, and to help shape the world into a better place.", format: "Daily programming course", street: "2474 Crotona Ave.", longitude: -73.8825, latitude: 40.8561, contact_email: "info@bronxsoftware.org", phone: "", languages: "---\n- Alice\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Ruby\n- Scratch\n", country: nil},
