  {name: "Math Magicians, Inc.", city: "Quartz Hill", state: "CA", zip_code: 93536, site_url: "http://www.mmtutor.com", ed_level: "---\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Our course is 14 weeks long, one-hour per week.  Students will learn program development using structured programming techniques.  They will problem solve through development of algorithms.  Students will learn the mechanics of running, testing, and correcting programs.  They will also learn to plan, create, test and run their own programs.", format: "Afterschool program", street: "42202 50th Street West, Ste D", longitude: -118.218, latitude: 34.6495, contact_email: "learnmathmagic@gmail.com", phone: "661.718.3699", languages: "---\n- C++\n", country: nil},
