  {name: "University of Alabama Summer Computer Science Camps", city: "Vance", state: "AL", zip_code: 35487, site_url: "http://outreach.cs.ua.edu/camps/", ed_level: "---\n- Middle School\n- High School\n", bio: "The University of Alabama Department of Computer Science within the College of Engineering hosts a series of multi-week Computer Science camps each summer. A week-long middle school camp is available for commuting campers and two weeks of camps (commuter or residential dorm) are available for high school students. Students will be taught multiple topics of Computer Science while learning to program a computer in several exciting contexts (e.g., game programming and robotics at the middle school camps; and Java, robotics control and smartphone apps at the high school camps). The Computer Science camps are taught in a manner that encourages self-exploration across multiple projects.", format: "Summer camp", street: "Box 870290", longitude: -87.2566, latitude: 33.1536, contact_email: "gray@cs.ua.edu", phone: "205 348 2847", languages: "---\n- Java\n- Mobile Apps\n- Scratch\n", country: nil},
