  {name: "Life Christian School", city: "Aloha", state: "OR", zip_code: 97005, site_url: "http://lcslions.org/Activities/StudentLife.aspx", ed_level: "---\n- Middle School\n- High School\n", bio: "Introduction to Computer Science teaches the fundamentals of computer programming starting with C and moving to Objective-C. Students learn to write basic computer programs using Xcode IDE on Mac OS X. The course moves on to a introduction of graphics programming using Cocos2d to develop a graphical game on the iPhone.", format: "Daily programming course", street: "5585 SW 209th Ave", longitude: -122.895, latitude: 45.4796, contact_email: "cyang91@gmail.com", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n", country: nil},
  {name: "CBS Primary", city: "Mitchelstown", state: "Cork", zip_code: 0, site_url: "http://www.cbsmitchprim.scoilnet.ie", ed_level: "---\n- Middle School\n", bio: "CBS Coder-Maker Club after-school club for boys in the senior classes (pilot scheme). The clubs focus will be on computer coding skills and engagement in collaborative and creative projects (some of which will include robotics and design of computer games, websites, animations, musical instruments. etc). This idea is inspired by Coderdojo, Makerspace and Codecademy, all of which are becoming global phenomenon!\r\n", format: "Afterschool program", street: "Brigown", longitude: -8.26974, latitude: 52.2629, contact_email: "juniorclasscliffher@gmail.com", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "Creative Coding For Kids", city: "Seattle", state: "WA", zip_code: 98103, site_url: "http://www.creativecoding4kids.com", ed_level: "---\n- Elementary\n", bio: "We teach kids the joy of coding computers by helping them write their own customized computer game!\r\n\r\n\r\nWe are currently offering a half-day, week long summer camp here in NE Seattle, for ages 8-12. We use Scratch, the MIT-developed tool created just for this purpose.  After-school classes are also being considered for next fall. \r\n\r\n\r\nFor up-to-date class dates and times, please go to our website. The address given is this year's class location. Use email for all correspondence. \r\n\r\n\r\nOur philosophy: Today's computers are more like a box of crayons than a calculator. Major math skills are no longer required. The most important traits for coding today are CREATIVITY and PERSISTENCE. \r\n\r\n\r\nI started this class because I didn't see much out there for kids my daughter's age. I think we need to start 'em young, especially if we want to encourage girls like my daughter. The key is to make it fun, provide encouragement and gentle guidance, then let them be creative with coding.\r\n\r\n\r\nCheck out our site.\r\nhttp://www.creativecoding4kids.com", format: "Summer camp", street: "4649 Sunnyside Ave N", longitude: -122.331, latitude: 47.664, contact_email: "info@creativecoding4kids.com", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "Pythoner.CN", city: "Beijing", state: "Beijing", zip_code: 100080, site_url: "http://www.pythoner.cn", ed_level: "--- []\n", bio: "programming skill trainning.", format: "All-day workshop (up to 1 week)", street: " the North Road of Renda No.33, Suzhou Street", longitude: 116.307, latitude: 39.9707, contact_email: "", phone: "", languages: "---\n- Python\n", country: nil},
  {name: "iMedia College", city: "Dartmouth", state: "MA", zip_code: 2747, site_url: "http://www.myimedia.com/", ed_level: "---\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "iMedia's Modern Technology Education Initiative is providing at-work education and training in the field of Internet Technology, in collaboration with the local schools and colleges. Qualified students are offered the opportunity to work on local civil applications in partnership with local towns. Monthly 4-hour classes and weekly 1-hour labs currently available to registered students. Contact us to apply. ", format: "Afterschool program", street: "45 Slocum Road, Suite 4", longitude: -70.9581, latitude: 41.6068, contact_email: "imt@myimedia.com", phone: "617-299-9694", languages: "---\n- HTML\n- Javascript\n- Jquery and javascript/css/html frameworks\n- PHP\n- Relational databases\n", country: nil},
  {name: "CBS Coder-Maker Club- Mitchelstown", city: "Mitchelstown", state: "Cork", zip_code: 0, site_url: "http://cbscodermakerclub.edublogs.org", ed_level: "---\n- Middle School\n", bio: "CBS Coder-Maker Club after-school club for boys in the senior classes (pilot scheme). The clubs focus will be on computer coding skills and engagement in collaborative and creative projects (some of which will include robotics and design of computer games, websites, animations, musical instruments. etc). This idea is inspired by Coderdojo, Makerspace and Codecademy, all of which are becoming global phenomenon!", format: "Afterschool program", street: "CBS Primary-Brigown", longitude: nil, latitude: nil, contact_email: "", phone: "353 25 24505", languages: "---\n- Scratch\n", country: nil},
  {name: "Merritt Academy", city: "Fairfax", state: "VA", zip_code: 22031, site_url: "http://www.merrittacademy.org", ed_level: "---\n- Elementary\n", bio: "At Merritt Academy we teach Etoys and Logo starting in third grade. From there, we go on to Scratch, Alice and Basic. We also teach HTML. These courses are integrated into our computer curriculum for grades 3 - 6.", format: "Programming integrated in other classes", street: "9211 Arlington Blvd.", longitude: -77.2627, latitude: 38.8638, contact_email: "kathyk@merrittacademy.org", phone: "703-273-8000", languages: "---\n- Alice\n- HTML\n- Logo\n- Scratch\n", country: nil},
  {name: "Coleman University", city: "San Diego", state: "CA", zip_code: 92123, site_url: "http://www.coleman.edu", ed_level: "---\n- College\n- Vocational\n", bio: "For 50 years, Coleman University has served as San Diego's only exclusive Computer Training Institution. Founded in 1963, Coleman is recognized as a thriving force in the field of Information Technology. Renowned for its innovative, inverted curriculum, the University has proven to be successful in teaching thousands of students the skills they need to excel within their chosen field.\r\n\r\nThe University's motto \"Dreams into Reality\" is a testament to Coleman's dedication to ensuring that each student is equipped with the knowledge and skills they need to build the future of their dreams. \r\n\r\nSpecializing in programs such as: Network Security, Computer Networking, Information Systems, and Game Programming Development and Design, Coleman strives to provide students a top rate educational experience, while offering a supportive, friendly, and encouraging learning environment. Coleman's knowledgeable and supportive administrative staff and faculty further enhances one's learning process and make attending Coleman a wonderful and fulfilling experience. Committed to enhancing the life of its students, Coleman University aspires to maintain academic excellence and professional greatness.", format: "Full university CS curriculum", street: "8888 Balboa Ave", longitude: -117.136, latitude: 32.8222, contact_email: "admissions@coleman.edu", phone: "8584990202", languages: "---\n- Actionscript\n- Asp.net\n- C#\n- C++\n- Css\n- HTML\n- Java\n- Javascript\n- PHP\n- Perl\n", country: nil},
  {name: "Creative Circus", city: "Atlanta", state: "GA", zip_code: 30324, site_url: "http://creativecircus.edu", ed_level: "---\n- College\n- Vocational\n", bio: "The mission of The Creative Circus is to graduate the best-prepared, most avidly sought-after creatives in the industry. Programs offered: interactive development, interactive design, copywriting, grapgic design, art direction, and photography, . ", format: "Daily programming course", street: "812 Lambert Drive", longitude: -84.3618, latitude: 33.813, contact_email: "", phone: "", languages: "---\n- HTML\n- Javascript\n- PHP\n- Python\n- Ruby\n", country: nil},
  {name: "App Camp for kids", city: "Larkspur", state: "CA", zip_code: 94939, site_url: "http://larkspur.recdesk.com/recdeskportal/Programs/tabid/1753/Default.aspx", ed_level: "---\n- Middle School\n- High School\n", bio: "Making an app requires many skills beyond a brilliant idea - coding, design, and the ability to work as a development team. You also need an understanding of technology that goes beyond being able to get to the top level in your favourite gaming app.\r\nThis five-day course, August 5th-9th 2013, is an introduction to the tools and skills you need to make an app. We'll be working on a real app for a local business and you'll be taught by a top software engineer. You'll also have the chance to meet successful app developers from the Bay Area. Students need some programming experience (ie website design) and bring their own Mac laptop with the latest version of Mountain Lion and Xcode. ", format: "Summer camp", street: "240 Doherty Drive", longitude: -122.531, latitude: 37.939, contact_email: "claire@kidscontent.co.uk", phone: "", languages: "---\n- Mobile Apps\n- Objective-c\n", country: nil},
  {name: "Pretty River Academy", city: "Collingwood", state: "ON", zip_code: 0, site_url: "http://www.prettyriveracademy.com", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "Robotics is taught from pre-school to Grade 12.  Students program robots for in class competitions.  Team Robotics program outside of school hours as a specialized club.  This Team attends Robotic Competitions.", format: "Robotics club", street: "11521 Highway 26", longitude: -80.2564, latitude: 44.5172, contact_email: "info@prettyriveracademy.com", phone: "7054445376", languages: "--- []\n", country: nil},
  {name: "Copenhagen Coding Acadamy", city: "Copenhagen", state: "Capital Region of Denmark", zip_code: nil, site_url: "http://copenhagencode.dk", ed_level: "---\n- Middle School\n", bio: "Free courses for learners in middle school (grundskole). Your application requires a letter of recommendation from the faculty at your school.\r\nThe education will be on Saturdays or Sundays.\r\nSee copenhagencode.dk\r\n---\r\nKurser for studerende i grundskolen. Din ansgning krver en anbefaling af din lrer - eller resten af fakultetet - p din skole. \r\nUndervisningen tager sted hver anden lrdag eller sndag.", format: "Multi-week workshop", street: "To be announced", longitude: 12.5683, latitude: 55.6761, contact_email: "albert@copenhagencode.dk", phone: "", languages: "---\n- HTML\n- PHP\n", country: nil},
  {name: "Bonnells Bay Public School", city: "Bonnells Bay", state: "NSW", zip_code: 2264, site_url: "http://www.bonnellbay-p.schools.nsw.edu.au", ed_level: "---\n- Elementary\n", bio: "IT Class K-6", format: "Other", street: "Morisset Park Road", longitude: 151.517, latitude: -33.1166, contact_email: "", phone: "", languages: "--- []\n", country: nil},
  {name: "CompCamp", city: "Halifax", state: "NS", zip_code: 0, site_url: "http://compcamp.ca/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Programs\r\n\r\n*July 8-12, Aug 12-16 Game Development\r\n\r\nOne of the most popular CompCamp camps to date, Game Development allows participants to create their own simple game. Digging in to elements of basic programming, this camp will give the participant a beginners knowledge of the Java and/or C# programming language. At the culmination of the week, games are exhibited in front of friends and family, and awards are given.\r\n\r\n*July 15-19, Aug 19-23 Robotics & Visual Programming\r\n\r\nThis new camp is perfect for the kid with the hands-on inventors mind, bringing participants in to the world of programming and technology through the use of Lego robotics, Arduino projects and visual programming software. Through the multiple project opportunities, participants use equal parts creativity and logic to design and build tools for their world. All projects will be on show at the end of the week, with friends and family welcome to come try them out.\r\n\r\n*July 22-26 Build-a-Comp\r\n\r\nOver the course of a week, each participant will get a speed lesson in computer hardware, and build a machine from base up. This camp is perfect for the hands-on learner, who likes to tinker with technology- but requires no previous knowledge in the subject. By the end of the week, participants will be able to identify all the most important hardware pieces inside a computer, have assembled their own computer, and designed a dream comp, which they will pitch to a panel of professional judges for honours at the culmination of the camp.\r\n\r\n*July 29- Aug 2 App Development\r\n\r\nIn this camp, participants create an app using a visual programming tool. Theyll learn the essentials about user-interface design, demographic research, prototyping and of course, a brief intro to the basics of programming. Throughout the week, they will learn about the many types of apps, and be asked to create an app prototype on a specific theme, including a mini business plan. This app will be judged by a panel of our mentors for awards at the end of the week.\r\n\r\n*Aug 5-9 Web Creation\r\n\r\nThis course teaches participants about the valuable tools of web development, and how to use them to create professional-looking sites. The course uses design and usability challenges as participants learn basic HTML5 and CSS, and also delves in to various Content Management Systems (CMS) such as WordPress. By the end of the week, each student has perfected a website, and will have the chance to show family and friends, as well as win awards for achievement.\r\n\r\n", format: "Summer camp", street: "2583 Wood Ave", longitude: -63.5903, latitude: 44.6578, contact_email: "rose@compcamp.ca", phone: "19022662381", languages: "---\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Python\n- Scratch\n", country: nil},
  {name: "Code Workshops", city: "Shrewsbury", state: "MA", zip_code: 1545, site_url: "http://www.codeworkshops.com/?co", ed_level: "---\n- Middle School\n- High School\n", bio: "Code Workshops offers summer computer camp/workshop that is geared towards middle and high school kids. For parents of teenagers who are looking for summer educational activities for their children our code workshops is a full day technology/computer workshop that teaches computer programming and coding. ", format: "All-day workshop (up to 1 week)", street: "45 Oak Street", longitude: -71.7287, latitude: 42.2827, contact_email: "info@codeworkshops.com", phone: "508-251-9851", languages: "---\n- Css\n- HTML\n- Javascript\n- Jquery\n- Kinectjs\n- PHP\n- Python\n- Ruby\n- Scratch\n", country: nil},
  {name: "Canadian", city: "Canadian", state: "TX", zip_code: 79014, site_url: "http://chs.sharpschool.com/staff_directory/science_department/wade_hood/", ed_level: "---\n- High School\n", bio: "I teach high school computer science (programming in Java).  We emphasize writing code in Java for command prompt (DOS screen) but also do some GUI work in applets.\r\nWe are aligned to the TEKS and compete in UIL computer science competitions.  If my students take it multiple years, some take the AP CS exam.", format: "Daily programming course", street: "800 Hillside", longitude: -100.381, latitude: 35.9082, contact_email: "wade.hood@canadianisd.net", phone: "", languages: "---\n- Java\n", country: nil},
  {name: "Web Edukator - kurs web dizajna", city: "Belgrade", state: nil, zip_code: 11000, site_url: "http://web.kulturban.org", ed_level: "---\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "Course Title: Web Design\r\nDuration: 3 months - once a week for two hours\r\nProgram: HTML, CSS, JS, Joomla, SEO, Flash ...\r\nPrice: 1800 dinars. / Month\r\nContact: vebkurs@gmail.com 060/5582422\r\nLocation: Cvijiceva 112, Belgrade\r\nWeb site: http://.web.kulturban.org\r\nWeb Educator - Web Design Course is a project of the Kulturban which aims to train students to independently create and maintain websites. During the course, students will create a site that will get hosting for one year. In this way, students will get their personal Web site on the Internet that can be used in employment, education, etc..\r\nThe course program includes site planning, HTML, CSS, JavaScript, Flash animations, PSD2HTML, SEO, Cpanel, Joomla, Marketing ...\r\n\r\nWeb design course will be held in the Youth Office of Palilula Cvijiceva 112, and the Municipality of Stari Grad, 1300 Kaplara 2, side entrance Kolarac Belgrade.\r\n\r\nWeb Design Course is organized with the support of the City Municipality of Palilula and the Old Town. Support of the municipality allows students to pay only a partial amount of the cost of the course. Cost is symbolic and is 1800din/meseno. Payment is made through the account.\r\nCourse duration is 3 months, once a week for two hours. Flexible groups, depending on your commitments.\r\n\r\nOffice for Youth is organizing different training courses and want to help young people to expand their knowledge and learn new skills to help them get a job or start their own business.\r\n\r\nUpon completion of the course, students will take a test on the basis of which receive a certificate of successful completion of the course of web design.\r\n\r\nOffice for Youth has developed cooperation with the National Employment Service, and are often organized training for successful job placement. Also, the trainees are given the opportunity to participate in the implementation of various programs, regional and international exchanges.\r\n\r\nParticipants will be provided with the print materials, and online presentations. Consultations are provided after completion of the course.", format: "Multi-week workshop", street: "Cvijieva 112", longitude: 20.4791, latitude: 44.8117, contact_email: "vebkurs@gmail.com", phone: "", languages: "---\n- HTML\n- Javascript\n- PHP\n", country: nil},
  {name: "Lynnwood High School", city: "Bothell", state: "WA", zip_code: 98012, site_url: "http://www.edmonds.wednet.edu/lhs", ed_level: "---\n- High School\n", bio: "Courses Offered:\r\n- AP Computer Science A\r\n- Introduction to Computer Science (UW in the High School, CSE 120 - Computer Science Principles)", format: "Daily programming course", street: "18218 North Rd. ", longitude: -122.239, latitude: 47.8332, contact_email: "chanc@edmonds.wednet.edu", phone: "425-431-5226", languages: "---\n- Java\n- Processing\n", country: nil},
  {name: "Vashon High School", city: "Vashon", state: "WA", zip_code: 98070, site_url: "http://www.vashonsd.org/index.php?/district2/vhs/", ed_level: "---\n- High School\n", bio: "In AP Computer Science, students will learn program design and basic programming in Java. The course will be equivalent to a college-level semester introduction to programming and will prepare students for the Advanced Placement Exam. Topics covered will include primitive types, procedural programming (methods, parameters, return values), basic control structures (if/else, for loop, while loop), array manipulation, file processing and using and defining objects (identifying reusable components, class relationships). Students will learn by designing, writing and testing their own software.", format: "AP Computer Science", street: "20120 Vashon Hwy SW", longitude: -122.457, latitude: 47.4227, contact_email: "gkilpatrick@vashonsd.org", phone: "2064639171", languages: "---\n- Java\n", country: nil},
  {name: "Vashon High School", city: "Vashon", state: "WA", zip_code: 98070, site_url: "http://www.vashonsd.org/index.php?/district2/vhs/", ed_level: "---\n- High School\n", bio: "Introduction to Computer Programming is for students that have never programmed before and would like to see what it is about.  Our programming journey will take place using the  Scheme programming language.  In the semester, we will journey through data structures, variables and logic operators, functions, recursion and object-oriented programming.", format: "Daily programming course", street: "20120 Vashon Hwy SW", longitude: -122.457, latitude: 47.4227, contact_email: "gkilpatrick@vashonsd.org", phone: "2064639171", languages: "---\n- Scheme\n", country: nil},
  {name: "Nagel Middle School", city: "Cincinnati", state: "OH", zip_code: 45255, site_url: "http://www.foresthills.edu/nagel", ed_level: "---\n- Middle School\n", bio: "Introductory to Scratch basics. Students develop beginner program that uses basic movement, color, sprite, and sound options. Students then move to using more complex programming skills to create a game shared to a class gallery. Students range from below grade level skills to gifted and talented level. Discussion forums within our school LMS called Schoology, provides a platform for supportive discussion and peer interactions.  ", format: "Daily programming course", street: "1500 Nagel Road", longitude: -84.3297, latitude: 39.0791, contact_email: "", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "Academy for Civic and Entreprenurial Leadership of Fresno", city: "Fresno", state: "CA", zip_code: 93721, site_url: "http://ACELfresno.org", ed_level: "---\n- High School\n", bio: "The Academy for Civic and Entrepreneurial Leadership of Fresno is a hands on, project based, civic minded high tech charter high school in Fresno California.", format: "Daily programming course", street: "1713 Tulare St", longitude: -119.793, latitude: 36.7317, contact_email: "dwilson@acelfresno.org", phone: "5594087077", languages: "---\n- HTML\n- Java\n- Python\n- Scratch\n", country: nil},
  {name: "Kempsville Middle School", city: "Virginia Beach", state: "VA", zip_code: 23464, site_url: "http://www.kempsvillems.vbschools.com", ed_level: "---\n- Middle School\n", bio: "I teach a unit of Programming in a Computer Solutions 2 course.  This is a nine week course taught to 6th and 7th grade students. I currently utilize Logo Programming but will learn Scratch this summer to incorporate into my classes for next year.", format: "Other", street: "860 Churchill Dr", longitude: -76.1564, latitude: 36.8126, contact_email: "Emily.Christy@vbschools.com", phone: "757-648-4700", languages: "---\n- Logo\n- Scratch\n", country: nil},
  {name: "Holy Child Sr Sec School", city: "New Delhi", state: "DL", zip_code: 110027, site_url: "http://holychilddelhi.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "In primary classes, all students are taught Logo. At middle school, the language taught is BASIC. In 11th grade, students have to choose a stream as per the CBSE system of education. Only the students opting for Non-Medical stream can take up Computer Science as one of their subjects. They are then taught C++ in the following two years. The curriculum also includes the study of SQL, Networking Systems and basic knowledge of Boolean Algebra.In class 11th and 12th, students also have to make their own projects,i.e,a game, a working program etc to pass the subject.\r\n\r\nAlong with classroom lectures, the curriculum also includes regular practicals. Hence, from an early age, students get to learn programming. There is also a proposal by the CBSE board to teach Python from class 11th onward but nothing has been finalized in that regard. ", format: "Daily programming course", street: "Tagore Garden", longitude: 77.1126, latitude: 28.6492, contact_email: "", phone: "", languages: "---\n- Basic\n- C++\n- Logo\n", country: nil},
