  {name: "Tualatin High School - Tualatin Robotics", city: "Tualatin", state: "OR", zip_code: 97062, site_url: "http://www.tualatinrobotics.com", ed_level: "---\n- High School\n", bio: "Tualatin Robotics is an after-school academic program.  Students work with industry mentors and take part in a variety of technical competitions including: \r\nFIRST Robotics Competitions\r\nFIRST Technical Challenges \r\nOregon Game Programming Competitions \r\nWillamette University Programming Competitions", format: "Afterschool program", street: "22300 SW Boones Ferry Rd", longitude: -122.775, latitude: 45.3583, contact_email: "jhubbard@ttsd.k12.or.us", phone: "", languages: "---\n- C++\n- Gamemaker\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Perl\n- Python\n", country: nil},
  {name: "Oak grove high school", city: "San Jose", state: "CA", zip_code: 95123, site_url: "http://oghs.schoolloop.com", ed_level: "---\n- High School\n", bio: "Exploring computer science (ECS) is a course designed to introduce all types of programming to the student. It cover the basic of HTML all the way to object oriented programing language.  It helps students learn about all the different possible coding that occurs in business and engineering jobs. ", format: "Other", street: "285 blossom hill rd", longitude: -121.819, latitude: 37.2537, contact_email: "", phone: "", languages: "---\n- Alice\n- HTML\n- Javascript\n- Lego mindstorm nxt\n- Scratch\n", country: nil},
  {name: "Alice Programming Workshop for Girls", city: "Greensboro", state: "NC", zip_code: 27410, site_url: "http://www.programming4girls.com", ed_level: "---\n- Middle School\n", bio: "Alice Programming Workshop for Girls is a two week class that introduces middle school girls to computer science through an easy-to-learn program that allows them to create their own stories and games in 3D computer animation. The Alice interface is user friendly and easy to learn; students will begin designing a virtual world the very first day. An easy-to-follow textbook and memory stick with Alice loaded on it are included so students can continue to learn and work with Alice after the class is over. \r\n\r\nParticipants: Open to rising 6th through 9th grade girls.\r\n\r\nLocation: Guilford College (A map and parking directions will be forwarded to participants prior to the start of the session)\r\n\r\nDates: Session 1 (Introductory) - July 8 - July 19  2013     \r\nDates: Session 2 (Intermediate) - July 22 - Aug 2  2013\r\n\r\nTime: Classes meet Monday - Friday, 8:30 AM - 12:00 PM\r\n\r\nCost: $250 per student per session. Fee includes a textbook (Virtual World Design and Creation for Teens by Charles R. Hardnett), a memory stick with the Alice program loaded on it (students will also save their virtual worlds on the memory stick), and lessons and guidance from our Alice Workshop Instructors. \r\n\r\nClasses are taught by female computer science undergraduates from Duke University and Stanford University.", format: "Summer camp", street: "Guilford College - 5800 West Friendly Avenue", longitude: -79.887, latitude: 36.0896, contact_email: "info@programming4girls.com", phone: "", languages: "---\n- Alice\n", country: nil},
  {name: "Evergreen Valley High School", city: "San Jose", state: "CA", zip_code: 95148, site_url: "http://www.evhs.schoolloop.com/", ed_level: "---\n- High School\n", bio: "Exploring Computer Science introduces students to the breadth of the field of computer science through engaging and accessible topics. The goal of the class is to develop computational practices of algorithm development, problem solving, and programming within the context of problems that are relevant to the lives of today's students. ", format: "Other", street: "3300 Quimby Rd.", longitude: -121.78, latitude: 37.3247, contact_email: "", phone: "", languages: "---\n- Alice\n- Python\n", country: nil},
  {name: "Monte Cassino", city: "Tulsa", state: "OK", zip_code: 74114, site_url: "http://www.montecassino.org/site/sections/1", ed_level: "---\n- Elementary\n- Middle School\n", bio: "HTML Markup language is written to describe and explain the entire scientific process of each child's final science project.  The student's end result is a webpage explaining the purpose, procedure, pictures of the experiment process, results with a graph or table, and  the conclusion.  ", format: "Other", street: "2006 S. Lewis Ave", longitude: -95.9582, latitude: 36.1341, contact_email: "", phone: "", languages: "---\n- HTML\n", country: nil},
  {name: "Brewer High School", city: "Brewer", state: "ME", zip_code: 4412, site_url: "http://www.brewerhs.org/", ed_level: "---\n- High School\n", bio: "Brewer High School offers \"Introduction to Computer Science\", a 1 credit course that follows the Massively Open Online Course (MOOC) from EdX called \"CS50x\" that is offered by Harvard University.  This course is open to all grades, 9-12.", format: "Daily programming course", street: "79 Parkway South", longitude: -68.7564, latitude: 44.781, contact_email: "grand@breweredu.org", phone: "207-989-4140", languages: "---\n- C++\n- Css\n- HTML\n- Javascript\n- PHP\n- Python\n- Scratch\n- Sql\n", country: nil},
  {name: "The Designation", city: "Chicago", state: "IL", zip_code: 60605, site_url: "http://thedesignation.co", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "The Designation offers an intensive digital design course in Chicago. For two nights a week for nine weeks, you will be taught in-person all the fundamentals of UX, web design, and graphic design -- including HTML, CSS, and JavaScript. It doesn't matter if you've never coded before -- we'll teach you everything there is to know in order for you to become a great designer for the Web. We require all applicants to submit an application form to assess eligibility for the course.", format: "Multi-week workshop", street: "35 E. Wacker Drive", longitude: -87.6268, latitude: 41.8866, contact_email: "kevin@thedesignation.co", phone: "", languages: "---\n- HTML\n- Javascript\n", country: nil},
  {name: "Mount Si High School", city: "Snoqualmie", state: "WA", zip_code: 98065, site_url: "http://www.svsd410.org/Domain/17", ed_level: "---\n- High School\n", bio: "Bots On The Sound (BOTS) is a water robotics summer camp targeted towards high school boys and girls. During this 1-week camp, typically held in July/August, students learn to program robots using the LEGO NXT-G software. The robots are designed, built, and programmed to complete challenges in the water.", format: "Summer camp", street: "8651 Meadowbrook  Way SE", longitude: -121.814, latitude: 47.5236, contact_email: "warrenk@svsd410.org", phone: "425-831-8159", languages: "---\n- Lego nxt-g\n", country: nil},
  {name: "Sabio.la - Developer Bootcamp for Women & Minorities", city: "Los Angeles", state: "CA", zip_code: 90049, site_url: "http://sabio.la", ed_level: "---\n- Vocational\n", bio: "We are a developer bootcamp focused on bringing more women and minorities into the software development field. Currently offering weekend based training, all day Saturday and Sunday for a period of several months. \r\n\r\nYou will leave our program as an entry level, full stack developer.\r\n\r\nWe aim to be the most accessible program in the area and therefore will be providing laptops for all our trainees and do not charge you until you get job offers.\r\n\r\nWe also provide interview training.\r\n\r\nWe will have our training out of a number of locations both on the west side and east side of Los Angeles.\r\n\r\n", format: "Multi-week workshop", street: "11777 San Vicente Blvd", longitude: -118.468, latitude: 34.0533, contact_email: "code@sabio.la", phone: "", languages: "---\n- C#\n- Css\n- HTML\n- Javascript\n- Tsql\n", country: nil},
  {name: "IT-oLogy", city: "Columbia", state: "SC", zip_code: 29201, site_url: "http://www.it-ology.org", ed_level: "---\n- Middle School\n- High School\n", bio: "Cyber Saturday is a free monthly program run by IT-oLogy partners where middle and high school students can learn more about IT. These creative sessions cover a variety of IT topics including hands-on activities as well as presentations from IT professionals. The content covered on a particular Cyber Saturday rotates each month. The goal of this program is to give students the opportunity to explore and experience technology in new ways, learn about careers in technology, and inspire students to continue to learn through critical thinking so that they increase their proficiency in STEM.\r\n\r\nWe cover a variety of topics including Scratch, App Inventor, Codeacademy, Code Avengers, Lightbot 2.0, Alice, Game Maker, Kodu Game Lab, Arduino and many more.\r\n\r\nThe following are the remaining dates for 2013:\r\nJuly 20\r\nAugust 17\r\nSeptember 21\r\nOctober 19\r\nNovember 16\r\nDecember 21\r\nRegistration is free: http://columbiacybersaturday.eventbrite.com/", format: "Other", street: "1301 Gervais Street, Suite 200", longitude: -81.0316, latitude: 34.0024, contact_email: "alicia.thibaudet@it-ology.org", phone: "803-354-5730", languages: "---\n- Alice\n- Arduino\n- HTML\n- Javascript\n- Kodu\n- Mobile Apps\n- PHP\n- Python\n- Ruby\n- Scratch\n", country: nil},
  {name: "HEAT Institute by Stanford alumni", city: "Stanford", state: "CA", zip_code: 94305, site_url: "http://www.heatinstitute.org", ed_level: "---\n- High School\n- College\n", bio: "HEAT is an academic and professional development institute based in Silicon Valley dedicated towards the advancement of the humanities, entrepreneurship and technology, with curriculum developed in collaboration with members of QSci Lab at the Center for the Study of Language and Information at Stanford University. Our programs operate in Palo Alto just two blocks from the home of the late Steve Jobs. We are building a platform for students, educators, and professionals across disparate fields to enhance interdisciplinary knowledge discovery and innovation with a curricular focus on Big Data and Data Science applications. HEAT started the world's first dedicated Data Science course for high school and undergraduate students in 2011-2012, offering students an insider's introduction to curriculum that is now making the rounds in the Harvard Business Review, the Wall Street Journal, Forbes, the New York Times, and in new institutions that have emerged in 2013.\r\n\r\nJust as Bill Hewlett and Dave Packard founded the very \"birthplace of Silicon Valley\" in their Palo Alto garage, the HEAT team believes academic and professional educators perform their best in an environment in which they can freely design and teach new curricula. We work closely with individual professors, teachers, entrepreneurs, researchers, and professionals from Stanford, Harvard, Yale, Princeton, Oxford, UC Berkeley, USF, Google, Facebook, Apple, Intel, and a number of other Silicon Valley institutions currently facing a critical shortage of Big Data and Data Science talent. We are committed to providing future generations innovative curricula and pedagogy not found at any single institution.\r\n\r\nData Science is an emerging field using Big Data that relies heavily on the expertise of other fields to help us make better decisions. Research by the McKinsey Global Institute (MGI) (Big Data: The next frontier for innovation, competition, and productivity) forecasts a 50 to 60 percent gap between the supply and demand of people with deep analytical talent in big data. Big Data is predicted to create over 4.4 million jobs globally by 2015, and the HEAT Institute aims to prepare students of all backgrounds for \"the sexiest job of the 21st century,\" according to the Harvard Business Review, the Wall Street Journal, Forbes, and the New York Times. Previously obscured as a subset of computer science, Data Science is actually an accessible way for students and professionals outside of computer science to harness the latest tools in software engineering. The techniques, theories, logic, ideas and vocabulary of any field (including medicine, law, public policy, finance, and education) can be stored and used as data, which serves as the lifeblood of software engineering. The demand for data scientists is as, if not more, pressing as the need for computer scientists. HEAT SV is launching a new data science core with the help of Google's Visualization API and datasets to prepare future graduates in any field for the new economy.\r\n\r\nSo where do we find tomorrow's Data Science superheroes? According to the Wall Street Journal: \"Not from universities, it seems. Nigel Shadbolt, who doubles up as the professor of artificial intelligence at the University of Southampton as well as co-director of the U.K.'s Open Data Institute, said the courses don't yet exist. 'Bits of it do exist in various departments around the country, and also in businesses, but as an integrated discipline it is only just starting to emerge.'\"\r\n\r\nThe HEAT Institute aims to nurture creativity and critical thinking in students around the world by offering a core humanities curriculum, business and technology practica, and a platform for building interdisciplinary applications of knowledge.\r\n\r\nIn the data science core, students will:\r\n-Learn about big data and relevant technologies\r\n-Learn about databases and structured query language (SQL)\r\n-Practice the extract, transform, load process used by every technology company using programming languages such as Python, PHP, and JavaScript and tools such as Pentaho Data Integration.\r\n-Learn how to tell stories with data and use data as the basis of your own startup company\r\n-Attend a field trip to a Silicon Valley company that uses large datasets on a day-to-day basis\r\n \r\nParticipants will also do one of the following:\r\n-Build complex extract, transform, and load processes on large datasets such as US patents and US trademarks datasets provided by Google\r\n-Build their own portfolio of dynamic data visualizations using Google API and Tableau\r\n-Build their own functional \"Facebook\" social networking website\r\n-Build a search engine using US Patent And Trademark Data provided by Google", format: "Summer camp", street: "210 Panama St.", longitude: -122.179, latitude: 37.4304, contact_email: "heatinstitute@alumni.stanford.edu", phone: "650-503-4325", languages: "---\n- Google visualization api\n- HTML\n- Javascript\n- Mapreduce\n- Mysql\n- PHP\n- Pentaho data integration\n- Python\n- Tableau\n", country: nil},
  {name: "Metairie Park Country Day School", city: "Metairie", state: "LA", zip_code: 70005, site_url: "http://bitsandbytes.eventbrite.com", ed_level: "---\n- Middle School\n", bio: "Bits & Bytes on the Bayou  (Ages 12-14)\r\n \r\nIt is time to give every child an opportunity to learn how to interact with computer technology\r\non a level where they have control: they should be able to code! Students dont have to wait\r\nuntil high school or university to begin learning how to harness the power of technology. \r\nTools for exploring, creating, and designing programs and robots are readily available and\r\nyoung minds are eager to explore.\r\n\r\nBits and Bytes on the Bayou is a 1-week summer camp (July 22-26, 2013) that will introduce\r\nstudents ages 12-14 (rising 6th, 7th, and 8th graders) to programming through hands-on experiences. \r\nEach morning students will learn to write computer programs using the MIT-developed programming\r\nlanguage called Scratch and in the afternoons will work to develop a project\r\n(individually or in groups) using these skills.  If you have your own computer you are encouraged to\r\nbring it.  No prior exposure to programming is necessary, and students from all area schools\r\nare invited to attend.   \r\n \r\nCamp starts promptly at 9:00 am and ends\r\npromptly at 4:00 pm each day with a one hour break for lunch which is provided. \r\nThe cost of the camp is $300 for the week. ", format: "Summer camp", street: "300 Park Rd", longitude: -90.1323, latitude: 29.9822, contact_email: "andy_talmadge@mpcds.com", phone: "504-931-4781", languages: "---\n- Scratch\n", country: nil},
  {name: "iT2PIE", city: "Greenville", state: "SC", zip_code: 29601, site_url: "http://www.raspi-Greenville.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "The iT2PIE program currently offers a variety of levels of training for youth programming, design, and invention classes.  \r\n\r\nThe program is scheduled to end in a programmer's invention expo, Spring 2014 at Timmons Arena where students and local inventors can show off their built or conceptualized inventions.  Inventions will be encouraged in the areas of environmental & energy, medical, art, technology access, gaming & play, and industrial & commercial.  Teams will be assigned to inventions in August.  Invention selection begins in July.\r\n\r\nThe program utilizes the Raspberry Pi to teach intro courses.  Students then move into physical computing, which adds micro controllers to the Raspberry Pi and adds other new tech, e.g., BeagleBoards\r\n\r\nClasses started June 8th at Furman.  Classes are additionally schedule for the Iron Yard, downtown Greenville. (Classes will be offered through the year in the form of webinars and workshops).  Pre-Pi is always offered as a workshop.\r\n\r\nThere is a small tuition; however, sponsorships are available.  \r\n\r\niT2PIE recently arranged to partner with iT-ology to become a feeder program for the STARS Computing Corps and other iT-oligy intern programs so that High School students that work as instructors with iT2PIE can be placed into job training programs as they exit iT2PIE.\r\n", format: "Multi-week workshop", street: "330 E Coffee St", longitude: -82.3955, latitude: 34.8506, contact_email: "raspi@freshstartsc.com", phone: "8645275983", languages: "---\n- Arduino\n- C\n- C++\n- Python\n- Scratch\n", country: nil},
