  {name: "Overachievers Academy", city: "Brandon", state: "FL", zip_code: 33510, site_url: "http://oak8.org", ed_level: "---\n- Middle School\n- High School\n", bio: "Beginning summer of 2014 we will offer coding sessions in our technology camp for grades 6-12. This is a fun and exciting session that is apart of our S.T.E.M (Science, Technology, Engineering and Mathematics) initiative and our Microsoft Information Technology Certification sessions. Our summer coding sessions are low priced and affordable so that any middle or high school student can take advantage of this wonderful opportunity.", format: "Summer school CS program", street: "203 N. Kingsway Road", longitude: -82.2772, latitude: 27.9402, contact_email: "overachievers@live.com", phone: "813-667-7422", languages: "---\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Kodu\n- Logo\n- Mobile Apps\n- PHP\n- Perl\n- Python\n- Ruby\n- Scheme\n- Scratch\n", country: nil},
