  {name: "HTML @ Summer Academy of the HTSD Ed Foundation", city: "Havertown", state: "PA", zip_code: 19083, site_url: "http://www.haverfordedfoundation.org/summeracademy2013.html", ed_level: "---\n- Middle School\n- High School\n", bio: "HTML 5 & CSS 3 for kids Grades 7+\r\nJuly 29 - August 1, 8:30-12:30  Fee $180\r\nLearn the computer coding languages for basic web design used by professionals  HTML5 and CSS3. We'll use HTML tags - the building blocks of web pages - and bring your pages to life using CSS style rules for color, type and page layout. ", format: "Summer camp", street: "1701 Darby Road", longitude: -75.3058, latitude: 39.983, contact_email: "summer@haverfordedfoundation.org", phone: "", languages: "---\n- HTML\n", country: nil},
  {name: "Indiana University - Purdue Unviversity, Fort Wayne", city: "Fort Wayne", state: "IN", zip_code: nil, site_url: "http://www.ipfw.edu/departments/etcs/outreach/explorations.html", ed_level: "---\n- Middle School\n- High School\n", bio: "Computer Science Exploration - ACT: Adventures in Computing for Teens; ACT II: More Adventures in Computing for Teens\r\nDepartment of Computer Science\r\nDates: ACT I: July 8-12 Time: 8:30 AM - 1:00 PM\r\nDates: ACT II: July 15-19 Time: 8:30 AM - 1:00 PM\r\nInfo at: ACT Information.pdf\r\nRegistration info at: 2013 ACT Registration Form.pdf\r\n8 -12th grade students; Fee: $90\r\n\r\nCreate 3D movies and video games with Alice software. See interactive illustrations of computing principles; learn object-oriented programming; discover computing careers. ACT II is open to previous ACT participants and focuses on design and construction of a sophisticated animation or video game using advanced features of Alice. Participants in both sessions will showcase their animations to family and friends. ", format: "Summer camp", street: "2101 E. Coliseum Blvd.", longitude: -85.105, latitude: 41.1209, contact_email: "", phone: "260-481-6803", languages: "---\n- Alice\n", country: nil},
  {name: "Bright & Smart Robotics", city: "Pompano Beach", state: "FL", zip_code: 33062, site_url: "http://www.brightandsmart.com/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Especially designed for girls and boys, 7 to 12 years old. We combine engineering skills with visual-spatial activities to be able to offer a week packed with knowledge, fun and entertainment, based on Teamwork, Computer programming, and \"hands-on\" Robot assembly.", format: "Summer camp", street: "49 N Federal Hwy #239", longitude: -80.1032, latitude: 26.2331, contact_email: "info@BrightAndSmart.com", phone: "954-816-3346", languages: "---\n- Kodu\n- Logo\n- Nxt-g\n- Robolab (labview)\n- Scratch\n", country: nil},
