  {name: "Pacific Science Center App Camp with xCode ", city: "Seattle", state: "WA", zip_code: 98109, site_url: "http://www.pacificsciencecenter.org", ed_level: "---\n- Middle School\n- High School\n", bio: "A part of Camps for Curious Minds at Pacific Science Center, App Camp with xCode is a week-long summer camp offering students in grades 7-9 the opportunity to explore how apps (applications) work using Apple's xCode programming software. \r\n\r\nStudents learn the basics of the programming language and work their way up to more complicated app development. By the end of the week, they will be able to read and pick apart the codes in an app, manipulate the code to change how the app runs, and debug simple coding problems. This camp is for any student excited about technology, so no programming experience is necessary. \r\n\r\nApp Camp with xCode is being offered this summer for week-long sessions from 9 a.m. to noon during the following weeks:\r\n\r\nJuly 8 - 12\r\nJuly 15 - 19\r\nJuly 22 - 26\r\n\r\nFor more information and to register for this camp, visit pacificsciencecenter.org", format: "Summer camp", street: "200 Second Avenue North", longitude: -122.353, latitude: 47.6198, contact_email: "", phone: "2064432925", languages: "---\n- Mobile Apps\n- Xcode\n", country: nil},
