  {name: "Girls' Programming Network", city: "Camperdown", state: "NSW", zip_code: 2006, site_url: "http://sydney.edu.au/it/gpn", ed_level: "---\n- Middle School\n- High School\n", bio: "The Girls Programming Network is an extra-curricular program for high school girls interested in computers and technology.  GPN is run by girls, for girls. The tutors are a mix of university IT and software engineering students (from the University of Sydney and others) as well as professional software engineers.  \r\n\r\nGPN investigates different topics in IT, ranging from transistors to artificial intelligence, while they learn to program in Python.  Each school term we run a workshop where students complete a small project, such as a \"game in a day\". For all our workshops, no previous programming knowledge is assumed, and we organise extension activities and lectures designed for more advanced students.  \r\n\r\nGPN lets girls explore computer science and engineering in an encouraging, fast-paced atmosphere, and gives the girls the chance to meet new friends with similar interests, find female university students as mentors, and find out about university life.", format: "All-day workshop (up to 1 week)", street: "University of Sydney", longitude: 151.184, latitude: -33.8862, contact_email: "gpn@it.usyd.edu.au", phone: "", languages: "---\n- Python\n", country: nil},
