  {name: "DaVinci Coders", city: "Louisville", state: "CO", zip_code: 80027, site_url: "http://www.davincicoders.com", ed_level: "---\n- Vocational\n", bio: "11-week program for people with no programming experience to learn back-end web development with Ruby on Rails: MWF 9am-12:30: Web Development with Ruby Level 1\r\n\r\nAdditional night class for people with some programming experience: MW 7:30-9pm F 7-9pm Sat 10-3pm: Building the Toolbelt of a Junior Ruby on Rails Developer", format: "Multi-week workshop", street: "511 E South Boulder Road", longitude: -105.136, latitude: 39.9872, contact_email: "", phone: "303-666-4133", languages: "---\n- HTML\n- Ruby\n", country: nil},
  {name: "CoderDojo Twin Cities", city: "Minneapolis", state: "MN", zip_code: 55418, site_url: "http://www.coderdojotc.org/", ed_level: "---\n- Elementary\n- Middle School\n", bio: "CoderDojo is a global movement about providing free and open learning to youth, with an emphasis on computer programming. The Twin Cities chapter was founded to bring this movement to the Minneapolis-Saint Paul area, inspire other chapters, and partner with other organizations to better introduce kids to coding.\r\n\r\nCoderDojo Twin Cities welcomes girls and boys ages 8 to 17 and provides a friendly, supportive learning environment for all kids, from absolute beginners to experienced young programmers. We aim to reduce economic barriers and will provide access to computers during the sessions for those unable to bring a laptop.\r\n\r\nCoderDojoTC currently meets on Saturday afternoons, and has groups exploring:  \r\n    web design (HTML, CSS, JavaScript)\r\n    Scratch and introduction to programming\r\n    Python/Minecraft\r\n    Gaming/Graphics (Unity)\r\n    Mobile apps\r\n    Arduino\r\n\r\nMore information can be found on our website.\r\n\r\n", format: "Other", street: "1501 E Hennepin Ave ", longitude: -93.2303, latitude: 44.9917, contact_email: "", phone: "", languages: "---\n- Arduino\n- HTML\n- Javascript\n- Mobile Apps\n- Python\n- Scratch\n- Unity\n", country: nil},
