  {name: "Casey-Westfield High School", city: "Casey", state: "IL", zip_code: 62420, site_url: "http://www.cw.k12.il.us/education/school/school.php?sectiondetailid=103", ed_level: "---\n- High School\n", bio: "The Mid-American Programming Group was founded by Julie Littlejohn, the computer/business teacher at Casey-Westfield High School in Casey, IL. One of the classes Mrs. Littlejohn taught was Introduction to Programming, where students learned fundamental, foundational, and practical programming skills. Some of the students in this class wanted to learn more about programming, but no Advanced Programming class was offered by the school. Mrs. Littlejohn approached Willy Farrell, a friend who had been programming professionally for more than 30 years (including many years at IBM), and asked him if he would facilitate an afterhours program to provide Advanced Programming training to her interested students. Being a card-carrying member of the Mrs. Littlejohn Fan Club himself, he agreed to do it, free of charge, and on his own time.\r\n\r\nCurrently, Willy Farrell heads the programming group, and because she is retired and pursuing other interests, Mrs. Littlejohn is not as involved in the group as she once was. All inquiries about the group should be made to Willy, though all still warmly regard Julie Littlejohn as our \r\nFounder.\r\n\r\nThe group started with one student, and called itself the Learning Java Advanced Programming Group. Soon after starting, another student joined the group. Later, a member was added who was still taking the Introduction to Programming class while participating, so Advanced was dropped from the title.\r\n\r\nWilly quickly realized there was a problem with group members getting enough computer time to complete their assigned exercises. To solve this, he bought every member of the group a small but adequate laptop. Willy understands that group members are the best and brightest from Casey-Westfield High School and are involved in a lot of activities, so an excuse by a member that he or she didn't get an assignment done because of extracurricular activities is readily accepted. But he will not accept these excuses:\r\n\r\n1) I didn't get the assignment done because I didn't understand it. Not acceptable  every group member has the phone number and email address of Willy. Members can call or\r\nwrite Willy night and day if they have a problem or need some help;\r\n\r\n2) I didnt get enough computer time to finish the assignment. Not acceptable  Willy got you a laptop to prevent that possibility.\r\n\r\nInitially, the group was meeting every Sunday at 1PM at a local fast-food restaurant where they could usually find a booth. But the booths were rather small and it was difficult to juggle textbooks and laptops. And it was a bit loud. The group needed a bigger, quieter place. Plus, the group was made aware of a YouTube video about coding/programming (willyfarrell.com/coders) that inspired them to try and grow.\r\n\r\nEnter Pastor Michael Kasting of Trinity Lutheran Church. When asked if the programmers could use the conference room in his church, he readily consented. His remarks were: When I was approached about the possibility of using the facilities of Trinity Lutheran Church for a programming class for high school students, I was glad to make our facility available. The kids need a quiet space to gather. God has blessed us with quiet space in abundance. It makes sense to share it! With our schools facing a financial crunch, were glad we can help in this very practical way. It will be exciting to see what comes from this venture.\r\n\r\nWith a place that gave the group room to expand, the group decided to make that growth happen. So as not to exclude anyone, the group changed its name to the Mid-American \r\nProgramming Group. New members to the group still begin by learning Java, a very popular programming language. But after that they learn C#, a popular Microsoft programming \r\nlanguage. The goal is to get members certifications in these languages. A certification isn't a college degree (though members are consistently encouraged to go to college), but a\r\ncertification can make the resume of a college graduate more appealing to employers. After Java and C#, there are a multitude of Web design languages and techniques that can be\r\nexplored and mastered, and the group is setting out to do just that. The programming group also doesn't want to limit itself to only those in Casey, which is part of the reason for the name change.\r\n\r\nWhen we reach a certain point in our learning, we would like to do free software projects for local organizations, with our preference being charitable and not-for-profit institutions.\r\n\r\nPlease watch the video at willyfarrell.com/coders. Its only 9 minutes long and is a real eyeopener about the importance of what the Mid-American Programming Group is doing. What \r\nthe group is doing is good for our community; programmers often get jobs where they can work from home, so our best and brightest can stay right here in Casey. And what the group is doing is good for our young people  did you catch the part in the video where 1.4 million programming jobs will be created but only 400,000 U.S. students will get the required training for those jobs? Lets give our young people the opportunity to get one of those jobs that will be \r\ncreated and drive the economy of the future.\r\n\r\nIt costs about $500 to add a member to the group  laptop, mouse, textbook, thumb drive. Up to now, Willy has borne those expenses, and happily. But Willy can only afford to add one member every month or two, say 8 or 9 per year. That pace is too slow for the group to have the kind of community impact for which it is striving. The teachers at the high school have identified upwards of a dozen students that would benefit by being in the group. They are also \r\nreaching out to high schools in nearby towns to identify students in those schools that would like to join the group. If they all came at once, Willy could not afford to equip each one of them.\r\n\r\nWith $10,000, 20 students could join the group. The group needs help raising those kinds of funds. Wont you help the Mid-American Programming Group add members and give them the tools and equipment they need for success?\r\n\r\nMichael Leichty Contact Info:\r\nPhone: 217-932-2175\r\nEmail: mleichty@cw.k12.il.us\r\n\r\nWilly Farrell Contact Info: \r\nPhone: 219-218-0688\r\nEmail  wf@willyfarrell.com\r\nWeb: willyfarrell.com/coders", format: "Afterschool program", street: "306 E Edgar Ave", longitude: -87.9894, latitude: 39.3046, contact_email: "mleichty@cw.k12.il.us", phone: "217-932-2175", languages: "---\n- After java\n- Java\n- Plan to teach c#\n- Then javascript\n- Then on and on with the web languages/technolgoies\n- Then php\n", country: nil},
