  {name: "Fremont College", city: "Cerritos", state: "CA", zip_code: 92703, site_url: "http://www.fremont.edu", ed_level: "---\n- Vocational\n", bio: "Online Multimedia Design Degree Program:\r\n\r\nMM221 Web Design\r\nQuarter Credits: 5 Prerequisites: None\r\n\r\nThis course will prepare students to apply multimedia skills for the design and implementation of web sites, using web design software and HTML.\r\n\r\nMM231 Web Development\r\nQuarter Credits: 5 Prerequisites: None\r\n\r\nThis course will prepare students to analyze, design, build and implement websites. Areas covered include identification of information objects, the creation of flow diagrams, the use of multimedia, the use of hyperlinks, navigational efficiency, text creation and the appropriate use of maps, menus and frames\r\n\r\nMM121 Visual Communication\r\nQuarter Credits: 5 Prerequisites: None\r\n\r\nCourse Description\r\n\r\nThe goal of the course is to learn the fundamentals of web-based programming in PHP. This course will introduce how to connect to external database content and manipulate data. This course also allows the learner to receive hands-on experience building online and mobile applications using PHP, CSS, and JavaScript.\r\n\r\nMM123 Application Programming \r\nQuarter Credits: 5 Prerequisites: None\r\n\r\nCourse Description\r\n\r\nThe goal of the course is to learn the fundamentals of object-oriented code programming in Python. This course introduces programming through manipulating data, pictures, sounds, and videos. This course will introduce programming principles like conditions, functions, loops, arrays, and class objects.\r\n\r\n", format: "Programming integrated in other classes", street: "18000 Studebaker Road, Suite 900A", longitude: -118.096, latitude: 33.8682, contact_email: "info@fremont.edu", phone: "1-800-FRE-MONT(373-6668)", languages: "---\n- Css\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n", country: nil},
  {name: "Silicon Beach University at Fremont College", city: "Los Angeles", state: "CA", zip_code: 90010, site_url: "http://www.siliconbeachuniversity.com/", ed_level: "---\n- Vocational\n", bio: "Level 1 (7 months, Diploma program): Web Fundamentals\r\n\r\nLearn WordPress, HTML, CSS, Style and Design of making your own website at the end of the program. You will also learn other program language like Python, Ruby, PHP so that you have various options to code.\r\n\r\nLevel 2 (15 months, AA Degree program): Interactive Website Building\r\n\r\nBy learning jQuery and Java Script, you can build exciting custom animations and interactive website that is user friendly. As a capstone projects, our students will use projects to use all the knowledge gained to create a variety of web applications.\r\n\r\nLevel 3 (30 months, BA Degree program): Multimedia Marketing and Design\r\n\r\nTodays winning strategy in user interface and how we connect with our customers. By learning the front end graphics and being able to create marketing content, our students are well-prepared to enter the entrepreneurial tech world. The program also includes APIs so that students learn to write codes to pull in outside data to send messages or make powerful apps for the mobile world.", format: "Daily programming course", street: "3440 Wilshire Blvd. 10th Floor", longitude: -118.299, latitude: 34.0618, contact_email: "info@fremont.edu", phone: "1-800-FRE-MONT(373-6668)", languages: "---\n- Css\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n- Python\n- Ruby\n", country: nil},
