  {name: "The Lisbon School of Design", city: "Lisboa", state: "", zip_code: 1998, site_url: "http://www.lsd.pt", ed_level: "---\n- Vocational\n", bio: "Founded in 2009, the Lisbon School of Design applies innovative teaching techniques, creative and challenging environment simulating a real working studio / agency. We are the first school to join the professional\r\ntheoretical / conceptual tools with teaching practices in each area. This is possible because each course is composed of two types of teachers: the conceptual, which dominate the theory, and experts in the technologies and challenges of everyday practice in each area.", format: "Daily programming course", street: "Edifcio Mar do Oriente", longitude: nil, latitude: nil, contact_email: "jose.gouveia@lsd.pt", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n- PHP\n", country: nil},
