  {name: "Burnt Hills-Ballston Lake High School", city: "Ballston", state: "NY", zip_code: 12027, site_url: "http://bhbl.org", ed_level: "---\n- High School\n", bio: "We are an AP Computer Science Principles pilot site for 2013 - 2016.  The pilot course is an introduction to a broad array of computer science topics including the internet, computational collaboration, large data sets, abstraction, problem solving, algorithms, programming, and the global impact of computing on society.  This pilot course has been vetted and accepted by many colleges and universities across the country.  The first AP Computer Science Principles exam is expected in May of 2017.", format: "Daily programming course", street: "88 Lakehill Road", longitude: -73.8905, latitude: 42.9101, contact_email: "pwhite@bhbl.org", phone: "", languages: "---\n- Java\n- Javascript\n- Python\n- Scratch\n", country: nil},
