  {name: "Ranney School", city: "Tinton Falls", state: "NJ", zip_code: 7724, site_url: "http://www.ranneyschool.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "At Ranney School, our AP Comp Sci course actually begins in a prior course, Computer Science Honors, which students typically take before they take AP CS. In Computer Science Honors we cover topics such as: Logic and Set Theory, Logic Gates, HTML, history of Computer Science, flowcharting, pseudocode, Control Statements, and an introduction to Java (equivalent to about 3-4 chapters of an AP Comp Sci textbook). Once in AP Comp Sci, we continue with the AP curriculum, working on projects in a lab setting.", format: "AP Computer Science", street: "235 Hope Road", longitude: -74.0782, latitude: 40.308, contact_email: "chiarashah@mac.com", phone: "", languages: "---\n- HTML\n- Java\n", country: nil},
  {name: "West Forsyth High School", city: "Cumming", state: "GA", zip_code: 30040, site_url: "http://www.forsyth.k12.ga.us/wfhs", ed_level: "---\n- High School\n", bio: "The AP Computer Science A course is an introductory course in computer science. Because the design\r\nand implementation of computer programs to solve problems involve skills that are fundamental to the\r\nstudy of computer science, a large part of the course is built around the development of computer\r\nprograms that correctly solve a given problem. These programs should be understandable, adaptable,\r\nand, when appropriate, reusable. At the same time, the design and implementation of computer\r\nprograms is used as a context for introducing other important aspects of computer science, including\r\nthe development and analysis of algorithms, the development and use of fundamental data structures,\r\nthe study of standard algorithms and typical applications, and the use of logic and formal methods. In\r\naddition, the responsible use of these systems is an integral part of the course. The topic outline on\r\npages 810 summarizes the content typically taught in the AP Computer Science A course.", format: "AP Computer Science", street: "4155 Drew Road", longitude: -84.2111, latitude: 34.2096, contact_email: "acoleman@forsyth.k12.ga.us", phone: "", languages: "---\n- Java\n", country: nil},
