  {name: "The Grauer School", city: "Encinitas", state: "CA", zip_code: 92024, site_url: "http://www.grauerschool.com", ed_level: "---\n- High School\n", bio: "Our robotics class is offered as a regular block schedule class that meets twice per week for 1 hour and 40 minutes.  We focus on the FIRST FTC competition and use that to uncover STEM related topic involved with coming up with strategies for the game, designing and building the robot, and programming it using RobotC. \r\n\r\nAdditionally we meet outside of class for approximately 4-6 hours per week and conduct a wide variety of STEM outreach projects, such as displaying our robot at conferences, organizing STEM events at local schools or libraries, and helping to host robotics scrimmages and competitions.", format: "Robotics club", street: "1500 S El Camino Real", longitude: -117.256, latitude: 33.0283, contact_email: "", phone: "", languages: "---\n- Robotc\n", country: nil},
