  {name: "CoderDojoTC", city: "Minneapolis", state: "MN", zip_code: nil, site_url: "http://www.coderdojoTC.org", ed_level: "---\n- Middle School\n", bio: "\r\nCoderDojo Twin Cities\r\n1501 East Hennepin Ave\r\nMinneapolis, MN, 55414\r\nWeb site: www.coderdojoTC.org\r\nLanguages: Arduino, HTML, Java, Javascript, PHP, Python, Ruby, Scratch\r\nCoderDojo is a global movement about providing free and open learning to youth, with an emphasis on computer programming. The Twin Cities chapter was founded to bring this movement to the Minneapolis-Saint Paul area, inspire other chapters, and partner with other organizations to better introduce kids to coding.\r\n\r\nCoderDojo Twin Cities welcomes girls and boys ages 10 to 16 and provides a friendly, supportive learning environment for all kids, from absolute beginners to experienced young programmers. We aim to reduce economic barriers and will provide access to computers during the sessions for those unable to bring a laptop.\r\n1501 E Hennepin Ave\r\nMinneapolis, MN, 55418\r\nLanguages: Arduino, HTML, Javascript, Mobile Apps, Python, Scratch, Unity\r\nCoderDojo is a global movement about providing free and open learning to youth, with an emphasis on computer programming. The Twin Cities chapter was founded to bring this movement to the Minneapolis-Saint Paul area, inspire other chapters, and partner with other organizations to better introduce kids to coding.\r\n\r\nCoderDojo Twin Cities welcomes girls and boys ages 8 to 17 and provides a friendly, supportive learning environment for all kids, from absolute beginners to experienced young programmers. We aim to reduce economic barriers and will provide access to computers during the sessions for those unable to bring a laptop.\r\n\r\nCoderDojoTC currently meets on Saturday afternoons, and has groups exploring:\r\nweb design (HTML, CSS, JavaScript)\r\nScratch and introduction to programming\r\nPython/Minecraft\r\nGaming/Graphics (Unity)\r\nMobile apps\r\nArduino\r\n\r\nMore information can be found on our website. ", format: "Other", street: "University of MN", longitude: -93.266, latitude: 44.9572, contact_email: "hello@CoderDojoTC.org", phone: "", languages: "---\n- Arduino\n- HTML\n- Mobile Apps\n- Python\n- Ruby\n- Scratch\n", country: nil},
