  {name: "Utah Valley University", city: "Orem", state: "UT", zip_code: 84058, site_url: "http://uvu.edu", ed_level: "---\n- College\n", bio: "In the Computer Science Department we have programs in Computer Science, Software Engineering, and Computer Engineering. Programming languages offered include C#, C++, Java, Python, JavaScript, PHP, ASP.NET, and others. Online and evening courses are available.", format: "Full university CS curriculum", street: "800 W. University Parkway", longitude: -111.713, latitude: 40.2773, contact_email: "", phone: "", languages: "---\n- Asp.net\n- C++\n- D\n- HTML\n- Java\n- Javascript\n- Ml\n- PHP\n- Python\n", country: nil},
  {name: "Good Shepherd School", city: "Pacifica", state: "CA", zip_code: 94044, site_url: "http://goodshepherdschool.us", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Good Shepherd School introduces basic computer literacy skills at kindergarten.  Our 3rd to 5th graders become proficient in using Office applications, digital paint programs and also explore the major components of a computer.  Programming is introduced early, in the 4th grade, as students begin to learn how to build games on Scratch.  Our sixth and seventh graders create multimedia projects using audio and video editing software.  They also create 3D models using Sketchup. Our 8th graders spend their entire year on introduction to programming with a focus on Visual Logic and Alice.", format: "Other", street: "909 Oceana Blvd", longitude: -122.489, latitude: 37.6382, contact_email: "gss.office@goodshepherdschool.us", phone: "(650) 359-4544", languages: "---\n- Alice\n- Scratch\n- Visual logic\n", country: nil},
  {name: "Anasazi Elementary School", city: "Scottsdale", state: "AZ", zip_code: 85259, site_url: "http://susd.anasazi.schoolfusion.us/", ed_level: "---\n- Elementary\n", bio: "Baron Smith (aka Future Coders) began teaching an Introduction to Computer Programming with Scratch at Anasazi Elementary School in the fall of 2013.  It has gone very well.  Plans are still being developed yet but we expect to continue offering this course in upcoming semesters  possibly expanding to summer programs, intermediate level courses and even into middle schools in the Scottsdale Unified School District.\r\n\r\n", format: "Afterschool program", street: "12121 N. 124th Street", longitude: -111.812, latitude: 33.5965, contact_email: "baron@desertfountainsoftware.com", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "kidOYO Maker Dojo", city: "Stony Brook", state: "NY", zip_code: 11790, site_url: "http://www.kidoyo.com/about", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Join us monthly for our newest kidOYO Maker Dojo where kids will learn how to create and make using advanced technical tools in a collaborative and fun way amongst peers with similar interests.\r\nThe future of education is here, and kidOYO students are learning how to build the world of tomorrow today.  At kidOYO Dojo events, we dive in and explore technology-based tools to inspire creative invention.  Whether you are drawn towards robotics, micro-circuitry, 3D prototyping or like to work with software building games, websites and animations, kidOYO Dojo events will help you find your path.\r\nAs the originators and leaders of the Coder Dojo movement on Long Island, as well as maker camps, MinecraftEDU and unique startup entrepreneurial learning opportunities, kidOYO allows young people to explore a wide spectrum of interests including:\r\n~ Minecraft, Mod-installation, and Mod-building with Java\r\n~ 2D and 3D Video Game Design\r\n~ 2D and 3D Animation\r\n~ Graphic Design\r\n~ HTML/ CSS/ Javascript/ Jquery\r\n~ Electronic Prototyping using various micro-circuitry components\r\n~ 3D Printing and CAD design\r\n~ more.....every day new innovations are available to explore and we will continue to introduce these to kidOYO students.\r\n \r\nPlease contact us if you have any questions.  The kidOYO Maker Dojo is open to kids aged 9 - 13.  Differentiated instruction from 3 instructors will allow students to move at their pace and skill level.  If you are not sure if your child is ready for this type of learning opportunity, please contact us to set up a phone assesment.  ", format: "Other", street: "Infirmary Road", longitude: -73.1212, latitude: 40.9191, contact_email: "info@kidoyo.com", phone: "631.223.8725", languages: "---\n- Alice\n- Arduino\n- HTML\n- Java\n- PHP\n- Scratch\n", country: nil},
  {name: "Coder Dojo Long Island", city: "Patchogue", state: "NY", zip_code: 11772, site_url: "http://www.coderdojolongisland.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "Coder Dojo Long Island is a free open non-profit movement to teach youth ages 7-17 to code. We are the Official Long Island Chapter of the Coder Dojo global collaboration. Our chapter was founded in 2012 to bring this global movement to Long Island, and to inspire other chapters to continue introducing kids to coding. Our sessions are geared towards any student, from absolute beginners to experienced young programmers.\r\n\r\n\r\nAt a Coder Dojo event, kids and parents learn together how to code, develop websites, apps, programs, games and more. Dojos are set up and run by volunteers to take on the interests of their community, and they invite local tech leaders to come play a part in the skill-sharing events being orchestrated in their community. In addition to learning to code, children get to interact with their peers who share similar interests in computers, and to show off what they've been working on or playing with. Coder Dojo makes development and learning to code a fun, social, and rewarding experience. Coder Dojo also puts a strong emphasis on open source and free software, and has a strong network of members and volunteers globally.\r\n\r\nA Coder Dojo has just one rule: \"Be Cool\". \r\nBullying, lying, wasting people's time and complaining is uncool.\r\n\r\nThe Coder Dojo Long Island group is supported by many awesome volunteers and sponsors. If you would like to get involved Contact Us today!", format: "Other", street: "155 West Roe Blvd", longitude: -73.0251, latitude: 40.7763, contact_email: "info@kidoyo.com", phone: "631.223.8725", languages: "---\n- Alice\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Scratch\n", country: nil},
  {name: "Computao na Escola", city: "Florianopolis", state: "SC", zip_code: 88049, site_url: "http://www.computacaonaescola.ufsc.br/", ed_level: "---\n- Elementary\n", bio: "Pilot projects in elementary and middle school classes.\r\nWe offer the realization of pilot projects teaching programming with SCRATCH in a interdisciplinary way integrated with other disciplines, such as, literature, arts, geography etc. Examples of a pilot project realized with 1. year elementary school kids making an interactive game related to the story of Little Red Riding Hood can be found here: http://www.computacaonaescola.ufsc.br/?page_id=59", format: "Programming integrated in other classes", street: "Federal University of Santa Catarina", longitude: -48.55, latitude: -27.6884, contact_email: "computacaonaescola@incod.ufsc.br", phone: "", languages: "---\n- Scratch\n", country: nil},
  {name: "FredX Coders: Coder Dojo Fredericksburg", city: "Fredericksburg", state: "VA", zip_code: 22406, site_url: "http://www.fredxcoders.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "Fredericksburg Coder Dojo is a free open non-profit movement to teach youth ages 7-17 to code. This website represents the Official Fredericksburg, VA Chapter of the Coder Dojo global collaboration. Our chapter was founded in 2012 to bring this global movement to Central Virginia, and to inspire other chapters to continue introducing kids to coding. Our sessions are geared towards any student, from absolute beginners to experienced young programmers.\r\n\r\n\r\nAt a Coder Dojo event, kids and parents learn together how to code, develop websites, apps, programs, games and more. Dojos are set up and run by volunteers to take on the interests of their community, and they invite local tech leaders to come play a part in the skill-sharing events being orchestrated in their community. In addition to learning to code, children get to interact with their peers who share similar interests in computers, and to show off what they've been working on or playing with. Coder Dojo makes development and learning to code a fun, social, and rewarding experience. Coder Dojo also puts a strong emphasis on open source and free software, and has a strong network of members and volunteers globally.\r\n\r\nA Coder Dojo has just one rule: \"Be Cool\". \r\nBullying, lying, wasting people's time and complaining is uncool.\r\n\r\nThe Coder Dojo Fredericksburg, VA group is supported by many awesome volunteers and sponsors. If you would like to get involved Contact Us today!", format: "Other", street: "121 University Blvd", longitude: -77.5339, latitude: 38.37, contact_email: "info@kidoyo.com", phone: "540.999.8727", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Scratch\n", country: nil},
  {name: "kidOYO Game Makers @ SBU", city: "Stony Brook", state: "NY", zip_code: 11790, site_url: "http://www.kidoyo.com/about", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Don't just be a video game player, Be a Video Game CREATOR!!  Learn to design and build computer-based Video Games and Interactive Stories using object oriented programming methods.\r\n\r\nEach day will be filled with a combination of creative design, strategy, coding, outdoor play and lots of FUN!.  \r\n\r\nLocated on the beautiful Stony Brook University campus, kidOYO summer programs include a rich university experience including tours through campus, interaction with professors, discussions about future STEM opportunities, and social interaction with other young coders.\r\n\r\nCampers should bring lunch or pre-purchase a meal ticket for $40.00  to access lunch through University Dining halls.  Meal tickets MUST be purchased NO LATER than JUNE 15th, per Univeristy requirements.  Meals will consist a choice between a hot meal or sandwich and salad bar, include a drink and dessert.  \r\n\r\nAges 9 - 12 (must turn 9 by 12.31.2013)\r\n\r\nImpressive 10:1 Student to Teacher ratio\r\n\r\nAll campers receive; kidOYO tshirt and 1GB USB wristband + project(s) data\r\n\r\nPlease contact us for any special concerns or considerations.\r\n\r\ncamp@kidoyo.com or 631.223.USA5 (8725)", format: "Summer camp", street: "Infirmary Road", longitude: -73.1212, latitude: 40.9191, contact_email: "info@kidoyo.com", phone: "631.223.8725", languages: "---\n- Alice\n- HTML\n- PHP\n- Scratch\n", country: nil},
  {name: "Internet Academy - Front-end Web Development Course", city: "New York", state: "NY", zip_code: 10012, site_url: "http://www.internetacademy.net/", ed_level: "---\n- College\n- Vocational\n", bio: "In our eight week front-end Web development course, you'll learn to code professional, beautiful, interactive client-facing websites using HTML5, CSS3 and JavaScript. Our dedicated team will always be here to support you. During the course, you will also learn to cooperate with others as a professional developer. Upon completion of the course, you should be ready for real-world professional work.", format: "Other", street: "568 Broadway, 11th FL", longitude: -73.9977, latitude: 40.7251, contact_email: "", phone: "", languages: "---\n- Css\n- HTML\n- Javascript\n- Mobile Apps\n", country: nil},
  {name: "Lincoln Public school- Information Technology Focus Program", city: "Lincoln", state: "NE", zip_code: 68510, site_url: "http://itfp.lps.org/", ed_level: "---\n- High School\n", bio: "The Information Technology Focus Program(ITFP) exists to provide opportunities for high school students to develop advanced technology skills. The program is designed to accommodate students with interest, talent and ability in a variety of areas of computer technology. Opportunities exist for students to explore computer technology as it relates to digital video production, web page development, computer science & networking, graphic design, computer programming, computer game development and independent study . ITFP courses meet for 100 minutes daily for one semester. ITFP students spend the majority of their day at their home high school. Opportunities to make connections between course work and the \"real world\" are also provided. Students participate in various community projects and local, state and national contests \r\n\r\nEach class meets for 100 minutes daily. Students either attend morning classes from 7:35 - 9:15 AM or afternoon classes from 1:30 - 3:10 PM. Tuesdays are District PLC days and the schedule is 7:35 - 8:55 AM and 12:45 - 2:05 PM. Students may attend both sessions if their high school schedule permits. Students attend their home high school when not at the ITFP. Classes meet for the entire semester and are worth 10 credit points Once accepted into the program, students do not need to reapply. Accepted students can enter/exit the program at any time during their high school career.", format: "Daily programming course", street: "South 68th St. Place, 4th Floor", longitude: -96.6279, latitude: 40.8113, contact_email: "itfp@lps.org", phone: "", languages: "---\n- Alice\n- C++\n- Java\n- Mobile Apps\n- Scratch\n", country: nil},
