  {name: "BrainStation", city: "Toronto", state: "ON", zip_code: 0, site_url: "http://www.brainstation.it", ed_level: "---\n- High School\n- College\n- Vocational\n", bio: "BrainStation is a progressive technology school located in downtown Toronto offering web development courses for beginners. We use small class sizes, hands-on, collaborative, project-based learning, facilitated by industry professionals to create a classroom environment that mimics the real world as closely as possible. Think of BrainStation as an accelerated apprenticeship rather than traditional education. We support and grow the ecosystem by creating people who have the technical skills to work at startups, established tech companies, as freelancers, or as entrepreneurs.\r\n\r\nCourses: \r\n\r\nFront-end Web Development (Part-time): Starts January 6th  2014, Mondays & Wednesday, 6:30 PM - 9:30 PM \r\n\r\nBack-end Web Development (Part-time): Starts January 7th  2014, Tuesdays & Thursdays, 6:30 PM - 9:30 PM\r\n\r\nWeb Development Immersive (Full-time): Starts January 6th 2014, \r\nMonday - Friday, 9:00 AM - 5:00 PM", format: "Other", street: "73 Bathurst Street", longitude: -79.4025, latitude: 43.6436, contact_email: "admissions@brainstation.it", phone: "4168173031", languages: "---\n- Ajax\n- Coffee script\n- Css\n- Git\n- HTML\n- Haml\n- Javascript\n- Jquery\n- Postgres\n- Ruby\n- Ruby on rails\n- Sass\n- Sql\n- Tdd\n", country: nil},
