  {name: "Advanced Computer Science", city: "Gilbert", state: "AZ", zip_code: 85296, site_url: "http://www.gilbertchristianschools.org", ed_level: "---\n- High School\n", bio: "AP Computer Science:  \r\nStudents will play the role of a \"survivor\" while they work their way through the course material. AP Computer Science A is a college level computer course covering the applications of computing within the context of programming methodology,\r\nalgorithms, and data structures.", format: "AP Computer Science", street: "3632 East Jasper Drive", longitude: -111.713, latitude: 33.3261, contact_email: "", phone: "480-699-1215", languages: "---\n- Java\n", country: nil},
  {name: "Brain Boost", city: "Fairfield", state: "CT", zip_code: 6824, site_url: "http://www.brainboostfairfield.com", ed_level: "---\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "In these times of high pressure tests and memorization, we believe that learning analytical skills is getting lost. We want to help your child learn to think analytically, to understand a collection of concepts and build a solid foundation in math and computer programming. Test scores and academic success will follow.\r\n\r\nProgramming is a powerful way to interact with the computing resources that are everywhere in today's world.  This fact is being recognized by national educational groups as well as numerous organizations and even corporate America.  The business world is seeing a decline in the programming skills of new college graduates.  In response to the need, this movement is encouraging exposure to children at a young age when they are most receptive, adaptable, and eager to learn.\r\n\r\nWe are a team of seasoned industry experts in the field of quantitative software development. We have decades of experience working in Intel, Cisco and various startups as well as in the investment banking technology area. We teach mathematics and computer software development to middle and high school students.\r\n\r\nSo if you want your child to get world class supplemental education and want to explore how we can help your child succeed, please reach out to us.\r\n\r\nWe are building the next generation of analytical thinkers!", format: "Afterschool program", street: "1172 Post Road", longitude: -73.2542, latitude: 41.1436, contact_email: "kenny@brainboostfairfield.com", phone: "203-955-1024", languages: "---\n- Arduino\n- C++\n- Javascript\n- Python\n", country: nil},
