  {name: "Vision College", city: "Hamilton East", state: "Waikato", zip_code: 3216, site_url: "http://www.visioncollege.ac.nz", ed_level: "---\n- College\n", bio: "Our Level 6 hands-on IT Diplomas will enable you to quickly upskill and launch into the world of web development or software engineering.\r\n\r\nDiploma in Web Development and Design (Level 6)\r\n 1 year  Level 6  Full-time  Auckland, Hamilton or Christchurch campus.\r\n\r\nDiploma in Software Engineering and Design (Level 6)\r\n 1 year  Level 6  Full-time  Auckland, Hamilton or Christchurch campus.\r\n\r\nCertificate in Applied Electronics Technology (Level 3)\r\n 1 year  Level 3  Full-time  East Tamaki, Auckland campus\r\n 1 year  Level 3  Full-time  Christchurch campus\r\n", format: "Full university CS curriculum", street: "21 Ruakura Rd", longitude: 175.3, latitude: -37.7802, contact_email: "enquiries@visioncollege.ac.nz", phone: "0800 834 834", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Perl\n", country: nil},
  {name: "Vision College Short Courses", city: "Hamilton", state: "Waikato", zip_code: 3216, site_url: "http://www.visioncollege.ac.nz", ed_level: "---\n- High School\n", bio: "Short Courses - STAR \r\nThese short courses are provided to Highschool students as part of STAR programmes.  If you would like to attend or have a child you would like to attend please contact the High School careers advisor to register.\r\n\r\nWeb Design Taster - 1 day Course\r\nNo units attached - HTML & CSS Design as well as responsive web designing\r\n\r\nCoding School Modules - 1 Friday every week through Term 1 & Term 2 - \r\nModule 1 CSS Scripting\r\nModule 2 Server Side Scripting\r\nModule 3 MarkUp Language \r\nModule 4 Mobile App (VB.net)\r\nUnits included \r\n\r\n", format: "Other", street: "21 Ruakura Rd", longitude: 175.301, latitude: -37.779, contact_email: "enquiries@visioncollege.ac.nz", phone: "0800 834 834", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n", country: nil},
  {name: "C2PKids.org", city: "Charlotte", state: "NC", zip_code: 28226, site_url: "http://C2PKids.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "C2P Kids is my experiment and my attempt to create a local community of Technology Producer-Kids who can create technology in the form of local apps or games of some commercial or social value. Trying to create something of value is best learning experience in technology versus purely academic learning of programming languages or academic projects.\r\n\r\nSome Key Links\r\n(About the C2PKids Movement and Mission) http://c2pkids.org/about/\r\n\r\n(Teaching Method)\r\nhttp://c2pkids.org/teaching-methodology-what-is-a-c2p-jam/\r\n\r\n(FAQ)\r\nhttp://c2pkids.org/project-c2p-kids-club-of-charlotte-nc/\r\n\r\n\r\n\r\n\r\n", format: "Multi-week workshop", street: "7239 Rea Croft Drive", longitude: -80.8064, latitude: 35.1055, contact_email: "psarode@gmail.com", phone: "7045790864", languages: "---\n- HTML\n- Javascript\n- Scratch\n", country: nil},
  {name: "Barnard College", city: "New York", state: "NY", zip_code: 10027, site_url: "https://athenacenter.barnard.edu/barnardcodes", ed_level: "---\n- College\n", bio: "Inspired by student-run businesses, Barnard Bartending Agency & Barnard Babysitting, Barnard students will be trained to develop websites and mobile apps, in order to provide these services, for hire, to the community. \r\n\r\nOnce Phase I of our custom web design & development training (4 weeks) is successfully completed, students will have the opportunity to join Barnard Codes, an agency that connects local businesses and organizations with students to help build or maintain their web sites.\r\n\r\nBarnard Codes will be a student-run business, advised and funded through Entrepreneurs@Athena, a project of the Athena Center for Leadership Studies.\r\n\r\nBecause of the overwhelming response to this program, students interested in going through the training and joining the agency will be invited to apply (more info on this coming soon).\r\n\r\nNO CODING EXPERIENCE or computer science background will be required for participation and applications will be open to ALL Barnard students. \r\n\r\nBarnard students can sign up to learn more at www.BarnardCodes.com", format: "Multi-week workshop", street: "301 Barnard Hall 3009 Broadway ", longitude: -73.9634, latitude: 40.8094, contact_email: "athenacenter@barnard.edu", phone: "212 854.1264", languages: "---\n- HTML\n- Python\n", country: nil},
