  {name: "TN Code Academy Code Camps", city: "Cookeville", state: "TN", zip_code: 38501, site_url: "http://tncodeacademy.com", ed_level: "---\n- Middle School\n- High School\n", bio: "Tennessee Code Camps are open to those ages 12 to 18. Students will learn HTML, PHP, design fundamentals, web application, gaming and more. These camps will be offered over various school breaks across the state. Students have the opportunity to learn a valuable skill from expert mentors and programmers. The weeklong day-camp will be conducted from 9 AM to 3 PM each day. At the end of the camp, the students will host parents for a Demo Day where they will exhibit the skills they have learned. Lunch will be provided each day of the camp. We are now hosting Spring Break camps in Chattanooga, Knoxville, Tri-cities, Nashville, Cookeville, and Tullahoma.", format: "Summer camp", street: "140 West 7th Street", longitude: -85.5084, latitude: 36.1718, contact_email: "sammy@tncodeacademy.com", phone: "931-372-1039", languages: "---\n- HTML\n- Java\n- PHP\n", country: nil},
