  {name: "University of Regina - Department of Computer Science", city: "Regina", state: "SK", zip_code: 0, site_url: "http://www.cs.uregina.ca/", ed_level: "---\n- College\n", bio: "There are many options to study computer science at the University of Regina.  Our general program is the B.Sc. with a major in Computer Science.  Ours is the longest continously-accredited program in Canada.  This accreditation, from the Canadian Information Processing Society, puts our graduates on the fast track to receive the professional designation (I.S.P. -- Information Systems Professional).  It is also possible to do a combined degree in Computer Science and Mathematics; focus on Software Systems Development or add a concentration in Business or Creative Technologies.\r\n\r\nStudents who have completed a Diploma in Business Information Systems or Computer Systems Technology at SIAST can earn a B.Sc. after 2 years of study.\r\n\r\nFor students from other areas, it is possible to add computer science as a minor, or as a certificate, which can be earned after 1 year of study (if you have a degree, or 2 years otherwise).", format: "Full university CS curriculum", street: "3737 Wascana Parkway", longitude: -104.587, latitude: 50.4183, contact_email: "info@cs.uregina.ca", phone: "306-585-4633", languages: "---\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Python\n- Scratch\n", country: nil},
  {name: "Costa Ricas National Program of Educational Informatics MEP-FOD", city: "San Jose", state: "San Jose", zip_code: 10104, site_url: "http://www.fod.ac.cr", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n- Vocational\n", bio: "The Omar Dengo Foundation of Costa Rica is a private, non-profit organization that since 1987 has developed and executed national projects in the fields of educational innovation and digital technologies in public schools with a distinctive use of coding (programming) as a central tool to stimulate creativity, thinking skills and problem-solving abilities in teachers, children and youth. The National Program of Educational Informatics of the Ministry of Public Education and the Omar Dengo Foundation (PRONIE MEP-FOD), that currently serves 512.232 students in 1,668 public elementary and high schools thorough the country, is strongly linked to the epistemological theories of Piaget and Vigotsky concerning social and cognitive development in individuals, and has based its pedagogical foundation on the constructionist theory of Dr. Seymour Papert. The Foundation, based on a constructivist approach to teaching and learning, introduced the use of computers in public schools in Costa Rica in 1988 to provide opportunities for children and youth to improve their capacities and computer programming has always been at the core of the programs activities. \r\n\r\nThe Foundations programs have introduced programming throughout Costa Ricas public school system as a mean for children and youth to make representation and share personal interpretations of their knowledge and they have started programming computers from an early age. Teachers and researchers have been trained to facilitate computational thinking tasks and approaches proposed by researchers from MIT such as tinkering, debugging, remixing, abstraction, and use of modules.  Elementary school children start by using tile programming interfaces (drag and drop) as a way to simplify syntax structure and help them understand algorithmic thinking. High-school age youth expand their programming experience with the use of open code writing (scripting) and object-oriented programming.  Programming is then used as a powerful resource for developing abilities such as learning to reason logically and creatively, interactive resolution of problems, learning by design of robots, and teamwork.  This special know-how has been of central importance for the development of a digital culture among Costa Rican children, youth and teachers, and for the attainment of significant levels of technology fluency and overall improved capacities. \r\n", format: "Other", street: "Calle 25A Avenidas 10 y 10B", longitude: -84.0753, latitude: 9.92953, contact_email: "eduardo.monge@fod.ac.cr", phone: "50625276105", languages: "---\n- Alice\n- Etoys\n- HTML\n- Java\n- Javascript\n- Lego nxt-g\n- Logo\n- Microworlds\n- Scratch\n- Starlogo tng\n", country: nil},
