  {name: "Mountain View Christian Schools", city: "Las Vegas", state: "NV", zip_code: 89110, site_url: "http://mvcs.net", ed_level: "---\n- High School\n", bio: "CS/Web/Java: First semester students are introduced to XHTML and HTML5. It is a high school introductory course to provide students with a better understanding of the mechanics of web design. \r\nSecond semester students are introduced to Java language. Students gain an understanding of algorithms, problem solving, and object oriented programming.   ", format: "Daily programming course", street: "3900 E. Bonanza Road", longitude: -115.092, latitude: 36.1736, contact_email: "cfholcombe@mvcs.net", phone: "7024521300", languages: "---\n- HTML\n- Java\n", country: nil},
