  {name: "High Tech Youth", city: "Auckland", state: "Auckland", zip_code: 2023, site_url: "http://www.hightechyouth.org", ed_level: "---\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "The High Tech Youth Network is a pioneering learning & development community of closely affiliated High Tech Youth Studios and people that support each other, young people and underserved communities across the Oceania region.\r\n\r\nThe Network has four core objectives, these are:\r\nTo empower young people and communities to become more capable, creative, and confident life long learners.\r\nTo foster the growth of a learning community, through the sharing of ideas and support.\r\nTo encourage in young people the development of a positive identity and belief in their potential, through linking cultural knowledges and values with technology.\r\nTo champion, support, manage, research and implement services and projects that will further the above objectives within New Zealand and the Pacific", format: "Afterschool program", street: "51 Othello Drive", longitude: 174.893, latitude: -36.9809, contact_email: "kane@hightechyouth.org", phone: "", languages: "---\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Kodu\n- Logo\n- Mobile Apps\n- PHP\n- Perl\n- Python\n- Ruby\n- Scratch\n", country: nil},
  {name: "Bothell High School ", city: "Bothell", state: "WA", zip_code: 98021, site_url: "http://www.nsd.org", ed_level: "---\n- High School\n", bio: "Students use the C# programming language to\r\nwrite programs that run in the Microsoft.NET\r\nenvironment. This course emphasizes good overall\r\nprogram design and effective use of objects. Topics\r\ninclude fundamental language constructs, classes, exception handling, interfaces and inheritance. Students end the year with a multi-week project where they create, test, and document a major program of their own design. (Up to 10 college credits available)", format: "Daily programming course", street: "3330 Monte Villa Parkway", longitude: -122.19, latitude: 47.7771, contact_email: "dschuneman@nsd.org", phone: "", languages: "---\n- C++\n", country: nil},
  {name: "Inglemoor High School", city: "Kenmore", state: "WA", zip_code: 98028, site_url: "http://www.nsd.org", ed_level: "---\n- High School\n", bio: "IB COMPUTER SCIENCE WITH JAVA:\r\nThis course meets the requirements of the IB\r\nComputer Science (SL) curriculum, but you do\r\nnot have to be an IB student to take this course.\r\nProgramming topics cover fundamental Java language constructs, including objects, classes, methods, parameter passing, primitive and reference types, and use of the Java class libraries. In addition, students will study the systems life cycle, software development and computer systems fundamentals.\r\n(Up to 5 college credits available)", format: "Daily programming course", street: "15500 Simonds Road", longitude: -122.224, latitude: 47.7405, contact_email: "", phone: "", languages: "---\n- Java\n", country: nil},
  {name: "Woodinville High School ", city: "Woodinville", state: "WA", zip_code: 98072, site_url: "http://www.nsd.org", ed_level: "---\n- High School\n", bio: "COMPUTER GAME DESIGN:\r\nThe game software development industry represents\r\nan increasingly important segment of applied communication technology. This class is a prepratory -2 hour a day course intended for those students who have a high interest in applying artistic and creative, and academic capabilities to game crafting. In this class, based upon industry skill standards, you will learn the theory, planning, art, production and design of video games through state of the art gaming software, UNITY.Up to 20 College Credits available", format: "Daily programming course", street: "19819 136th Ave. N.E.", longitude: -122.161, latitude: 47.7707, contact_email: "dschuneman@nsd.org", phone: "", languages: "---\n- HTML\n- Javascript\n- Mobile Apps\n", country: nil},
  {name: "Timbercrest Junior High School ", city: "Woodinville", state: "WA", zip_code: 98077, site_url: "http://www.nsd.org", ed_level: "---\n- Middle School\n", bio: "Exploring Computer Technology (7th & 8th grade):\r\n\r\nGoals: To explore the many facets of digital technology while developing analytical and problem solving skills that will help students succeed in academia and beyond.\r\nSkills: Students will begin by learning the basics of how hardware and software interact to compute data, and move on to create digital projects using a variety of tools. Topics covered include office and presentation applications, multimedia design (such as Photoshop, Garageband, and iMovie), basic web design (using HTML and CSS), programming theory, introductory video game design, and careers in computer technology. It doesn't matter if you're a technophobe or a computer guru, students of all skill levels are welcome. Opportunities are available for technologically savvy students to pursue advanced topics.\r\n\r\n\r\nIntro to Computer Science and Design 9th grade:\r\n\r\nGoals: Students in this class will build on their existing technology skills to apply analytical thinking and a variety of technology tools to solve a variety of problems. By the end of the year, students will have a portfolio of projects that can be used to demonstrate and verify their technology skills.\r\nSkills: Students will gain a deeper understanding of computer systems and logic through hands on projects and simulations. Topics covered include computer maintenance and troubleshooting, network design, intermediate web design (including basic PHP and Javascript), basic applied programming, video game design, and multimedia production. Opportunities are available for all students to pursue independent learning in advanced topics of interest.\r\n", format: "Daily programming course", street: "19115 215th Way N.E.", longitude: -122.051, latitude: 47.7667, contact_email: "dschuneman@nsd.org", phone: "", languages: "---\n- Arduino\n- HTML\n- Javascript\n", country: nil},
  {name: "Gurdon S. Hubbard High School", city: "Chicago", state: "IL", zip_code: 60559, site_url: "http://hubbardhighschool.org/", ed_level: "---\n- High School\n", bio: "The AP Computer Science A course is designed to provide students with a learning experience equivalent to \r\nthat of an introductory college course in Computer Science. \r\nThis course emphasizes object-oriented programming methodology with a concentration on problem solving \r\nand algorithm development, and includes the study of data structures, design, and abstraction. Other topics \r\ncovered include an overview of the history of computing, basics of computing systems, ethics in computing, \r\nsyntax/semantics in JAVA, selection, repetition, classes and their methods, and an introduction to the \r\nGridWorld Case Study. This two-semester course will culminate in the Advanced Placement Exam in \r\nComputer Science A.", format: "AP Computer Science", street: "6200 S. Hamlin Ave", longitude: -87.7179, latitude: 41.7805, contact_email: "", phone: "773.535.2200 ex. 26538", languages: "---\n- HTML\n- Java\n- Scratch\n", country: nil},
  {name: "Reigate Grammar School", city: "Reigate", state: nil, zip_code: 0, site_url: "http://www.reigategrammar.org", ed_level: "---\n- High School\n", bio: "Teaching of computer science from Year 7 to GCSE.\r\nWe start with Scratch and progress to Java using the Greenfoot IDE.\r\nWe also cover HTML and mobile app development on the way.\r\n\r\nClubs include Lego robotics, Game Maker, Greenfoot Java and Arduino.", format: "Daily programming course", street: "Reigate Road", longitude: -0.193901, latitude: 51.2375, contact_email: "", phone: "", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Pembroke Community Middle School", city: "Pembroke", state: "MA", zip_code: 2359, site_url: "http://www.pembrokek12.org/MiddleSchool.cfm?subpage=371970", ed_level: "---\n- Middle School\n", bio: "Using the Bootstrap curriculum in the WeScheme environment, we learn solid program design skills, such as stating input and types, writing test cases, and explaining code to others.  Bootstrap uses algebra as the vehicle for creating images and animations which we can experiment with algebraic concepts by writing functions that make a rocket fly (linear equations), respond to key presses  (piecewise functions), or explode when it hits a meteor (distance formula). After this course, our coding skills and knowledge of the Bootstrap language can be transferred to other coding programs such as Python.", format: "Daily programming course", street: "559 School St.", longitude: -70.8012, latitude: 42.0322, contact_email: "adam.newall@pembrokeke12.org", phone: "", languages: "---\n- Racket\n- Scheme\n", country: nil},
