  {name: "Lake Washington Girls Middle School", city: "Seattle", state: "WA", zip_code: 98122, site_url: "http://www.lwgms.org", ed_level: "---\n- Middle School\n", bio: "Lego League Robotics Club.\r\nThe club meet on Fridays afternoons from 3:30 - 5:00.  In the fall, as part of the Washington First Robotics competition, we will build and program a Lego NXT robot to complete a challenge, and we will research and design a product related to disaster relief. In the winter, we will examine the inner-workings of a computer as well as learn to use programs such as Scratch and Blender to make video animation and games. ", format: "Afterschool program", street: "810 18th Avenue", longitude: -122.309, latitude: 47.6096, contact_email: "", phone: "", languages: "---\n- Lego nxt\n- Scratch\n- Visual programmer\n", country: nil},
