  {name: "Funutation Tekademy LLC", city: "Cleveland", state: "OH", zip_code: 44122, site_url: "http://funutation.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Funutation stands for fun and education! We run kids' camps, called Tek Labs, partly during the school year and mostly during the summer. Our approach is a blend of learning and fun that focuses on hands-on action.\r\n\r\nWhat we offer\r\n\r\nWe run a broad range of tech camps, including:\r\n- 2D and 3D game design\r\n- Animation\r\n- Robotics\r\n\r\nAnd more! Click here to see all the Tek Labs we offer.\r\n\r\nWhy Funutation?\r\n\r\nFunutation not only teaches kids basic and advanced computing, it does so in a fun way. Our program is extensive and we cover everything from 2D and 3D game design, Robotronix, and developing iPhone and Android apps as well as Advanced Physics and Java.\r\n\r\n\r\n", format: "Summer camp", street: "23715 Mercantile Road, Ste 215", longitude: -81.5084, latitude: 41.4586, contact_email: "camps@funutation.com", phone: "216-378-9035", languages: "---\n- .net\n- Alice\n- Arduino\n- C++\n- HTML\n- Java\n- Javascript\n- Kodu\n- Logo\n- Mobile Apps\n- Robotc\n- Scratch\n", country: nil},
