  {name: "Borderless Education", city: "Kuala Lumpur", state: "Federal Territory of Kuala Lumpur", zip_code: 60000, site_url: "http://fb.me/borderlesseducation ", ed_level: "---\n- Elementary\n- Middle School\n", bio: "This December, we would like to invite your child to take part in our \"Creative Computing for Kids\" pilot workshops conducted by Imperial College London graduates to help children discover their inner interest and passion in technology.\r\n\r\nCreative Computing for Kids is designed to make introduction to programming both easier and fun. By using a simplified visual programming system called Scratch, your child can explore and learn at their own pace and tackle problems through trial and error.  It is a 4 session pilot workshops designed to give children aged between 8-13 an introduction to programming, inspired by the Code.org video featuring Bill Gates and Mark Zuckerberg. We believe that this early exposure gives kids an opportunity to discover themselves, nurture their natural curiosity while instilling the basic groundwork of computational thinking.\r\n\r\nInvitation Details\r\n\r\n\r\nDates:\r\n   Every Saturday in December 2013 (30th Nov, 7th, 14th & 21st), or\r\n   Every Sunday in December 2013 (1st, 8th, 15th & 22nd)\r\nTimes:\r\n   Morning (10:00-12:30pm) for ages 8-13, \r\n\r\nLocation:\r\n   Starbucks @ TTDI, Grande Conference Room\r\n   No. 20-G, Jalan Tun Mohd Fuad 1, Taman Tun Dr Ismail\r\nFees:\r\n   None. By invitation\r\nRequirements:\r\n   Bring your own Laptop (and its power supply and mouse)\r\n\r\nTo register a place, click on our website.", format: "Multi-week workshop", street: "No. 20-G, Jalan Tun Mohd Fuad 1, Taman Tun Dr Ismail", longitude: 101.629, latitude: 3.14174, contact_email: "", phone: "", languages: "---\n- Scratch\n", country: nil},
