  {name: "Creative Coding for Kids- After School & Day Camps", city: "Seattle", state: "WA", zip_code: 98103, site_url: "http://www.creativecoding4kids.com", ed_level: "---\n- Elementary\n", bio: "We teach kids ages 8-12 the joy of coding, by helping them write their own customized computer game!  \r\nIn addition to our summer camps, we now offer after-school programs at several Seattle Schools, plus all-day coding camps on certain \"no school\" days. \r\nOur unique games-centered approach is winning rave reviews from both kids and parents. We use Scratch, the MIT-developed tool created just for this purpose. Our philosophy: Today's computers are more like a box of crayons than a calculator. Major math skills are no longer required. The most important traits for coding today are CREATIVITY and PERSISTENCE. \r\nThe key is to make it fun, start young, and encourage your child's work on their own pet projects, so they learn because they want to make their own thing awesome. It works brilliantly. Read reviews on our site. \r\nTo see if we're teaching at your school, (or request that we come to you) please go to our website. The address given is our \"No School\" all-day camp location. \r\nGirls and boys are taught in a supportive, mutually respectful, fun environment. Classes offered for all skill levels and may be repeated to progress further.  \r\nFor up-to-date class dates, times, and schools served, visit us at \r\nhttp://www.creativecoding4kids.com", format: "Afterschool program", street: "4649 Sunnyside Ave N", longitude: -122.331, latitude: 47.664, contact_email: "info@creativecoding4kids.com", phone: "", languages: "---\n- Scratch\n", country: nil},
