  {name: " St. Anthony's G.R.P.S. Sharfed Time Program", city: "Grand Rapids", state: "MI", zip_code: 49546, site_url: "http://computerkiddoswiki.pbwiki.com", ed_level: "---\n- Elementary\n- Middle School\n", bio: "I am a certified teacher that works for Grand Rapids Public Schools, in a program called Shared Time. I currently service Anchor Point Christian and St. Anthony of Padua. I see children 1-2 times each week throughout the school year, and use classroom content for the basis of teaching technology skills.\r\n\r\n I teach  Cyber Safety, Animation, Digital Photography, C.A.D., Desktop Publishing, Presentation, Skills review, Research, Engineering,  Physics and Programing. The first and second graders I teach learn logo using the Roamer Robot and Roamer World software. I also use Lightbot and the online logo programing site for the youngest students. I use Toontalk programing for 3rd grade, for 4th grade I teach tesselations using Tesslemanic, 5th graders learn to program using Etoys sometimes called \"Squeak\",6th graders learn Scratch, 7th graders Alice and my 8th graders use HTML Kit to write code for webpages.  All of these are free open source software which make it both practical and affordable to teach programing. \r\n\r\nUnfortunately none of the programs work on Ipad tablets, so as so many schools move to one to one tablets-it is going to even more difficult to teach programing.\r\n\r\nI am open to having others visit my classroom and even use the lessons on my wiki site to encourage the use of technology.  So far I am hanging in there fighting the good fight even with all the state of Michigan cuts to education and decreases in pay.", format: "Other", street: "2510 Richmond N.W.", longitude: -85.7295, latitude: 42.996, contact_email: "kdeboer@saparish.com", phone: "", languages: "---\n- Alice\n- HTML\n- Logo\n- Robomind\n- Scratch\n- Squeak-etoys\n- Tesslemanic\n- Toontalk\n", country: nil},
