  {name: "Twin Falls High school", city: "Twin Falls", state: "ID", zip_code: 83301, site_url: "http://moodle.tfhsbruins.com", ed_level: "---\n- High School\n", bio: "The Twin Falls High School Computer Science program focuses on Mobile and Web application development.  Students begin the program in a survey of the IT industry, continue into client-side, server-side, and mobile application development courses that culminate with a project based/internship course that focuses on developing technologies that are put into production for the school district as well as local non-profits.  The suggested course sequence is as follows...\r\n\r\n- Intro to Information System Technology\r\n- HTML/CSS\r\n- Programming Fundamentals in JavaScript\r\n- Mobile Application Development in HTML5/CSS3/JavaScript\r\n- Web Application Development using PHP/MySQL\r\n- Native Android Application Development using Java/XML\r\n- AP Computer Science in Java\r\n- IT Help Desk\r\n\r\nWe have a large SkillsUSA presence and are closely partnered with our local Google Develop Group, SocialGeeks, and our High School Hacker Space called NeverLAN.\r\n\r\nWe ROCK Computer Science!", format: "Daily programming course", street: "1615 Filer Ave. E", longitude: -114.453, latitude: 42.5719, contact_email: "torgrimsonja@tfsd.org", phone: "208-733-6551", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Scratch\n", country: nil},
