  {name: "East Austin College Prep", city: "Austin", state: "TX", zip_code: 78721, site_url: "http://www.eaprep.org/programs", ed_level: "---\n- Middle School\n- High School\n", bio: "The Globaloria program at EAPrep is a college-level course where students learn to create educational web-games for social change. EAPrep is the first charter school to use Globaloria and is leading the nation in offering this game-making course as core curriculum to all students.\r\n\r\nThe Globaloria curriculum teaches kids to code their own video games from scratch. Kids choose a social issue in which they are interested and build a game about it using math, research, problem solving, critical thinking and other career-building skills. \r\n\r\n", format: "Daily programming course", street: "5800 E. MLK Blvd.", longitude: -97.6667, latitude: 30.2878, contact_email: "", phone: "", languages: "---\n- Actionscript\n", country: nil},
  {name: "Paideia School", city: "Atlanta", state: "GA", zip_code: 30307, site_url: "http://www.paideiaschool.org", ed_level: "---\n- Elementary\n- Middle School\n", bio: "We are an independent school that goes from K-12. We have integrated the hour of code into our normally scheduled science courses for most our elementary. (K-6) Because of scheduling, we did it all last week, and it was awesome.\r\n\r\nAgain, because of scheduling, we will do our junior high NEXT week, also integrated into normally scheduled science. \r\n\r\nThank you for all of this.", format: "Programming integrated in other classes", street: "1509 S Ponce De Leon", longitude: -84.3389, latitude: 33.7736, contact_email: "wrede.john@paideiaschool.org", phone: "", languages: "--- []\n", country: nil},
  {name: "IIS \"F. Filelfo\"", city: "Tolentino", state: "Marche", zip_code: 62029, site_url: "http://www.iisfilelfotolentino.it/default.asp", ed_level: "---\n- High School\n", bio: "E' attiva la specializzazione dell'indirizzo tecnico economico \"Sistemi Informativi\", il quale, dopo un biennio comune, prevede l'insegnamento delle disciplina Informatica per 4 ore al terzo anno, 5 ore al quarto e al quinto. E' previsto lo studio di almeno un linguaggio di programmazione \"tradizionale\"(attualmente C), di linguaggi per il web - AJAX - della progettazione, implementazione e gestione di database (con studio del linguaggio SQL e del PHP per la programmazione lato server). L'indirizzo  di nuova formazione e consta attualmente della classe iniziale terza (primo anno del triennio). ", format: "Programming integrated in other classes", street: "Piazza don Bosco 10", longitude: 13.2806, latitude: 43.2093, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n", country: nil},
