  {name: "Saint Ann School", city: "Lawrence Township", state: "NJ", zip_code: 8648, site_url: "http://www.st-ann-school.org", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Every student at Saint Ann School is taught the basic concepts of computer programming. At least a part of one semester is dedicated to learning code through a weekly technology class. Various languages are uses depending on the grade level. Logo, Scratch, Alice, HTML, are among the languages covered. Students are in grades 4 through 8 sign into Khan Academy's code tutorials, CODE.org or CodeAcademy.com and can work on code from home.", format: "Other", street: "34 Rossa Ave", longitude: -74.7436, latitude: 40.2661, contact_email: "sas@st-ann-school.org", phone: "", languages: "---\n- Alice\n- Arduino\n- HTML\n- Javascript\n- Kodu\n- Logo\n- Mobile Apps\n- Scratch\n", country: nil},
  {name: "Wilton High School ", city: "Wilton", state: "CT", zip_code: 6897, site_url: "http://www.wiltonhs.com", ed_level: "---\n- High School\n", bio: "1. Website Design-Grades 10-12 in the Business Department\r\nStudents will explore the World Wide Web as they learn how to design and create their own web pages. This course will explore the basics of HTML, site planning, e-commerce, layout and design, website construction, set-up and maintenance. Students will study current websites with a focus on improving the functional and business aspects of website design. The course will include simulations and projects.\r\n\r\n\r\n2. Computer Programming in the Business Department at the high school is a semester course is designed for students with an interest in computer programming. Students will be introduced to programming, including designing 2D games using the Java programming language. A student does not need to be familiar with software applications, but should be comfortable using a computer and have a strong math background.", format: "Daily programming course", street: "395 Danbury Road", longitude: -73.4349, latitude: 41.215, contact_email: "korna@wilton.k12.ct.us", phone: "", languages: "---\n- Alice\n- HTML\n- Scratch\n", country: nil},
  {name: "Engineering For Kids", city: "Brentwood", state: "TN", zip_code: 37027, site_url: "http://www.engineeringforkids.com/location/nashville", ed_level: "---\n- Preschool\n- Elementary\n", bio: "Robotics 101\r\n\r\nDuring the Robotics 101 program, students will learn the basics of designing, programing, and controlling a fully functional robot. Using LEGO MINDSTORMS, mathematical concepts, and engineering principles students will brainstorm, plan, test, and modify sequences of instructions to accomplish a given task. Students will also learn the sequence of communication between the robot, and the programmer by collecting and analyzing data using the robot's sensors.\r\n", format: "Afterschool program", street: "Husker CT", longitude: -86.7072, latitude: 35.9733, contact_email: "nashville@engineeringforkids.net", phone: "615-261-9937", languages: "---\n- Lego mindstorms\n", country: nil},
