  {name: "The Browning School", city: "New York", state: "NY", zip_code: 10065, site_url: "http://www.browning.edu", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Intro to Comp Science\r\nThe introductory Form IV course is a one-semester, half-credit class designed to explore the world of computer science and programming. The students will learn in a lab environment, working in Java through software that slowly introduces object-oriented programming to students without overwhelming them with syntax. Students will watch lectures from Stanford Universitys Programming Methodology course online for homework and work on their programming assignments with the teacher in class.\r\n\r\nAP Computer Science\r\nThis elective is designed for Form V and VI students who want to explore more advanced topics in computer science. Students will gain valuable hands-on experience working with advanced techniques such as object-oriented design, decomposition, encapsulation, abstraction, and testing. Students will watch lectures from Stanford Universitys Programming Methodology course online for homework and work on their programming assignments with the teacher in class.", format: "AP Computer Science", street: "52 East 62nd Streeet", longitude: -73.969, latitude: 40.765, contact_email: "agrill@browning.edu", phone: "2128386280", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- Scratch\n", country: nil},
