  {name: "Quincy University", city: "Quincy", state: "IL", zip_code: 62301, site_url: "http://www.quincy.edu", ed_level: "---\n- College\n", bio: "If you see yourself applying computing concepts in business, industry, education, or government service, the Quincy University Computer Science and Computer Information Systems program is for you. With a challenging curriculum based on the recommendations of the Association of Computing Machinery (ACM), the program will guide you in mastering the principles of software engineering, algorithms, database systems, operating systems, computer networking, and programming. You'll be prepared to solve the problems of today and to respond quickly to new developments in this dynamic field.\r\n\r\nThrough the Computer Science curriculum, you'll tackle rigorous coursework in networking, web and visual programming, and architecture. A senior capstone course will give you the chance to apply your abilities to creating software products that solve authentic problems for actual clients.", format: "Full university CS curriculum", street: "1800 College Ave.", longitude: -91.3857, latitude: 39.9392, contact_email: "pecksy@quincy.edu", phone: "217-228-5432 x3400 ", languages: "---\n- Alice\n- Assembly language\n- C++\n- HTML\n- Java\n- Javascript\n- PHP\n- Sql\n- Visual basic\n", country: nil},
