  {name: "North Seattle Community College", city: "Seattle", state: "WA", zip_code: 98103, site_url: "https://northseattle.edu/", ed_level: "---\n- College\n", bio: "CSC 110 - Intro to Computer Programming (5 credits)<br>\r\nProvides basic skills in structured programming, including variables, expressions, decisions, loops, and functions. Learn to analyze problems, develop solutions, test, debug and document programs. Uses the Python language.\r\n<p>\r\nOffered daily, evenings, and online. See schedule for details.<p><p>\r\n\r\nCSC 142 - Computer Programming I (5 credits)\r\nContinues study of programming into object-oriented programming. Includes encapsulation, object design, methods, inheritance and polymorphism.  Uses the Java language.\r\n<p>\r\nOffered daily, evenings, and online. See schedule for details.\r\n<p><p>\r\nCSC 143 - Computer Programming II (5 credits)\r\nAdvanced concepts of modern programming that continue the ideas introduced in CSC 142. Topics include classes and interfaces, inheritance, graphics, exceptions, stream I/O, recursion, analysis of algorithms, and some dynamic structures (lists, stacks, trees). Uses Java programming language. \r\n<p>\r\nOffered daily and evenings. See schedule for details.", format: "Daily programming course", street: "9600 College Way N", longitude: -122.332, latitude: 47.6996, contact_email: "dennis.schaffer@seattlecolleges.edu", phone: "206-934-3746", languages: "---\n- Java\n- Python\n", country: nil},
