  {name: "Cyberpack", city: "Mons", state: "Walloon Region", zip_code: 7000, site_url: "http://cyberpack.numediart.org", ed_level: "---\n- Middle School\n", bio: "CyberPack project aims to develop creativity through the implementation of projects based on digital technologies used daily by young people ( sound, image, 3D , web, Twitter, Facebook , Kinect , etc.) It also aims to provide a framework facilitators / trainers / teachers who will implement these projects.\r\n\r\nThrough a series of practical experiments with the increasing complexity , users will learn the basics of programming, develop logical thinking but also an artistic sense . For this, they discover the free software and open source Processing. It is used by young digital creators in the world and can address very quickly the real-time programming and therefore access to interactivity. It also allows the graphic design and geometry , 2D and 3D animation, sound generation , data processing and data visualization, facial recognition, physics, etc. .\r\n\r\nTo assist users in their learning, CyberPack project provides them with :\r\n\r\n1 . a toolkit based on the principle of learning by projects: it offers more than 10 exciting projects of increasing complexity in the field of image , audio , video , and interaction. Projects are accompanied by two booklets (one student booklet and a reference manual ) .\r\nNo prerequisite is required.\r\n\r\n2 . an online learning platform , using social networks to share experiences among organizations (questions, achievements , demonstration videos , etc. . ) (in progress)\r\n\r\n3 . educational support for facilitators / trainers / teachers : sessions of discovery and use of the kit , training for\r\nusers and / or students (initiation, lectures, courses , workshops, ... )\r\n\r\nCyberPack project is supported by the AS- E as part of the call for projects CREATIVE PEOPLE organized under the Creative Wallonia program.\r\n\r\nIt was designed by The Institute NUMEDIART UMONS , in collaboration with teachers in digital ARTS  and Arts Centre team Diffusion of Science and Technology UMONS .", format: "Other", street: "Boulevard Dolez, 31", longitude: 3.95886, latitude: 50.4517, contact_email: "martin.waroux@numediart.org", phone: "+32499253305", languages: "---\n- Processing\n- Scratch\n", country: nil},
