  {name: "New Minas Youth Tech Group and Acadia Univeristy", city: "Wolfville", state: "NS", zip_code: 0, site_url: "https://www.facebook.com/events/698703223480731/permalink/712730695411317/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n- College\n", bio: "Tuesday, December 10, 2013 @ 7:00pm\r\nWolfville Farmers' Market (this is a wheelchair accessible venue)\r\nThe DeWolfe Building, 24 Elm Ave, Wolfville, NS, Canada\r\n\r\nScratching an Itch: Learning to Code Games and Robots\r\nwith Acadia's RPC Group & New Minas Youth Tech Club.\r\n\r\nHave you ever wanted to create your own digital interactive stories, games, music and art? How about building robots that follow your every command? \r\nKids, tweens, teens, and so-called adults -- come get your hands dirty with Acadia University's Robot Programming Competitions group as they teach us how to build and code robots on the Lego Mindstorms platform. Learn to think like a computer so you can become a master of your own army of robots. \r\nHave a big idea for a video game? The New Minas Youth Tech Club will take us for a spin around Scratch - an online environment where you can learn how to write code to make mini-games and more in your web browser.\r\nParents, learn how you can help introduce the world of Computer Science to your kids by hosting Lego Robotics and Scratch programming groups in your school and community.\r\n\r\nOrganized in cooperation with innovacorp", format: "Other", street: "Wolfville Farmers' Market, 24 Elm Ave", longitude: -64.3598, latitude: 45.0918, contact_email: "danny.silver@acadiau.ca", phone: "902-679-9315", languages: "---\n- Lego mindstorms programming\n- Scratch\n", country: nil},
