  {name: "Southwest Career & Technical Academy", city: "Las Vegas", state: "NV", zip_code: 89113, site_url: "http://swcta.net/", ed_level: "---\n- High School\n", bio: "We do many different events throughout the year. Our next event is the \"Girls in Tech 2014\" conference. It will be held for about 200 middle school girls this spring (April 9th & 10th). My students coordinate the conference. Everything from the logo, to the website, to the trainings, to the tours, to the panel, are run completely by the students. We get to bring industry partners in for the day to watch and see what the future of IT looks like and how these graduating seniors are ready to work in their field.\r\n\r\nDuring the conference, we bus in girls over the two days, my senior web development students do the hospitality and implementation of the whole conference, my junior class does the website/tweeting/marketing of the event and teaches some of the workshops, and my sophomore class teaches workshops. We also bring in women who work in technology to sit on a panel during our luncheon with the girls and we discuss how there is a place for girls in the technology field and how they should begin now in their middle school years to prepare. ", format: "Other", street: "7050 W Shelbourne Ave.", longitude: -115.247, latitude: 36.0382, contact_email: "clchang@interact.ccsd.net", phone: "702 799 5766", languages: "---\n- HTML\n- Java\n- Javascript\n- Mobile Apps\n- PHP\n- Scratch\n", country: nil},
