  {name: "The Digital Arts Experience", city: "White Plains", state: "NY", zip_code: 10601, site_url: "http://www.thedae.com", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "The Digital Arts Experience (The DAE) provides after school, weekend, and summer break programs for kids and teens ages 7 - 17. Located in the heart of downtown White Plains in Westchester County, NY, The DAE opened its doors in July of 2012.\r\n\r\nOur classes are small sized, 100% hands on, goal oriented, and designed to give real world exposure. Set up a class for your kids and their friends today! Give us a call at (914) 644-8100 or e-mail Cristina@TheDAE.com to get you started!\r\n\r\nOur upcoming January 2014 schedule:\r\n\r\nEach class meets once a week for 8-weeks long.\r\n\r\nAges 7-8:\r\n\r\nGame Programming with Scratch: Monday, Jan. 13th @ 4PM\r\nGame Programming with Scratch: Wednesday, Jan. 15th @ 4PM\r\nGame Programming with Scratch: Saturday, Jan. 18th @ 10AM\r\n\r\n\r\nAges 9-12:\r\n\r\nGame Programming with Scratch: Monday, Jan. 13th @ 6PM\r\nComputer Programming with Processing: Tuesday, Jan. 14th @ 4PM\r\nComputer Programming with Processing: Thursday, Jan. 16th @ 4PM\r\nComputer Programming with Processing: Saturday, Jan. 18th @ 10AM\r\n\r\nAges 13-17:\r\n\r\nGame Programming with Java Code: Thursday, Jan. 16th @ 4PM\r\nGame Programming with Java Code: Thursday, Jan. 16th @ 6PM\r\nWeb Design with HTML5/CSS3: Saturday, Jan. 18th @ NOON\r\n\r\nPlease reach out to Cristina at Cristina@thedae.com or feel free to give us a call, or stop by for a tour to learn more about our programs!", format: "Afterschool program", street: "170 Hamilton Avenue", longitude: -73.7709, latitude: 41.0334, contact_email: "cristina@thedae.com", phone: "9146448100", languages: "---\n- Arduino\n- HTML\n- Java\n- Javascript\n- Processing\n- Scratch\n", country: nil},
  {name: "Sonoran Science Academy Phoenix", city: "Phoenix", state: "AZ", zip_code: 85008, site_url: "http://www.sonoranschools.org", ed_level: "---\n- Middle School\n- High School\n", bio: "FTC is designed for students in grades 7-12 to compete head to head, using a sports model. Teams are responsible for designing, building, and programming their robots to compete in an alliance format against other teams. The robot kit is reusable from year-to-year and is programmed using a variety of languages. Teams, including coaches, mentors and volunteers, are required to develop strategy and build robots based on sound engineering principles. Awards are given for the competition as well as for community outreach, design, and other real-world accomplishments.\r\n\r\n\r\nStudents get to: \r\n \r\n  Design, build, and program robots\r\n  Apply real-world math and science concepts\r\n  Develop problem-solving, organizational, and team-building skills\r\ncheckbox gold  Compete and cooperate in alliances and tournaments\r\n  Earn a place in the World Championship\r\n  Qualify for over $12 million in college scholarships", format: "Robotics club", street: "4837 E McDowell Rd", longitude: -111.977, latitude: 33.4651, contact_email: "", phone: "", languages: "---\n- C++\n- HTML\n- Java\n- Javascript\n", country: nil},
