  {name: "Farset Labs", city: "Belfast", state: nil, zip_code: 0, site_url: "http://www.eventbrite.co.uk/e/farset-labs-coderdojo-tickets-5770231919", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n", bio: "Happens every two weeks on a friday 5.30pm to 7.30pm. Feel free to sign up and come down. When emailing please put FAO Hannah in subject line.\r\n\r\nAt a CoderDojo, young people learn how to code, develop websites, apps, programs, games and more. Dojos are set up, run by and taught at by volunteers. In addition to learning to code, members meet like minded people, show off what theyve been working on and so on. CoderDojo makes development and learning to code a fun, sociable, kick ass experience.\r\n\r\nIt also provides essential teaching and mentorship experience for budding software developers; after all, to teach is to learn twice! And you don't have to be a hardcore code-hacker to mentor; anyone can help to guide these kids through the processes of problem solving, breaking down tasks, thinking in a stepwise fashion, or just picking out the killer-spelling-mistakes like variable names or missing semi-colons!", format: "Afterschool program", street: "Unit 1, Weavers court business center, Linfield Road", longitude: -5.93574, latitude: 54.5922, contact_email: "admin@farsetlabs.org.uk", phone: "", languages: "---\n- HTML\n- Javascript\n- Python\n- Scratch\n", country: nil},
