  {name: "Devonport High School for Boys", city: "Plymouth", state: nil, zip_code: 0, site_url: "http://www.dhsb.org/", ed_level: "---\n- High School\n- College\n", bio: "Year 7 and 8 have an integrated program of study (Business Enterprise) which incorporates a range of languages and programs. We offer GCE Computing (AQA) to Year 12 & 13. IT skills (such as Office etc) are developed throught the programmes of study across the curricular. We have links with Plymouth University School of Computing & Mathematics and have luunchtime clubs in programming and robotics not to mention our recently launched http://thinkspace.co.uk/. ", format: "Daily programming course", street: "Paradise Road", longitude: -4.1659, latitude: 50.3745, contact_email: "", phone: "", languages: "---\n- Alice\n- HTML\n- Java\n- Javascript\n- Kodu\n- Mobile Apps\n- Python\n- Scratch\n", country: nil},
  {name: "Saint Bridget School", city: "Framingham", state: "MA", zip_code: 1702, site_url: "http://www.saintbridgetschool.info/curriculum/technology", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Students  in grades two through eight have computer class in a lab setting once a week.\r\n\r\nElementary students (Grs. 2-5)  are introduced to the inside and outside components of computers and the various functions of computers. Students begin typing skills in grade two and three. Students in grades three, four, and five learn to utilize Microsoft Office applications for classroom projects.\r\nMiddle School students (Grs. 6-8) enhance their skills by integrating projects from other academic areas into the more advanced Office topics in word processing, spreadsheets, multi-media presentations, and database concepts.\r\n7th grade students are introduced to the history of the Internet with hands-on experience using HTML and WYSIWYG web site creation.\r\n8th grade students are introduced to concepts in computer programming using Alice and Scratch and advanced skills in MS Office when they publish their own memory book and DVD at the end of the school year.\r\n", format: "Other", street: "832 Worcester Road", longitude: -71.4321, latitude: 42.2988, contact_email: "admissions@saintbridgetschool.info", phone: "508-875-0181", languages: "---\n- Alice\n- HTML\n- Scratch\n", country: nil},
  {name: "kidOYO Minecraft Event @ Stony Brook", city: "Lake Grove", state: "NY", zip_code: 11790, site_url: "http://www.kidoyo.com/nyevents", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Give the Gift of..MINECRAFT\r\n\r\nWrap up the Holiday Season with the BEST GIFT YET!!\r\n \r\nJoin kidOYO for this special one day MinecraftDojo.org event at Stony Brook University.  We all know and love a Minecrafter.  This unique experience will bring them together for an exciting day filled with group builds, new mod experiences, parkour challenges, tips & tricks from young experts and more.  All level players welcome.\r\n\r\nHosted by Minecon 2013 Panelists, kidOYO!!\r\n\r\n(Kids Learning Code - link)\r\n\r\nProgram starts at 10:00am and ends at 4:00pm.\r\nIncludes Lunch and Collectible kidOYO Minecraft Tshirt!!\r\nParents may stay in lounge area or drop off and go enjoy the day.\r\n", format: "All-day workshop (up to 1 week)", street: "Nichols Rd", longitude: -73.112, latitude: 40.8664, contact_email: "info@kidoyo.com", phone: "", languages: "---\n- Java\n- Minecraft\n- Scratch\n", country: nil},
