  {name: "Herman Intermediate School", city: "San Jose", state: "CA", zip_code: 95123, site_url: "http://www.myglife.org/usa/his/index.php/Main_Page", ed_level: "---\n- Middle School\n", bio: "I teach a year-long Globaloria course that teaches students to design and program their own educational games through a mix of teacher-led instruction, team-based learning and online networking with experts and peers.", format: "Programming integrated in other classes", street: "5955 Blossom Ave", longitude: -121.84, latitude: 37.2394, contact_email: "", phone: "", languages: "---\n- Adobe flash actionscript\n", country: nil},
  {name: "Coder Dojo Long Island @ St. Joseph's College", city: "Patchogue", state: "NY", zip_code: 11772, site_url: "http://www.coderdojolongisland.org", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Coder Dojo Long Island is a free open non-profit movement to teach youth ages 7-17 to code. This website represents the Official Long Island Chapter of the Coder Dojo global collaboration. Our chapter was founded in 2012 to bring this global movement to Long Island, and to inspire other chapters to continue introducing kids to coding. Our sessions are geared towards any student, from absolute beginners to experienced young programmers. ", format: "All-day workshop (up to 1 week)", street: "155 West Roe Blvd", longitude: -73.0251, latitude: 40.7763, contact_email: "info@kidoyo.com", phone: "", languages: "---\n- Alice\n- HTML\n- Java\n- Processing\n- Python\n- Scratch\n", country: nil},
  {name: "kidOYO Kids Learning Code @ The Cradle of Aviation", city: "Garden City", state: "NY", zip_code: 11530, site_url: "http://www.kidoyo.com/nyevents", ed_level: "---\n- Elementary\n- Middle School\n", bio: "Program Runs from Monday, February 17th thru Friday, February 21st, 2014.\r\n\r\nJoin kidOYO Instructors in partnership with The Cradle of Aviation for this exciting 5 Day Winter Break event:\r\n\r\nKids Learning Code!\r\n\r\nkidOYO focuses on introducing children at a very early age to computer science and engineering through hands-on learning projects integrated with computational problem solving challenges.  \r\nIn this unique \"Kids Learning Code\" program aimed at students aged 9-13, we will be introducing students to the mechanics of computational problem solving for any number of student-interest driven outcomes. Students interested in gaining computational thinking skills, learning to create computer programmed  games, imagine interactive and animated stories, or prototype ideas generated from their imaginations using tools such as micro-circuits and the wildly popular 3D sandbox Minecraft will be among peers in this exciting and unique program. We will introduce kids 9-13 to creative tools that let their imaginations explore and pursure outcomes in a social context unlike anything else. Here, kids own their own education.\r\nStudents will receive a kidOYO USB flash drive and a kidOYO Tshirt.\r\nAbout kidOYO\r\nkidOYO produces innovative entrepreneurial ed-tech programs for students and teachers in multiple settings and formats. In-school K-12 programs, after-school programs, professional development programs, library programs, University-based programs, online-only programs, summer camps and monthly clubs offer many ways of getting involved with kidOYO.\r\n\r\nLeadership sets kidOYO apart; our team is composed of professional toy and technology developers and entrepreneurs who do what they teach, and bring real world context to the programs they develop to get students learning by doing.\r\nLearn more about kidOYO \r\nhere: www.kidOYO.com/about\r\n ", format: "All-day workshop (up to 1 week)", street: "Charles Lindburgh Blvd", longitude: -73.5934, latitude: 40.726, contact_email: "info@kidoyo.com", phone: "631-223-8725", languages: "---\n- Scratch\n- Stencyl\n", country: nil},
  {name: "kidOYO @ Manhasset Library", city: "Manhasset", state: "NY", zip_code: 11030, site_url: "http://www.kidoyo.com/nyevents", ed_level: "---\n- Elementary\n", bio: "Manhasset SEPTA's Gifted & Talented Division Presents.....\r\nkidOYO Code Dojo\r\nIn this age-appropriate \"Kids Learning Code\" program, kidOYO instructors will walk students through the process of learning object oriented programming as they engage computational problem solving challenges.  Students will complete the program with a working video game to take home with them as well as the software to continue to imagine, create and share!  \r\nStudents will learn about working with game character development, background stage and costume design basics.  They will gain an understanding of controlling movements and using algorithms to write script which will result in multiple computer-based games to take home and continue their work.\r\nAges 7-10\r\nStudents will require a USB Flash drive to save their work to.  USBs will be available for purchase for $10 each at the event, or students may bring their own from home.", format: "All-day workshop (up to 1 week)", street: "30 Onderdonk Ave", longitude: -73.6953, latitude: 40.7945, contact_email: "info@kidoyo.com", phone: "631-223-8725", languages: "---\n- Scratch\n", country: nil},
