  {name: "Greene Scholars Program", city: "San Jose", state: "CA", zip_code: 95134, site_url: "http://www.greenescholars.org/", ed_level: "---\n- Elementary\n- Middle School\n- High School\n", bio: "Leveraging our unique collaborative model, the Greene Scholars Program assist youth successfully complete higher education in STEM, and serve as positive role models and contributors to their communities. Students need access to enrichment opportunities that provide engaging experiences to expose them to career path options, the workplace, and innovation in technology. The GSP uses technology to reinforce core subject knowledge through hands-on, student-centered applied learning while simultaneously building a strong foundation of knowledge in STEM skills through project-based learning. It is our belief that as the student builds and applies these skills, their enthusiasm for learning will continue to grow. This process will unveil to them their full potential providing them with the added confidence needed and the necessary work ethic to improve their performance in all academic areas. ", format: "Other", street: "P. O. Box 3134 ", longitude: -121.953, latitude: 37.4309, contact_email: "greenescholars1@gmail.com", phone: "(408) 766-4776", languages: "--- []\n", country: nil},
  {name: "Monticello Academy", city: "Santa Clara", state: "CA", zip_code: 95051, site_url: "http://monticelloacademy.org", ed_level: "---\n- Elementary\n- Middle School\n", bio: "This specialized curriculum begins at Kindergarten and continues through eighth grade. Students develop creativity and self expression skills while at the same time acquiring problem solving and mathematics skills. Ultimately, students work both individually and collaboratively with a team to develop iPad Apps, JavaScript Apps, and Flash games of professional caliber. This unique curriculum is designed to bridge subjects such as math, science, English, and history by integrating them into coding and interactive programming development.\r\n\r\nAdditional information about the curriculum and examples of student work can be found at http://arrashthearcher.org.  Information about the school can be found at http://monticelloacademy.org.", format: "Daily programming course", street: "3345 Lochinvar Ave", longitude: -121.991, latitude: 37.3397, contact_email: "ajaffarzadeh@monticelloacademy.org", phone: "408-615-9416", languages: "---\n- Actionscript\n- HTML\n- Javascript\n- Objective-c\n- Scratch\n", country: nil},
