  {name: "Holland Christian High School", city: "Holland", state: "MI", zip_code: 49423, site_url: "http://www.hollandchristian.org/", ed_level: "---\n- High School\n", bio: "My school called Holland Christian is in my opinion of the schools that most uses programming in the whole state! Every student in our school is given a mac book pro and we have many classes with I mac's for students to use. Our school is based around computers. I am attending a c++ programming class right now which we are not just learning how to program but we also go to companies and shadow programers/engineers making automation and robots etc. After you are done with that class you can either take c++ 2 which is more advances or Java. Also it is required for all math teachers to teach a class in coding using matrices in math using an app called Cpmp tools that has integrated coding to draw things and do translations,dilations,color fill ins etc. Not only that but our school also has a robotics class which is taken during school which you use coding with. Also we have a robotics team which in after school program using engineering and coding to make and teach robots to do things and then compete with them. Our school is in partnership with many companies such as Koops for programming. They have invited us to visit their company also many programmers and engineers will come to our school and teach us a bunch of new programming and engineering things! Also we have graphic design classes and much more.", format: "Daily programming course", street: "950 Ottawa Ave ", longitude: -86.1265, latitude: 42.7626, contact_email: "", phone: "616) 820-2905", languages: "---\n- Alice\n- Basic programming using cpmp tools.\n- C++\n- Java\n- Javascript\n- Logo\n- Scratch\n", country: nil},
