  {name: "HSA Belmont", city: "Chicago", state: "IL", zip_code: 60639, site_url: "http://www.umechatronics.com", ed_level: "---\n- Elementary\n", bio: "UMechatronics Cadets learn how to design and select sensors and actuators, develop control algorithms and use and develop functional mechanical systems with Lego Robotics.\r\n\r\nMechatronics engineering has become an internationally recognised discipline with degree programmes offered in Japan, the United States of America, Europe and Australia. There are many opportunities for mechatronics graduates.\r\n\r\nThe desire for a high-tech, knowledge-based economy that has recently been expressed. Mechatronics engineers are employed in a wide range of jobs in design, improvement, implementation and maintenance of high-tech products, services and processes in mechanical, electronic and computer-related businesses.\r\n\r\nWith the multi-disciplinary nature of mechatronics engineering it is anticipated that mechatronics engineers will have excellent opportunities and progress quickly to jobs with greater responsibilities.\r\n\r\nUMechatronics challenges young minds to explore robotic engineering has an exciting, memorable and successful journey to the sciences.\r\n\r\nUMechatronics is an after school program (3:00 PM to 4:00 PM. Meeting times are weekdays and sometimes weekends.", format: "Afterschool program", street: "5035 North Ave.", longitude: -87.7523, latitude: 41.9095, contact_email: "chicago@umechatronics.com", phone: "202.758.5890", languages: "---\n- HTML\n- PHP\n", country: nil},
