  {name: "Trenton Catholic Academy", city: "Hamilton Township", state: "NJ", zip_code: 8619, site_url: "http://trentoncatholic.org", ed_level: "---\n- Middle School\n", bio: "The Trenton Catholic Academy Robotics Club is for students in grades 5-8. We are a registered FLL team.  We share the FLL mission as described on the FLL website.  At TCA we run the program as an after school club, usually meeting once a week. The focus of our meetings in the beginning of the year is preparation for the official FLL tournament hosted by Steinert High Schools robotic team.  During this time we may meet more often.  The club is not just programming a robot and building with Legos but it is project based.  This years project is Natures Fury, prepare, stay safe, rebuild. Students must research natural disasters and how to prepare for them and come up with creative solutions to help make rebuilding successful. They present this research and solution during the challenge.  All throughout the challenge and even at every meeting we constantly stress the FLL core values as described at the FLL website. After the competition is over we will continue to meet to explore other types of programming.", format: "Robotics club", street: "177 Leonard Avenue", longitude: -74.7181, latitude: 40.2187, contact_email: "", phone: "", languages: "---\n- Alice\n- Scratch\n", country: nil},
