  {name: "Code by the Needle", city: "Seattle", state: "WA", zip_code: 98109, site_url: "http://codebytheneedle.com", ed_level: "---\n- High School\n- College\n", bio: "Code by the Needle is an evening course designed to teach programming to people with minimal coding experience. The course is conducted in Python, a programming language that anyone can learn. The class requires 15 hours of participation over a period of 10 weeks. \r\n\r\nCurrent ongoing session\r\n\r\nNov 26 Free Session-Download Presentation Meet & Greet / Setup your machines / Start talking about structure of programs in python\r\nDec 3 - Download Presentation Conditional / Loops\r\nDec 10 - Download Presentation Functions/ List & Dictionaries in Depth\r\nDec 17 - Download Presentation File IO\r\nDec 23 - Classes\r\nJan 7 - String Manipulation\r\nJan 14 - Regular Expressions / Closures & Generators\r\nJan 21 - Object Oriented Theory \r\nJan 28 - Introduction to Unit Testing & Refactoring\r\nFeb 4 - Special Topics\r\n", format: "Other", street: "821 exchange buikding 8th floor", longitude: -122.348, latitude: 47.6409, contact_email: "", phone: "", languages: "---\n- C#\n- Python\n", country: nil},
