  {name: "Greater Columbia BDPA", city: "Columbia", state: "SC", zip_code: 29224, site_url: "http://www.bdpa.org/group/GC", ed_level: "---\n- High School\n", bio: "The Greater Columbia Area Chapter, Black Data Processing Associates is a non-profit organization dedicated to developing and increasing Information Technology skills and knowledge in the community through seminars, workshops, and training programs. \r\n\r\nThe program is open to high school students in grades 9 to 12. Students will learn to design, code, document, test and present a finished web development project using various technologies, including HTML, VB.Net, ASP.Net and MySQL.", format: "Multi-week workshop", street: "P.O. Box 23612", longitude: -80.85, latitude: 34.06, contact_email: "GCBDPA@bdpa.org", phone: "803-261-0866", languages: "---\n- Alice\n- HTML\n- Javascript\n- Kodu\n- Scratch\n", country: nil},
