  {name: "Sant  Bani School", city: "Sanbornton", state: "NH", zip_code: 3269, site_url: "http://www.santbani.org", ed_level: "---\n- High School\n", bio: "COURSE DESCRIPTION: In this course students will learn the building blocks necessary to develop and deploy applications for the iPhone and iPad. Building blocks include the C programming language, the Objective-C programming language, object-oriented programming, and the Xcode development tools. Students will use Mac computers and the Xcode development tools to design, build, test, and demonstrate their work. By the end of this course, spanning the school year, students will have created at least one application for iOS, and will deploy that app on an iPhone or iPad (or the iPhone / iPad simulator under Mac OS X). ************** We are fortunate to have the most awesome industry trained adjunct staff member to instruct our students.", format: "Daily programming course", street: "19 Ashram Rd", longitude: -71.6524, latitude: 43.5229, contact_email: "richard@santbani.org", phone: "603 934-4240", languages: "---\n- C++\n- Mobile Apps\n", country: nil},
