  {name: "Lenape Technical School", city: "Ford City", state: "PA", zip_code: 16226, site_url: "http://www.lenape.k12.pa.us", ed_level: "---\n- Vocational\n", bio: "Computer Information Technology offers Programming & Smart Apps Development as Options in the Third Year of CIT.", format: "Programming integrated in other classes", street: "2215 Chaplin Avenue", longitude: -79.5207, latitude: 40.7677, contact_email: "shirjer@lenape.k12.pa.us", phone: "", languages: "---\n- C++\n- HTML\n- Mobile Apps\n- Python\n", country: nil},
  {name: "Coding Campus - Dojo Dev Camp", city: "Provo", state: "UT", zip_code: 84601, site_url: "http://dojodevcamp.com/", ed_level: "---\n- Vocational\n", bio: "<strong>Introduction to Web Development \r\nTotal Clock Hours: 135\r\nAvailable Track: Part-time ~9 Weeks, 15hs/Week \r\nRequired Supplies: Laptop computer no more than 3 years old with at least 4 Gigs of RAM.</strong> \r\n\r\nCoding Campus Introduction to Web Development Course provides introductory training in front end development with a brief overview of back end. Students are trained in HTML, CSS and Javascript with an introduction to Python. This course will prepare the student with the skills necessary to work as a frontend developer, with a basic understanding of back end software programming. The average front end developer in Utah earns an annual salary between $49K-$90K. Completion of this course will require at least 90% attendance and a brief, final portfolio presentation during the last week of the course. Coding Campus adheres to a Pass/Fail grading policy. Graduates of this course will receive an Introduction to Web Development certificate of completion.\r\n \r\nThe introductory course builds a solid foundation for students completely new to computer programming and is an optional prerequisite to the Advanced Web Development course. \r\n\r\n<strong>Advanced Web Development \r\nTotal Clock Hours: 360\r\nAvailable Tracks: Full-Time ~9 weeks, 40hs/Week, \r\nPart-Time Day and Part-Time Evening ~18 weeks each, 20hs/Week\r\nRequired Supplies: Laptop computer no more than 3 years old with at least 4 Gigs of RAM.</strong>\r\n\r\nThe Advanced Web Development course is an in-depth approach to backend development with front end review and additional training in web development best-practices. Students are trained in HTML, CSS, Javascript, Python, and are instructed in using popular web development tools, Configuration Management, and cloud computing. This course will prepare the student for a career in back end web development. The average Back-end developer in Utah earns an annual salary between $55K-$90K. Completion of this course will require at least 90% attendance and a brief, final portfolio presentation during the last week of the course. Coding Campus adheres to a Pass/Fail grading policy. Graduates of this course will receive an Advanced Web Development certificate of completion.", format: "Daily programming course", street: "42 N University Ave Suite #204", longitude: -111.658, latitude: 40.2343, contact_email: "mzaro@dojodevcamp.com", phone: "425-446-1197", languages: "---\n- Css\n- HTML\n- Javascript\n- Python\n", country: nil},
