  {name: "DevPoint Labs", city: "Salt Lake City", state: "UT", zip_code: 84101, site_url: "http://www.DevPointLabs.com", ed_level: "---\n- College\n- Vocational\n", bio: "DevPoint Labs provides the best training in the latest software languages for web and mobile. We teach Ruby on Rails and iOS development through our rigorous bootcamps. We combine industry experience with university knowledge to breed the next generation of developers.\r\n\r\nAt the Lab we help beginners who may have struggled in the past to teach themselves how to program. Our learning approach incorporates pair programming with traditional lectures and a mix of group projects, lean methodologies, hackathons, industry guest speakers, and one-on-ones with instructors, TAs, and mentors. \r\n\r\nLearn it. Code it. Build it.", format: "Other", street: "230 S. 500 W. Suite 220", longitude: -111.906, latitude: 40.7641, contact_email: "nhi@devpointlabs.com", phone: "8018196571", languages: "---\n- HTML\n- Ios\n- Javascript\n- Mobile Apps\n- Objective c\n- Rails\n- Ruby\n", country: nil},
