  {name: "reKode Center - Redmond", city: "Redmond", state: "WA", zip_code: 98052, site_url: "http://www.rekode.com", ed_level: "---\n- Preschool\n- Elementary\n- Middle School\n- High School\n- College\n- Vocational\n", bio: "reKode is educating the next generation of innovators that will change the world beyond technology. We teach children from the age of six how to code through a proven methodology developed by our team of experts in psychology, education, and technology. We also teach teachers how to code and how they can implement coding into their school. \r\n\r\nOpening our first reKode Center in Redmond, WA in March 2014.\r\n\r\nCourses:\r\n- Take the Plunge (start coding with reKode)\r\n- Let's Code some more (the next steps in coding)\r\n- Game Development with Unity 3D\r\n- Web Development\r\n- iPad Programming\r\n- Minecraft \r\n- Hardware Hacking\r\n- reKode Hang Out (different tech subjects)", format: "Afterschool program", street: "8201 164th Ave NE", longitude: -122.122, latitude: 47.6762, contact_email: "info@reKode.com", phone: "(425) 285 4343", languages: "---\n- Alice\n- C#\n- C++\n- HTML\n- Java\n- Javascript\n- Kodu\n- Lua\n- Mobile Apps\n- Python\n- Ruby\n", country: nil},
