  {name: "Dev League LLC", city: "Honolulu", state: "HI", zip_code: 96822, site_url: "http://www.devleague.com/", ed_level: "---\n- Vocational\n", bio: "Dev League is a 12-week immersive experience into the world of modern professional software development and the first of it's kind in Hawaii. We are looking to take smart, driven individuals who are at a crossroads in life and are ready to propel themselves into the professional ranks of software development. We focus our efforts primarily on creating top-notch entry-level web developers who are well versed in current web technologies but also have the proper knowledge of the full stack and modern theory to easily transition into various roles and technologies moving forward.\r\n\r\nOur current offering focuses heavily on full-stack JavaScript, CSS3, and HTML5.", format: "Multi-week workshop", street: "2800 Woodlawn Drive", longitude: -157.809, latitude: 21.3085, contact_email: "contact@devleague.com", phone: "", languages: "---\n- HTML\n- Javascript\n- Ruby\n", country: nil},
